erican Nights - In Concert','1991-05-23 00:14:00',8439,'https://i.scdn.co/image/ab67616d0000b273655aa919fb41687486eeace4',NULL,'N;','american-nights-in-concert','2025-05-23 00:14:00','2025-05-27 16:41:49','7teTxSPnJrpRoi7BxJ9qTC'),(317,'An American Prayer','1978-05-23 00:15:35',2784,'https://i.scdn.co/image/ab67616d0000b2735ff547366ddaa4cd104388b9','\"An American Prayer\" is the ninth and final studio album by the American rock band the Doors. After the death of Jim Morrison and the band\'s breakup, the surviving members reunited to set several of Morrison\'s spoken word recordings to music. It is the only Doors album to be nominated for a Grammy Award in the \"Spoken Word\" category. Keyboardist Ray Manzarek described \"An American Prayer\" as being divided into five parts: the first part covers Morrison\'s childhood, the second his high school years, the third focuses on \"the young poet, stoned on a rooftop with acid dreams,\" the fourth <a href=\"https://www.last.fm/music/The+Doors/An+American+Prayer\">Read more on Last.fm</a>.','a:6:{s:8:\"allmusic\";s:43:\"https://www.allmusic.com/album/mw0000312491\";s:7:\"discogs\";s:36:\"https://www.discogs.com/master/45548\";s:6:\"lyrics\";s:54:\"https://genius.com/albums/The-doors/An-american-prayer\";s:15:\"other databases\";s:76:\"https://www.spirit-of-rock.com/en/album/Jim_Morrison_an_American_Prayer/1001\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q252751\";s:7:\"spotify\";s:53:\"https://open.spotify.com/album/7qj6lZyChZxDGAqzTArHHQ\";}','an-american-prayer','2025-05-23 00:15:35','2025-05-27 16:42:56','7qj6lZyChZxDGAqzTArHHQ'),(318,'Full Circle','1972-07-17 00:00:00',2437,'https://i.scdn.co/image/ab67616d0000b273a217433125ab8324ce5f7e09','\"Full Circle\" is the eighth studio album by the American rock band the Doors, released in August 1972. It was the second album released after the death of lead singer Jim Morrison and the last album by the band until the 1978 release of \"An American Prayer.\" The album includes the single \"The Mosquito,\" which was the last Doors single to chart. Following the band\'s first album without Morrison, \"Other Voices\" (1971), which reached number 31 on the Billboard chart, the remaining members—keyboardist Ray Manzarek, guitarist Robby Krieger, and drummer John Densmore—continued as a trio. While \"Other Voices\" was recorded <a href=\"https://www.last.fm/music/The+Doors/Full+Circle\">Read more on Last.fm</a>.','a:6:{s:8:\"allmusic\";s:43:\"https://www.allmusic.com/album/mw0000742752\";s:7:\"discogs\";s:36:\"https://www.discogs.com/master/45935\";s:6:\"lyrics\";s:47:\"https://genius.com/albums/The-doors/Full-circle\";s:15:\"other databases\";s:57:\"https://www.spirit-of-rock.com/en/album/Full_Circle/20027\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q693627\";s:7:\"spotify\";s:53:\"https://open.spotify.com/album/26Fac6kNgB6MLeoGVkmpKN\";}','full-circle','2025-05-23 00:15:36','2025-05-27 16:43:21','26Fac6kNgB6MLeoGVkmpKN'),(319,'Other Voices','1971-10-18 00:00:00',2420,'https://i.scdn.co/image/ab67616d0000b273730941e19bd40f4efe838688','\"Other Voices\" is the seventh studio album by American rock band the Doors, released by Elektra Records in October 1971. It was the first album recorded and released following the death of lead singer Jim Morrison in July of that year. Keyboardist Ray Manzarek and guitarist Robby Krieger took over lead vocal duties. Work on the album had begun before Morrison\'s departure to Paris, where he later died, with the band initially anticipating his return to complete the recordings. In the wake of Morrison’s death and the critical and commercial success of their previous album \"L.A. Woman,\" the remaining members—Manzarek, <a href=\"https://www.last.fm/music/The+Doors/Other+Voices\">Read more on Last.fm</a>.','a:6:{s:8:\"allmusic\";s:43:\"https://www.allmusic.com/album/mw0000836527\";s:7:\"discogs\";s:36:\"https://www.discogs.com/master/45536\";s:6:\"lyrics\";s:48:\"https://genius.com/albums/The-doors/Other-voices\";s:15:\"other databases\";s:58:\"https://www.spirit-of-rock.com/en/album/Other_Voices/20026\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q217017\";s:7:\"spotify\";s:53:\"https://open.spotify.com/album/6uhwVoXKDMzdXXjhTCH6Nk\";}','other-voices','2025-05-23 00:15:37','2025-05-27 16:43:45','6uhwVoXKDMzdXXjhTCH6Nk'),(320,'L.A. Woman','1971-04-19 00:00:00',2911,'https://i.scdn.co/image/ab67616d0000b2733992c7ab57975935b29fa22b','\"L.A. Woman\" is the sixth studio album by the American rock band the Doors, released on April 19, 1971, by Elektra Records. It was the final album to feature lead singer Jim Morrison during his lifetime; he died two months and two weeks after its release. Morrison later appeared posthumously on the 1978 album \"An American Prayer\". The album is notable for its strong blues influence, more pronounced than on the band’s earlier recordings. Production of the album took place without long-time producer Paul A. Rothchild, who left the project due to dissatisfaction with the band’s studio performances. In his <a href=\"https://www.last.fm/music/The+Doors/L.A.+Woman\">Read more on Last.fm</a>.','a:7:{s:8:\"allmusic\";s:43:\"https://www.allmusic.com/album/mw0000391383\";s:7:\"discogs\";s:36:\"https://www.discogs.com/master/45432\";s:6:\"lyrics\";s:45:\"https://genius.com/albums/The-doors/L-a-woman\";s:15:\"other databases\";s:57:\"https://www.spirit-of-rock.com/en/album/L.A._Woman/113523\";s:6:\"review\";s:40:\"https://www.bbc.co.uk/music/reviews/8hq4\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q212846\";s:7:\"spotify\";s:53:\"https://open.spotify.com/album/7IKUTIc9UWuVngyGPtqNHS\";}','l-a-woman','2025-05-23 00:15:37','2025-05-27 16:44:12','7IKUTIc9UWuVngyGPtqNHS'),(321,'Absolutely Live','1970-07-20 00:00:00',4643,'https://i.scdn.co/image/ab67616d0000b273c97ac09bd67730de819b2292',NULL,'N;','absolutely-live','2025-05-23 00:15:38','2025-06-23 00:14:41','0BgWlAKJAn8VQKRKIdx9ul'),(322,'Morrison Hotel','1970-02-09 00:00:00',2236,'https://i.scdn.co/image/ab67616d0000b273f12a8a7e0b2cbe16d2bef4dc','\"Morrison Hotel\" is the fifth studio album by the American rock band the Doors, released on February 9, 1970, by Elektra Records. Following the use of brass and string arrangements on their previous album \"The Soft Parade\", as encouraged by producer Paul A. Rothchild, the band returned to a more straightforward blues rock sound. This stylistic shift was widely regarded as a return to form. Recording took place at Elektra Sound Recorders in Los Angeles beginning in November 1969. The album is divided into two titled sides: \"Hard Rock Café\" and \"Morrison Hotel\". Notable contributions include session bass performances by <a href=\"https://www.last.fm/music/The+Doors/Morrison+Hotel\">Read more on Last.fm</a>.','a:6:{s:8:\"allmusic\";s:43:\"https://www.allmusic.com/album/mw0000193596\";s:7:\"discogs\";s:36:\"https://www.discogs.com/master/45415\";s:6:\"lyrics\";s:50:\"https://genius.com/albums/The-doors/Morrison-hotel\";s:15:\"other databases\";s:58:\"https://www.spirit-of-rock.com/en/album/Morrison_Hotel/999\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q214139\";s:7:\"spotify\";s:53:\"https://open.spotify.com/album/6AFLOkpJjFF652jevcSOZX\";}','morrison-hotel','2025-05-23 00:15:39','2025-05-27 16:44:50','6AFLOkpJjFF652jevcSOZX'),(323,'Live in Seattle 1970','1970-05-23 00:15:39',4386,'https://i.scdn.co/image/ab67616d0000b273fce7d3fcb7d96bd03e39495d',NULL,'N;','live-in-seattle-1970','2025-05-23 00:15:39','2025-05-27 16:44:50','6x5Jp9ajbnaEq7OoQmeQtB'),(324,'The Soft Parade','1969-07-21 00:00:00',2020,'https://i.scdn.co/image/ab67616d0000b273a0c993789a4875837cf7cf71','\"The Soft Parade\" is the fourth studio album by the American rock band the Doors, released on July 18, 1969, by Elektra Records. The album was recorded primarily after an intensive touring schedule that left the band with limited time to develop new material. At the suggestion of producer Paul A. Rothchild, the group adopted a different approach from their earlier work, incorporating brass and string arrangements arranged by Paul Harris to create a more expansive sound. During the album\'s production, lead singer Jim Morrison was less engaged with the songwriting process, as he was focusing more on his poetry <a href=\"https://www.last.fm/music/The+Doors/The+Soft+Parade\">Read more on Last.fm</a>.','a:6:{s:8:\"allmusic\";s:43:\"https://www.allmusic.com/album/mw0000652096\";s:7:\"discogs\";s:36:\"https://www.discogs.com/master/45384\";s:6:\"lyrics\";s:51:\"https://genius.com/albums/The-doors/The-soft-parade\";s:15:\"other databases\";s:59:\"https://www.spirit-of-rock.com/en/album/The_Soft_Parade/998\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q217203\";s:7:\"spotify\";s:53:\"https://open.spotify.com/album/75bLu4Ung5QbMdJYxx7wTI\";}','the-soft-parade','2025-05-23 00:15:40','2025-05-27 16:57:25','75bLu4Ung5QbMdJYxx7wTI'),(325,'Shot To Pieces','1969-05-23 00:15:40',4321,'https://i.scdn.co/image/ab67616d0000b2731d86a378800e8cc6e5b74f98',NULL,'N;','shot-to-pieces','2025-05-23 00:15:40','2025-05-27 16:57:25','38zyyaBKnOrCZLTLkTee5E'),(326,'Waiting for the Sun','1968-07-03 00:00:00',1971,'https://i.scdn.co/image/ab67616d0000b273d848096c6318e3317771721d','\"Waiting for the Sun\" is the third studio album by the American rock band the Doors, released on July 3, 1968, by Elektra Records. The album\'s eleven tracks were recorded between late 1967 and May 1968, primarily at TTG Studios in Los Angeles. It became the band\'s only album to reach number one on the Billboard 200, holding the top position for four weeks. It includes the Doors\' second number one single in the United States, \"Hello, I Love You\". The first single released from the album, \"The Unknown Soldier\", peaked at number 39 on the Billboard Hot 100. The <a href=\"https://www.last.fm/music/The+Doors/Waiting+for+the+Sun\">Read more on Last.fm</a>.','a:6:{s:8:\"allmusic\";s:43:\"https://www.allmusic.co