:\"spotify\";s:53:\"https://open.spotify.com/album/5bTixyz2GHx1YUqNUdzfut\";}','gigaton','2025-05-23 16:51:11','2025-05-23 16:51:11','5bTixyz2GHx1YUqNUdzfut'),(335,'Vault 9: Live in Seattle 12/8/93','2019-12-13 00:00:00',5990,'https://i.scdn.co/image/ab67616d0000b2738644fed4be9161f6e9502eb7',NULL,'N;','vault-9-live-in-seattle-12-8-93','2025-05-23 16:51:12','2025-05-23 16:51:12','1D4fI3BbLIJL1aNhGztjUK'),(336,'Let\'s Play Two (Live / Original Motion Picture Soundtrack)','2017-09-29 00:00:00',4790,'https://i.scdn.co/image/ab67616d0000b2734d3b7874e11eeb8ab140628e',NULL,'N;','let-s-play-two-live-original-motion-picture-soundtrack','2025-05-23 16:51:12','2025-05-23 16:51:12','5p58xqouYCtDpKCmdISXvT'),(337,'Lightning Bolt','2013-01-01 00:00:00',2818,'https://i.scdn.co/image/ab67616d0000b273fa475954245b93ca3167469e','Lightning Bolt is the tenth studio album by the American rock band Pearl Jam. The album is scheduled to be released internationally on October 14, 2013, before being released in the United States on October 15, 2013. The first single, \"Mind Your Manners\" was released on July 11, 2013. Lightning Bolt follows up Backspacer, which was released in September 2009. The album was produced by long-time Pearl Jam producer Brendan O\'Brien and is scheduled to be released on Monkeywrench Records/Republic Records through Universal Music. <a href=\"https://www.last.fm/music/Pearl+Jam/Lightning+Bolt\">Read more on Last.fm</a>.','a:6:{s:8:\"allmusic\";s:43:\"https://www.allmusic.com/album/mw0002563197\";s:7:\"discogs\";s:37:\"https://www.discogs.com/master/606964\";s:6:\"lyrics\";s:50:\"https://genius.com/albums/Pearl-jam/Lightning-bolt\";s:15:\"other databases\";s:60:\"https://www.spirit-of-rock.com/en/album/Lightning_Bolt/84588\";s:8:\"wikidata\";s:39:\"https://www.wikidata.org/wiki/Q13780884\";s:7:\"spotify\";s:53:\"https://open.spotify.com/album/01WEcEzoa9mfh8fIDhvV1M\";}','lightning-bolt','2025-05-23 16:51:13','2025-05-23 16:51:13','01WEcEzoa9mfh8fIDhvV1M'),(338,'Backspacer','2009-09-19 00:00:00',2495,'https://i.scdn.co/image/ab67616d0000b273cd1c5e0054c122d9aa3f829a','The band released the album through its own label Monkeywrench Records in the United States and through Universal Music Group internationally. Pearl Jam went back to producer Brendan O\'Brien who they hadn\'t worked with since 1998\'s Yield. \"At this point, I think we\'re willing to let somebody cut the songs up a little bit,\" says lead vocalist Eddie Vedder. \"In the past, Brendan would say, \'It\'s a great song, but I think you should do it in a different key\', and we\'d say no. But now that we\'ve heard Bruce has listened to his suggestions, I think we will too.\" <a href=\"https://www.last.fm/music/Pearl+Jam/Backspacer\">Read more on Last.fm</a>.','a:8:{s:8:\"allmusic\";s:43:\"https://www.allmusic.com/album/mw0000823355\";s:17:\"discography entry\";s:43:\"https://pearljam.com/music/album/backspacer\";s:7:\"discogs\";s:37:\"https://www.discogs.com/master/183300\";s:6:\"lyrics\";s:46:\"https://genius.com/albums/Pearl-jam/Backspacer\";s:15:\"other databases\";s:56:\"https://www.spirit-of-rock.com/en/album/Backspacer/25977\";s:6:\"review\";s:40:\"https://www.bbc.co.uk/music/reviews/6gjw\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q798509\";s:7:\"spotify\";s:53:\"https://open.spotify.com/album/4DCwNXpnKEBYbls0T4LQzN\";}','backspacer','2025-05-23 16:51:14','2025-05-23 16:51:14','4DCwNXpnKEBYbls0T4LQzN'),(339,'Pearl Jam (2017 Mix)','2006-05-02 00:00:00',2958,'https://i.scdn.co/image/ab67616d0000b273f374adccc44c849e2633eadf',NULL,'N;','pearl-jam-2017-mix','2025-05-23 16:51:14','2025-05-23 16:51:14','1cJEPzLBLME22ZUra16HT2'),(340,'Pearl Jam','2006-05-02 00:00:00',2961,'https://i.scdn.co/image/ab67616d0000b273abd6980a0f2f2c9cc13581e0','Pearl Jam is the eighth studio album by Pearl Jam, released on May 2, 2006, on J Records. It was Pearl Jam\'s first and only release for J Records, their last album issued by Sony Music. <a href=\"https://www.last.fm/music/Pearl+Jam/Pearl+Jam\">Read more on Last.fm</a>.','a:7:{s:8:\"allmusic\";s:43:\"https://www.allmusic.com/album/mw0000776561\";s:7:\"discogs\";s:36:\"https://www.discogs.com/master/90786\";s:6:\"lyrics\";s:45:\"https://genius.com/albums/Pearl-jam/Pearl-jam\";s:15:\"other databases\";s:53:\"https://www.spirit-of-rock.com/en/album/Pearl_Jam/184\";s:6:\"review\";s:52:\"https://www.metacritic.com/music/pearl-jam/pearl-jam\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q931609\";s:7:\"spotify\";s:53:\"https://open.spotify.com/album/5PY2mZGCOMezmWH7hiCwFH\";}','pearl-jam','2025-05-23 16:51:15','2025-05-23 16:51:15','5PY2mZGCOMezmWH7hiCwFH'),(341,'Riot Act','2002-11-08 00:00:00',3250,'https://i.scdn.co/image/ab67616d0000b273a20dd7a979699da6dce878ae',NULL,'a:7:{s:8:\"allmusic\";s:43:\"https://www.allmusic.com/album/mw0000662115\";s:7:\"discogs\";s:36:\"https://www.discogs.com/master/90780\";s:6:\"lyrics\";s:44:\"https://genius.com/albums/Pearl-jam/Riot-act\";s:15:\"other databases\";s:52:\"https://www.spirit-of-rock.com/en/album/Riot_Act/177\";s:6:\"review\";s:40:\"https://www.bbc.co.uk/music/reviews/r5rg\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q762309\";s:7:\"spotify\";s:53:\"https://open.spotify.com/album/7AOWw68DEPnDmTpquZw8bG\";}','riot-act','2025-05-23 16:51:17','2025-05-23 16:51:17','7AOWw68DEPnDmTpquZw8bG'),(342,'Binaural','2000-05-16 00:00:00',3122,'https://i.scdn.co/image/ab67616d0000b273370ece74b1dcfdc34264f41b','Binaural is Pearl Jam\'s sixth studio album, released on May 16, 2000 through Epic Records. Following a full-scale tour in support of its previous album, Yield, released in 1998, the band took a short break. The band then reconvened toward the end of 1999 and commenced work on a new album. The music on the record featured an experimental sound, evidenced on songs that utilized binaural recording techniques. Binaural debuted at number two on the Billboard charts. The album became the first Pearl Jam studio album to fail to reach platinum status. The album\'s 2000 tour spawned an enormous collection <a href=\"https://www.last.fm/music/Pearl+Jam/Binaural\">Read more on Last.fm</a>.','a:6:{s:8:\"allmusic\";s:43:\"https://www.allmusic.com/album/mw0000058349\";s:7:\"discogs\";s:36:\"https://www.discogs.com/master/72997\";s:6:\"lyrics\";s:44:\"https://genius.com/albums/Pearl-jam/Binaural\";s:15:\"other databases\";s:52:\"https://www.spirit-of-rock.com/en/album/Binaural/176\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q803814\";s:7:\"spotify\";s:53:\"https://open.spotify.com/album/1RuYprt6Qlqu286h1f4dzZ\";}','binaural','2025-05-23 16:51:17','2025-05-23 16:51:17','1RuYprt6Qlqu286h1f4dzZ'),(343,'Yield','1998-02-17 00:00:00',2895,'https://i.scdn.co/image/ab67616d0000b273a53f06a45b489abe8f577134','Yield is the fifth studio album by the American alternative rock band Pearl Jam, released on February 3, 1998. Following a short promotional tour for its previous album, No Code (1996), Pearl Jam recorded Yield throughout 1997 at Studio Litho and Studio X in Seattle, Washington. The album was proclaimed as a return to the band\'s early, straightforward rock sound, and marked a more collaborative effort from the band as opposed to relying heavily on frontman Eddie Vedder to compose the songs. The lyrics deal with contemplative themes, albeit seen in a more positive manner compared to the band\'s earlier <a href=\"https://www.last.fm/music/Pearl+Jam/Yield\">Read more on Last.fm</a>.','a:7:{s:8:\"allmusic\";s:43:\"https://www.allmusic.com/album/mw0000031540\";s:7:\"discogs\";s:36:\"https://www.discogs.com/master/73721\";s:6:\"lyrics\";s:41:\"https://genius.com/albums/Pearl-jam/Yield\";s:15:\"other databases\";s:49:\"https://www.spirit-of-rock.com/en/album/Yield/174\";s:6:\"review\";s:49:\"http://www.inmusicwetrust.com/articles/06r10.html\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q339078\";s:7:\"spotify\";s:53:\"https://open.spotify.com/album/5zsDtoSrXK4usJ4MB1tCh2\";}','yield','2025-05-23 16:51:18','2025-05-23 16:51:18','5zsDtoSrXK4usJ4MB1tCh2'),(344,'No Code','1996-08-06 00:00:00',2967,'https://i.scdn.co/image/ab67616d0000b2734c29f49b11488856e468719c','\'No Code\' is Pearl Jam\'s fourth studio album and was released on August 27, 1996 through Epic Records. The music on the record is even more diverse than what the band had done on previous releases, incorporating elements of garage rock, worldbeat, and experimentalism. Although \'No Code\' debuted at number one on the Billboard 200, it left a large section of the band’s fanbase unsatisfied and quickly fell down the charts. The album became the first Pearl Jam album to not reach multi-platinum status. The album has been certified platinum by the RIAA in the United States. <a href=\"https://www.last.fm/music/Pearl+Jam/No+Code\">Read more on Last.fm</a>.','a:7:{s:8:\"allmusic\";s:43:\"https://www.allmusic.com/album/mw0000185938\";s:7:\"discogs\";s:37:\"https://www.discogs.com/master/115933\";s:6:\"lyrics\";s:43:\"https://genius.com/albums/Pearl-jam/No-code\";s:15:\"other databases\";s:51:\"https://www.spirit-of-rock.com/en/album/No_Code/173\";s:6:\"review\";s:49:\"http://www.inmusicwetrust.com/articles/03r06.html\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q659941\";s:7:\"spotify\";s:53:\"https://open.spotify.com/album/3FKhxgSZdtJBIjdHsjbxI0\";}','no-code','2025-05-23 16:51:20','2025-05-23 16:51:20','3FKhxgSZdtJBIjdHsjbxI0'),(345,'Vitalogy','1994-11-22 00:00:00',4083,'https://i.scdn.co/image/ab67616d0000b273f0f6b8bc425633e6ed6369c4','Vitalogy is the third studio album by the American alternative rock band Pearl Jam, released on November 22, 1994 through Epic Records. Pearl Jam wrote and recorded while touring behind its previous album Vs. (1993). The music on the record was more diverse than previous releases, and consists of aggressive rock songs, ballads, and several experimental tracks. Vitalogy was packaged in a booklet that replicated material from a 1920s medical book. The album was first released on vinyl record, followed by a release in other formats two weeks later on December 6, 1994. Upon its CD release, Vitalogy became the <a href=\"https://www.last.fm/music/Pearl+Jam/Vitalogy\">Read more on Last.fm</a>.','a:6:{s:8:\"allmusic\";s:43:\"https://www.allmusic.com/album/mw0000121446\";s:7:\"discogs\";s:36:\"https://www.discogs.com/master/73769\";s:6:\"lyrics\";s:44:\"https://genius.com/albums/Pearl-jam/Vitalogy\";s:15:\"other databases\";s:52:\"https://www.spirit-of-rock.com/en/album/Vitalogy/172\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q826834\";s:7:\"spotify\";s:53:\"https://open.spotify.com/album/5pd9B3KQWKshHw4lnsSLNy\";}','vitalogy','2025-05-23 16:51:21','2025-05-23 16:51:21','5pd9B3KQWKshHw4lnsSLNy'),(346,'Vs.','1993-10-19 00:00:00',3588,'https://i.scdn.co/image/ab67616d0000b273777344aba9d5b5785b4593a5','Vs. is the second studio album by the American alternative rock band Pearl Jam, released on October 19, 1993 through Epic Records. After a relentless touring schedule in support of its debut album, Ten (1991), Pearl Jam headed into the studio in early 1993 facing the challenge of following up the commercial success of its debut. The resulting album, Vs., featured a rawer and more aggressive sound compared with the band\'s previous release. Pearl Jam decided to scale back its commercial efforts for Vs., including declining to produce music videos for any of the album’s singles. Upon its release, Vs. <a href=\"https://www.last.fm/music/Pearl+Jam/Vs.\">Read more on Last.fm</a>.','a:6:{s:8:\"allmusic\";s:43:\"https://www.allmusic.com/album/mw0000620499\";s:7:\"discogs\";s:36:\"https://www.discogs.com/master/73754\";s:6:\"lyrics\";s:38:\"https://genius.com/albums/Pearl-jam/Vs\";s:15:\"other databases\";s:47:\"https://www.spirit-of-rock.com/en/album/Vs./171\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q174218\";s:7:\"spotify\";s:53:\"https://open.spotify.com/album/3BSOiAas8BpJOii3kCPyjV\";}','vs','2025-05-23 16:51:21','2