INSERT INTO `band` VALUES (27,'2025-05-20 20:10:53','2025-06-23 00:09:28','KNEECAP','Kneecap are an Irish hip hop trio from West Belfast, NI, composed of Mo Chara, Móglaí Bap, and DJ Próvaí, the stage names of Liam Óg Ó hAnnaidh, Naoise Ó Cairealláin, and J.J. Ó Dochartaigh, respectively. They rap in a mixture of English and Irish, and their lyrics often contain Irish republican themes. \nThey released their first mixtape 3CAG, short for 3 Chonsan Agus Guta, on the 28th of June 2018. Their debut album Fine Art was released on the 14th of June 2024. <a href=\"https://www.last.fm/music/Kneecap\">Read more on Last.fm</a>','a:14:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0004594146\";s:8:\"bandcamp\";s:29:\"https://kneecap.bandcamp.com/\";s:7:\"discogs\";s:39:\"https://www.discogs.com/artist/13892566\";s:14:\"free streaming\";s:38:\"https://www.deezer.com/artist/13860855\";s:17:\"official homepage\";s:23:\"https://www.kneecap.ie/\";s:15:\"other databases\";s:40:\"https://rateyourmusic.com/artist/kneecap\";s:21:\"purchase for download\";s:47:\"https://itunes.apple.com/us/artist/id1330315811\";s:14:\"social network\";s:36:\"https://www.instagram.com/kneecap32/\";s:8:\"songkick\";s:40:\"https://www.songkick.com/artists/9759359\";s:10:\"soundcloud\";s:36:\"https://soundcloud.com/user-89644332\";s:9:\"streaming\";s:32:\"https://tidal.com/artist/9401535\";s:8:\"wikidata\";s:39:\"https://www.wikidata.org/wiki/Q65327538\";s:7:\"youtube\";s:56:\"https://www.youtube.com/channel/UCR8_tdf_kr2tn01dFmRK6wQ\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/1ZVACPeq7ccGCoUXwtafUU\";}','https://i.scdn.co/image/ab6761610000e5ebc07b6d26c0ae6faa9a90152f','kneecap','6ac275dd-eb37-42cf-9a60-6b147320c7be','1ZVACPeq7ccGCoUXwtafUU','2017-01-01 00:00:00',NULL,0),(28,'2025-05-20 20:14:40','2025-05-28 01:47:11','Slowdive','Slowdive are a dream pop/shoegaze band that formed in 1989 in Reading, England, United Kingdom. Signed to Creation Records in 1990 and initially championed by the British music press, the band scored a UK top forty entry with their debut album Just For a Day. \n\nThe band consists of Rachel Goswell (vocals/guitar), Neil Halstead  (vocals/guitar), Nick Chaplin (bass), Christian Savill (guitar), and Simon Scott (drums, 1990-1994, 2014-present); additionally, Ian McCutcheon replaced Scott from 1994-1995. <a href=\"https://www.last.fm/music/Slowdive\">Read more on Last.fm</a>','a:25:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000030431\";s:8:\"bandcamp\";s:30:\"https://slowdive.bandcamp.com/\";s:14:\"BBC Music page\";s:72:\"https://www.bbc.co.uk/music/artists/a16371b9-7d36-497a-a9d4-42b0a0440c5e\";s:16:\"discography page\";s:46:\"http://www.lysator.liu.se/~chief/slowdive.html\";s:7:\"discogs\";s:36:\"https://www.discogs.com/artist/26494\";s:7:\"fanpage\";s:32:\"http://www.slowdivedatabase.com/\";s:14:\"free streaming\";s:34:\"https://www.deezer.com/artist/2021\";s:5:\"image\";s:65:\"https://commons.wikimedia.org/wiki/File:2014_WGT_298_Slowdive.jpg\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm3164267/\";s:7:\"last.fm\";s:34:\"https://www.last.fm/music/Slowdive\";s:6:\"lyrics\";s:35:\"https://genius.com/artists/Slowdive\";s:7:\"myspace\";s:35:\"https://myspace.com/slowdivetribute\";s:17:\"official homepage\";s:32:\"http://www.slowdiveofficial.com/\";s:15:\"other databases\";s:50:\"https://www.worldcat.org/identities/lccn-n92019922\";s:21:\"purchase for download\";s:39:\"https://www.amazon.co.uk/-/e/B000APAS1Q\";s:23:\"purchase for mail-order\";s:39:\"https://www.amazon.co.uk/-/e/B000APAS1Q\";s:15:\"secondhandsongs\";s:40:\"https://secondhandsongs.com/artist/20961\";s:14:\"social network\";s:43:\"https://www.instagram.com/slowdiveofficial/\";s:8:\"songkick\";s:39:\"https://www.songkick.com/artists/319721\";s:10:\"soundcloud\";s:35:\"https://soundcloud.com/slowdiveband\";s:9:\"streaming\";s:32:\"https://tidal.com/artist/3505228\";s:4:\"VIAF\";s:30:\"http://viaf.org/viaf/127457614\";s:8:\"wikidata\";s:38: