") is a German Neue Deutsche Härte band formed in Berlin in 1994. The band\'s lineup—consisting of lead vocalist Till Lindemann, lead guitarist Richard Kruspe, rhythm guitarist Paul Landers, bassist Oliver Riedel, drummer Christoph Schneider, and keyboardist Christian \"Flake\" Lorenz—has remained unchanged throughout their history, along with their approach to songwriting, which consists of Lindemann writing and singing the lyrics over instrumental pieces the rest of the band has completed beforehand. <a href=\"https://www.last.fm/music/Rammstein\">Read more on Last.fm</a>','a:26:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000333648\";s:11:\"bandsintown\";s:33:\"https://www.bandsintown.com/a/627\";s:14:\"BBC Music page\";s:72:\"https://www.bbc.co.uk/music/artists/b2d122f9-eadb-4930-a196-8f221eeb0c66\";s:7:\"discogs\";s:36:\"https://www.discogs.com/artist/11771\";s:7:\"fanpage\";s:24:\"http://www.sehnsucht.dk/\";s:14:\"free streaming\";s:32:\"http://www.pandora.com/rammstein\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm1339792/\";s:7:\"last.fm\";s:35:\"https://www.last.fm/music/Rammstein\";s:6:\"lyrics\";s:43:\"https://www.musixmatch.com/artist/Rammstein\";s:7:\"myspace\";s:29:\"https://myspace.com/rammstein\";s:17:\"official homepage\";s:25:\"http://www.rammstein.com/\";s:15:\"other databases\";s:39:\"http://www.musik-sammler.de/artist/1820\";s:21:\"purchase for download\";s:75:\"https://www.qobuz.com/gb-en/interpreter/rammstein/download-streaming-albums\";s:23:\"purchase for mail-order\";s:42:\"https://www.cdjapan.co.jp/person/700153203\";s:10:\"purevolume\";s:35:\"http://www.purevolume.com/rammstein\";s:15:\"secondhandsongs\";s:39:\"https://secondhandsongs.com/artist/1924\";s:9:\"setlistfm\";s:55:\"https://www.setlist.fm/setlists/rammstein-3bd43cd0.html\";s:14:\"social network\";s:33:\"https://www.tiktok.com/@rammstein\";s:8:\"songkick\";s:38:\"https://www.songkick.com/artists/11557\";s:10:\"soundcloud\";s:41:\"https://soundcloud.com/rammstei