\"myspace\";s:33:\"https://myspace.com/rachelgoswell\";s:17:\"official homepage\";s:32:\"http://www.slowdiveofficial.com/\";s:15:\"other databases\";s:53:\"https://www.worldcat.org/identities/lccn-no2007039432\";s:21:\"purchase for download\";s:39:\"https://www.amazon.co.uk/-/e/B000APV4GY\";s:23:\"purchase for mail-order\";s:39:\"https://www.amazon.co.uk/-/e/B000APV4GY\";s:14:\"social network\";s:34:\"https://twitter.com/RachelAGoswell\";s:8:\"songkick\";s:38:\"https://www.songkick.com/artists/76731\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/27312779\";s:8:\"wikidata\";s:38:\"https://www.wikidata.org/wiki/Q3928560\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/0prEgQscX7BEd2EvCFm6Se\";}','https://i.scdn.co/image/42fab120f0b4e6d00a3e8fd6845d7cf96c8d0728','rachel-goswell','80e91439-21f6-4a0a-84f8-23be4cd48549','0prEgQscX7BEd2EvCFm6Se',NULL,NULL,0),(40,'2025-05-19 23:20:12','2025-05-28 01:47:11','Neil Halstead','Neil Halstead (born 7 October 1970 in Reading, England) is a British guitarist and singer. He was a founding member of Slowdive. When Slowdive disbanded, Halstead, along with some other members of Slowdive (including longtime friend and musical collaborator Rachel Goswell), formed Mojave 3, a British country/folk band that features Halstead as the principal singer and songwriter. \n\nIn 2002, Halstead released his debut solo album, Sleeping on Roads. <a href=\"https://www.last.fm/music/Neil+Halstead\">Read more on Last.fm</a>','a:13:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000329602\";s:14:\"BBC Music page\";s:72:\"https://www.bbc.co.uk/music/artists/184699cd-f489-463a-95c3-f2f72d6fd92a\";s:7:\"discogs\";s:36:\"https://www.discogs.com/artist/51139\";s:5:\"image\";s:65:\"https://commons.wikimedia.org/wiki/File:2014_WGT_287_Slowdive.jpg\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm1217948/\";s:9:\"interview\";s:68:\"http://www.brooklynvegan.com/archives/2014/06/an_interview_w_73.html\";s:7:\"last.fm\";s:39:\"https://www.last.fm/music/Neil+Halstead\";s:7:\"myspace\";s:40:\"https://myspace.com/neilhalsteadofficial\";s:17:\"official homepage\";s:28:\"http://www.neilhalstead.com/\";s:15:\"other databases\";s:46:\"https://rateyourmusic.com/artist/neil_halstead\";s:14:\"social network\";s:32:\"https://twitter.com/neilhalstead\";s:8:\"wikidata\";s:38:\"https://www.wikidata.org/wiki/Q1776073\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/3QbwwBVHCVDEDrVpvUcCwj\";}','https://i.scdn.co/image/ab6772690000c46cb762c10c92da495dc5081751','neil-halstead','184699cd-f489-463a-95c3-f2f72d6fd92a','3QbwwBVHCVDEDrVpvUcCwj',NULL,NULL,0),(42,'2025-05-19 23:20:15','2025-05-28 01:47:11','Neil Carter',' <a href=\"https://www.last.fm/music/Neil+Carter\">Read more on Last.fm</a>','a:1:{s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/6Wl6KI41fI7QV6f7xaUuFJ\";}','https://i.scdn.co/image/ab6761610000e5eb814918a4e03e84c74425ead4','neil-carter','0a4c84d9-2e67-4413-8135-df0e21b578bc','6Wl6KI41fI7QV6f7xaUuFJ',NULL,NULL,0),(43,'2025-05-19 23:20:15','2025-05-28 01:47:11','Simon Scott','Simon Scott (b. 1971) is a British sound artist and multi-instrumentalist who is from Cambridge, UK. Below Sea Level, released in summer 2012, is Scott’s third solo album and his debut album for the US experimental record label 12k. Scott is also a member of the group BETWEEN, featuring Taylor Deupree, Marcus Fisher and illuha, who released their debut album on 12.12.12 on 12k.\n\nThe aesthetics of active listening and the subjective distinction of compositional materials and sound timbres are predominant explorations in his work. <a href=\"https://www.last.fm/music/Simon+Scott\">Read more on Last.fm</a>','a:14:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000957879\";s:8:\"bandcamp\";s:32:\"https://simonscott.bandcamp.com/\";s:4:\"blog\";s:33:\"http://spsmastering.blogspot.com/\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/499484\";s:9:\"interview\";s:85:\"http://whenthesunhitsblog.blogspot.com/2011/10/in