oglaí Bap',NULL,'a:2:{s:14:\"social network\";s:36:\"https://www.instagram.com/moglaibap/\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/0OFppp8Z3TaehuqGoC6BD1\";}','https://i.scdn.co/image/ab6761610000e5ebaaf090b1bc73ab3e365e9f0b','moglai-bap','9e1147dd-3e44-4297-81ed-1696c1fa36df','0OFppp8Z3TaehuqGoC6BD1',NULL,NULL,0),(54,'2025-05-20 20:14:42','2025-05-28 01:47:11','Christian Savill',' <a href=\"https://www.last.fm/music/Christian+Savill\">Read more on Last.fm</a>','a:5:{s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/506952\";s:14:\"free streaming\";s:54:\"https://open.spotify.com/artist/3wpV4KSaZ7E4y8EJuwFYMI\";s:5:\"image\";s:65:\"https://commons.wikimedia.org/wiki/File:2014_WGT_288_Slowdive.jpg\";s:9:\"interview\";s:82:\"http://www.creation-records.com/interviews/slowdive/christian-saville-of-slowdive/\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/3wpV4KSaZ7E4y8EJuwFYMI\";}',NULL,'christian-savill','e9b893d4-c2b4-40ec-b485-d7605f838d5a','3wpV4KSaZ7E4y8EJuwFYMI','1970-12-06 00:00:00',NULL,0),(55,'2025-05-22 16:16:03','2025-05-31 17:43:40','Jack Irons','Jack Irons (born July 18, 1962 in Los Angeles, California, USA) is a drummer who has played for the Red Hot Chili Peppers, What Is This?, Redd Kross, Raging Slab, Joe Strummer and Latino Rockabilly War, Pearl Jam, and Eleven.\n\n(1983-1988) Red Hot Chilli Peppers\n\nJack was a founding member of, and the original drummer for, the Red Hot Chili Peppers. He attended Fairfax High School in Los Angeles, California alongside Anthony Kiedis, Michael \"Flea\" Balzary and Hillel Slovak. <a href=\"https://www.last.fm/music/Jack+Irons\">Read more on Last.fm</a>','a:12:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000778337\";s:8:\"bandcamp\";s:31:\"https://jackirons.bandcamp.com/\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/365506\";s:14:\"free streaming\";s:54:\"https://open.spotify.com/artist/6q06p4F3Kh9N8IztbE7ibk\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm0410076/\";s:7:\"last.fm\";s:36:\"https://www.last.fm/music/Jack+Irons\";s:17:\"official homepage\";s:21:\"http://jackirons.com/\";s:15:\"other databases\";s:43:\"https://rateyourmusic.com/artist/jack_irons\";s:21:\"purchase for download\";s:41:\"https://us.7digital.com/artist/jack-irons\";s:4:\"VIAF\";s:30:\"http://viaf.org/viaf/101470515\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q353316\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/6q06p4F3Kh9N8IztbE7ibk\";}','https://i.scdn.co/image/ab6761610000e5eb613742872720ef0f1184d4d0','jack-irons','6305aa7b-97c7-46ae-b9b9-5d0c73f18e54','6q06p4F3Kh9N8IztbE7ibk','1962-07-18 00:00:00',NULL,0),(56,'2025-05-22 16:16:04','2025-05-31 17:43:40','Hillel Slovak','Hillel Slovak (Hebrew: הלל סלובק; April 13, 1962 – June 25, 1988) was an Israeli-American musician best known as the founding guitarist of the Los Angeles rock band Red Hot Chili Peppers, with whom he recorded two albums. His guitar work was rooted in funk and hard rock, and he often experimented with other genres including reggae and speed metal. He is considered to have been a major influence on the Red Hot Chili Peppers\' early sound. <a href=\"https://www.last.fm/music/Hillel+Slovak\">Read more on Last.fm</a>','a:6:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000958131\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/513652\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm0806234/\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/19376711\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q186924\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/1QtBT7yDXOW4REDDNFxTtR\";}','https://i.scdn.co/image/ab67616d0000b273bfd694a21d521febf19f8df3','hillel-slovak','e9abbfc9-6140-4fdc-ba65-eb6592533134','1QtBT7yDXOW4REDDNFxTtR','1962-04-13 00:00:00','1988-06-25 00:00:00',1),(57,'2025-05-22 16:16:05','2025-05-31 17:43:40','Jack Sherman',' <a href=\"https://www.last.fm/music/Jack+Sherman\">Read more on Last.fm</a>','a:5:{s:7:\"discogs\"