rontmen in modern American rock music as part of the Red Hot Chili Peppers. He was fired for a month some time during 1986 due to drug problems.\n\nKiedis was born in Michigan on November 1st 1962 to parents John Michael Kiedis (later to become actor Blackie Dammett) and Peggy Nobel. After his parents split he moved to Hollywood with his father aged twelve. At this time he featured in several films under the psydenoum Cole Dammett, most notably as Sylvester Stalones son in the film F. <a href=\"https://www.last.fm/music/Anthony+Kiedis\">Read more on Last.fm</a>','a:8:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000582721\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/136870\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm0452347/\";s:15:\"other databases\";s:53:\"https://www.worldcat.org/identities/lccn-nb2002001854\";s:8:\"songkick\";s:40:\"https://www.songkick.com/artists/2434561\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/84964807\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q204751\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/0IIMIbfPjCJoQyMLwLtk06\";}','https://i.scdn.co/image/894c20ff4cd06d43481fe9dfd23d3c4a20ed8cc3','anthony-kiedis','8df62446-21d3-4449-8901-9e2914362639','0IIMIbfPjCJoQyMLwLtk06','1962-11-01 00:00:00',NULL,0),(61,'2025-05-22 16:16:08','2025-05-31 17:43:40','DeWayne \"Blackbyrd\" McKnight',' <a href=\"https://www.last.fm/music/Dewayne+McKnight\">Read more on Last.fm</a>','a:6:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000098140\";s:7:\"discogs\";s:38:\"https://www.discogs.com/artist/4782987\";s:15:\"other databases\";s:51:\"https://www.worldcat.org/identities/lccn-no99015455\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/51319209\";s:8:\"wikidata\";s:38:\"https://www.wikidata.org/wiki/Q2467456\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/3ef2an5giEP6Hc60lKEVEy\";}','https://i.scdn.co/image/ab6761610000e5eb65b98f7fdb65ac30ef4b5627','dewayne-blackbyrd-mcknight','f48e4420-d2b