/Chad+Smith\">Read more on Last.fm</a>','a:7:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000158063\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/225315\";s:7:\"myspace\";s:33:\"https://myspace.com/chadsmithsolo\";s:14:\"social network\";s:28:\"https://twitter.com/RHCPchad\";s:4:\"VIAF\";s:30:\"http://viaf.org/viaf/101264007\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q269500\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/4DW34vji6G9GgGY0k2mic7\";}','https://i.scdn.co/image/894c20ff4cd06d43481fe9dfd23d3c4a20ed8cc3','chad-smith','da8f13f1-2a7f-44f7-93a8-3f5f9d7fa52d','4DW34vji6G9GgGY0k2mic7','1961-10-25 00:00:00',NULL,0),(65,'2025-05-22 16:16:17','2025-06-22 23:02:58','Arik Marshall','Arik Ben Marshall (born February 13, 1967 in Los Angeles) is an American guitarist, singer, songwriter, poet, and author, best known as a former member of the Red Hot Chili Peppers. He divides his time between London; Rio Rancho, New Mexico, and Los Angeles.  <a href=\"https://www.last.fm/music/Arik+Marshall\">Read more on Last.fm</a>','a:7:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000592255\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/333941\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm1976624/\";s:15:\"other databases\";s:46:\"https://rateyourmusic.com/artist/arik_marshall\";s:4:\"VIAF\";s:30:\"http://viaf.org/viaf/315945918\";s:8:\"wikidata\";s:38:\"https://www.wikidata.org/wiki/Q2861291\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/7DZiqxr1vtxhgsJLRf6uXL\";}','https://i.scdn.co/image/ab67616d0000b27342f2569791c375b03210d62f','arik-marshall','81049199-25ba-44a1-bab5-a1415da4075d','7DZiqxr1vtxhgsJLRf6uXL','1967-02-13 00:00:00',NULL,0),(66,'2025-05-22 16:16:18','2025-05-31 17:43:40','Dave Navarro','Dave Navarro (David Michael \"Dave\" Navarro, born June 7, 1967) is an American guitarist who plays in the alternative rock band Jane\'s Addiction and cover band Camp Freddy. He has also played with t