cal range. His solo output mixes various styles and genres, including metal, rock and Armenian musical motifs.\n\nAt age five, Serj Tankian moved with his parents to Los Angeles, California. <a href=\"https://www.last.fm/music/Serj+Tankian\">Read more on Last.fm</a>','a:19:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000743175\";s:14:\"BBC Music page\";s:72:\"https://www.bbc.co.uk/music/artists/e471b63c-c3b5-4f62-a971-cd0b2273838f\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/153410\";s:14:\"free streaming\";s:39:\"https://www.deezer.com/artist/248742102\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm1413742/\";s:7:\"last.fm\";s:38:\"https://www.last.fm/music/Serj+Tankian\";s:6:\"lyrics\";s:39:\"https://genius.com/artists/Serj-tankian\";s:7:\"myspace\";s:31:\"https://myspace.com/serjtankian\";s:17:\"official homepage\";s:24:\"https://serjtankian.com/\";s:15:\"other databases\";s:41:\"https://www.musik-sammler.de/artist/3400/\";s:21:\"purchase for download\";s:45:\"https://itunes.apple.com/us/artist/id82647909\";s:14:\"social network\";s:38:\"https://www.instagram.com/serjtankian/\";s:8:\"songkick\";s:39:\"https://www.songkick.com/artists/582183\";s:10:\"soundcloud\";s:34:\"https://soundcloud.com/serjtankian\";s:9:\"streaming\";s:30:\"https://tidal.com/artist/36225\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/22345165\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q486063\";s:7:\"youtube\";s:40:\"https://www.youtube.com/user/serjtankian\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/0BEI7i5sgUuivcfwXLzFmM\";}','https://i.scdn.co/image/ab6761610000e5ebfda268d9e79a9a51bed597b1','serj-tankian','e471b63c-c3b5-4f62-a971-cd0b2273838f','0BEI7i5sgUuivcfwXLzFmM','1967-08-21 00:00:00',NULL,0),(74,'2025-05-22 16:18:33','2025-05-28 01:59:51','John Dolmayan','John Dolmayan (born July 15, 1973 in Lebanon) is a musician, best known as the drummer for the Armenian-American alternative metal band System of a Down. His bandmates are vocalis