eyboard player in a heavy metal group.\n\nFlake is probably best known for <a href=\"https://www.last.fm/music/Christian+Lorenz\">Read more on Last.fm</a>','a:8:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0001884906\";s:10:\"BookBrainz\";s:66:\"https://bookbrainz.org/author/6c06a29d-3250-49f7-b351-71cf3a8542b0\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/506667\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm0520704/\";s:15:\"other databases\";s:49:\"https://rateyourmusic.com/artist/christian_lorenz\";s:4:\"VIAF\";s:30:\"http://viaf.org/viaf/311695367\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q155687\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/3XS0NFXQjOGmQnwwIhco70\";}','https://i.scdn.co/image/ab6761610000e5eb6b4ae282fd9c7c10ed7302dc','christian-lorenz','11f64d5e-77a6-48f7-ac1f-6d17b3ac2ba9','3XS0NFXQjOGmQnwwIhco70','1966-11-16 00:00:00',NULL,0),(79,'2025-05-22 16:19:19','2025-05-28 01:54:56','Oliver Riedel','Oliver \"Ollie\" Riedel (born April 11, 1971) is a German musician, notable for being the Bassist for the German Neue Deutsche Härte band Rammstein. \n\nRiedel was born on April 11, 1971 in Schwerin as an only child. Growing up, Oliver had relatively good relationships with both of his parents. He attributes this to the small gap in between their ages. As a child, Oliver wasn\'t a good student, but he made his way through school with the assistance of his mother. <a href=\"https://www.last.fm/music/Oliver+Riedel\">Read more on Last.fm</a>','a:9:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0002365491\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/506669\";s:5:\"image\";s:57:\"https://commons.wikimedia.org/wiki/File:Oliver_Riedel.jpg\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm0726112/\";s:15:\"other databases\";s:46:\"https://rateyourmusic.com/artist/oliver_riedel\";s:4:\"VIAF\";s:30:\"http://viaf.org/viaf/220857397\";s:8:\"wikidata\";s:36:\"https://www.wikidata.org/wiki/Q45520\";s:9:\"wikipedia\";s:43:\"https://en.wikipedia.org/wiki/Oliver_Riedel\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/6j3ySslqA7U31jkos4hS6o\";}',NULL,'oliver-riedel','730e20a5-66d3-4052-9143-a3ea7b56f568','6j3ySslqA7U31jkos4hS6o','1971-04-11 00:00:00',NULL,0),(80,'2025-05-22 16:19:19','2025-05-28 01:54:56','Christoph Schneider','Christoph Schneider was born on May 11th, 1966. His father was a musician. Schneider is the eldest of 7 children. He has one brother, and 5 sisters. One of his sisters, Constance, was the costume designer for the band Rammstein for some years. In 1980, when was 14, his brother gave him a drum, which his brother had made with aluminium cans. At age 16, he got out of college and started working as a telecommunication assistant. He said \"At last, after saving for a long time, I had enough money to buy myself a set of drums. <a href=\"https://www.last.fm/music/Christoph+Schneider\">Read more on Last.fm</a>','a:8:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0001269989\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/275286\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm0773750/\";s:15:\"other databases\";s:52:\"https://rateyourmusic.com/artist/christoph_schneider\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/57446850\";s:8:\"wikidata\";s:36:\"https://www.wikidata.org/wiki/Q57168\";s:9:\"wikipedia\";s:49:\"https://en.wikipedia.org/wiki/Christoph_Schneider\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/7IqZmVJpBuIVvIyLzmyKFS\";}','https://i.scdn.co/image/ab67616d0000b273f8db5f477840b9eeae2fa26b','christoph-schneider','bb9fe2b7-87fa-43e6-95ca-bc4592d8d5bc','7IqZmVJpBuIVvIyLzmyKFS','1966-05-11 00:00:00',NULL,0),(81,'2025-05-22 16:20:05','2025-06-23 00:14:40','Aaron Burckhard',' <a href=\"https://www.last.fm/music/Aaron+Burckhard\">Read more on Last.fm</a>','a:4:{s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/455772\";s:8:\"wikidata\";s:38:\"https://www.wikidata.org/wiki/Q1990978\";s:9:\"wikipedia\";s