ility that accompanies success\".\n\nCobain and Nirvana were highly influential, popularizing what came to be known as \"grunge music\". <a href=\"https://www.last.fm/music/Kurt+Cobain\">Read more on Last.fm</a>','a:12:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000095243\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/275118\";s:14:\"free streaming\";s:54:\"https://open.spotify.com/artist/6pAuTi6FXi6qFQJ1dzMXQs\";s:5:\"image\";s:62:\"http://www.quotecollection.com/author-images/kurt-cobain-2.jpg\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm0001052/\";s:15:\"other databases\";s:57:\"https://www.metal-archives.com/artists/Kurt_Cobain/112071\";s:21:\"purchase for download\";s:40:\"https://music.apple.com/us/artist/526647\";s:15:\"secondhandsongs\";s:39:\"https://secondhandsongs.com/artist/4182\";s:9:\"streaming\";s:40:\"https://music.apple.com/us/artist/526647\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/66668107\";s:8:\"wikidata\";s:35:\"https://www.wikidata.org/wiki/Q8446\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/6pAuTi6FXi6qFQJ1dzMXQs\";}','https://i.scdn.co/image/272283152dd4314895df4b05cb9bf25fdbdf341e','kurt-cobain','3c9b356d-d1db-4f4e-a7a3-2d00c1d70255','6pAuTi6FXi6qFQJ1dzMXQs','1967-02-20 00:00:00','1994-04-05 00:00:00',1),(85,'2025-05-22 16:21:06','2025-05-27 17:03:37','Krist Novoselic','Krist Anthony Novoselic (born May 16, 1965) is a American rock musician best known as the bassist for Nirvana. Apart from his musical endeavors, Novoselic has been active politically, including the creation of the political action committee JAMPAC. The original Croatian spelling of his surname is \'Novoselić\' (eng. Novoselich).\n\nHis family members were Paulo and Misha Novoselic and little brother Robert. Krist is Croatian-American born in Compton, California. <a href=\"https://www.last.fm/music/Krist+Novoselic\">Read more on Last.fm</a>','a:13:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000114761\";s:4:\"blog\";s:83:\"http://www.seattleweekly.com/news/blogs/dailyweekly/krist_novoselic_contention_con/\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/281754\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm0637218/\";s:7:\"last.fm\";s:41:\"https://www.last.fm/music/Krist+Novoselic\";s:17:\"official homepage\";s:25:\"http://www.novoselic.com/\";s:15:\"other databases\";s:54:\"https://www.worldcat.org/identities/lccn-no2004101889/\";s:15:\"secondhandsongs\";s:40:\"https://secondhandsongs.com/artist/20237\";s:14:\"social network\";s:34:\"https://twitter.com/KristNovoselic\";s:8:\"songkick\";s:40:\"https://www.songkick.com/artists/2464726\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/71110819\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q428798\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/4BZKfXia2RPZnzCgQ2fG8M\";}','https://i.scdn.co/image/5181846227f1c7d57d56e957b705e6a042d16ee1','krist-novoselic','ac05e29f-0561-4445-bb26-5562d2389531','4BZKfXia2RPZnzCgQ2fG8M','1965-05-16 00:00:00',NULL,0),(86,'2025-05-22 16:21:07','2025-05-27 17:03:37','Chad Channing','Chad Channing (born January 31, 1967 in Bainbridge Island, WA) is an American musician who was a former drummer for the band Nirvana from 1988 until 1990, when he left the band due to creative differences. Contrary to popular belief, it was a mutual decision and no hard feelings existed on either side.[citation needed] Amongst various Nirvana releases (singles etc), Channing appears as drummer on both the Bleach and Incesticide LPs, as well as the cymbal crash in the Nevermind version of \"Polly.\" <a href=\"https://www.last.fm/music/Chad+Channing\">Read more on Last.fm</a>','a:7:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0001179198\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/251654\";s:14:\"free streaming\";s:54:\"https://open.spotify.com/artist/0MF4CqR9hcWu0NrRuqvOVm\";s:15:\"other databases\";s:46:\"https://rateyourmusic.com/artist/chad_channing\";s:4:\"VIAF\";s:30:\"http://viaf.org/viaf/176146930\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q356938\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/0MF4CqR9hcWu0NrRuqvOVm\";}',NULL,'chad-channing','e2f28104-72bb-4c8f-b0f9-78d4eaf492fd','0MF4CqR9hcWu0NrRuqvOVm','1967-01-31 00:00:00',NULL,0),(87,'2025-05-22 16:21:08','2025-05-27 17:03:37','Dave Foster','Dave Foster was the third drummer for the legendary grunge rock band Nirvana. He was fired after playing only a couple of performances with the band, mostly because of his inability to attend rehearsal sessions regularly. Foster lived hours away from Kurt Cobain and bassist Krist Novoselic back in Aberdeen, Washington, which required the men to pick Foster up and bring him to the band\'s rehearsal space in Tacoma. According to Cobain\'s own account, this made band practices too much of a hassle. <a href=\"https://www.last.fm/music/Dave+Foster\">Read more on Last.fm</a>','a:2:{s:7:\"discogs\";s:38:\"https://www.discogs.com/artist/5525291\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/0SgQK24WzZf2pXBXYqHJYF\";}','https://i.scdn.co/image/ab6772690000c46ca182ac0198083642963c7eb6','dave-foster','6740416b-a0ab-4a46-9ee5-8cd9c69c6442','0SgQK24WzZf2pXBXYqHJYF',NULL,NULL,0),(88,'2025-05-22 16:21:11','2025-05-27 17:03:37','Jason Everman','Everman joined Nirvana in February 1989 as a second guitarist. He is listed as being second guitarist on Nirvana\'s Bleach, but did not actually play on any of the tracks. Nirvana founder Kurt Cobain said the credit was a token of thanks to Everman for paying a fee of US$606.17 to record the album.\n\nEverman toured with Nirvana the summer of 1989 in support of Bleach. He can be heard playing guitar on Trust No-One, an unofficial release of a live performance in Boston, MA. <a href=\"https://www.last.fm/music/Jason+Everman\">Read more on Last.fm</a>','a:7:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0001217832\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/441072\"