 (born 23 May 1967) is an English musician and songwriter, best known as the drummer of English alternative rock group Radiohead. He also plays drums and provides backing vocals, along with occasional guitar and lead vocals for 7 Worlds Collide. Selway is known for his precision and proficiency in various styles and unusual time signatures. He has worked with Samaritans since 1991. Selway released his debut solo album, Familial, on 30 August 2010. <a href=\"https://www.last.fm/music/Philip+Selway\">Read more on Last.fm</a>','a:14:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000338517\";s:14:\"BBC Music page\";s:72:\"https://www.bbc.co.uk/music/artists/4ab74d13-d1eb-4895-b874-6da5d8b1aac3\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/365781\";s:14:\"free streaming\";s:36:\"https://www.deezer.com/artist/508174\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm0783621/\";s:7:\"last.fm\";s:39:\"https://www.last.fm/music/Philip+Selway\";s:17:\"official homepage\";s:29:\"https://www.philipselway.com/\";s:15:\"other databases\";s:46:\"https://rateyourmusic.com/artist/philip-selway\";s:15:\"secondhandsongs\";s:39:\"https://secondhandsongs.com/artist/4302\";s:14:\"social network\";s:37:\"https://www.facebook.com/philipselway\";s:8:\"songkick\";s:40:\"https://www.songkick.com/artists/3011786\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/84963988\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q842263\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/2A59wav3PGiJij2rK7HQYH\";}','https://i.scdn.co/image/ab6761610000e5eb25909e9b5cbf668f8be115cb','philip-selway','4ab74d13-d1eb-4895-b874-6da5d8b1aac3','2A59wav3PGiJij2rK7HQYH','1967-05-23 00:00:00',NULL,0),(95,'2025-05-22 16:27:07','2025-05-27 16:22:48','Thom Yorke','Thomas Edward Yorke is an English musician who is the main vocalist and songwriter of the rock band Radiohead. A multi-instrumentalist, he mainly plays guitar and keyboards and is noted for his falsetto. He has been described by Rolling Stone as one of the greatest and most influential singers of his generation.\n\nYorke formed Radiohead with schoolmates at Abingdon School in Oxfordshire. Their 1992 debut single, \"Creep\", made Yorke a celebrity, and Radiohead went on to achieve critical acclaim and sales of over 30 million albums. <a href=\"https://www.last.fm/music/Thom+Yorke\">Read more on Last.fm</a>','a:22:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000588887\";s:8:\"bandcamp\";s:31:\"https://thomyorke.bandcamp.com/\";s:14:\"BBC Music page\";s:72:\"https://www.bbc.co.uk/music/artists/8ed2e0b3-aa4c-4e13-bec3-dc7393ed4d6b\";s:4:\"blog\";s:43:\"https://whathaveyoudonetomyface.tumblr.com/\";s:7:\"discogs\";s:35:\"https://www.discogs.com/artist/4854\";s:14:\"free streaming\";s:34:\"https://www.deezer.com/artist/5806\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm0948810/\";s:7:\"last.fm\";s:36:\"https://www.last.fm/music/Thom+Yorke\";s:6:\"lyrics\";s:37:\"https://genius.com/artists/Thom-yorke\";s:7:\"myspace\";s:34:\"https://myspace.com/thomyorkemusic\";s:15:\"other databases\";s:53:\"https://www.worldcat.org/identities/lccn-no2001079376\";s:21:\"purchase for download\";s:47:\"https://www.onkyomusic.com/GB/artist/thom-yorke\";s:23:\"purchase for mail-order\";s:38:\"https://boomkat.com/artists/thom-yorke\";s:15:\"secondhandsongs\";s:39:\"https://secondhandsongs.com/artist/4300\";s:14:\"social network\";s:34:\"https://www.threads.com/@thomyorke\";s:8:\"songkick\";s:39:\"https://www.songkick.com/artists/220083\";s:10:\"soundcloud\";s:40:\"https://soundcloud.com/thomyorkeofficial\";s:9:\"streaming\";s:32:\"https://tidal.com/artist/3544256\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/52905497\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q188668\";s:7:\"youtube\";s:56:\"https://www.youtube.com/channel/UC9BJwi8Q2AiLtLHdGlWqsrQ\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/4CvTDPKA6W06DRfBnZKrau\";}','https://i.scdn.co/image/ab6761610000e5ebbe918e48bee898ae236c0