3b075cb17e6eea7e','garza','b035597b-30ef-439b-94c6-2c1a7f4b5bad','3ahHdzUaLWYfWKovnVfqpg',NULL,NULL,0),(100,'2025-05-22 17:39:58','2025-06-17 01:21:22','Rob Garza','Founding member of international music group Thievery Corporation, Rob Garza\'s career includes decades-worth of accolades as a pioneer of a flourishing electronic music movement. Originally hailing from Washington, DC, Garza\'s legacy includes a timeless music catalog that\'s still in rotation today. His infusion of electronic music with the international flavors of dub, trip hop, reggae, and bossa nova gave birth to a new era of sound that has attracted a cult following across the decades. <a href=\"https://www.last.fm/music/Rob+Garza\">Read more on Last.fm</a>','a:7:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000278626\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/195227\";s:7:\"last.fm\";s:37:\"https://www.last.fm/music/Rob%20Garza\";s:17:\"official homepage\";s:24:\"http://www.robgarza.com/\";s:14:\"social network\";s:38:\"https://www.facebook.com/RobGarzaMusic\";s:10:\"soundcloud\";s:36:\"https://soundcloud.com/robgarzamusic\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/2oOHsFHeYnIBTYY8bBL5wG\";}','https://i.scdn.co/image/ab6761610000e5ebc6c25a4108fd3cbb2e897be4','rob-garza','0cd190b9-7a4d-4701-9d31-0005cf6408ba','2oOHsFHeYnIBTYY8bBL5wG',NULL,NULL,0),(101,'2025-05-22 17:39:59','2025-06-17 01:21:22','Eric Hilton','On his stunning new album “The Lost Dialect”, Eric Hilton speaks in his mother tongue, the 12-bit vernacular of Trip-Hop, a genre he helped bring to life as a co-founder of the legendary downtempo electronic music act Thievery Corporation. Across ten expansive tracks, the artist/producer uses old-school skills to craft new school chill in a genre that is currently enjoying a resurgence -but for Hilton at least, trip-hop never really went away. <a href=\"https://www.last.fm/music/Eric+Hilton\">Read more on Last.fm</a>','a:9:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000156750\";s:8:\"bandcamp\";s:32:\"https://erichilton.bandcamp.com/\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/195228\";s:14:\"free streaming\";s:37:\"https://www.deezer.com/artist/4671767\";s:17:\"official homepage\";s:23:\"https://erichilton.com/\";s:15:\"other databases\";s:44:\"https://rateyourmusic.com/artist/eric_hilton\";s:21:\"purchase for download\";s:50:\"https://www.beatport.com/artist/eric-hilton/613336\";s:14:\"social network\";s:42:\"https://www.instagram.com/erichiltonmusic/\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/4tgBpjW0GVvKqP7uY2OHYB\";}','https://i.scdn.co/image/ab6761610000e5ebb1cd5c35d08722333c34f78c','eric-hilton','28ea287e-6e83-473f-b404-936bbfbb88f6','4tgBpjW0GVvKqP7uY2OHYB',NULL,NULL,0),(102,'2025-05-22 17:40:24','2025-05-27 16:23:05','Ben Moody','Ben Moody, guitarist of We Are The Fallen, started out as the co-founder of the alternative rock band, Evanescence. After leaving in October 2003 during the European tour, he moved on to a solo project and began producing songs for other artists.  The list includes Avril Lavigne, Kelly Clarkson, Lindsay Lohan, Bo Bice, Godhead, 3Faced, Daughtry and Celine Dion. He has also been producing, writing and touring with singer-songwriter Hana Pestle.\n\nBen <a href=\"https://www.last.fm/music/Ben+Moody\">Read more on Last.fm</a>','a:10:{s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/313346\";s:14:\"free streaming\";s:34:\"https://www.deezer.com/artist/3633\";s:6:\"lyrics\";s:52:\"http://muzikum.eu/en/122-10356/ben-moody/lyrics.html\";s:7:\"myspace\";s:28:\"https://myspace.com/benmoody\";s:17:\"official homepage\";s:24:\"http://www.benmoody.com/\";s:15:\"secondhandsongs\";s:40:\"https://secondhandsongs.com/artist/41185\";s:14:\"social network\";s:31:\"https://twitter.com/TheBenMoody\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q313849\";s:9:\"wikipedia\";s:39:\"https://en.wikipedia.org/wiki/Ben_Moody\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/2TpF4YCzKyTMfU05atRy18\";}','https://i.scdn.co/image/ac0f24f75e887c7ba3b2cf717c4282918d7c380e','ben-moody','0d00b498-512d-4a4d-9234-a4d710f37e6d','2TpF4YCzKyTMfU05atRy18','1980-01-22 00:00:00',NULL,0),(103,'2025-05-22 17:40:25','2025-06-23 00:14:40','Amy Lee','Amy Lynn Lee (born December 13, 1981) is an American singer-songwriter and musician. She plays a key role in the rock band Evanescence as the co-founder, lead vocalist, lead songwriter, and keyboardist. In addition to her work with the band, Lee has been involved in various musical projects. She has contributed to albums like Nightmare Revisited and Muppets: The Green Album. Lee has also composed soundtracks for films like War Story (2014) and Indigo Grey: The Passage (2015) alongside cellist Dave Eggar. <a href=\"https://www.last.fm/music/Amy+Lee\">Read more on Last.fm</a>','a:14:{s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/263224\";s:14:\"free streaming\";s:35:\"https://www.deezer.com/artist/15741\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm1341624/\";s:17:\"official homepage\";s:30:\"http://www.amyleeofficial.com/\";s:15:\"other databases\";s:52:\"https://www.worldcat.org/identities/lccn-n2006086066\";s:21:\"purchase for download\";s:43:\"https://itunes.apple.com/artist/id913276857\";s:15:\"secondhandsongs\";s:40:\"https://secondhandsongs.com/artist/34210\";s:14:\"social network\";s:33:\"https://www.instagram.com/amylee/\";s:8:\"songkick\";s:39:\"https://www.songkick.com/artists/524819\";s:9:\"streaming\";s:32:\"https://tidal.com/artist/3626252\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/50444018\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q172632\";s:7:\"youtube\";s:56:\"https://www.youtube.com/channel/UCxdWaWTIj-AFycTmuAPm62A\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/0fGVuq5ed21pM7iWwTcMyk\";}','https://i.scdn.co/image/ab6761610000e5eb23f91cfef09d0f0a92bbaf0f','amy-lee','7ee89158-3446-4044-bb88-0dcc4d4cd6c0','0fGVuq5ed21pM7iWwTcMyk','1981-12-13 00:00:00',NULL,0),(104,'2025-05-22 17:40:26','2025-05-27 16:23:05','David Hodges','David Hodges is an all-round musician, songwriter and producer. His most significant role has been as co-writer and keyboardist on the Evanescence albums, \'Origin\' and \'Fallen\'. Hodges joined Evanescence in 1998, but left after the completion of \'Fallen\', before the band rocketed to global success. Hodges has received two Grammy Awards, one for Best New Artist (as part of Evanescence) and the other for Best Hard Rock Performance for the band\'s debut single, Bring Me to Life. <a href=\"https://www.last.fm/music/David+Hodges\">Read more on Last.fm</a>','a:16:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000143711\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/331044\";s:7:\"fanpage\";s:67:\"https://evanescencereference.info/wiki/index.php?title=David_Hodges\";s:14:\"free streaming\";s:54:\"https://open.spotify.com/artist/7fRabwYwLBgvOudI9GY2Op\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm1396091/\";s:6:\"lyrics\";s:39:\"https://genius.com/artists/David-hodges\";s:7:\"myspace\";s:36:\"https://myspace.com/davidhodgesmusic\";s:17:\"official homepage\";s:28:\"http://davidhodgesmusic.com/\";s:15:\"other databases\";s:52:\"https://www.worldcat.org/identities/lccn-n2006086083\";s:15:\"secondhandsongs\";s:40:\"https://secondhandsongs.com/artist/41184\";s:14:\"social network\";s:41:\"https://www.facebook.com/davidhodgesmusic\";s:8:\"songkick\";s:37:\"https://www.songkick.com/artists/9515\";s:9:\"streaming\";s:32:\"https://tidal.com/artist/3636075\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/43733806\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q362886\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/7fRabwYwLBgvOudI9GY2Op\";}','https://i.scdn.co/image/ab6761610000e5eb15a50e37fbac6feb6a781c33','david-hodges','8006f1d0-8851-46d8-a928-085c686b29b9','7fRabwYwLBgvOudI9GY2Op','1978-12-05 00:00:00',NULL,0),(105,'2025-05-22 17:40:27','2025-05-27 16:23:05','William Boyd',' <a href=\"https://www.last.fm/music/William+Boyd+&+Randy+Brooks\">Read more on Last.fm</a>','a:3:{s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q281159\";s:9:\"wikipedia\";s:39:\"https://en.wikipedia.org/wiki/Will_Boyd\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/2m3QTMNI89DEFSlvmnayPE\";}','https://i.scdn.co/image/ab6761610000e5eb3834cd835a78c9a41b9f9934','william-boyd','ea05652d-fe86-479e-9225-8d3b540902b6','2m3QTMNI89DEFSlvmnayPE','1979-04-27 00:00:00',NULL,0),(106,'2025-05-22 17:40:33','2025-05-27 16:23:05','Rocky Gray','Rocky Gray (born William Gray on July 2, 1974 in Jacksonville, Arkansas, United States) is a drummer and guitarist who has been part of the Arkansas metal scene since the early 90\'s and is best known as the lead guitarist for Living Sacrifice and former drummer for Evanescence. Gray is married to Renee Gray with two children, Abraham and Madison, and currently resides in Little Rock, Arkansas.\n\nGray is currently involved in several bands including Soul Embraced (guitars, vocals), Mourningside (drums), and Fatal Thirteen (guitars). <a href=\"https://www.last.fm/music/Rocky+Gray\">Read more on Last.fm</a>','a:6:{s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/410224\";s:7:\"myspace\";s:29:\"https://myspace.com/rockygray\";s:14:\"social network\";s:29:\"https://twitter.com/ROCKYGRAY\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q362056\";s:9:\"wikipedia\";s:40:\"https://en.wikipedia.org/wiki/Rocky_Gray\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/6Chzc8bFbzWJ2q4SgwG5uV\";}','https://i.scdn.co/image/ab6761610000e5eba6549d1414590ec4007bcd2f','rocky-gray','250c291f-f7ea-4064-a8ff-d9aeb4bc3124','6Chzc8bFbzWJ2q4SgwG5uV','1974-07-02 00:00:00',NULL,0),(107,'2025-05-22 17:40:34','2025-05-27 16:23:05','John LeCompt','John Charles LeCompt is an American guitarist (born: March 10 1973). He was born in Little Rock. He was the guitarist and lead vocalist for the bands Mindrage and Kill System. John joined Evanescence as their guitarist after the recording of Fallen (co-wrote \"Taking Over Me\") in 2003. He co-wrote \"All That I\'m Living For\" on the album The Open Door. He was fired from Evanescence by Amy Lee (May 4 2007). He is the guitarist and backing vocalist for the bands Machina and Mourningside. <a href=\"https://www.last.fm/music/John+LeCompt\">Read more on Last.fm</a>','a:6:{s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/627848\";s:14:\"social network\";s:31:\"https://twitter.com/JohnLeCompt\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/84509600\";s:8:\"wikidata\";s:38:\"https://www.wikidata.org/wiki/Q1629524\";s:9:\"wikipedia\";s:42:\"https://en.wikipedia.org/wiki/John_LeCompt\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/336kNQ5Icn8ged0hgfbLr7\";}',NULL,'john-lecompt','fa5f1642-48ad-4337-9bcf-21a1c47af406','336kNQ5Icn8ged0hgfbLr7','1973-03-10 00:00:00',NULL,0),(108,'2025-05-22 17:40:35','2025-05-27 16:23:05','Terry Balsamo',' <a href=\"https://www.last.fm/music/Terry+Balsamo\">Read more on Last.fm</a>','a:5:{s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/633790\";s:14:\"social network\";s:32:\"https://twitter.com/TerryBalsamo\";s:8:\"wikidata\";s:38:\"https://www.wikidata.org/wiki/Q1102269\";s:9:\"wikipedia\";s:43:\"https://en.wikipedia.org/wiki/Terry_Balsamo\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/3Jysilh9NowA4WllbQYzeW\";}',NULL,'terry-balsamo','7c679635-a892-496b-82e7-84abe3eb5739','3Jysilh9NowA4WllbQYzeW','1972-10-08 00:00:00',NULL,0),(109,'2025-05-22 17:40:36','2025-05-27 16:23:05','Tim McCord',' <a href=\"https://www.last.fm/music/Tim+McCord\">Read more on Last.fm</a>','a:4:{s:7:\"discogs\";s:38:\"https://www.discogs.com/artist/1537429\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q586794\";s:9:\"wikipedia\";s:40:\"https://en.wikipedia.org/wiki/Tim_McCord\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/5vZDFVsuw55g0vvtQovCYn\";}',NULL,'tim-mccord','60fd91c9-d22c-477