7:\"https://genius.com/artists/Jen-majura\";s:17:\"official homepage\";s:25:\"http://www.jenmajura.com/\";s:14:\"social network\";s:42:\"https://www.facebook.com/jenmajuraofficial\";s:8:\"wikidata\";s:39:\"https://www.wikidata.org/wiki/Q20830501\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/1qrZ7rdIkGzD1VUr8aIAtl\";}','https://i.scdn.co/image/ab67616d0000b2731adbfed162320362ee46d26a','jen-majura','664e2844-1eb4-4624-9122-3ea4b7d9cbb3','1qrZ7rdIkGzD1VUr8aIAtl','1983-06-16 00:00:00',NULL,0),(113,'2025-05-22 17:40:45','2025-05-27 16:23:05','Emma Anzai',' <a href=\"https://www.last.fm/music/Emma+Anzai\">Read more on Last.fm</a>','a:1:{s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/1bCzp3rxmRWu8NrPEAkvna\";}',NULL,'emma-anzai','11f66ca4-02d9-429e-a117-892a0af8fa6a','1bCzp3rxmRWu8NrPEAkvna',NULL,NULL,0),(114,'2025-05-22 17:41:15','2025-05-28 02:07:16','Steve Hewitt','Steve Hewitt (born 22 March 1971) was the drummer for the band Placebo between mid-1996 and October 2007. He was born in Northwich, Cheshire, England. Prior to joining Placebo, Hewitt was a member of various bands such as Electric Crayons, K-Klass, The Mystic Deckchairs, Boo Radleys and Breed. He also worked as a session musician.[citation needed]\n\nHe met band member Brian Molko through his then-girlfriend. Although he appeared on some early demo tapes for Placebo, he wasn\'t able to join the band at first due to prior commitments to Breed. <a href=\"https://www.last.fm/music/Steve+Hewitt\">Read more on Last.fm</a>','a:7:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000547569\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/435459\";s:15:\"other databases\";s:45:\"https://rateyourmusic.com/artist/steve_hewitt\";s:8:\"songkick\";s:40:\"https://www.songkick.com/artists/3775036\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/84251738\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q372318\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/0W4w84n5TdM55p4GMnClIM\";}','https://i.scdn.co/image/ab6761610000e5ebe248d61d7f713c7cfd821112','steve-hewitt','5976af3a-ab6a-4725-a9cc-72cdffc6b932','0W4w84n5TdM55p4GMnClIM','1971-03-22 00:00:00',NULL,0),(115,'2025-05-22 17:41:16','2025-05-28 02:07:16','Robert Schultzberg','Robert Schultzberg was the original drummer for alternative rock band Placebo. He was born in Geneva, Switzerland on 3 January 1975 and is half English (mother), half Swedish.\n\nSchultzberg joined when the band formed in September 1994, helping them to record their first studio demo in April 1995. The band\'s first rehearsal demo had been recorded with Steve Hewitt before Schultzberg joined, but Hewitt at the time was committed to another band (Breed) and so did not join until later. <a href=\"https://www.last.fm/music/Robert+Schultzberg\">Read more on Last.fm</a>','a:5:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000484054\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/521304\";s:15:\"other databases\";s:51:\"https://rateyourmusic.com/artist/robert_schultzberg\";s:8:\"wikidata\";s:38:\"https://www.wikidata.org/wiki/Q2745512\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/3t5xRXzsuZmMDkQzgOX35S\";}','https://i.scdn.co/image/ab6761610000e5eb869ddcc058c5ff2a459ad8d5','robert-schultzberg','8caa0df7-5493-4eaa-946f-a05b9b716a0c','3t5xRXzsuZmMDkQzgOX35S','1975-01-03 00:00:00',NULL,0),(116,'2025-05-22 17:41:17','2025-05-28 02:07:16','Brian Molko','Born to an American international banker father and a Scottish mother, Brian Molko\'s family moved frequently during his childhood, including spells in Scotland, Liberia, Lebanon and Luxembourg. Molko has referred to his mother\'s home town of Dundee, Scotland as \"where I grew up\". He attended Goldsmiths College in London, where he studied drama. He describes his childhood as a period when he felt very lonely and alienated. He started to wear make-up at the age of 11. He was an actor in a school drama theater. <a href=\"https://www.last.fm/music/B