fy.com/artist/76qL9yopA0SRbE3jolAvEN\";}','https://i.scdn.co/image/ab67616d0000b27336495b417834cda901338e8b','stefan-olsdal','d9a4caf6-9b71-4be1-901f-017f4b40b905','76qL9yopA0SRbE3jolAvEN','1974-03-31 00:00:00',NULL,0),(118,'2025-05-22 17:41:24','2025-05-28 02:07:16','Steve Forrest','Steven Forrest born September 25, 1986  in Modesto, California, is former percussionist of ambient rock group Evaline and vocalist of indie rock band É Florentino, who\'s playing acoustic guitar also. \n\nFrom the beginning of 2008 full-professional percussionist of Placebo. He participated in recording their sixth studio album \"Battle for the Sun\", released at June of 2009. \n\nSometimes he\'s supporting Placebo concerts, performing É Florentino\'s songs and his own compositions.  <a href=\"https://www.last.fm/music/Steve+Forrest\">Read more on Last.fm</a>','a:9:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0002736051\";s:7:\"discogs\";s:38:\"https://www.discogs.com/artist/1522027\";s:15:\"other databases\";s:49:\"https://rateyourmusic.com/artist/steve_forrest_f1\";s:14:\"social network\";s:56:\"https://www.facebook.com/pages/Steve-Forrest/99715881532\";s:8:\"songkick\";s:40:\"https://www.songkick.com/artists/3483406\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/96947101\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q655799\";s:9:\"wikipedia\";s:54:\"https://en.wikipedia.org/wiki/Steve_Forrest_(musician)\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/3oAbjWINfcTSAuVUlXXMty\";}','https://i.scdn.co/image/ab6761610000e5eb435c0c8dbd72af2a4c632d47','steve-forrest','6a1d90cb-c9f8-4e20-a417-f96fc11af17f','3oAbjWINfcTSAuVUlXXMty','1986-09-25 00:00:00',NULL,0),(119,'2025-05-22 17:41:50','2025-05-27 17:56:21','Vince Clarke','Vincent John Martin (born 3 July 1960 in South Woodford, Essex, United Kingdom), known professionally as Vince Clarke, is an English, London-based synth pop musician and songwriter. Clarke has been the main composer and musician of the band Erasure since its inception in 1985 and was previously the main songwriter for several groups, including Depeche Mode, Yazoo, and The Assembly. In Erasure, he is known for his deadpan and low-key onstage demeanour <a href=\"https://www.last.fm/music/Vince+Clarke\">Read more on Last.fm</a>','a:17:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000807893\";s:14:\"BBC Music page\";s:72:\"https://www.bbc.co.uk/music/artists/6ef12fc1-40f4-41ea-ac52-f487840255bd\";s:7:\"discogs\";s:36:\"https://www.discogs.com/artist/37365\";s:14:\"free streaming\";s:54:\"https://open.spotify.com/artist/7zkGCcaPSB7nLCtaxEWWE1\";s:5:\"image\";s:65:\"https://commons.wikimedia.org/wiki/File:VInce_Clarke,_Erasure.jpg\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm0165047/\";s:9:\"interview\";s:67:\"http://www.muzines.co.uk/articles/waiting-for-the-perfect-song/4030\";s:7:\"last.fm\";s:38:\"https://www.last.fm/music/Vince+Clarke\";s:6:\"lyrics\";s:39:\"https://genius.com/artists/Vince-clarke\";s:17:\"official homepage\";s:32:\"http://www.vinceclarkemusic.com/\";s:15:\"other databases\";s:50:\"https://www.worldcat.org/identities/viaf-11061775/\";s:21:\"purchase for download\";s:50:\"https://www.beatport.com/artist/vince-clarke/16811\";s:15:\"secondhandsongs\";s:39:\"https://secondhandsongs.com/artist/5340\";s:14:\"social network\";s:41:\"https://www.facebook.com/vinceclarkemusic\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/11061775\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q312060\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/7zkGCcaPSB7nLCtaxEWWE1\";}','https://i.scdn.co/image/ab6761610000e5ebb9b4329ffbf1fbd9e9b4cc30','vince-clarke','6ef12fc1-40f4-41ea-ac52-f487840255bd','7zkGCcaPSB7nLCtaxEWWE1','1960-07-03 00:00:00',NULL,0),(120,'2025-05-22 17:41:50','2025-06-23 00:14:40','Andrew Fletcher',' <a href=\"https://www.last.fm/music/Andrew+Fletcher\">Read more on Last.fm</a>','a:11:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000166150\";s:7:\"disc