re on Last.fm</a>','a:15:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000318966\";s:11:\"bandsintown\";s:35:\"https://www.bandsintown.com/a/64054\";s:7:\"discogs\";s:36:\"https://www.discogs.com/artist/26847\";s:14:\"free streaming\";s:54:\"https://open.spotify.com/artist/6KQQ6ka4Thwww3kjYqrG0F\";s:5:\"image\";s:75:\"https://commons.wikimedia.org/wiki/File:Martin_Gore_2009_London_cropped.jpg\";s:7:\"last.fm\";s:40:\"https://www.last.fm/music/Martin+L.+Gore\";s:7:\"myspace\";s:34:\"https://myspace.com/martingoresolo\";s:17:\"official homepage\";s:26:\"http://www.martingore.com/\";s:15:\"other databases\";s:47:\"https://rateyourmusic.com/artist/martin_l__gore\";s:15:\"secondhandsongs\";s:39:\"https://secondhandsongs.com/artist/3455\";s:9:\"setlistfm\";s:59:\"https://www.setlist.fm/setlists/martin-l-gore-6bd6aa9e.html\";s:9:\"streaming\";s:32:\"https://tidal.com/artist/4981420\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/24803305\";s:8:\"wikidata\";s:37:\"https://www.wikidata.org/wiki/Q491583\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/6KQQ6ka4Thwww3kjYqrG0F\";}','https://i.scdn.co/image/ab6761610000e5ebc64fdcbfaf0e7d7087836ea8','martin-l-gore','e08ac443-f1d2-4666-abd1-fa5859592981','6KQQ6ka4Thwww3kjYqrG0F','1961-07-23 00:00:00',NULL,0),(123,'2025-05-22 17:41:53','2025-06-23 00:14:40','Alan Wilder','Alan Charles Wilder was born on June 1st June 1959 in Hammersmith, West London, England. An electronic musician, composer, arranger and record producer. Alan is best known as a former member of Depeche Mode. He is also the founder of an electronic music project named Recoil. Recoil started as a side project to Depeche Mode, but when he left the latter in 1995, it evolved into Wilder\'s primary project. Wilder has also provided production and remixing services to the bands Nitzer Ebb, and Curve.  <a href=\"https://www.last.fm/music/Alan+Wilder\">Read more on Last.fm</a>','a:10:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000611320\";s