cene as a member of the sound system The Wild Bunch in the 1980s, which included two other Massive Attack members, Robert del Naja and Andrew Vowles. In 1986, The Wild Bunch disbanded. Del Naja, Vowles, and Marshall then formed the trip-hop group Massive Attack, which is considered to be the first and definitive group in the trip-hop genre. <a href=\"https://www.last.fm/music/Daddy+G\">Read more on Last.fm</a>','a:5:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000950958\";s:7:\"discogs\";s:36:\"https://www.discogs.com/artist/40062\";s:15:\"other databases\";s:40:\"https://rateyourmusic.com/artist/daddy_g\";s:4:\"VIAF\";s:29:\"http://viaf.org/viaf/85700595\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/1ZzrtywizUvz4v6jo9P874\";}',NULL,'daddy-g','57070ee8-e44c-48c7-9519-6c985adfe6b2','1ZzrtywizUvz4v6jo9P874','1959-12-18 00:00:00',NULL,0),(168,'2025-05-23 00:11:33','2025-05-27 16:38:07','Damon Reece',' <a href=\"https://www.last.fm/music/Damon+Reece\">Read more on Last.fm</a>','a:5:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000772957\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/370932\";s:14:\"social network\";s:45:\"https://www.instagram.com/damonreeceofficial/\";s:8:\"wikidata\";s:38:\"https://www.wikidata.org/wiki/Q2836635\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/1FnF0jvuRpY6kZIHwbCzrD\";}','https://i.scdn.co/image/ab67616d0000b27336e90f32b889871c99b0a4a2','damon-reece','ebd7e97d-ea86-42d8-98ee-9d7f243f9030','1FnF0jvuRpY6kZIHwbCzrD',NULL,NULL,0),(169,'2025-05-23 00:13:55','2025-05-27 16:59:03','Jim Morrison','There are at least two recording artists named Jim Morrison. The by far most famous one is, of course, the late, legendary frontman of American rock band, The Doors. For other musicians named Jim Morrison: please scroll down.\n\n1. James Douglas \"Jim\" Morrison (born December 8, 1943 in Melbourne, Florida, United States – died July 3, 1971 in Paris, France) was an American singer, songwriter,