e involved with the electronic music scene after he moved to Paris in 2005, where he meet the Parisian electronic music trio dOP. After spending hours in the studio with the three musicians, Brian\'s musical sound was profoundly changed. <a href=\"https://www.last.fm/music/Aquarius+Heaven\">Read more on Last.fm</a>','a:6:{s:7:\"discogs\";s:38:\"https://www.discogs.com/artist/1872647\";s:14:\"free streaming\";s:54:\"https://open.spotify.com/artist/0lAjFl20uNiFMWafrHRxea\";s:15:\"other databases\";s:31:\"https://ra.co/dj/aquariusheaven\";s:21:\"purchase for download\";s:54:\"https://www.beatport.com/artist/aquarius-heaven/188028\";s:10:\"soundcloud\";s:38:\"https://soundcloud.com/aquarius-heaven\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/0lAjFl20uNiFMWafrHRxea\";}','https://i.scdn.co/image/ab6761610000e5ebe122b1d83583a5cbfb997ff5','aquarius-heaven','bd5c51e9-a36b-43a6-93d5-20970346acf4','0lAjFl20uNiFMWafrHRxea',NULL,NULL,0),(192,'2025-06-18 23:18:18','2025-06-18 23:19:08','Λόγος Απειλή',' <a href=\"https://www.last.fm/music/%CE%9B%CF%8C%CE%B3%CE%BF%CF%82+%CE%91%CF%80%CE%B5%CE%B9%CE%BB%CE%AE\">Read more on Last.fm</a>','a:13:{s:11:\"bandsintown\";s:38:\"https://www.bandsintown.com/a/15554622\";s:7:\"discogs\";s:38:\"https://www.discogs.com/artist/1847274\";s:14:\"free streaming\";s:37:\"https://www.deezer.com/artist/9789740\";s:6:\"lyrics\";s:43:\"https://genius.com/artists/Logos-apeili-grc\";s:7:\"myspace\";s:31:\"https://myspace.com/logosapeilh\";s:21:\"purchase for download\";s:60:\"https://www.qobuz.com/us-en/interpreter/logos-apeili/6068651\";s:14:\"social network\";s:36:\"https://www.tiktok.com/@logos.apeilh\";s:10:\"soundcloud\";s:34:\"https://soundcloud.com/logosapeili\";s:9:\"streaming\";s:60:\"https://www.qobuz.com/us-en/interpreter/logos-apeili/6068651\";s:8:\"wikidata\";s:39:\"https://www.wikidata.org/wiki/Q46995963\";s:7:\"youtube\";s:56:\"https://www.youtube.com/channel/UC1L7llruQjolIaYnJzYxvhw\";s:13:\"youtube music\";s:58:\"https://music.youtube.com/channel/UCnXAhFCNsDCAZpZETXpEWAQ\";s:7:\"spotify\";s:54:\"https://open.spotify.com/artist/4V1VqmIhq4RIFEjBQQZABS\";}','https://i.scdn.co/image/ab67616d0000b27383ce6f49700dfbbd3e46ff0f','logos-apeile','8878a512-51ad-49c5-9dcd-4a8a2a3a2436','4V1VqmIhq4RIFEjBQQZABS','1986-01-01 00:00:00',NULL,0),(193,'2025-06-18 23:28:40','2025-06-18 23:33:49','Howard Shore','Howard Leslie Shore OC (born October 18, 1946) is a Canadian composer who is notable for his film scores. He has composed the scores for over 80 films, most notably the scores for The Lord of the Rings and The Hobbit film trilogies. He won three Academy Awards for his work on the first trilogy, with one being for the original song \"Into the West\", an award he shared with Eurythmics lead vocalist Annie Lennox and writer/producer Fran Walsh, who wrote the lyrics. <a href=\"https://www.last.fm/music/Howard+Shore\">Read more on Last.fm</a>','a:25:{s:8:\"allmusic\";s:44:\"https://www.allmusic.com/artist/mn0000278644\";s:11:\"bandsintown\";s:35:\"https://www.bandsintown.com/a/12143\";s:14:\"BBC Music page\";s:72:\"https://www.bbc.co.uk/music/artists/9b58672a-e68e-4972-956e-a8985a165a1f\";s:7:\"discogs\";s:37:\"https://www.discogs.com/artist/102211\";s:7:\"fanpage\";s:62:\"https://fanart.tv/artist/9b58672a-e68e-4972-956e-a8985a165a1f/\";s:14:\"free streaming\";s:33:\"https://www.deezer.com/artist/556\";s:5:\"image\";s:56:\"https://commons.wikimedia.org/wiki/File:Howard_Shore.jpg\";s:4:\"IMDb\";s:36:\"https://www.imdb.com/name/nm0006290/\";s:7:\"last.fm\";s:38:\"https://www.last.fm/music/Howard+Shore\";s:6:\"lyrics\";s:39:\"https://genius.com/artists/Howard-shore\";s:17:\"official homepage\";s:24:\"https://howardshore.com/\";s:15:\"other databases\";s:36:\"http://www.maniadb.com/artist/122773\";s:21:\"purchase for download\";s:47:\"https://www.qobuz.com/gb-en/interpreter/-/19298\";s:15:\"secondhandsongs\";s:40:\"https://secondhandsongs.com/artist/60055\";s:9:\"setlistfm\";s:58:\"https://www.setlist.fm/setlist