INSERT INTO `rating` VALUES (1,1,'2025-05-22 02:23:34','2025-05-22 02:40:21',34,NULL,75),(2,1,'2025-05-22 02:41:19','2025-05-22 02:41:19',64,NULL,77),(3,1,'2025-05-22 02:49:27','2025-05-22 02:49:27',71,NULL,79),(4,1,'2025-05-22 02:49:37','2025-05-22 02:49:37',49,NULL,80),(5,1,'2025-05-22 02:49:53','2025-06-17 00:07:48',50,NULL,76),(6,1,'2025-05-25 00:04:56','2025-06-18 01:07:55',58,'Waiting for the Sun is far from their best album – but with enough Doors classics on it to make it essential to any music lover’s collection.  \r\n\r\nBut that lead singer of theirs, he was never going to be long for this world.  Perhaps he couldn’t have given us everything he did if he hadn’t had such a self-destructive streak – maybe that was essential to his art, and taking that away would have changed too much of who he was an artist for himself to give us everything he did. Such a waste of talent though – I will always wish Jim Morrison had been born with the discipline to focus all of that talent and the restraint to keep himself from going off the rails.  \r\n\r\nWould it have been to much to ask for God to give him focus and restraint along with all of his other gifts?  But God gave him what he gave him, and he was what he was, and as it is we have to settle for the six albums he and the other Doors left us with that contain some of the greatest music the 60s had to offer.',326),(7,1,'2025-05-25 00:41:51','2025-05-25 00:41:51',42,NULL,211),(8,6,'2025-05-25 14:12:21','2025-05-26 02:17:49',49,'So I have to ask myself, who do I respect more, the 80-year-old Paul McCartney who has the guts to go out there and perform for the fans who love him even though he sounds like Nursing Home Paul McCartney, or somebody like Grace Slick, who famously said “All rock-and-rollers over the age of 50 look stupid and should retire.”  And she actually did it, she walked away from performing when she turned 50 and never came back.  Said Grace\r\n\r\n“I don’t like seeing people my age leaping around, singing about their feelings when they were 23…If you’re comfortable with it, go ahead. I’m easily embarrassed for people. ‘Oh my God, honey, get off the stage. Become a producer or something.’”.     \r\n\r\nThere is something to be said for recognizing when you are too old to play a young person’s game, and walking away instead of trying to make it an old person’s game.',326),(9,4,'2025-05-25 14:17:22','2025-05-25 14:17:22',NULL,'You know who I never would have had to ask that question about?  Jim Morrison.  There’s no way in hell an 80-year-old Jim Morrison would have been at Glastonbury singing Doors songs.  \r\n\r\nAlthough that’s partly because there is no way in hell there could ever have been an 80-year-old Jim Morrison.  Someone that self-destructive didn’t have a snowball’s chance in Hell of making it to 80.  \r\n\r\nAs I write this, it is exactly fifty-one years to the day after he was found in a Paris bathtub after possibly dying from heart failure or a drug overdose or God just for whatever reason deciding it was time to hit the kill switch.  God might’ve got as tired of Jim Morrison as everyone else around him was at that point, and maybe decided he was the only one who could do something about it.  Who knows?\r\n\r\n',326),(10,5,'2025-05-25 14:19:54','2025-05-25 14:19:54',NULL,'I’ve got this weird compulsion to read biographies about The Doors – I really can’t understand it, but if I see one, I have to read it.  \r\n\r\nCurrently I am reading the Grandaddy of all Doors biographies, I finally found a copy of Danny Sugerman’s No One Here Gets Out Alive, and it’s riveting.  Jim Morrison was absolutely fascinating, fifty-one years after his death he still has a charismatic pull, even though 90% of the time he was drunk off his butt.  \r\n\r\nThe man was a mass of contradictions – charming and repellant, generous and self-absorbed, friendly and vicious, charismatic and boorish, sophisticated and sophomoric.  And above all, ambitious yet self-destructive to the point it eventually ended him.  ',326),(11,3,'2025-05-25 14:21:57','2025-05-25 14:21:57',NULL,'No wonder the music of the band he led is such a mix of highs and lows.  When it is brilliant, it’s Beatles and Dylan level 60s genius. \r\n\r\n But some of it as bad as the worst of what plagued the airwaves of AM radio at the time.  None of their albums demonstrate this quite so effectively as Waiting for the Sun.  \r\n\r\nPersonally, I have always placed it and the boring L.A. Woman on the bottom rung of Doors albums, although I have to say that existentially marvelous line “No eternal reward will forgive us now for wasting the dawn” all by itself almost makes me rate L.A. Woman a rung higher.  \r\n\r\nSimply the best.',326),(12,1,'2025-05-25 22:20:42','2025-05-25 22:20:42',48,NULL,257),(13,1,'2025-05-25 22:28:16','2025-05-25 23:50:37',42,NULL,265),(14,6,'2025-06-16 22:58:47','2025-06-16 22:58:47',NULL,'The band separated the two releases because they wanted to avoid releasing a double album, that most tired and bloated of rock-excess beasts. At the time, avoidance of all rock-star gestures had become something of a survival mechanism for the band. They had been touring, more or less continuously, for the past seven years. Six months into the long, punishing tour for OK Computer, Thom Yorke had briefly slipped into catatonia. They were getting more successful, and it felt awful: Watch the 1998 documentary Meeting People Is Easy and you’ll see what rock stardom felt like to Yorke’s nervous system—dull, pointless torture, like being detained for eternity by airport security.',134),(15,6,'2025-06-16 23:01:01','2025-06-16 23:01:01',NULL,'It was on Kid A and Amnesiac that they became in love with almost recognizable sounds. What was born out of a desire to erase—and Yorke used this word more than once, suggesting a vigorous desire, naming his solo album after this impulse—became an opportunity to transfigure. The standard rock instruments became the ghosts—nothing in Kid A sounds so otherworldly as the guitars, or Yorke’s voice. On “Morning Bell,” Greenwood scraped the strings with a coin to produce keyboard-like sounds.\r\n\r\nAnother “lost” Radiohead song from these sessions, “Fog,” is a little more intriguing. It was one of those nakedly vulnerable ballads that slipped out of Yorke from time to time, seemingly against his will. The grief-haunted lyrics mingled tenderness and dread—a child, possibly dead, runs forever up and down a hallway, while a luminous fog belches up from the sewers.',135),(16,6,'2025-06-16 23:01:21','2025-06-16 23:01:52',60,'Yorke’s impulse to deform himself on record, however, led to moments of wild creativity. On Amnesiac’s “Pulk/Pull Revolving Doors,” seven years before Lil Wayne’s “Lollipop,” he intentionally mangled his voice with Auto-Tune. As an entire generation of hip-hop performers would go on to do, Yorke mumbled into the machine, allowing the pitch-corrector to randomly assign a key and a melody to his words.\r\n\r\nPerhaps no single song encapsulates this mix of aimlessness and invention, the will toward prettiness and the losing war against it, as neatly as “Like Spinning Plates.” In the studio, they were grimacing their way through another demo—the chord progressions were somehow insulting, too obvious. Thom Yorke, always quick with a withering aside for their own material, dubbed it “dodgy Kraftwerk.”\r\n\r\n',136),(17,6,'2025-06-16 23:01:58','2025-06-16 23:01:58',88,NULL,163),(18,6,'2025-06-16 23:02:03','2025-06-16 23:02:03',78,NULL,176),(19,1,'2025-06-17 11:38:55','2025-06-17 11:38:55',38,NULL,176),(20,1,'2025-06-17 11:39:07','2025-06-17 11:39:07',43,NULL,163),(21,1,'2025-06-17 11:39:35','2025-06-17 13:45:12',75,'That isn’t to say that this is necessarily a “break-up album.” Separations (particularly those involving children) take place in the harsh light of day, with lawyers’ appointments and checklists and logistical arrangements. Radiohead albums are the stuff of dreams and nightmares, and the band retains a healthy resistance to clarity; their music is a maze of signs you can peer into any way you like. Even so, the impact of trauma, a sort of car crash of the soul, is palpable. The music here feels loose and unknotted, broken open in the way you can only be after a tragedy. “There’s a spacecraft blocking out the sky,” Yorke observes on “Decks Dark,” as choral voices pass overhead. The scene is straight from 1997’s “Subterranean Homesick Alien,” but here Yorke doesn’t sound “uptight.” He sounds utterly drained, as if impending invasion doesn’t concern him at all.',136),(22,1,'2025-06-17 11:39:44','2025-06-17 11:39:44',78,NULL,215),(23,1,'2025-06-17 11:40:04','2025-06-17 11:40:04',85,NULL,219),(24,1,'2025-06-17 13:33:42','2025-06-17 13:33:42',NULL,'A song title like “Glass Eyes” hints at many of the band’s longstanding morbid preoccupations—the semblance of humanity in something cold and dead, or the violation of the biological body by foreign objects—but the song is a bloodflow of strings straight into the heart. “Hey it’s me, I just got off the train,” Yorke sings, and it’s a strikingly ordinary image: the Paranoid Android himself, picking up the phone and calling someone to tell them he’s just arrived. “I feel this love turn cold,” he confesses as the ballad draws to a close, the phrasing an echo, subconscious or not, of his Kid A sign-off “I’ll see you in the next life.” A throbbing cello appears like a lump in the throat; the song fades away.',185),(25,1,'2025-06-17 13:34:03','2025-06-17 13:34:03',NULL,'And then there’s “True Love Waits.” It’s an old song, one that has been around in various forms for over two decades, but unlike “Burn the Witch” or the other teased sketches and scraps that Radiohead diehards pick apart on forums, it’s long been a part of their canon. It appeared on the 2001 live album I Might Be Wrong and, dragged into 2016, feels like a relic from a different geological era. “I’ll drown my beliefs,” Yorke sings, “just don’t leave.” It is the message they leave us with, this very open-hearted song that has always felt like an open wound in their discography, a geyser of feeling erupting out of scorched earth. Its very inclusion is a striking moment of transparency.',263),(26,1,'2025-06-17 13:34:21','2025-06-17 13:34:21',NULL,'The version here is just Yorke and a piano, so reverberant and echo-drenched that it feels like we’ve stuck our heads inside it. Yorke croons tenderly, never opening up into his chest voice. It’s sung to one person this time, not crowds. In its mundane visions of “lollipops and crisps,” the lyrics purposefully skirt doggerel, an acknowledgment that cliches can be, in fact, where all the action is. “I’m not living/I’m just killing time,” the 47-year-old admits. You can write a line like that and set it to music; you can perform it for years in front of adoring millions; you can carry the idea around in your heart and mind. But it might take a lifetime for it to strike, as it does here, with a newfound power. The truth, as always, lies in plain sight, right there in the kicking and the squealing, the panic and the vomit. Some truths just take longer to see than others.',243),(27,1,'2025-06-17 13:58:33','2025-06-17 13:58:41',84,NULL,228),(28,1,'2025-06-22 22:53:33','2025-06-22 22:53:33',56,NULL,553);
