27 15:39:35','Hello - Remastered 2023','2023-11-17 00:00:00',220,'https://i.scdn.co/image/ab67616d0000b2736af0b476d4783151541af05d',NULL,'N;','hello-remastered-2023','6eYdpq9HYm5W3TZKovmTgS',9),(18,'2025-05-27 15:39:35','2025-05-27 15:39:35','My Last Breath - Remastered 2023','2023-11-17 00:00:00',247,'https://i.scdn.co/image/ab67616d0000b2736af0b476d4783151541af05d',NULL,'N;','my-last-breath-remastered-2023','7Knc72pvFtqImIze02T0cn',10),(19,'2025-05-27 15:39:35','2025-05-27 15:39:35','Whisper - Remastered 2023','2023-11-17 00:00:00',327,'https://i.scdn.co/image/ab67616d0000b2736af0b476d4783151541af05d',NULL,'N;','whisper-remastered-2023','48kUVYtxMPCgAuKQEdjjv3',11),(20,'2025-05-27 15:39:35','2025-05-27 15:39:35','My Immortal - Band Version / Remastered 2023','2023-11-17 00:00:00',273,'https://i.scdn.co/image/ab67616d0000b2736af0b476d4783151541af05d',NULL,'N;','my-immortal-band-version-remastered-2023','6Jpcj0v0uc0IDq8ec35UGO',12),(21,'2025-05-27 15:39:35','2025-05-27 15:39:35','Breathe No More - Remastered 2023','2023-11-17 00:00:00',228,'https://i.scdn.co/image/ab67616d0000b2736af0b476d4783151541af05d',NULL,'N;','breathe-no-more-remastered-2023','5CwrCLwD5GRw0PsE3Si00Z',13),(22,'2025-05-27 15:39:35','2025-05-27 15:39:35','Farther Away - Remastered 2023','2023-11-17 00:00:00',239,'https://i.scdn.co/image/ab67616d0000b2736af0b476d4783151541af05d',NULL,'N;','farther-away-remastered-2023','5Bj502s50MDjeizj80IoTJ',14),(23,'2025-05-27 15:39:35','2025-05-27 15:39:35','Missing - Remastered 2023','2023-11-17 00:00:00',258,'https://i.scdn.co/image/ab67616d0000b2736af0b476d4783151541af05d',NULL,'N;','missing-remastered-2023','2V5R6eOtqJUXpfgkLKcMeG',15),(24,'2025-05-27 15:39:35','2025-05-27 15:39:35','My Immortal - Strings Version / Remastered 2023','2023-11-17 00:00:00',274,'https://i.scdn.co/image/ab67616d0000b2736af0b476d4783151541af05d',NULL,'N;','my-immortal-strings-version-remastered-2023','4AuTOA3kjmi5aoZ1EGp3Pf',16),(25,'2025-05-27 15:39:35','2025-05-27 15:39:35','Bring Me To Life - Demo / Remastered 2023','2023-11-17 00:00:00',232,'https://i.scdn.co/image/ab67616d0000b2736af0b476d4783151541af05d',NULL,'N;','bring-me-to-life-demo-remastered-2023','3bkobLllL6xTQGXEObVtzB',17),(26,'2025-05-27 15:39:35','2025-05-27 15:39:35','Bring Me To Life - AOL Session / 2003 / Remastered','2023-11-17 00:00:00',217,'https://i.scdn.co/image/ab67616d0000b2736af0b476d4783151541af05d',NULL,'N;','bring-me-to-life-aol-session-2003-remastered','1ncS7joQbULgpQwLSjDXz0',18),(27,'2025-05-27 15:39:35','2025-05-27 15:39:35','Going Under - Live Acoustic / 2003 / Remastered','2023-11-17 00:00:00',195,'https://i.scdn.co/image/ab67616d0000b2736af0b476d4783151541af05d',NULL,'N;','going-under-live-acoustic-2003-remastered','2FrSEN6oWjmtv3u1B32IOH',19),(28,'2025-05-27 15:39:35','2025-05-27 15:39:35','Bring Me To Life - Live On Triple M’s Garage Session / 2020 / Remastered 2023','2023-11-17 00:00:00',221,'https://i.scdn.co/image/ab67616d0000b2736af0b476d4783151541af05d',NULL,'N;','bring-me-to-life-live-on-triple-m-s-garage-session-2020-remastered-2023','558sFNXvHZWWOzbsDaeak2',20),(29,'2025-05-27 15:39:35','2025-05-27 15:39:35','My Immortal - Live At O2 Arena / 2022 / Remastered 2023','2023-11-17 00:00:00',290,'https://i.scdn.co/image/ab67616d0000b2736af0b476d4783151541af05d',NULL,'N;','my-immortal-live-at-o2-arena-2022-remastered-2023','6elo71dBBKbGFIRG7afV5j',21),(30,'2025-05-27 15:39:35','2025-05-27 15:39:35','Artifact/The Turn','2021-03-26 00:00:00',146,'https://i.scdn.co/image/ab67616d0000b27304d5f576e7e48f01b98eabae',NULL,'N;','artifact-the-turn','4W01mWRcPENGoy8SIxaSbg',1),(31,'2025-05-27 15:39:36','2025-05-27 15:39:36','Broken Pieces Shine','2021-03-26 00:00:00',230,'https://i.scdn.co/image/ab67616d0000b27304d5f576e7e48f01b98eabae',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1Pb82bodhVVLOardymYRmS\";}','broken-pieces-shine','1Pb82bodhVVLOardymYRmS',2),(32,'2025-05-27 15:39:36','2025-05-27 15:39:36','The Game Is Over','2021-03-26 00:00:00',262,'https://i.scdn.co/image/ab67616d0000b27304d5f576e7e48f01b98eabae','\"The Game is Over\" is a song on Evanescence\'s fifth album, The Bitter Truth. It was registered on ASCAP in early June 2020. It\'s the second single off the album, released on July 1, 2020. It\'s the third track on the album.\n\nThe song was written by all band members except Jen Majura. Amy Lee described the track as \"a protest against the facades we are pressured to put on by society. In the face of depression and anxiety - and especially in a world that seems to crumble further each day - it’s a cry to end the charade that everything’s fine. <a href=\"http://www.last.fm/music/Evanescence/_/The+Game+is+Over\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0saMyp91ojsNNBxH93DORH\";}','the-game-is-over','0saMyp91ojsNNBxH93DORH',3),(33,'2025-05-27 15:39:47','2025-05-27 15:39:47','Yeah Right','2021-03-26 00:00:00',209,'https://i.scdn.co/image/ab67616d0000b27304d5f576e7e48f01b98eabae',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/793uy0hxQXuVRITDAZZbE0\";}','yeah-right','793uy0hxQXuVRITDAZZbE0',4),(34,'2025-05-27 15:39:47','2025-05-27 15:39:47','Feeding the Dark','2021-03-26 00:00:00',254,'https://i.scdn.co/image/ab67616d0000b27304d5f576e7e48f01b98eabae',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1hOWOMx8klimFTevSb4TcW\";}','feeding-the-dark','1hOWOMx8klimFTevSb4TcW',5),(35,'2025-05-27 15:39:47','2025-05-27 15:39:47','Wasted On You','2021-03-26 00:00:00',264,'https://i.scdn.co/image/ab67616d0000b27304d5f576e7e48f01b98eabae',NULL,'N;','wasted-on-you','7sI2WC33xfq3Cw9C6e22pg',6),(36,'2025-05-27 15:39:48','2025-05-27 15:39:48','Better Without You','2021-03-26 00:00:00',245,'https://i.scdn.co/image/ab67616d0000b27304d5f576e7e48f01b98eabae',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0bFqnXTPcjoHsZKlSIK8Pa\";}','better-without-you','0bFqnXTPcjoHsZKlSIK8Pa',7),(37,'2025-05-27 15:39:59','2025-05-