head. <a href=\"http://www.last.fm/music/Evanescence/_/Never+Go+Back\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2QMF6DLnV7pg6EGhgSJ6ND\";}','never-go-back','2QMF6DLnV7pg6EGhgSJ6ND',2),(60,'2025-05-27 15:40:35','2025-05-27 15:40:35','Hi-Lo','2017-11-10 00:00:00',306,'https://i.scdn.co/image/ab67616d0000b273df572320cd13f0ad58f8f42b',NULL,'N;','hi-lo','12DYnS4EGAWbKL1gYHOUph',3),(61,'2025-05-27 15:40:45','2025-05-27 15:40:45','My Heart Is Broken','2017-11-10 00:00:00',273,'https://i.scdn.co/image/ab67616d0000b273df572320cd13f0ad58f8f42b','The second single from Evanescence, “My Heart is Broken” is inspired by victims of sex trafficking, with singer Amy Lee saying:\n\nAs I was writing the song I was putting myself in that place – what would it be like to be trapped? Threatened? Alone? Unable to tell anyone what was happening because you’re afraid of what would happen?\n\nA music video was released, an incredibly dramatic narrative, with Lee in an exquisite dress wandering through a corn field, and ending up in a dimly lit basement playing the piano. <a href=\"http://www.last.fm/music/Evanescence/_/My+Heart+Is+Broken\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2S9gUe3G1buwpGQhpZZFZB\";}','my-heart-is-broken','2S9gUe3G1buwpGQhpZZFZB',4),(62,'2025-05-27 15:40:46','2025-05-27 15:40:46','Lacrymosa','2017-11-10 00:00:00',222,'https://i.scdn.co/image/ab67616d0000b273df572320cd13f0ad58f8f42b','“Lacrymosa\" was written by Amy Lee and Terry Balsamo, produced by Dave Fortman, and recorded in a chapel near Seattle, Washington. In a number of interviews, Lee revealed that everyone asked about a collaboration between her and Mozart. She further stated that she always wanted to make Lacrimosa from Mozart\'s Requiem a metal song, later adding that The Open Door was \"the time for that, for trying things I hadn\'t been brave enough to try before.\" In an interview with VH1 News <a href=\"http://www.last.fm/music/Evanescence/_/Lacrymosa\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3RNQzQiY9dBvN0cPan67x6\";}','lacrymosa','3RNQzQiY9dBvN0cPan67x6',5),(63,'2025-05-27 15:40:46','2025-05-27 15:40:46','The End of the Dream','2017-11-10 00:00:00',294,'https://i.scdn.co/image/ab67616d0000b273df572320cd13f0ad58f8f42b',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1WmfSmkpN991n7vfRpRK6f\";}','the-end-of-the-dream','1WmfSmkpN991n7vfRpRK6f',6),(64,'2025-05-27 15:40:47','2025-05-27 15:40:47','Bring Me to Life - Synthesis','2017-11-10 00:00:00',257,'https://i.scdn.co/image/ab67616d0000b273df572320cd13f0ad58f8f42b',NULL,'N;','bring-me-to-life-synthesis','63cDKKoslDEiixaYsdFejf',7),(65,'2025-05-27 15:40:47','2025-05-27 15:40:47','Unraveling (Interlude)','2017-11-10 00:00:00',100,'https://i.scdn.co/image/ab67616d0000b273df572320cd13f0ad58f8f42b',NULL,'N;','unraveling-interlude','0BKZ9qfKhVuEAqFOafTYa4',8),(66,'2025-05-27 15:40:57','2025-05-27 15:40:57','Imaginary','2017-11-10 00:00:00',243,'https://i.scdn.co/image/ab67616d0000b273df572320cd13f0ad58f8f42b','Written by: A. Lee and B. Moody\n\nThis song lasts about the entire span of Evanescence’s recording history. Originally released on the original Evanescence EP in 1998, Imaginary has evolved through 7 different versions. Amy Lee wrote the song and it apparently refers to her old room. The song is interpreted as finding a place which is imaginary, to escape personal troubles which is in the form of an abusive relationship. \n\nThere was speculation that Imaginary would be the fourth single from Fallen. However, Everybody\'s Fool was released. <a href=\"http://www.last.fm/music/Evanescence/_/Imaginary\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3pGxGz74s73nhGFvrYn44T\";}','imaginary','3pGxGz74s73nhGFvrYn44T',9),(67,'2025-05-27 15:40:58','2025-05-27 15:40:58','Secret Door','2017-11-10 00:00:00',228,'https://i.scdn.co/image/ab67616d0000b273df572320cd13f0ad58f8f42b',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2RjqeTNizi8kaiKBL8FeLf\";}','secret-door','2RjqeTNizi8kaiKBL8FeLf',10),(68,'2025-05-27 15:40:58','2025-05-27 15:40:58','Lithium','2017-11-10 00:00:00',244,'https://i.scdn.co/image/ab67616d0000b273df572320cd13f0ad58f8f42b','Written by: A. Lee\n\nAmy Lee has been quoted saying the song is about losing the comfort of sorrow. Lithium is a mood stabilizer that would take away the sorrow that the writer holds inside and she is not ready to let go of it. She has lived with sorrow so long that losing it now would be like losing a part of herself. That is what the whole refrain is about: \"Lithium, Don\'t want to lock myself up inside, Lithium, Don\'t want to forget what it feels without, Lithium, I want to stay in love with my sorrow. <a href=\"http://www.last.fm/music/Evanescence/_/Lithium\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5wMv9lfzG7hffOc37nAmti\";}','lithium','5wMv9lfzG7hffOc37nAmti',11),(69,'2025-05-27 15:41:09','2025-05-27 15:41:09','Lost in Paradise','2017-11-10 00:00:00',283,'https://i.scdn.co/image/ab67616d0000b273df572320cd13f0ad58f8f42b','In a track-by-track interview with NME.com, Amy also said: \n\nI\'d say this is the most intimate song on the album. Really, it was from that kind of hard time in 2010 where I felt lost and sort of like I lost my vision for a second.\n\nAnd it\'s cool because the song is sort of almost an apology to the fans, for being gone. It\'s like \'Here\'s how it went, I needed to run away\'. But I miss this, and it\'s hard and it\'s painful sometimes and it\'s this big giant mess of things. <a href=\"http://www.last.fm/music/Evanescence/_/Lost+in+Paradise\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7zeKRUBOWbW2exciIgCiCc\";}','lost-in-paradise','7zeKRUBOWbW2exciIgCiCc',12),(70,'2025-05-27 15:41:10','2025-05-27 15:41:10','Your Star','2017-11-10 00:00:00',277,'https://i.scdn.co/image/ab67616d0000b273df572320cd13f0ad58f8f42b','“Your Star” was used to close the show in their last tour, The Open Door.  It featured Amy Lee playing at the piano who would throw the \"horns\" while performing in her very animated style.  Though it was never a single, it remains a standout with the fans of the band.\n\nThe song was inspired by Lee\'s loneliness during the band\'s tour in support of Fallen. She was inspired to write the chorus in Lisbon when she looked at the sky and she couldn\'t see the stars at night. <a href=\"http://www.last.fm/music/Evanescence/_/Your+Star\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/33Ma2Nph5oxtQB3sILngBq\";}','your-star','33Ma2Nph5oxtQB3sILngBq',13),(71,'2025-05-27 15:41:10','2025-05-27 15:41:10','My Immortal','2017-11-10 00:00:00',264,'https://i.scdn.co/image/ab67616d0000b273df572320cd13f0ad58f8f42b','Written by: A. Lee and B. Moody\n\n\"My Immortal\" is one of the most popular songs ever recorded by Evanescence. This song lasts the entire span of Evanescence’s recording history. It is credited as the 4th song ever written for Evanescence. Ben Moody wrote the original in full when he was 15 years old. It is the second song that he wrote for the band (Understanding is credited as his first). In the later versions of the song, Amy Lee is credited to have written the bridge and the coinciding piano part to the song. <a href=\"http://www.last.fm/music/Evanescence/_/My+Immortal\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/46SOM5rxqJ6YWAQUAX93xa\";}','my-immortal','46SOM5rxqJ6YWAQUAX93xa',14),(72,'2025-05-27 15:41:10','2025-05-27 15:41:10','The In-Between (Piano Solo)','2017-11-10 00:00:00',132,'https://i.scdn.co/image/ab67616d0000b273df572320cd13f0ad58f8f42b',NULL,'N;','the-in-between-piano-solo','1zookkb1xH1PyxA6U05lod',15),(73,'2025-05-27 15:41:11','2025-05-27 15:41:11','Imperfection','2017-11-10 00:00:00',262,'https://i.scdn.co/image/ab67616d0000b273df572320cd13f0ad58f8f42b',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7etddoQzbpDrViOXRN9hfV\";}','imperfection','7etddoQzbpDrViOXRN9hfV',16),(77,'2025-05-27 15:45:06','2025-05-27 15:45:06','Lost Whispers - Intro','2016-01-01 00:00:00',58,'https://i.scdn.co/image/ab67616d0000b27317c58b17b0d1526c8d25a0aa',NULL,'N;','lost-whispers-intro','651g6g8RLhF5dN7lyb9f5N',1),(78,'2025-05-27 15:45:06','2025-05-27 15:45:06','Even In Death - 2016 Version','2016-01-01 00:00:00',261,'https://i.scdn.co/image/ab67616d0000b27317c58b17b0d1526c8d25a0aa',NULL,'N;','even-in-death-2016-version','4VO8CRItRuli3cnQLBDpvv',2),(79,'2025-05-27 15:45:07','2025-05-27 15:45:07','Missing','2016-01-01 00:00:00',255,'https://i.scdn.co/image/ab67616d0000b27317c58b17b0d1526c8d25a0aa','Written by A. Lee, B. Moody and D. Hodges\n\nRecorded during the 2001-2002 demos and revamped as a B-side on the Australian Bring Me To Life Commercial Single and later released as a bonus track on the CD portion of Anywhere But Home (the track can also be heard during the ending credits of the live performance). Has been internationally released as a radio single in Europe and South America in 2004. \n\nThroughout the verses there is a looped background <a href=\"http://www.last.fm/music/Evanescence/_/Missing\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4EMVX83u8TXyl6Pwl0nPmy\";}','missing','4EMVX83u8TXyl6Pwl0nPmy',3),(80,'2025-05-27 15:45:07','2025-05-27 15:45:07','Farther Away','2016-01-01 00:00:00',239,'https://i.scdn.co/image/ab67616d0000b27317c58b17b0d1526c8d25a0aa','Written by: A. Lee, B. Moody and D. Hodges\n\nSometimes incorrectly known as Further Away. Recorded as a demo in 2001-2002 and later made into a B-side on the Bring Me to Life single. In 2004 the track was included on the Japanese release of Fallen. It was performed live regularly during the many legs of the Fallen tour, which spanned from December 2002 and ended in 2004. \n\nWhen performed live, back in 2003, Ben Moody would hand his guitar over to a stage hand close to the end of the song and go into a tribal drum solo. <a href=\"http://www.last.fm/music/Evanescence/_/Farther+Away\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/63Yk0ZcjJSv37O8Vy7PFZi\";}','farther-away','63Yk0ZcjJSv37O8Vy7PFZi',4),(81,'2025-05-27 15:45:18','2025-05-27 15:45:18','Breathe No More - B-Side Version','2016-01-01 00:00:00',228,'https://i.scdn.co/image/ab67616d0000b27317c58b17b0d1526c8d25a0aa',NULL,'N;','breathe-no-more-b-side-version','2lH8hMXxuIcjpbIok9KbUj',5),(82,'2025-05-27 15:45:18','2025-05-27 15:45:18','If You Don’t Mind','2016-01-01 00:00:00',177,'https://i.scdn.co/image/ab67616d0000b27317c58b17b0d1526c8d25a0aa',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5XFvhTjWWDttRY2pi4SIwx\";}','if-you-don-t-mind','5XFvhTjWWDttRY2pi4SIwx',6),(83,'2025-05-27 15:45:19','2025-05-27 15:45:19','Together Again','2016-01-01 00:00:00',198,'https://i.scdn.co/image/ab67616d0000b27317c58b17b0d1526c8d25a0aa',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4J0TPFdHcy2z4u3myLlGXe\";}','together-again','4J0TPFdHcy2z4u3myLlGXe',7),(84,'2025-05-27 15:45:19','2025-05-27 15:45:19','The Last Song I\'m Wasting on You','2016-01-01 00:00:00',247,'https://i.scdn.co/image/ab67616d0000b27317c58b17b0d1526c8d25a0aa',NULL,'N;','the-last-song-i-m-wasting-on-you','0BeBYa53MXh2aQmzc64BHd',8),(85,'2025-05-27 15:45:19','2025-05-27 15:45:19','A New Way To Bleed','2016-01-01 00:00:00',225,'https://i.scdn.co/image/ab67616d0000b27317c58b17b0d1526c8d25a0aa',NULL,'N;','a-new-way-to-bleed','5xlXTUTO2ysHVF8cZx50bp',9),(86,'2025-05-27 15:45:29','2025-05-27 15:45:29','Say You Will','2016-01-01 00:00:00',222,'https://i.scdn.co/image/ab67616d0000b27317c58b17b0d1526c8d25a0aa','Say You Will is the fourteenth track from the deluxe edition of Evanescence\'s third studio album, Evanescence. \nThe song was included on the b-side album, Lost Whispers, for The Ultimate Collection LP set that was released on December 9, 2016.\nIt was performed live for the first time on June 7, 2017 at Caribana Festival in Switzerland. Jen Majura and Tim McCord swapped instruments for the song, with Jen playing bass and Tim playing guitar. <a href=\"http://www.last.fm/music/Evanescence/_/Say+You+Will\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4qdjOKgTaqtkvFYnxGqPVn\";}','say-you-will','4qdjOKgTaqtkvFYnxGqPVn',10),(87,'2025-05-27 15:45:30','2025-05-27 15:45:30','Disappear','2016-01-01 00:00:00',186,'https://i.scdn.co/image/ab67616d0000b27317c58b17b0d1526c8d25a0aa',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/66zcDbGryhKQuXAglsJX94\";}','disappear','66zcDbGryhKQuXAglsJX94',11),(89,'2025-05-27 15:54:17','2025-05-27 15:54:17','Secret Door','2016-01-01 00:00:00',234,'https://i.scdn.co/image/ab67616d0000b27317c58b17b0d1526c8d25a0aa',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7xMXe4LiIuHAHM4O8HZFKs\";}','secret-door','7xMXe4LiIuHAHM4O8HZFKs',12),(90,'2025-05-27 15:54:17','2025-05-27 15:54:17','What You Want','2011-01-01 00:00:00',221,'https://i.scdn.co/image/ab67616d0000b273d116026b6b4711886f9c80e6',NULL,'N;','what-you-want','2AGqa4oBgQh6zNXJZK0pIn',1),(91,'2025-05-27 15:54:17','2025-05-27 15:54:17','Made Of Stone','2011-01-01 00:00:00',213,'https://i.scdn.co/image/ab67616d0000b273d116026b6b4711886f9c80e6',NULL,'N;','made-of-stone','0Y4sMYBU1cX3I87wCCiNph',2),(92,'2025-05-27 15:54:17','2025-05-27 15:54:17','The Change','2011-01-01 00:00:00',222,'https://i.scdn.co/image/ab67616d0000b273d116026b6b4711886f9c80e6',NULL,'N;','the-change','0zRPZZVxmk5xht8TWjCxPk',3),(93,'2025-05-27 15:54:17','2025-05-27 15:54:17','My Heart Is Broken','2011-01-01 00:00:00',269,'https://i.scdn.co/image/ab67616d0000b273d116026b6b4711886f9c80e6',NULL,'N;','my-heart-is-broken','6M1tLxJkFULMF7A16ASKXI',4),(94,'2025-05-27 15:54:17','2025-05-27 15:54:17','The Other Side','2011-01-01 00:00:00',245,'https://i.scdn.co/image/ab67616d0000b273d116026b6b4711886f9c80e6',NULL,'N;','the-other-side','2brk2ghshXUneoNlRGqzLb',5),(95,'2025-05-27 15:54:17','2025-05-27 15:54:17','Erase This','2011-01-01 00:00:00',235,'https://i.scdn.co/image/ab67616d0000b273d116026b6b4711886f9c80e6',NULL,'N;','erase-this','4PEutqBWoJx2C9aO4tuwNF',6),(96,'2025-05-27 15:54:17','2025-05-27 15:54:17','Lost In Paradise','2011-01-01 00:00:00',282,'https://i.scdn.co/image/ab67616d0000b273d116026b6b4711886f9c80e6',NULL,'N;','lost-in-paradise','7M47csS1XBvTQ4LipbMdll',7),(97,'2025-05-27 15:54:17','2025-05-27 15:54:17','Sick','2011-01-01 00:00:00',210,'https://i.scdn.co/image/ab67616d0000b273d116026b6b4711886f9c80e6',NULL,'N;','sick','71SgzOcizOn76Vt7wMcQ71',8),(98,'2025-05-27 15:54:17','2025-05-27 15:54:17','The End Of The Dream','2011-01-01 00:00:00',229,'https://i.scdn.co/image/ab67616d0000b273d116026b6b4711886f9c80e6',NULL,'N;','the-end-of-the-dream','5Yg0f9XeDCGigWYd5Zizlq',9),(99,'2025-05-27 15:54:17','2025-05-27 15:54:17','Oceans','2011-01-01 00:00:00',218,'https://i.scdn.co/image/ab67616d0000b273d116026b6b4711886f9c80e6',NULL,'N;','oceans','3vAcPaj7gkYBL2xEA2jymi',10),(100,'2025-05-27 15:54:17','2025-05-27 15:54:17','Never Go Back','2011-01-01 00:00:00',267,'https://i.scdn.co/image/ab67616d0000b273d116026b6b4711886f9c80e6',NULL,'N;','never-go-back','6QhVpLrz1GB1xJRa7Z80TO',11),(101,'2025-05-27 15:54:17','2025-05-27 15:54:17','Swimming Home','2011-01-01 00:00:00',221,'https://i.scdn.co/image/ab67616d0000b273d116026b6b4711886f9c80e6',NULL,'N;','swimming-home','6AEtinnOEoC6T2i5m6fbHe',12),(102,'2025-05-27 15:54:17','2025-05-27 15:54:17','A New Way To Bleed','2011-01-01 00:00:00',226,'https://i.scdn.co/image/ab67616d0000b273d116026b6b4711886f9c80e6',NULL,'N;','a-new-way-to-bleed','3UkDyGtriDY7NzOJbF0rIH',13),(103,'2025-05-27 15:54:17','2025-05-27 15:54:17','Say You Will','2011-01-01 00:00:00',223,'https://i.scdn.co/image/ab67616d0000b273d116026b6b4711886f9c80e6',NULL,'N;','say-you-will','4cfoU2UXXsbES5qwvdLHCO',14),(104,'2025-05-27 15:54:17','2025-05-27 15:54:17','Disappear','2011-01-01 00:00:00',186,'https://i.scdn.co/image/ab67616d0000b273d116026b6b4711886f9c80e6',NULL,'N;','disappear','0TVPq3QIYUYaD2LytckdPD',15),(105,'2025-05-27 15:54:17','2025-05-27 15:54:17','Secret Door','2011-01-01 00:00:00',233,'https://i.scdn.co/image/ab67616d0000b273d116026b6b4711886f9c80e6',NULL,'N;','secret-door','1ium9V09FUQ32Co0D3B6Dz',16),(106,'2025-05-27 15:54:18','2025-05-27 15:54:18','What You Want','2011-01-01 00:00:00',221,'https://i.scdn.co/image/ab67616d0000b273a694061dd2dead2b4b043a8d','The What You Want Songfacts reports that Evanescence frontwoman Amy Lee penned the song at her house in New York with bassist Tim McCord and guitarist Terry Balsamo. She told MTV News: \"We were just jamming, like, recording demos, and obviously the song has grown a lot since then, with everyone else. For me, it was — and I need to remember this, so I can apply it in the future — it wasn\'t trying so hard to be some epic, massive chorus. I was just doodling around on the piano and the guys were like, \'Do that. <a href=\"http://www.last.fm/music/Evanescence/_/What+You+Want\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0uOo8xRtQ6okTZMR89ppVk\";}','what-you-want','0uOo8xRtQ6okTZMR89ppVk',1),(107,'2025-05-27 15:54:19','2025-05-27 15:54:19','Made Of Stone','2011-01-01 00:00:00',213,'https://i.scdn.co/image/ab67616d0000b273a694061dd2dead2b4b043a8d',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/28FTCznKZRfYwJVA9OmPif\";}','made-of-stone','28FTCznKZRfYwJVA9OmPif',2),(108,'2025-05-27 15:54:25','2025-05-27 15:54:25','The Change','2011-01-01 00:00:00',222,'https://i.scdn.co/image/ab67616d0000b273a694061dd2dead2b4b043a8d',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/03cH7hozNkNX8qWi8xbkUA\";}','the-change','03cH7hozNkNX8qWi8xbkUA',3),(109,'2025-05-27 15:54:26','2025-05-27 15:54:26','My Heart Is Broken','2011-01-01 00:00:00',269,'https://i.scdn.co/image/ab67616d0000b273a694061dd2dead2b4b043a8d','The second single from Evanescence, “My Heart is Broken” is inspired by victims of sex trafficking, with singer Amy Lee saying:\n\nAs I was writing the song I was putting myself in that place – what would it be like to be trapped? Threatened? Alone? Unable to tell anyone what was happening because you’re afraid of what would happen?\n\nA music video was released, an incredibly dramatic narrative, with Lee in an exquisite dress wandering through a corn field, and ending up in a dimly lit basement playing the piano. <a href=\"http://www.last.fm/music/Evanescence/_/My+Heart+Is+Broken\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1Ej0xptDBpBxUM1dIPcHlm\";}','my-heart-is-broken','1Ej0xptDBpBxUM1dIPcHlm',4),(110,'2025-05-27 15:54:26','2025-05-27 15:54:26','The Other Side','2011-01-01 00:00:00',245,'https://i.scdn.co/image/ab67616d0000b273a694061dd2dead2b4b043a8d','Then in a track-by-track with NME.com she added:\n\nThis is one that evolved over time too. We had the start for it from one session a few month before and it wasn\'t finished. Then we worked on it with the band and it really grew into something. This is a cool song that we all really love, I think as a group it\'s one of our favorites, on the record and to play too, it\'s a really fun song to play. It\'s about loss, but not so much mourning for the dead as much as comitting yourself to being together again in another life.  <a href=\"http://www.last.fm/music/Evanescence/_/The+Other+Side\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5VLfWwZvV9zk368UJQEyyB\";}','the-other-side','5VLfWwZvV9zk368UJQEyyB',5),(111,'2025-05-27 15:54:37','2025-05-27 15:54:37','Erase This','2011-01-01 00:00:00',235,'https://i.scdn.co/image/ab67616d0000b273a694061dd2dead2b4b043a8d',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7xiZGclYWXgBpFjmr3ziMz\";}','erase-this','7xiZGclYWXgBpFjmr3ziMz',6),(112,'2025-05-27 15:54:37','2025-05-27 15:54:37','Lost In Paradise','2011-01-01 00:00:00',282,'https://i.scdn.co/image/ab67616d0000b273a694061dd2dead2b4b043a8d','In a track-by-track interview with NME.com, Amy also said: \n\nI\'d say this is the most intimate song on the album. Really, it was from that kind of hard time in 2010 where I felt lost and sort of like I lost my vision for a second.\n\nAnd it\'s cool because the song is sort of almost an apology to the fans, for being gone. It\'s like \'Here\'s how it went, I needed to run away\'. But I miss this, and it\'s hard and it\'s painful sometimes and it\'s this big giant mess of things. <a href=\"http://www.last.fm/music/Evanescence/_/Lost+in+Paradise\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7c8unZeNL9gI6Go9DgGYpb\";}','lost-in-paradise','7c8unZeNL9gI6Go9DgGYpb',7),(113,'2025-05-27 15:54:38','2025-05-27 15:54:38','Sick','2011-01-01 00:00:00',210,'https://i.scdn.co/image/ab67616d0000b273a694061dd2dead2b4b043a8d','In a track-by-track interview with NME.com, Amy said about the song:\n\nSick, okay, this is the song that was one of the first one we came up with when we had like a band jam session, about a year ago. And I don\'t know, we were really excited about it right away. Sometimes you get in a room with a group of people and try to write a song together and it just doesn\'t work. The more brains you get going, sometimes the more disjointed it becomes and the more directions start getting pulled apart. <a href=\"http://www.last.fm/music/Evanescence/_/Sick\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3ml4u4tmryJO9a68Rc7d8O\";}','sick','3ml4u4tmryJO9a68Rc7d8O',8),(114,'2025-05-27 15:54:38','2025-05-27 15:54:38','The End Of The Dream','2011-01-01 00:00:00',229,'https://i.scdn.co/image/ab67616d0000b273a694061dd2dead2b4b043a8d',NULL,'N;','the-end-of-the-dream','39UzUACTcDknfjc7umPcuM',9),(115,'2025-05-27 15:54:38','2025-05-27 15:54:38','Oceans','2011-01-01 00:00:00',218,'https://i.scdn.co/image/ab67616d0000b273a694061dd2dead2b4b043a8d','In a track-by-track interview with NME.com, Amy said:\n\nOceans is, I think a really cool song with some taste of a new direction. But at the same time it totally claims that Evanescence feeling.\n\nIt\'s got a big cool synthetic keyboard, you know, moog plus we used like 5 keyboards to make that sound. I really like that song because I feel like it\'s different sounding and I kind of been falling in love with a lot of old analog gear for the last couple of years. <a href=\"http://www.last.fm/music/Evanescence/_/Oceans\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5NvEXCtdAv5M0FFyBrGKN5\";}','oceans','5NvEXCtdAv5M0FFyBrGKN5',10),(116,'2025-05-27 15:54:49','2025-05-27 15:54:49','Never Go Back','2011-01-01 00:00:00',267,'https://i.scdn.co/image/ab67616d0000b273a694061dd2dead2b4b043a8d','Never Go Back was actually inspired by the earthquakes and tsunami in Japan. While we were writing a bunch of music at pre-production that was going on. And I just remember, you know, we were just watching the news and looking at all these pictures on the internet, and just like... I was just inspired and feeling a lot of feelings, just of empathy and sympathy, and just sort of like \'wow, what would that be like\'... you know. Putting myself in the situation in my head. <a href=\"http://www.last.fm/music/Evanescence/_/Never+Go+Back\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5JcSPtJJev0wWbFfOsEVjy\";}','never-go-back','5JcSPtJJev0wWbFfOsEVjy',11),(117,'2025-05-27 15:54:50','2025-05-27 15:54:50','Swimming Home','2011-01-01 00:00:00',221,'https://i.scdn.co/image/ab67616d0000b273a694061dd2dead2b4b043a8d','\"Swimming Home\" is the last song on the self-titled studio album Evanescence. It was one of the songs that got reworked from the 2010 Lillywhite sessions, along with \"Made of Stone\" and \"Secret Door\". Amy explained in an interview that this song is about passing over to the next life.\nThis is the only song on the standard edition of Evanescence to include harp. The song was submitted for the soundtrack of the 2008 Japanese animated fantasy movie Ponyo, but wasn\'t accepted. <a href=\"http://www.last.fm/music/Evanescence/_/Swimming+Home\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6d8ta9H6DvgOqfwxQYqJsV\";}','swimming-home','6d8ta9H6DvgOqfwxQYqJsV',12),(118,'2025-05-27 15:54:51','2025-05-27 15:54:51','Sweet Sacrifice','2006-01-01 00:00:00',185,'https://i.scdn.co/image/ab67616d0000b2737b8aabae10ab5bbe7c7f11c5','\"Sweet Sacrifice\" is a song on the second studio album, The Open Door. It was the last song recorded and finished for The Open Door.\n\nThe song was written by Amy Lee and Terry Balsamo while the production was handled by Dave Fortman. It was recorded in Record Plant Studios, Los Angeles, mixed by Dave Fortman at Ocean Way Studios, Los Angeles and mastered by Ted Jensen at Sterling Sound, New York. The programming was done by DJ Lethal and additional programming by Amy Lee. <a href=\"http://www.last.fm/music/Evanescence/_/Sweet+Sacrifice\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7hlXiMxN81uctLsvbtHZ8x\";}','sweet-sacrifice','7hlXiMxN81uctLsvbtHZ8x',1),(119,'2025-05-27 15:54:51','2025-05-27 15:54:51','Call Me When You\'re Sober','2006-01-01 00:00:00',214,'https://i.scdn.co/image/ab67616d0000b2737b8aabae10ab5bbe7c7f11c5',NULL,'N;','call-me-when-you-re-sober','663Karu2rvKLdnY0eo1n3M',2),(120,'2025-05-27 15:55:01','2025-05-27 15:55:01','Weight Of The World','2006-01-01 00:00:00',217,'https://i.scdn.co/image/ab67616d0000b2737b8aabae10ab5bbe7c7f11c5',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1UfCIFhRr8Bci9LUJ68dvp\";}','weight-of-the-world','1UfCIFhRr8Bci9LUJ68dvp',3),(121,'2025-05-27 15:55:02','2025-05-27 15:55:02','Lithium','2006-01-01 00:00:00',224,'https://i.scdn.co/image/ab67616d0000b2737b8aabae10ab5bbe7c7f11c5','Written by: A. Lee\n\nAmy Lee has been quoted saying the song is about losing the comfort of sorrow. Lithium is a mood stabilizer that would take away the sorrow that the writer holds inside and she is not ready to let go of it. She has lived with sorrow so long that losing it now would be like losing a part of herself. That is what the whole refrain is about: \"Lithium, Don\'t want to lock myself up inside, Lithium, Don\'t want to forget what it feels without, Lithium, I want to stay in love with my sorrow. <a href=\"http://www.last.fm/music/Evanescence/_/Lithium\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5YaLFRpqpUzgLLDcukNn0H\";}','lithium','5YaLFRpqpUzgLLDcukNn0H',4),(122,'2025-05-27 15:55:03','2025-05-27 15:55:03','Cloud Nine','2006-01-01 00:00:00',262,'https://i.scdn.co/image/ab67616d0000b2737b8aabae10ab5bbe7c7f11c5','\"Cloud Nine\" was inspired by a break-up with Shaun Morgan which is present in the lines that she quoted on her VH1 interview: \"If you want to live, let live/ If you want to go, let go/ What are we doing here?/ Because I can live without you.\"These lyrics may be from an early demo as they are not in the final song. It uses strings, studio effects and Lee\'s \"layered moaning.\"\n\n“It\'s about breaking up. There are a lot of relationship struggles on the record. <a href=\"http://www.last.fm/music/Evanescence/_/Cloud+Nine\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6Sh05fnlrLbMfSuI8Qur6a\";}','cloud-nine','6Sh05fnlrLbMfSuI8Qur6a',5),(123,'2025-05-27 15:55:03','2025-05-27 15:55:03','Snow White Queen','2006-01-01 00:00:00',262,'https://i.scdn.co/image/ab67616d0000b2737b8aabae10ab5bbe7c7f11c5','In issue 88 of Rock Sound, Amy Lee explained how this song is based on \"Scary Experiences.\" She explained how many nights she was forced to stay in hotels, because of a stalker. \n\nLee stated, \"My privacy had been completely invaded and there were a couple of nights where I couldn\'t stay at my house. So I wrote a song about it through the eyes of the stalker, and with my perspective, too.\"\n\nThe verses are from Amy\'s perspective and the choruses are the stalker\'s. <a href=\"http://www.last.fm/music/Evanescence/_/Snow+White+Queen\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7uCzFZHGoVPlINC4fR24gV\";}','snow-white-queen','7uCzFZHGoVPlINC4fR24gV',6),(124,'2025-05-27 15:55:14','2025-05-27 15:55:14','Lacrymosa','2006-01-01 00:00:00',217,'https://i.scdn.co/image/ab67616d0000b2737b8aabae10ab5bbe7c7f11c5','“Lacrymosa\" was written by Amy Lee and Terry Balsamo, produced by Dave Fortman, and recorded in a chapel near Seattle, Washington. In a number of interviews, Lee revealed that everyone asked about a collaboration between her and Mozart. She further stated that she always wanted to make Lacrimosa from Mozart\'s Requiem a metal song, later adding that The Open Door was \"the time for that, for trying things I hadn\'t been brave enough to try before.\" In an interview with VH1 News <a href=\"http://www.last.fm/music/Evanescence/_/Lacrymosa\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1M8YN6ekSgCnjc5UckHYpq\";}','lacrymosa','1M8YN6ekSgCnjc5UckHYpq',7),(125,'2025-05-27 15:55:14','2025-05-27 15:55:14','Like You','2006-01-01 00:00:00',256,'https://i.scdn.co/image/ab67616d0000b2737b8aabae10ab5bbe7c7f11c5','\"Like You\" was written in memory of Amy Lee\'s deceased sister, as was \"Hello\" on Fallen. \n\nLee stated: \"I can\'t help but be affected by that, and if it\'s my place to express myself and all the things that have been most deep and the most painful and have just touched me, I feel like it does honor her.”\n\nFrom a Metal Edge interview in November 2006:\n\n\"It is about something that\'s hard to even talk about but feels good to write about. It’s about my sister who passed away when I was a little girl. <a href=\"http://www.last.fm/music/Evanescence/_/Like+You\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/21ceHLJfgyO9703AlzM4DU\";}','like-you','21ceHLJfgyO9703AlzM4DU',8),(126,'2025-05-27 15:55:15','2025-05-27 15:55:15','Lose Control','2006-01-01 00:00:00',290,'https://i.scdn.co/image/ab67616d0000b2737b8aabae10ab5bbe7c7f11c5','The song was written by Amy Lee and Terry Balsamo. According to Lee, the guitars played by Balsamo on the song are a \"Portishead influence.\"\n\nThis is what Amy had to say about the song in a interview with a Italian magazine in 2006:\n\n“Lose Control” is less easy to explain. You know, when it comes to Evanescence I become really fussy and obsessive: I have to have control of everything, even the smallest details… I’m a “control freak”! I like to evaluate every single decision within the band. <a href=\"http://www.last.fm/music/Evanescence/_/Lose+Control\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3DxKCst1JPt8qw7soauFXc\";}','lose-control','3DxKCst1JPt8qw7soauFXc',9),(127,'2025-05-27 15:55:25','2025-05-27 15:55:25','The Only One','2006-01-01 00:00:00',280,'https://i.scdn.co/image/ab67616d0000b2737b8aabae10ab5bbe7c7f11c5','“The Only One\" was originally called \"Tuna Afternoon\" and it talks about Lee\'s experiences with close-mindedness and people around her which seemed lost in a world she didn\'t belong in.\n\nAmy explained in an interview how she came up with the duck intro:\n\n“Terry and me were bored one day \'cause we didn\'t have any good ideas so we started a silly song, that we called Tuna Afternoon. I found that duck on the internet and added it. I thought it didn\'t sound bad and added it to \'The Only One\'.” <a href=\"http://www.last.fm/music/Evanescence/_/The+Only+One\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2LlCbNQnkIRIc2ssMgUZsV\";}','the-only-one','2LlCbNQnkIRIc2ssMgUZsV',10),(128,'2025-05-27 15:55:26','2025-05-27 15:55:26','Your Star','2006-01-01 00:00:00',283,'https://i.scdn.co/image/ab67616d0000b2737b8aabae10ab5bbe7c7f11c5','“Your Star” was used to close the show in their last tour, The Open Door.  It featured Amy Lee playing at the piano who would throw the \"horns\" while performing in her very animated style.  Though it was never a single, it remains a standout with the fans of the band.\n\nThe song was inspired by Lee\'s loneliness during the band\'s tour in support of Fallen. She was inspired to write the chorus in Lisbon when she looked at the sky and she couldn\'t see the stars at night. <a href=\"http://www.last.fm/music/Evanescence/_/Your+Star\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3m8zVJ3n1mWv1SfovpmKHr\";}','your-star','3m8zVJ3n1mWv1SfovpmKHr',11),(129,'2025-05-27 15:55:27','2025-05-27 15:55:27','All That I Am Living For','2006-01-01 00:00:00',228,'https://i.scdn.co/image/ab67616d0000b2737b8aabae10ab5bbe7c7f11c5',NULL,'N;','all-that-i-am-living-for','4iDQezFTnOwgnrPYiqQ6TP',12),(130,'2025-05-27 15:55:27','2025-05-27 15:55:27','Good Enough','2006-01-01 00:00:00',331,'https://i.scdn.co/image/ab67616d0000b2737b8aabae10ab5bbe7c7f11c5','Written by: A. Lee \n\nThe song was inspired by Josh, Amy\'s husband. It was supposed to be on The Chronicles of Narnia: The Lion, the Witch and the Wardrobe soundtrack, just like Lacrymosa and Together Again, but wasn\'t approved.\n\nIt was announced the fourth and final single from The Open Door. The video was recorded 11-14 June 2007 in Budapest, Hungary.\n\nAt first, Amy Lee did not intend for this song to be on The Open Door. In an Italian interview with Rock TV, she said that she thought the song was not Evanescence\'s style. <a href=\"http://www.last.fm/music/Evanescence/_/Good+Enough\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0eHxqgbpr2ptXQtw8Ab3ve\";}','good-enough','0eHxqgbpr2ptXQtw8Ab3ve',13),(131,'2025-05-27 15:55:27','2025-05-27 15:55:27','Haunted - Live From Le Zénith,France/2004','2004-01-01 00:00:00',244,'https://i.scdn.co/image/ab67616d0000b273448aba708690c87f0b043b5b',NULL,'N;','haunted-live-from-le-zenith-france-2004','4CJGuGDU0Uf3Z9amdY5bji',1),(132,'2025-05-27 15:55:27','2025-05-27 15:55:27','Going Under - Live From Le Zénith,France/2004','2004-01-01 00:00:00',237,'https://i.scdn.co/image/ab67616d0000b273448aba708690c87f0b043b5b',NULL,'N;','going-under-live-from-le-zenith-france-2004','3zOJLR1Y7vhdoC9GdQZSkC',2),(133,'2025-05-27 15:55:27','2025-05-27 15:55:27','Taking Over Me - Live From Le Zénith,France/2004','2004-01-01 00:00:00',237,'https://i.scdn.co/image/ab67616d0000b273448aba708690c87f0b043b5b',NULL,'N;','taking-over-me-live-from-le-zenith-france-2004','75TjR409MNOJDUT0R80Lyw',3),(134,'2025-05-27 15:55:27','2025-05-27 15:55:27','Everybody\'s Fool - Live From Le Zénith,France/2004','2004-01-01 00:00:00',220,'https://i.scdn.co/image/ab67616d0000b273448aba708690c87f0b043b5b',NULL,'N;','everybody-s-fool-live-from-le-zenith-france-2004','49JdsVsUblQxCuw6iov2Op',4),(135,'2025-05-27 15:55:27','2025-05-27 15:55:27','Thoughtless - Live From Le Zénith,France/2004','2004-01-01 00:00:00',277,'https://i.scdn.co/image/ab67616d0000b273448aba708690c87f0b043b5b',NULL,'N;','thoughtless-live-from-le-zenith-france-2004','3FJQNtWFNNUlF2pi3razfk',5),(136,'2025-05-27 15:55:27','2025-05-27 15:55:27','My Last Breath - Live From Le Zénith,France/2004','2004-01-01 00:00:00',233,'https://i.scdn.co/image/ab67616d0000b273448aba708690c87f0b043b5b',NULL,'N;','my-last-breath-live-from-le-zenith-france-2004','0kOMliPZUwL4GEAaSdr0j2',6),(137,'2025-05-27 15:55:27','2025-05-27 15:55:27','Farther Away - Live From Le Zénith,France/2004','2004-01-01 00:00:00',302,'https://i.scdn.co/image/ab67616d0000b273448aba708690c87f0b043b5b',NULL,'N;','farther-away-live-from-le-zenith-france-2004','74zhOvR4FthxQgFeRP0bVF',7),(138,'2025-05-27 15:55:27','2025-05-27 15:55:27','Breathe No More - Live From Le Zénith,France/2004','2004-01-01 00:00:00',213,'https://i.scdn.co/image/ab67616d0000b273448aba708690c87f0b043b5b',NULL,'N;','breathe-no-more-live-from-le-zenith-france-2004','2zn4moJkEmIVfV83iye9t5',8),(139,'2025-05-27 15:55:27','2025-05-27 15:55:27','My Immortal - Live From Le Zénith,France/2004','2004-01-01 00:00:00',278,'https://i.scdn.co/image/ab67616d0000b273448aba708690c87f0b043b5b',NULL,'N;','my-immortal-live-from-le-zenith-france-2004','0umOKmb2xrgD9yutQHbCXz',9),(140,'2025-05-27 15:55:27','2025-05-27 15:55:27','Bring Me To Life - Live From Le Zénith,France/2004','2004-01-01 00:00:00',283,'https://i.scdn.co/image/ab67616d0000b273448aba708690c87f0b043b5b',NULL,'N;','bring-me-to-life-live-from-le-zenith-france-2004','1AjCrY9w0edn2jAGEAkzJ7',10),(141,'2025-05-27 15:55:27','2025-05-27 15:55:27','Tourniquet - Live From Le Zénith,France/2004','2004-01-01 00:00:00',257,'https://i.scdn.co/image/ab67616d0000b273448aba708690c87f0b043b5b',NULL,'N;','tourniquet-live-from-le-zenith-france-2004','2IR6jzSjOjp8X3Ib4SYDI8',11),(142,'2025-05-27 15:55:27','2025-05-27 15:55:27','Imaginary - Live From Le Zénith,France/2004','2004-01-01 00:00:00',325,'https://i.scdn.co/image/ab67616d0000b273448aba708690c87f0b043b5b',NULL,'N;','imaginary-live-from-le-zenith-france-2004','0GCjCEPkEuuzFn3izkuONK',12),(143,'2025-05-27 15:55:27','2025-05-27 15:55:27','Whisper - Live From Le Zénith,France/2004','2004-01-01 00:00:00',343,'https://i.scdn.co/image/ab67616d0000b273448aba708690c87f0b043b5b',NULL,'N;','whisper-live-from-le-zenith-france-2004','5xnziMgEllaD1ms67miiTj',13),(144,'2025-05-27 15:55:27','2025-05-27 15:55:27','Missing','2004-01-01 00:00:00',256,'https://i.scdn.co/image/ab67616d0000b273448aba708690c87f0b043b5b',NULL,'N;','missing','1kvuT0SqjPAUUqQJW4bxjo',14),(145,'2025-05-27 15:55:28','2025-05-27 15:55:28','Going Under','2003-03-04 00:00:00',214,'https://i.scdn.co/image/ab67616d0000b27325f49ab23f0ec6332efef432','Written by: A. Lee, B. Moody, and D. Hodges\n\nThis was the last song written for Fallen and would have been the first single, but Bring Me to Life had been put onto the Daredevil soundtrack, so it became the second single.\n\nAccording to Amy, the song is about emerging from a bad relationship: \"When you\'re at the end of your rope; when you\'re at the point where you realize something has to change; that you can\'t go on living in the situation that you\'re in. It\'s cool. It\'s a very strong song.\" <a href=\"http://www.last.fm/music/Evanescence/_/Going+Under\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3UygY7qW2cvG9Llkay6i1i\";}','going-under','3UygY7qW2cvG9Llkay6i1i',1),(146,'2025-05-27 15:55:39','2025-05-27 15:55:39','Bring Me To Life','2003-03-04 00:00:00',235,'https://i.scdn.co/image/ab67616d0000b27325f49ab23f0ec6332efef432','\"Bring Me to Life\" is a song by American rock band Evanescence. It was released on April 22, 2003, as the first single from their debut studio album, Fallen, and as the lead single for the film Daredevil. It was written by Amy Lee and Ben Moody. It features guest vocals from Paul McCoy of 12 Stones. It is the band\'s most successful single, and has peaked within the charts of more than 15 countries internationally, and won Best Hard Rock Performance at the 46th Grammy Awards. <a href=\"http://www.last.fm/music/Evanescence/_/Bring+Me+to+Life\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:45:\"https://music.youtube.com/watch?v=-eGM0IJc70Y\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0COqiPhxzoWICwFCS4eZcp\";}','bring-me-to-life','0COqiPhxzoWICwFCS4eZcp',2),(147,'2025-05-27 15:55:39','2025-05-27 15:55:39','Everybody\'s Fool','2003-03-04 00:00:00',195,'https://i.scdn.co/image/ab67616d0000b27325f49ab23f0ec6332efef432',NULL,'N;','everybody-s-fool','0tWEB6BxbI48XN79QE1JbT',3),(148,'2025-05-27 15:55:40','2025-05-27 15:55:40','My Immortal','2003-03-04 00:00:00',262,'https://i.scdn.co/image/ab67616d0000b27325f49ab23f0ec6332efef432','Written by: A. Lee and B. Moody\n\n\"My Immortal\" is one of the most popular songs ever recorded by Evanescence. This song lasts the entire span of Evanescence’s recording history. It is credited as the 4th song ever written for Evanescence. Ben Moody wrote the original in full when he was 15 years old. It is the second song that he wrote for the band (Understanding is credited as his first). In the later versions of the song, Amy Lee is credited to have written the bridge and the coinciding piano part to the song. <a href=\"http://www.last.fm/music/Evanescence/_/My+Immortal\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4UzVcXufOhGUwF56HT7b8M\";}','my-immortal','4UzVcXufOhGUwF56HT7b8M',4),(149,'2025-05-27 15:55:40','2025-05-27 15:55:40','Haunted','2003-03-04 00:00:00',185,'https://i.scdn.co/image/ab67616d0000b27325f49ab23f0ec6332efef432','Written by: A. Lee, B. Moody, and D. Hodges\n\nDeveloped during the 2001-2002 demo sessions and later released as track #5 on Fallen. Based on a story written by Ben that served as an inspiration for Amy to write the lyrics.  <a href=\"http://www.last.fm/music/Evanescence/_/Haunted\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6Z77oDcn6iI1MHFCBPjl24\";}','haunted','6Z77oDcn6iI1MHFCBPjl24',5),(150,'2025-05-27 15:55:51','2025-05-27 15:55:51','Tourniquet','2003-03-04 00:00:00',278,'https://i.scdn.co/image/ab67616d0000b27325f49ab23f0ec6332efef432','Written by: A. Lee, B. Moody, D. Hodges and R. Gray\n\nOriginally recorded as a demo and revamped as track #6 on Fallen. Rocky Gray is credited for writing the song for his band, Soul Embraced (The original, titled My Tourniquet, was a track on an album called For the Incomplete) and the rest of Evanescence reworked it for Fallen; Amy wrote a melody and a whole other second verse.\n\nDuring an interview with VH1, Amy Lee said, “A lot of our songs are written in a way that you could take them to mean several different things. <a href=\"http://www.last.fm/music/Evanescence/_/Tourniquet\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/46fyLy4W9HhAkcb67kLaAV\";}','tourniquet','46fyLy4W9HhAkcb67kLaAV',6),(151,'2025-05-27 15:55:51','2025-05-27 15:55:51','Imaginary','2003-03-04 00:00:00',256,'https://i.scdn.co/image/ab67616d0000b27325f49ab23f0ec6332efef432','Written by: A. Lee and B. Moody\n\nThis song lasts about the entire span of Evanescence’s recording history. Originally released on the original Evanescence EP in 1998, Imaginary has evolved through 7 different versions. Amy Lee wrote the song and it apparently refers to her old room. The song is interpreted as finding a place which is imaginary, to escape personal troubles which is in the form of an abusive relationship. \n\nThere was speculation that Imaginary would be the fourth single from Fallen. However, Everybody\'s Fool was released. <a href=\"http://www.last.fm/music/Evanescence/_/Imaginary\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7q6CybWAg3uYLgS5tDWqmd\";}','imaginary','7q6CybWAg3uYLgS5tDWqmd',7),(152,'2025-05-27 15:55:52','2025-05-27 15:55:52','Taking Over Me','2003-03-04 00:00:00',228,'https://i.scdn.co/image/ab67616d0000b27325f49ab23f0ec6332efef432','Written by: B. Moody, A. Lee, D. Hodges and J. LeCompt \n\nJohn LeCompt is credited with co-writing this song. Originally recorded for the 2001-2002 demos.\n\nAccording to Amy, \"Taking Over Me is about obsession. Like you\'re obsessed with someone who you believe is the one for you. I don\'t know...It\'s about obsession.\" <a href=\"http://www.last.fm/music/Evanescence/_/Taking+Over+Me\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5j7gLuOsBOyqooruGxX4nx\";}','taking-over-me','5j7gLuOsBOyqooruGxX4nx',8),(153,'2025-05-27 15:55:52','2025-05-27 15:55:52','Hello','2003-03-04 00:00:00',220,'https://i.scdn.co/image/ab67616d0000b27325f49ab23f0ec6332efef432','Written by: A. Lee, B. Moody and D. Hodges\n\n\"Hello\" was developed during the 2001-2002 demos and later released as track #9 on Fallen. The most personal song ever written and released by Amy Lee; this is the only Fallen song that has never been performed live in concert (the band considered it in 2003). A theme from the song, however, was used in the beginning of a few live shows in 2003 as the intro to the song Going Under. There is also a video of Amy singing it in her parents\' house in 2004, the only recorded live version of the song. <a href=\"http://www.last.fm/music/Evanescence/_/Hello\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0aYUqsvZG7bAslrUkd9Z0g\";}','hello','0aYUqsvZG7bAslrUkd9Z0g',9),(154,'2025-05-27 15:56:03','2025-05-27 15:56:03','My Last Breath','2003-03-04 00:00:00',247,'https://i.scdn.co/image/ab67616d0000b27325f49ab23f0ec6332efef432','Written by: A. Lee, B. Moody and D. Hodges\n\nOriginally recorded for the 2001-2002 demos sessions and later became a song on Fallen. Amy once received a fan\'s painting that was inspired by this song.\n\nIn an interview, Amy and Ben said that the 9/11 attacks in New York City inspired them to write this song. The band stopped playing this song after the Fallen Tour, but it was added to the setlist to support Evanescence in 2012 for two months. <a href=\"http://www.last.fm/music/Evanescence/_/My+Last+Breath\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2aUuMeSbt2aEv94MdG2BYS\";}','my-last-breath','2aUuMeSbt2aEv94MdG2BYS',10),(155,'2025-05-27 15:56:04','2025-05-27 15:56:04','Whisper','2003-03-04 00:00:00',327,'https://i.scdn.co/image/ab67616d0000b27325f49ab23f0ec6332efef432','Written by: A. Lee and B. Moody\n\nOriginally recorded on the Whisper EP in 1998. There are currently 6 versions of the song. A demo version of Whisper contains sound clips from the William Shakespeare\'s Romeo and Juliet soundtrack. This version begins with a sample intro from \"Death Scene\" and \"O Verona\"[1]. There are a few versions of the song floating around the internet and various bootleg discs. One version has a burst of noise before the vocals in the intro sample (at approx 0:29). <a href=\"http://www.last.fm/music/Evanescence/_/Whisper\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1TU3KOnNwSERgNbF2Yzl7N\";}','whisper','1TU3KOnNwSERgNbF2Yzl7N',11),(156,'2025-05-27 15:56:04','2025-05-27 15:56:04','My Immortal - Band Version','2003-03-04 00:00:00',273,'https://i.scdn.co/image/ab67616d0000b27325f49ab23f0ec6332efef432',NULL,'N;','my-immortal-band-version','3PYdxIDuBIuJSDGwfptFx4',12),(157,'2025-05-27 16:04:47','2025-05-27 16:04:47','Everything In Its Right Place','2021-11-05 00:00:00',251,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','\"Everything in Its Right Place\" was released as the opening track of Radiohead\'s fourth studio album, Kid A (2000). It features synthesiser, digitally manipulated vocals and unusual time signatures. The lyrics were inspired by the stress felt by the singer, Thom Yorke, while promoting the album OK Computer (1997).\n\nYorke wrote \"Everything in Its Right Place\" on piano. Radiohead worked on it in a conventional band arrangement before transferring it to synthesiser, and described it as a breakthrough in the album recording. <a href=\"http://www.last.fm/music/Radiohead/_/Everything+in+Its+Right+Place\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2kRFrWaLWiKq48YYVdGcm8\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/62dUmjtkYOUwYOALt6pefh\";}','everything-in-its-right-place','62dUmjtkYOUwYOALt6pefh',1),(158,'2025-05-27 16:04:47','2025-05-27 16:04:47','Kid A','2021-11-05 00:00:00',284,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','\"Kid A” is one of the more challenging songs on Radiohead’s fourth LP. Much like the album’s opener, “Everything in its Right Place”, it is distinguished by a conspicuous lack of guitars and heavily compressed vocals from Yorke.\n\nWhile some of the lyrics make clear references to literature and politics, it is unlikely that Thom intended for the song itself to carry a clear intellectual meaning. The severe distortion applied to the lead vocal track makes understanding the lyrics difficult <a href=\"http://www.last.fm/music/Radiohead/_/Kid+A\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3QDahKSqLwYJYQRbILdzS6\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/797AyTQcqoQgqWQ1Qz184Y\";}','kid-a','797AyTQcqoQgqWQ1Qz184Y',2),(159,'2025-05-27 16:04:48','2025-05-27 16:04:48','The National Anthem','2021-11-05 00:00:00',351,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','\"The National Anthem\" is a song by the band Radiohead, the third track from the album Kid A. The song is moored to a repetitive bassline, has a processed electronic production, and develops in a direction influenced by jazz.\nIn the album recording, the bass is played by lead singer Thom Yorke, who wrote the riff at age 16. The song is thought to have been previously attempted at recording sessions in 1994 and 1997, but according to Colin Greenwood, the band decided it was \"too good to use it as a b-side for OK Computer singles\". <a href=\"http://www.last.fm/music/Radiohead/_/The+National+Anthem\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4Wgj6jzoI2gYlumXdYAB8U\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/02FcgoInOjsdFT8YdAUMwu\";}','the-national-anthem','02FcgoInOjsdFT8YdAUMwu',3),(160,'2025-05-27 16:04:53','2025-05-27 16:04:53','How to Disappear Completely','2021-11-05 00:00:00',356,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','\"How to Disappear Completely\" is a song by the English rock band Radiohead from their fourth studio album \"Kid A\". It was produced by the band with their producer, Nigel Godrich. The song is titled after Doug Richmond\'s 1985 book \"How to Disappear Completely and Never Be Found\".\n\nThe band first performed the song in 1998 during the tour. An early soundcheck performance features in the 1998 documentary \"Meeting People Is Easy\".\n\nDuring the \"Kid A\" sessions in 1999 <a href=\"http://www.last.fm/music/Radiohead/_/How+to+Disappear+Completely\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2rtGaCAeYtmcIvuZsvgTf6\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7hFmiFUYmIjELj5d0UjbVh\";}','how-to-disappear-completely','7hFmiFUYmIjELj5d0UjbVh',4),(161,'2025-05-27 16:04:54','2025-05-27 16:04:54','Treefingers','2021-11-05 00:00:00',222,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','\"Treefingers\" will hands down be one of the biggest surprises on Kid A. One may think that Synthesizers were used to make the song, but as Ed pointed out in an interview, it was done all on guitar. Thom recorded Ed playing guitar for about 10 minutes and then cut and paste the recording in his sampler. <a href=\"http://www.last.fm/music/Radiohead/_/Treefingers\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4LrfsgQ5AGouvH3PlxW2PC\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0XGxvQj8dRhGn41nvXIxN0\";}','treefingers','0XGxvQj8dRhGn41nvXIxN0',5),(162,'2025-05-27 16:04:55','2025-05-27 16:04:55','Optimistic','2021-11-05 00:00:00',315,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','\"Optimistic\" is the sixth track on the 2000 album Kid A by the band Radiohead.\nNo singles were released from Kid A, but promos of several songs from the album, including \"Optimistic\", were sent to radio stations. Without an official single specified by the band or label, the guitar-driven \"Optimistic\" became the default track to be picked up by alternative rock stations in the United States and received more airplay than any other track on Kid A. The song hit number 10 on the Billboard modern rock charts <a href=\"http://www.last.fm/music/Radiohead/_/Optimistic\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1FoUsSi9BCTlNt2Vd7V8XA\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2NLpanao1S1XKsGpi1hOsT\";}','optimistic','2NLpanao1S1XKsGpi1hOsT',6),(163,'2025-05-27 16:05:05','2025-05-27 16:05:05','In Limbo','2021-11-05 00:00:00',211,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','A floaty, mesmerising track from \"Kid A\" that makes heavy use of dreamy imagery. Its themes are loneliness, being lost, confusion and water. It was originally titled “Lost at Sea”.\n\nThe theological meaning of limbo is that of a place outside hell and heaven to which unbaptized infants (or in this case, lost people) and the righteous who died before Christ’s coming were traditionally consigned.\n\nThe inspiration here derives from \"Dante’s Inferno\" (a book in which Thom\'s then-partner, Rachel Owen, was a specialist on). <a href=\"http://www.last.fm/music/Radiohead/_/In+Limbo\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0xivCtzVVrdeq32s8EnOO6\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6rBZtu8XpzdZT83CEp4zVT\";}','in-limbo','6rBZtu8XpzdZT83CEp4zVT',7),(164,'2025-05-27 16:05:06','2025-05-27 16:05:06','Idioteque','2021-11-05 00:00:00',309,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','\"Idioteque\" is the eighth track on Radiohead\'s album, Kid A. Driven by electronic beats, it was seen as a departure for the rock band, but remains a fan favourite, especially at live concerts. Singer Thom Yorke usually dances during the song, and the crowd joins in singing the second verse (\"Ice age coming, ice age coming\"). The song has been played at nearly every concert since 2001.\n\nThe song features a prominent sample from \"Track page: Mild und Leise\" - an experimental computer piece from 1973 by electronic music pioneer Paul Lansky. <a href=\"http://www.last.fm/music/Radiohead/_/Idioteque\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1W5XugQJGhnSATMI5n002M\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7Kx2i89MjDBLaT6zwy6eM2\";}','idioteque','7Kx2i89MjDBLaT6zwy6eM2',8),(165,'2025-05-27 16:05:07','2025-05-27 16:05:07','Morning Bell','2021-11-05 00:00:00',275,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','Thom recently talked about \"Morning Bell\" in an interview:\n\n\"It\'s very, very violent. Extremely violent. The really weird thing about that was I wrote the song with all the words pretty much straight away, which is basically the only one I did that with. I recorded it onto MiniDisc and then there was a lightning storm, and it wiped the MiniDisc and I lost the song. I completely forgot it. Then five months later, I was on a plane, knackered for 24 hours, I was just falling asleep, and I remembered it. <a href=\"http://www.last.fm/music/Radiohead/_/Morning+Bell\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4h37RgtBg9iynN3BIL5lFU\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7esSFXeHFfBhDBhamtT9Nh\";}','morning-bell','7esSFXeHFfBhDBhamtT9Nh',9),(166,'2025-05-27 16:05:07','2025-05-27 16:05:07','Motion Picture Soundtrack','2021-11-05 00:00:00',200,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3',NULL,'N;','motion-picture-soundtrack','5RxiwMqRNyPYjJTobU65UT',10),(167,'2025-05-27 16:05:07','2025-05-27 16:05:07','Untitled','2021-11-05 00:00:00',52,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3',NULL,'N;','untitled','5o0pk8K9JlJJXQjVzP5vSX',11),(168,'2025-05-27 16:05:17','2025-05-27 16:05:17','Packt Like Sardines In a Crushd Tin Box','2021-11-05 00:00:00',240,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','\"Packt Like Sardines in a Crushd Tin Box\" kicked off the session with a trippy, dance backbeat and a pounding kettle drum (or, perhaps, drummer Phil Selway was literally banging on a kitchen pot). Yorke’s vocal was mostly distorted and processed with auto-tune throughout the track, weaving in and out of indistinguishable (in this setting, at least) sampled vocals.\n\nColin: “The kkkurrghh from Packt Like Sardines, that’s from Thom’s laptop. We just compressed messed-up loops.” <a href=\"http://www.last.fm/music/Radiohead/_/Packt+Like+Sardines+in+a+Crushd+Tin+Box\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0tDn82XkoueVV5q9G7OUAv\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6B8qmIsuiiq2scZgUgmXfE\";}','packt-like-sardines-in-a-crushd-tin-box','6B8qmIsuiiq2scZgUgmXfE',1),(169,'2025-05-27 16:05:18','2025-05-27 16:05:18','Pyramid Song','2021-11-05 00:00:00',288,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','Pyramid Song” is a piano-driven piece with vocals and lyrics by Yorke. It also features string orchestrations by band member Jonny Greenwood. The song builds to a climax with the introduction of Phil Selway’s jazz-influenced compound rhythm and the siren-like wails of the Ondes Martenot, an early electronic instrument also played by Jonny. Colin Greenwood plays upright bass rather than his usual electric; O’Brien adds subtle electric guitar to live versions, playing with lots of delay. <a href=\"http://www.last.fm/music/Radiohead/_/Pyramid+Song\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=3M_Gg1xAHE4\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6odVNrn820IkdNB1zC3kii\";}','pyramid-song','6odVNrn820IkdNB1zC3kii',2),(170,'2025-05-27 16:05:19','2025-05-27 16:05:19','Pulk/Pull Revolving Doors','2021-11-05 00:00:00',247,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','Stop-start, bass-heavy sounds and elevator pings form the backdrop as an electronically distorted, sped-up voice free-associates on the topic of doors. Video-game sound effects rise and descend throughout. According to Colin Greenwood, the song was made using an MC505 and some loops. <a href=\"http://www.last.fm/music/Radiohead/_/Pulk%2FPull+Revolving+Doors\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6AIq6WIkWBoRUb6kTVY8yU\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1daHnZE6OXklKTaix7BCdc\";}','pulk-pull-revolving-doors','1daHnZE6OXklKTaix7BCdc',3),(171,'2025-05-27 16:05:19','2025-05-27 16:05:19','You And Whose Army?','2021-11-05 00:00:00',191,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','Thom has stated in a Mojo interview in 2001:\n\"Originally, it was about the voices in my head that were driving me ‘round the bend – to be honest (bursts out laughing). And then, once I came up with that “You And Whose Army” phrase, I was able to stick other ideas on there and Blair emerged as the song’s real subject matter. The song’s ultimately about someone who is elected into power by people and who then blatantly betrays them – just like Blair did. <a href=\"http://www.last.fm/music/Radiohead/_/You+and+Whose+Army%3F\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/7Hg6a7tZsVTkXnBUepjZU6\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/08QGvTyesyJiodOHSH2QsW\";}','you-and-whose-army','08QGvTyesyJiodOHSH2QsW',4),(172,'2025-05-27 16:05:30','2025-05-27 16:05:30','I Might Be Wrong','2021-11-05 00:00:00',293,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','\"I Might Be Wrong\" is a song by the English rock band Radiohead from their 2001 album, Amnesiac. In the United States, it was released as a radio-only single in advance of the album. \"Pyramid Song\" was the official first single in all other regions, and the \"Pyramid Song\" video was also released worldwide. The song charted at #27 on the Billboard Modern Rock Tracks chart.\nAlthough the album version is heavily produced by Nigel Godrich and Radiohead <a href=\"http://www.last.fm/music/Radiohead/_/I+Might+Be+Wrong\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=vOa--Dhu11M\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3EXR2NUmkNPJQihjvMlLGb\";}','i-might-be-wrong','3EXR2NUmkNPJQihjvMlLGb',5),(173,'2025-05-27 16:05:30','2025-05-27 16:05:30','Knives Out','2021-11-05 00:00:00',254,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','\"Knives Out\" is a song by English alternative rock band Radiohead. The composition features electric and acoustic guitars, complemented by singer Thom Yorke\'s vocals. It appears on Radiohead\'s 2001 album Amnesiac, recorded during the same sessions as the previous album Kid A. It was also released as the second Amnesiac single, receiving more radio airplay than the band\'s other songs of the period. The song reached #13 on the UK singles chart.\n\nYorke has usually described the song as being about \"cannibalism\". <a href=\"http://www.last.fm/music/Radiohead/_/Knives+Out\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=2Lpw3yMCWro\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4RMds1EdYrghXxBA3pBJeb\";}','knives-out','4RMds1EdYrghXxBA3pBJeb',6),(174,'2025-05-27 16:05:31','2025-05-27 16:05:31','Morning Bell/Amnesiac','2021-11-05 00:00:00',194,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','“Morning Bell/Amnesiac” is a version of “Morning Bell” off Radiohead’s previous album \"Kid A\".\n\nAlthough most of the lyrics are the same, there are some noticeable differences in some verses, as well as a slower tempo, a chiming xylophone-like instrumentation, and the entire outro being replaced with the refrain.\n\nEd O\'Brien explained the reason for re-releasing the song with a different arrangement:\n\n\"We often record different versions of songs and the new one is the first time it has been strong enough to bear hearing again. <a href=\"http://www.last.fm/music/Radiohead/_/Morning+Bell%2FAmnesiac\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/09rXQjOX61UGL36z76q8OS\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5B8noxM4Nv71LPBujOjOYz\";}','morning-bell-amnesiac','5B8noxM4Nv71LPBujOjOYz',7),(175,'2025-05-27 16:05:31','2025-05-27 16:05:31','Dollars and Cents','2021-11-05 00:00:00',291,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','The eighth track from Amnesiac, Dollars & Cents, was edited down from an eleven-minute jam inspired by krautrock band Can:\n\n\"That Holger thing of chop-chop-chop, making what seems like drivel into something coherent.\"\n\nColin Greenwood played a record by jazz musician Alice Coltrane over the recording, inspiring his brother Jonny to write a \"Coltrane-style\" string arrangement. Yorke said:\n\n\"The lyrics are gibberish but they come out of ideas I\'ve been fighting with for ages about how people are basically just pixels on a screen <a href=\"http://www.last.fm/music/Radiohead/_/Dollars+and+Cents\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0kSDNLOdJqpGhV2vtVFWmS\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6EKBZ1eARNuk560JX7bbOD\";}','dollars-and-cents','6EKBZ1eARNuk560JX7bbOD',8),(176,'2025-05-27 16:05:42','2025-05-27 16:05:42','Hunting Bears','2021-11-05 00:00:00',121,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','“Hunting Bears” is a two-minute instrumental song, the third purely instrumental piece on Radiohead’s catalogue (after “Treefingers” and “Meeting in the Aisle”), and the only one focused on guitars.\n\nThe slide guitar is reminiscent of Ry Cooder’s work and of Neil Young’s \"Dead Man\" soundtrack.\n\nInstead of, as a band would usually do, using a short instrumental piece as a segue into a related piece of music, “Hunting Bears” links <a href=\"http://www.last.fm/music/Radiohead/_/Hunting+Bears\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3LpAIBGaRKXqgDzEV25Bh7\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3eJ7eToeq7dOkTziF5neAk\";}','hunting-bears','3eJ7eToeq7dOkTziF5neAk',9),(177,'2025-05-27 16:05:43','2025-05-27 16:05:43','Like Spinning Plates','2021-11-05 00:00:00',237,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','\"Like Spinning Plates\" is a song written by the English band Radiohead that appears on their 2001 album Amnesiac. It also appears on their live album, I Might Be Wrong: Live Recordings.\n\nThe song is built over the reversed backing track of an electronic version of the then unreleased I Will (which would later be released in a much different form on Hail To The Thief). According to Thom Yorke, in an interview with The Wire, \"We\'d turned the tape [of \"I Will\"] around  <a href=\"http://www.last.fm/music/Radiohead/_/Like+Spinning+Plates\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1irS6wtXCUUF5ytfPqOzpM\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4KoyF1BiTEJ71EZxPVfMeZ\";}','like-spinning-plates','4KoyF1BiTEJ71EZxPVfMeZ',10),(178,'2025-05-27 16:05:43','2025-05-27 16:05:43','Life In a Glasshouse','2021-11-05 00:00:00',276,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','\"Life in a Glasshouse\" is a song written by the English alternative rock band Radiohead that appears on their 2001 album Amnesiac. It is performed by lead singer Thom Yorke with the late British trad jazz trumpeter Humphrey Lyttelton and his band.\n\nBeginning with a brief atmospheric loop and clanging church-like bells, the song quickly morphs into a funereal New Orleans jazz style number by a horn section including a clarinet, a trumpet and a trombone. <a href=\"http://www.last.fm/music/Radiohead/_/Life+in+a+Glasshouse\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5xJc58mBWz68WhwU2n5seR\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0qFTFL1V5nRMw4fmEodSYQ\";}','life-in-a-glasshouse','0qFTFL1V5nRMw4fmEodSYQ',11),(179,'2025-05-27 16:05:43','2025-05-27 16:05:43','Like Spinning Plates - \'Why Us?\' Version','2021-11-05 00:00:00',304,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3',NULL,'N;','like-spinning-plates-why-us-version','0GDeU5t1qHrcd191UOBAL1',1),(180,'2025-05-27 16:05:54','2025-05-27 16:05:54','Untitled v1','2021-11-05 00:00:00',108,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3',NULL,'a:3:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=ZTvniQgAQ0o\";s:21:\"purchase for download\";s:48:\"https://radiohead.bandcamp.com/track/untitled-v1\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3UhVihR6uX7ODreSzgmjT3\";}','untitled-v1','3UhVihR6uX7ODreSzgmjT3',2),(181,'2025-05-27 16:05:54','2025-05-27 16:05:54','Fog - Again Again Version','2021-11-05 00:00:00',145,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3',NULL,'N;','fog-again-again-version','7ioYcj2MKilwzLKO65Aw7H',3),(182,'2025-05-27 16:05:55','2025-05-27 16:05:55','If You Say the Word','2021-11-05 00:00:00',260,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3','‘\'If You Say The Word’‘ was released as the first single off of Radiohead’s compilation album \"Kid A Mnesia\". It came as the first piece of previously unreleased material from the recording sessions for Kid A and Amnesiac, roughly two decades later.\n\nEntries in Ed O\'Brien’s diary at the time confirm the working title of the track, ‘\'C-Minor Song’‘, and the fact that it had been on the works since around 1999. The song title changed to ’‘Say The Word’‘ in September 1999 <a href=\"http://www.last.fm/music/Radiohead/_/If+You+Say+the+Word\">Read more on Last.fm</a>.','a:3:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=GcIyKK8m4qo\";s:21:\"purchase for download\";s:56:\"https://radiohead.bandcamp.com/track/if-you-say-the-word\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0IW33PjCiwBKH4IGASRzrm\";}','if-you-say-the-word','0IW33PjCiwBKH4IGASRzrm',4),(183,'2025-05-27 16:05:55','2025-05-27 16:05:55','Follow Me Around','2021-11-05 00:00:00',319,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3',NULL,'a:3:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=qgFgNWUanQg\";s:21:\"purchase for download\";s:53:\"https://radiohead.bandcamp.com/track/follow-me-around\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4E6VIBxJdetyVUfQv2u360\";}','follow-me-around','4E6VIBxJdetyVUfQv2u360',5),(184,'2025-05-27 16:05:55','2025-05-27 16:05:55','Pulk/Pull - True Love Waits Version','2021-11-05 00:00:00',166,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3',NULL,'N;','pulk-pull-true-love-waits-version','3aodNsiXTJJxUyda1wKZeV',6),(185,'2025-05-27 16:06:06','2025-05-27 16:06:06','Untitled v2','2021-11-05 00:00:00',46,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3',NULL,'a:3:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=1WzCN1syZfc\";s:21:\"purchase for download\";s:48:\"https://radiohead.bandcamp.com/track/untitled-v2\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1lBISxqvaSesTdLXnAGFMG\";}','untitled-v2','1lBISxqvaSesTdLXnAGFMG',7),(186,'2025-05-27 16:06:06','2025-05-27 16:06:06','The Morning Bell - In the Dark Version','2021-11-05 00:00:00',120,'https://i.scdn.co/image/ab67616d0000b273bbaaa8bf9aedb07135d2c6d3',NULL,'N;','the-morning-bell-in-the-dark-version','6JUI1QpdlmcjfCFY8r2C9F',8),(187,'2025-0