'melatonin-remastered','70lnEv38W5ilDiDdGjgcLP',6),(209,'2025-05-27 16:06:18','2025-05-27 16:06:18','A Reminder - Remastered','2017-06-23 00:00:00',232,'https://i.scdn.co/image/ab67616d0000b273ee58b8ce747da91d69a862cc',NULL,'N;','a-reminder-remastered','6PSIzRBv7J3o6Vz8SFDKaT',7),(210,'2025-05-27 16:06:18','2025-05-27 16:06:18','Polyethylene (Parts 1 & 2) - Remastered','2017-06-23 00:00:00',262,'https://i.scdn.co/image/ab67616d0000b273ee58b8ce747da91d69a862cc',NULL,'N;','polyethylene-parts-1-and-2-remastered','17npanU0UU9JzglUnCoKdL',8),(211,'2025-05-27 16:06:18','2025-05-27 16:06:18','Pearly* - Remastered','2017-06-23 00:00:00',218,'https://i.scdn.co/image/ab67616d0000b273ee58b8ce747da91d69a862cc',NULL,'N;','pearly-remastered','1JjaPYOJEb5nvmVRGbpPz1',9),(212,'2025-05-27 16:06:18','2025-05-27 16:06:18','Palo Alto - Remastered','2017-06-23 00:00:00',231,'https://i.scdn.co/image/ab67616d0000b273ee58b8ce747da91d69a862cc',NULL,'N;','palo-alto-remastered','36smNNHs9GP5I5BGqoDVVX',10),(213,'2025-05-27 16:06:18','2025-05-27 16:06:18','How I Made My Millions - Remastered','2017-06-23 00:00:00',187,'https://i.scdn.co/image/ab67616d0000b273ee58b8ce747da91d69a862cc',NULL,'N;','how-i-made-my-millions-remastered','5uqLwDzYZ1rH5pnFkWMiM9',11),(214,'2025-05-27 16:06:20','2025-05-27 16:06:20','Burn the Witch','2016-05-08 00:00:00',220,'https://i.scdn.co/image/ab67616d0000b27345643f5cf119cbc9d2811c22','“Burn the Witch“ is a song by the English rock band Radiohead, released as download on 3 May 2016 as the first single from their ninth studio album A Moon Shaped Pool. The song features a string section playing col legno, producing a percussive sound. It was accompanied by a stop-motion animated music video that pays homage to the 1960s British children\'s television program Camberwick Green and the 1973 British horror film The Wicker Man. The <a href=\"http://www.last.fm/music/Radiohead/_/Burn+the+Witch\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=yI2oS2hoL0k\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3DpuYpzkvUWXbmzCm6pfzR\";}','burn-the-witch','3DpuYpzkvUWXbmzCm6pfzR',1),(215,'2025-05-27 16:06:20','2025-05-27 16:06:20','Daydreaming','2016-05-08 00:00:00',384,'https://i.scdn.co/image/ab67616d0000b27345643f5cf119cbc9d2811c22','“Daydreaming” is the second single off Radiohead’s ninth studio album.\n\nThe single was released on May 6, 2016. Earlier that day, the band teased the song’s music video on their Instagram.\n\nThe music video features Radiohead lead singer Thom Yorke wandering through various locations—a library, an empty parking garage, a family’s home. The clip was directed by filmmaker Paul Thomas Anderson who has worked extensively with Radiohead guitarist Jonny Greenwood. <a href=\"http://www.last.fm/music/Radiohead/_/Daydreaming\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=TTAU7lLDZYU\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1Rd5OVjqDAr5xC96MHt448\";}','daydreaming','1Rd5OVjqDAr5xC96MHt448',2),(216,'2025-05-27 16:06:31','2025-05-27 16:06:31','Decks Dark','2016-05-08 00:00:00',281,'https://i.scdn.co/image/ab67616d0000b27345643f5cf119cbc9d2811c22','This song continues the space narrative on A Moon Shaped Pool. Thom uses metaphors of a UFO and extraterrestrial matter in order to portray the questions and darkness of humanity.\n\nThe song is also personal for Thom. In parts, it seems as if he’s speaking directly to a woman in his past. The woman could be Rachel Owen, Thom’s former partner of 23 years. As theorized in “Daydreaming”, 23 years marks “half” of Thom’s life.\n <a href=\"http://www.last.fm/music/Radiohead/_/Decks+Dark\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5rIhBK9aaVMck0W2YtOwci\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4mRSbPLnOm54ttkTYvxxSY\";}','decks-dark','4mRSbPLnOm54ttkTYvxxSY',3),(217,'2025-05-27 16:06:32','2025-05-27 16:06:32','Desert Island Disk','2016-05-08 00:00:00',224,'https://i.scdn.co/image/ab67616d0000b27345643f5cf119cbc9d2811c22','The title of this song is a play on the classic BBC Radio 4 talk show programme Desert Island Discs, where celebrities must name eight recordings (usually songs) that they would take away with them on a desert island. Interestingly, Radiohead songs have appeared on a number of lists. Now former British Prime Minister David Cameron named “Fake Plastic Trees” as one of his tracks, and comedian David Mitchell chose the much maligned breakthrough hit “Creep” from Radiohead’s debut album Pablo Honey. <a href=\"http://www.last.fm/music/Radiohead/_/Desert+Island+Disk\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1kBGeOp1CDUHVdbK4ergqo\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0eLVt8CGVdNnyMcfP38kDi\";}','desert-island-disk','0eLVt8CGVdNnyMcfP38kDi',4),(218,'2025-05-27 16:06:32','2025-05-27 16:06:32','Ful Stop','2016-05-08 00:00:00',367,'https://i.scdn.co/image/ab67616d0000b27345643f5cf119cbc9d2811c22','The title “Ful Stop” may be read as a combination of an oxymoron and a play on words. Obviously “full” is spelled with two L’s and spelling with one L makes the word no longer full making it near full. However, “-ful” is a suffix found at the end of various words, including “truthful”. The absence of a second “l” invites us to ask whether it’s the beginning or the end that has been cut off. Maybe the “stop” described in the song is both a “full stop” and a “truthful stop”. <a href=\"http://www.last.fm/music/Radiohead/_/Ful+Stop\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4CzTgOmc3Sdm4EgKQWzjQl\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6nOsTV3cMjLh3k6Wpk468L\";}','ful-stop','6nOsTV3cMjLh3k6Wpk468L',5),(219,'2025-05-27 16:06:43','2025-05-27 16:06:43','Glass Eyes','2016-05-08 00:00:00',172,'https://i.scdn.co/image/ab67616d0000b27345643f5cf119cbc9d2811c22','This watery piano ballad featuring a stark string section, tackles themes of anxiety and alienation as the character is frightened by society, leading him to escape the unknown.\n\nRadiohead released a vignette to accompany “Glass Eyes”. The less than a minute long piece was directed by Weirdcore and was released via the bands Instagram page. <a href=\"http://www.last.fm/music/Radiohead/_/Glass+Eyes\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0eZN5WsQfmNFICHuw59Zfz\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0uOeAmfdyaekD2RIGwCDwq\";}','glass-eyes','0uOeAmfdyaekD2RIGwCDwq',6),(220,'2025-05-27 16:06:43','2025-05-27 16:06:43','Identikit','2016-05-08 00:00:00',266,'https://i.scdn.co/image/ab67616d0000b27345643f5cf119cbc9d2811c22','Radiohead performed this song along with Ful Stop on their 2012 tour although neither song was officially released in CDQ until 2016 when they released their album A Moon Shaped Pool. <a href=\"http://www.last.fm/music/Radiohead/_/Identikit\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3LhtqibvTtjOUrzKs7Vsz1\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/135WMJorhiGvPe50XF54D9\";}','identikit','135WMJorhiGvPe50XF54D9',7),(221,'2025-05-27 16:06:44','2025-05-27 16:06:44','The Numbers','2016-05-08 00:00:00',345,'https://i.scdn.co/image/ab67616d0000b27345643f5cf119cbc9d2811c22','Thom Yorke first played this protest song about global warming during the December 4, 2015 Pathway to Paris climate change concert at Le Trianon in the French capital. Yorke performed two Moon Shaped Pool tracks, \"The Numbers\" (then known as \"Silent Spring\") and \"Desert Island Disk,\" during his solo gig. As he played \"Silent Spring,\" Yorke could be heard saying, \"This is Jonny (Greenwood, guitar)\'s bit, which I can\'t play.\"\nThe tracklisting for A Moon Shaped Pool is entirely in alphabetical order <a href=\"http://www.last.fm/music/Radiohead/_/The+Numbers\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6f6pEjgfTtuRROmJ4a7Gf3\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1GnFQL9XnxrXFloKm1yjuW\";}','the-numbers','1GnFQL9XnxrXFloKm1yjuW',8),(222,'2025-05-27 16:06:44','2025-05-27 16:06:44','Present Tense','2016-05-08 00:00:00',306,'https://i.scdn.co/image/ab67616d0000b27345643f5cf119cbc9d2811c22','\"Present Tense\" is the ninth track from Radiohead\'s ninth studio album \"A Moon Shaped Pool\".\n\nThom Yorke first played this bittersweet bossa nova (then known as \"The Present Tense\") as an acoustic number during a solo set at the UK Latitude Festival in 2009. Yorke has since performed it several times during his solo shows and with his other band, Atoms for Peace. However, fans had to wait until 2016 for the studio version.\n\nLyrically, Yorke is singing here about a relationship in trouble. <a href=\"http://www.last.fm/music/Radiohead/_/Present+Tense\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4eruRiSfDY1jdT03hjyi0i\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7KHQtpLpoIV3Wfu22YQT8y\";}','present-tense','7KHQtpLpoIV3Wfu22YQT8y',9),(223,'2025-05-27 16:06:55','2025-05-27 16:06:55','Tinker Tailor Soldier Sailor Rich Man Poor Man Beggar Man Thief','2016-05-08 00:00:00',303,'https://i.scdn.co/image/ab67616d0000b27345643f5cf119cbc9d2811c22',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3cual6JOG286qZJmCxKRAT\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3YQVYTkonczhXyj31HH4AK\";}','tinker-tailor-soldier-sailor-rich-man-poor-man-beggar-man-thief','3YQVYTkonczhXyj31HH4AK',10),(224,'2025-05-27 16:06:55','2025-05-27 16:06:55','True Love Waits','2016-05-08 00:00:00',283,'https://i.scdn.co/image/ab67616d0000b27345643f5cf119cbc9d2811c22','\"True Love Waits\" is the closing track of Radiohead\'s ninth LP, A Moon Shaped Pool. It was previously released on the live album I Might Be Wrong: Live Recordings in 2001. Prior to this release, it was one of the most requested live songs in the band\'s catalog, performed on occasion prior to the release of OK Computer and during the Kid A and Amnesiac tours.\n\nWhen asked about the meaning of the line \"I\'ll dress like your niece,\" Thom had this to say: \"the difference between young and old when people start to dress sensible and act their age. <a href=\"http://www.last.fm/music/Radiohead/_/True+Love+Waits\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/01ZpFhrMMqKPVCwyqXneVp\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/07XaOyTS5hyaWiUK1Bc3bR\";}','true-love-waits','07XaOyTS5hyaWiUK1Bc3bR',11),(225,'2025-05-27 16:06:56','2025-05-27 16:06:56','Little By Little - Caribou Rmx','2011-10-10 00:00:00',340,'https://i.scdn.co/image/ab67616d0000b273c5d47a9a4553e4cca882162c',NULL,'N;','little-by-little-caribou-rmx','753xFobxoB4Y7jOu160vH4',1),(226,'2025-05-27 16:06:56','2025-05-27 16:06:56','Lotus Flower - Jacques Greene Rmx','2011-10-10 00:00:00',429,'https://i.scdn.co/image/ab67616d0000b273c5d47a9a4553e4cca882162c',NULL,'N;','lotus-flower-jacques-greene-rmx','0Q0aM8mUZnOwOfKJ2GDbEo',2),(227,'2025-05-27 16:06:56','2025-05-27 16:06:56','Morning Mr Magpie - Nathan Fake Rmx','2011-10-10 00:00:00',291,'https://i.scdn.co/image/ab67616d0000b273c5d47a9a4553e4cca882162c',NULL,'N;','morning-mr-magpie-nathan-fake-rmx','6qLPjCTnlLr4Adl0ndl3Wi',3),(228,'2025-05-27 16:06:56','2025-05-27 16:06:56','Bloom - Harmonic 313 Rmx','2011-10-10 00:00:00',304,'https://i.scdn.co/image/ab67616d0000b273c5d47a9a4553e4cca882162c',NULL,'N;','bloom-harmonic-313-rmx','5MR8vZztOvZW9LH5631fIv',4),(229,'2025-05-27 16:06:56','2025-05-27 16:06:56','Bloom - Mark Pritchard Rmx','2011-10-10 00:00:00',367,'https://i.scdn.co/image/ab67616d0000b273c5d47a9a4553e4cca882162c',NULL,'N;','bloom-mark-pritchard-rmx','4EUOC2daZWU4PV8e48dSF