:56','2025-05-27 16:06:56','Feral','2011-02-18 00:00:00',192,'https://i.scdn.co/image/ab67616d0000b273a9be6a9b8b5831a4c431ab9f',NULL,'N;','feral','7pEP2RXIZNXaI24enG8cyL',4),(248,'2025-05-27 16:06:56','2025-05-27 16:06:56','Lotus Flower','2011-02-18 00:00:00',300,'https://i.scdn.co/image/ab67616d0000b273a9be6a9b8b5831a4c431ab9f',NULL,'N;','lotus-flower','2QeutlLcJf2V1cMUUsDFT1',5),(249,'2025-05-27 16:06:56','2025-05-27 16:06:56','Codex','2011-02-18 00:00:00',287,'https://i.scdn.co/image/ab67616d0000b273a9be6a9b8b5831a4c431ab9f',NULL,'N;','codex','6ttYF5VadzTssGV2i1Q08T',6),(250,'2025-05-27 16:06:56','2025-05-27 16:06:56','Give Up The Ghost','2011-02-18 00:00:00',290,'https://i.scdn.co/image/ab67616d0000b273a9be6a9b8b5831a4c431ab9f',NULL,'N;','give-up-the-ghost','05NZMYuLR71Z3qrZOUiUm2',7),(251,'2025-05-27 16:06:56','2025-05-27 16:06:56','Separator','2011-02-18 00:00:00',319,'https://i.scdn.co/image/ab67616d0000b273a9be6a9b8b5831a4c431ab9f',NULL,'N;','separator','2fV57qob1dYMJKEfTwHOt1',8),(252,'2025-05-27 16:06:57','2025-05-27 16:06:57','15 Step','2007-12-28 00:00:00',237,'https://i.scdn.co/image/ab67616d0000b273de3c04b5fc750b68899b20a9','This is the first song of the album In Rainbows.\n\nThe song originated on May 6, 2006 in Copenhagen, Denmark.\n\nThom Yorke and Jonny Greenwood performed this song at the 2009 Grammys, for their first Grammy performance ever. <a href=\"http://www.last.fm/music/Radiohead/_/15+Step\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4oXg7xT4ksBxHTx8PcmSXw\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4oXg7xT4ksBxHTx8PcmSXw\";}','15-step','4oXg7xT4ksBxHTx8PcmSXw',1),(253,'2025-05-27 16:06:58','2025-05-27 16:06:58','Bodysnatchers','2007-12-28 00:00:00',242,'https://i.scdn.co/image/ab67616d0000b273de3c04b5fc750b68899b20a9','\"Bodysnatchers\" is a song by English band Radiohead and is the second track on their 2007 album In Rainbows. The song was released alongside House of Cards as a promotional single and video from In Rainbows in late June 2008. \n\nIt was recorded in a live take that was made at a dilapidated mansion. Nigel Godrich, the producer of the album, thought that throwing the band into an \"uncomfortable\" situation would create an interesting atmosphere for the recording sessions, not unlike the OK Computer sessions that took place at the St. <a href=\"http://www.last.fm/music/Radiohead/_/Bodysnatchers\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4pWIwnnqx8k01fuF95UMIg\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4pWIwnnqx8k01fuF95UMIg\";}','bodysnatchers','4pWIwnnqx8k01fuF95UMIg',2),(254,'2025-05-27 16:07:08','2025-05-27 16:07:08','Nude','2007-12-28 00:00:00',255,'https://i.scdn.co/image/ab67616d0000b273de3c04b5fc750b68899b20a9','\"Nude\" is a song by English rock band Radiohead and is the third track on their 2007 album In Rainbows. The song was released as the second single from In Rainbows on 31 March 2008. The song was written no later than 1997, when the band began to perform it live. However, a recording of \"Nude\" was not included on any Radiohead album until 10 years later.\n\nThe song has undergone numerous revisions since its origins in 1997. It was originally known as \"Big Ideas\", with the parenthetical \"(Don\'t Get Any)\" often added. <a href=\"http://www.last.fm/music/Radiohead/_/Nude\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=BbWBRnDK_AE\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/35YyxFpE0ZTOoqFx5bADW8\";}','nude','35YyxFpE0ZTOoqFx5bADW8',3),(255,'2025-05-27 16:07:09','2025-05-27 16:07:09','Weird Fishes / Arpeggi','2007-12-28 00:00:00',318,'https://i.scdn.co/image/ab67616d0000b273de3c04b5fc750b68899b20a9',NULL,'N;','weird-fishes-arpeggi','4wajJ1o7jWIg62YqpkHC7S',4),(256,'2025-05-27 16:07:09','2025-05-27 16:07:09','All I Need','2007-12-28 00:00:00',228,'https://i.scdn.co/image/ab67616d0000b273de3c04b5fc750b68899b20a9','\"All I Need\" is a song by English alternative rock band Radiohead. The song was written and recorded by the band for their seventh studio album In Rainbows and was produced by Nigel Godrich. One of the band\'s most direct love songs, \"All I Need\" is a downbeat track that sees frontman Thom Yorke singing of obsession and unrequited love. The recording also incorporates a full string section, a synthesizer, and various other instruments into its instrumentation. <a href=\"http://www.last.fm/music/Radiohead/_/All+I+Need\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5Qv2Nby1xTr9pQyjkrc94J\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5Qv2Nby1xTr9pQyjkrc94J\";}','all-i-need','5Qv2Nby1xTr9pQyjkrc94J',5),(257,'2025-05-27 16:07:10','2025-05-27 16:07:10','Faust Arp','2007-12-28 00:00:00',129,'https://i.scdn.co/image/ab67616d0000b273de3c04b5fc750b68899b20a9','The track’s title “Faust Arp” combines the name Faust (sometimes spelled Faustus) – a man who sold his soul to the devil for happiness and almost unlimited power – and Jean/Hans Arp, a French sculptor.\n\nRegarding the legend of Faustus:\n\n\"The second part begins with the spirits of the earth forgiving Faust (and the rest of mankind) and progresses into rich allegorical poetry. Faust and his devil pass through the world of politics and the world of the classical gods, and meet with Helen of Troy (the personification of beauty). <a href=\"http://www.last.fm/music/Radiohead/_/Faust+Arp\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/15irEKZ9D6FQqLoZ1qJ1Cx\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/15irEKZ9D6FQqLoZ1qJ1Cx\";}','faust-arp','15irEKZ9D6FQqLoZ1qJ1Cx',6),(258,'2025-05-27 16:07:20','2025-05-27 16:07:20','Reckoner','2007-12-28 00:00:00',290,'https://i.scdn.co/image/ab67616d0000b273de3c04b5fc750b68899b20a9','This song was first played at the Gorge in George, WA on June 23, 2001.\n\nReckoner is reminiscent of a line from the opening of Book II from Goethe’s Faust, “Life is not light but the refracted color.” The meaning is that life is not pure, but mixed, like rainbows. Radiohead’s album title, “In Rainbows,” and this song from which it comes, suggest there are deals made and reckonings to be made by the life we live. These deals mean we live multiple lives, not a singular or pure one. <a href=\"http://www.last.fm/music/Radiohead/_/Reckoner\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/02ppMPbg1OtEdHgoPqoqju\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/02ppMPbg1OtEdHgoPqoqju\";}','reckoner','02ppMPbg1OtEdHgoPqoqju',7),(259,'2025-05-27 16:07:21','2025-05-27 16:07:21','House Of Cards','2007-12-28 00:00:00',328,'https://i.scdn.co/image/ab67616d0000b273de3c04b5fc750b68899b20a9','\"House of Cards\" is a song by English alternative rock band Radiohead and is the eighth track on their 2007 album In Rainbows. The song was released alongside \"Bodysnatchers\" as a promotional single and video from In Rainbows in late June 2008. <a href=\"http://www.last.fm/music/Radiohead/_/House+of+Cards\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=8nTFjVm9sTQ\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/48X4D1FYOShPz2VF3YdfCF\";}','house-of-cards','48X4D1FYOShPz2VF3YdfCF',8),(260,'2025-05-27 16:07:21','2025-05-27 16:07:21','Jigsaw Falling Into Place','2007-12-28 00:00:00',248,'https://i.scdn.co/image/ab67616d0000b273de3c04b5fc750b68899b20a9','\"Jigsaw Falling Into Place\" is a song by the English band Radiohead and is the penultimate on their 2007 album In Rainbows. The song was released as the first single from In Rainbows on 14 January 2008, following the album\'s \"standard\" physical release on December 31, 2007.\n\nThe song was previously known as \"Open Pick\", a title it was given provisionally when it was performed during Radiohead\'s 2006 tour.\n\nThe song has spent several weeks as one of the 100-most-played songs on US modern rock radio <a href=\"http://www.last.fm/music/Radiohead/_/Jigsaw+Falling+Into+Place\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=GoLJJRIWCLU\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0YJ9FWWHn9EfnN0lHwbzvV\";}','jigsaw-falling-into-place','0YJ9FWWHn9EfnN0lHwbzvV',9),(261,'2025-05-27 16:07:22','2025-05-27 16:07:22','Videotape','2007-12-28 00:00:00',279,'https://i.scdn.co/image/ab67616d0000b273de3c04b5fc750b68899b20a9','Videotape is the final track from Radiohead\'s 2007 album In Rainbows. According to the Videotape Songfacts, the song is about a dying man saying goodbye to loved ones on old-fashioned videotape. \n\nThom Yorke described the process of composing Videotape as \"absolute agony\", stating that the song \"went through every possible parameter\". One day, Yorke left the studio, returning to find that Godrich and Jonny Greenwood had stripped the song down to the version found on the album, a minimal piano ballad.\n <a href=\"http://www.last.fm/music/Radiohead/_/Videotape\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4T1iiabe7G0UjWQJCY6NE2\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4T1iiabe7G0UjWQJCY6NE2\";}','videotape','4T1iiabe7G0UjWQJCY6NE2',10),(262,'2025-05-27 16:07:22','2025-05-27 16:07:22','MK 1','2025-05-27 20:07:00',62,'https://i.scdn.co/image/ab67616d0000b2734b88d5c1b3358cca2c94ec0b',NULL,'N;','mk-1','49oVFSbl8QdRAXktelJZWC',1),(263,'2025-05-27 16:07:22','2025-05-27 16:07:22','Down Is The New Up','2025-05-27 20:07:00',299,'https://i.scdn.co/image/ab67616d0000b2734b88d5c1b3358cca2c94ec0b',NULL,'N;','down-is-the-new-up','4Nckr2LBLkgNOdMadwNAxc',2),(264,'2025-05-27 16:07:22','2025-05-27 16:07:22','Go Slowly','2025-05-27 20:07:00',228,'https://i.scdn.co/image/ab67616d0000b2734b88d5c1b3358cca2c94ec0b'