/image/ab67616d0000b2730da53e8f58e59f28a79c10c7',NULL,'N;','a-wolf-at-the-door','3OHevW2cUT176DXWV0lHg9',14),(284,'2025-05-27 16:07:23','2025-05-27 16:07:23','The National Anthem - Live in France','2001-11-12 00:00:00',297,'https://i.scdn.co/image/ab67616d0000b27305a2f9af5f0eaed4835acf54',NULL,'N;','the-national-anthem-live-in-france','68Wf5I47kv3PC72baPEOcg',1),(285,'2025-05-27 16:07:23','2025-05-27 16:07:23','I Might Be Wrong - Live','2001-11-12 00:00:00',292,'https://i.scdn.co/image/ab67616d0000b27305a2f9af5f0eaed4835acf54',NULL,'N;','i-might-be-wrong-live','042kqquPL3pPtj8NgyMYG3',2),(286,'2025-05-27 16:07:23','2025-05-27 16:07:23','Morning Bell - Live in Oxford','2001-11-12 00:00:00',254,'https://i.scdn.co/image/ab67616d0000b27305a2f9af5f0eaed4835acf54',NULL,'N;','morning-bell-live-in-oxford','7dZXUEXUO6SW9CZPrTGEzo',3),(287,'2025-05-27 16:07:23','2025-05-27 16:07:23','Like Spinning Plates - Live','2001-11-12 00:00:00',232,'https://i.scdn.co/image/ab67616d0000b27305a2f9af5f0eaed4835acf54',NULL,'N;','like-spinning-plates-live','30V7kc7a8R3ONCRG1ipEZc',4),(288,'2025-05-27 16:07:23','2025-05-27 16:07:23','Idioteque - Live in Oxford','2001-11-12 00:00:00',264,'https://i.scdn.co/image/ab67616d0000b27305a2f9af5f0eaed4835acf54',NULL,'N;','idioteque-live-in-oxford','6QpvcM1VcNxxBMrxWkdgeM',5),(289,'2025-05-27 16:07:23','2025-05-27 16:07:23','Everything In Its Right Place - Live in France','2001-11-12 00:00:00',462,'https://i.scdn.co/image/ab67616d0000b27305a2f9af5f0eaed4835acf54',NULL,'N;','everything-in-its-right-place-live-in-france','1F2C3VZllQC9SV32FvMalr',6),(290,'2025-05-27 16:07:23','2025-05-27 16:07:23','Dollars and Cents - Live','2001-11-12 00:00:00',313,'https://i.scdn.co/image/ab67616d0000b27305a2f9af5f0eaed4835acf54',NULL,'N;','dollars-and-cents-live','4QhzDcpGhiWJzZSgIZQR9q',7),(291,'2025-05-27 16:07:23','2025-05-27 16:07:23','True Love Waits - Live in Oslo','2001-11-12 00:00:00',304,'https://i.scdn.co/image/ab67616d0000b27305a2f9af5f0eaed4835acf54',NULL,'N;','true-love-waits-live-in-oslo','62SvkbQm1wMS6KZtbtls1V',8),(292,'2025-05-27 16:07:33','2025-05-27 16:07:33','Packt Like Sardines In a Crushd Tin Box','2001-03-12 00:00:00',240,'https://i.scdn.co/image/ab67616d0000b273863e0e305637100311c91aa7','\"Packt Like Sardines in a Crushd Tin Box\" kicked off the session with a trippy, dance backbeat and a pounding kettle drum (or, perhaps, drummer Phil Selway was literally banging on a kitchen pot). Yorke’s vocal was mostly distorted and processed with auto-tune throughout the track, weaving in and out of indistinguishable (in this setting, at least) sampled vocals.\n\nColin: “The kkkurrghh from Packt Like Sardines, that’s from Thom’s laptop. We just compressed messed-up loops.” <a href=\"http://www.last.fm/music/Radiohead/_/Packt+Like+Sardines+in+a+Crushd+Tin+Box\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0tDn82XkoueVV5q9G7OUAv\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0tDn82XkoueVV5q9G7OUAv\";}','packt-like-sardines-in-a-crushd-tin-box','0tDn82XkoueVV5q9G7OUAv',1),(293,'2025-05-27 16:07:34','2025-05-27 16:07:34','Pyramid Song','2001-03-12 00:00:00',288,'https://i.scdn.co/image/ab67616d0000b273863e0e305637100311c91aa7','Pyramid Song” is a piano-driven piece with vocals and lyrics by Yorke. It also features string orchestrations by band member Jonny Greenwood. The song builds to a climax with the introduction of Phil Selway’s jazz-influenced compound rhythm and the siren-like wails of the Ondes Martenot, an early electronic instrument also played by Jonny. Colin Greenwood plays upright bass rather than his usual electric; O’Brien adds subtle electric guitar to live versions, playing with lots of delay. <a href=\"http://www.last.fm/music/Radiohead/_/Pyramid+Song\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=3M_Gg1xAHE4\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/55q3Ro66yXWi9rsEddeEN4\";}','pyramid-song','55q3Ro66yXWi9rsEddeEN4',2),(294,'2025-05-27 16:07:34','2025-05-27 16:07:34','Pulk/Pull Revolving Doors','2001-03-12 00:00:00',247,'https://i.scdn.co/image/ab67616d0000b273863e0e305637100311c91aa7','Stop-start, bass-heavy sounds and elevator pings form the backdrop as an electronically distorted, sped-up voice free-associates on the topic of doors. Video-game sound effects rise and descend throughout. According to Colin Greenwood, the song was made using an MC505 and some loops. <a href=\"http://www.last.fm/music/Radiohead/_/Pulk%2FPull+Revolving+Doors\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6AIq6WIkWBoRUb6kTVY8yU\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6AIq6WIkWBoRUb6kTVY8yU\";}','pulk-pull-revolving-doors','6AIq6WIkWBoRUb6kTVY8yU',3),(295,'2025-05-27 16:07:35','2025-05-27 16:07:35','You And Whose Army?','2001-03-12 00:00:00',191,'https://i.scdn.co/image/ab67616d0000b273863e0e305637100311c91aa7','Thom has stated in a Mojo interview in 2001:\n\"Originally, it was about the voices in my head that were driving me ‘round the bend – to be honest (bursts out laughing). And then, once I came up with that “You And Whose Army” phrase, I was able to stick other ideas on there and Blair emerged as the song’s real subject matter. The song’s ultimately about someone who is elected into power by people and who then blatantly betrays them – just like Blair did. <a href=\"http://www.last.fm/music/Radiohead/_/You+and+Whose+Army%3F\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/7Hg6a7tZsVTkXnBUepjZU6\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7Hg6a7tZsVTkXnBUepjZU6\";}','you-and-whose-army','7Hg6a7tZsVTkXnBUepjZU6',4),(296,'2025-05-27 16:07:46','2025-05-27 16:07:46','I Might Be Wrong','2001-03-12 00:00:00',293,'https://i.scdn.co/image/ab67616d0000b273863e0e305637100311c91aa7','\"I Might Be Wrong\" is a song by the English rock band Radiohead from their 2001 album, Amnesiac. In the United States, it was released as a radio-only single in advance of the album. \"Pyramid Song\" was the official first single in all other regions, and the \"Pyramid Song\" video was also released worldwide. The song charted at #27 on the Billboard Modern Rock Tracks chart.\nAlthough the album version is heavily produced by Nigel Godrich and Radiohead <a href=\"http://www.last.fm/music/Radiohead/_/I+Might+Be+Wrong\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=vOa--Dhu11M\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5JZ1jTanqLWVuThmZ6XRAc\";}','i-might-be-wrong','5JZ1jTanqLWVuThmZ6XRAc',5),(297,'2025-05-27 16:07:46','2025-05-27 16:07:46','Knives Out','2001-03-12 00:00:00',254,'https://i.scdn.co/image/ab67616d0000b273863e0e305637100311c91aa7','\"Knives Out\" is a song by English alternative rock band Radiohead. The composition features electric and acoustic guitars, complemented by singer Thom Yorke\'s vocals. It appears on Radiohead\'s 2001 album Amnesiac, recorded during the same sessions as the previous album Kid A. It was also released as the second Amnesiac single, receiving more radio airplay than the band\'s other songs of the period. The song reached #13 on the UK singles chart.\n\nYorke has usually described the song as being about \"cannibalism\". <a href=\"http://www.last.fm/music/Radiohead/_/Knives+Out\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=2Lpw3yMCWro\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/521OhfIeThXJKiTyz0m883\";}','knives-out','521OhfIeThXJKiTyz0m883',6),(298,'2025-05-27 16:07:47','2025-05-27 16:07:47','Morning Bell/Amnesiac','2001-03-12 00:00:00',194,'https://i.scdn.co/image/ab67616d0000b273863e0e305637100311c91aa7','“Morning Bell/Amnesiac” is a version of “Morning Bell” off Radiohead’s previous album \"Kid A\".\n\nAlthough most of the lyrics are the same, there are some noticeable differences in some verses, as well as a slower tempo, a chiming xylophone-like instrumentation, and the entire outro being replaced with the refrain.\n\nEd O\'Brien explained the reason for re-releasing the song with a different arrangement:\n\n\"We often record different versions of songs and the new one is the first time it has been strong enough to bear hearing again. <a href=\"http://www.last.fm/music/Radiohead/_/Morning+Bell%2FAmnesiac\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/09rXQjOX61UGL36z76q8OS\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/09rXQjOX61UGL36z76q8OS\";}','morning-bell-amnesiac','09rXQjOX61UGL36z76q8OS',7),(299,'2025-05-27 16:07:58','2025-05-27 16:07:58','Dollars and Cents','2001-03-12 00:00:00',291,'https://i.scdn.co/image/ab67616d0000b273863e0e305637100311c91aa7','The eighth track from Amnesiac, Dollars & Cents, was edited down from an eleven-minute jam inspired by krautrock band Can:\n\n\"That Holger thing of chop-chop-chop, making what seems like drivel into something coherent.\"\n\nColin Greenwood played a record by jazz musician Alice Coltrane over the recording, inspiring his brother Jonny to write a \"Coltrane-style\" string arrangement. Yorke said:\n\n\"The lyrics are gibberish but they come out of ideas I\'ve been fighting with for ages about how people are basically just pixels on a screen <a href=\"http://www.last.fm/music/Radiohead/_/Dollars+and+Cents\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0kSDNLOdJqpGhV2vtVFWmS\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0kSDNLOdJqpGhV2vtVFWmS\";}','dollars-and-cents','0kSDNLOdJqpGhV2vtVFWmS',8),(300,'2025-05-27 16:07:58','2025-05-27 16:07:58','Hunting Bears','2001-03-12 00:00:00',121,'https://i.scdn.co/image/ab67616d0000b273863e0e305637100311c91aa7','“Hunting Bears” is a two-minute instrumental song, the third purely instrumental piece on Radiohead’s catalogue (after “Treefingers” and “Meeting in the Aisle”), and the only one focused on guitars.\n\nThe slide guitar is reminiscent of Ry Cooder’s work and of Neil Young’s \"Dead Man\" soundtrack.\n\nInstead of, as a band would usually do, using a short instrumental piece as a segue into a related piece of music, “Hunting Bears” links <a href=\"http://www.last.fm/music/Radiohead/_/Hunting+Bears\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3LpAIBGaRKXqgDzEV25Bh7\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3LpAIBGaRKXqgDzEV25Bh7\";}','hunting-bears','3LpAIBGaRKXqgDzEV25Bh7',9),(301,'2025-05-27 16:07:59','2025-05-27 16:07:59','Like Spinning Plates','2001-03-12 00:00:00',237,'https://i.scdn.co/image/ab67616d0000b273863e0e305637100311c91aa7','\"Like Spinning Plates\" is a song written by the English band Radiohead that appears on their 2001 album Amnesiac. It also appears on their live album, I Might Be Wrong: Live Recordings.\n\nThe song is built over the reversed backing track of an electronic version of the then unreleased I Will (which would later be released in a much different form on Hail To The Thief). According to Thom Yorke, in an interview with The Wire, \"We\'d turned the tape [of \"I Will\"] around  <a href=\"http://www.last.fm/music/Radiohead/_/Like+Spinning+Plates\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1irS6wtXCUUF5ytfPqOzpM\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1irS6wtXCUUF5ytfPqOzpM\";}','like-spinning-plates','1irS6wtXCUUF5ytfPqOzpM',10),(302,'2025-05-27 16:07:59','2025-05-27 16:07:59','Life In a Glasshouse','2001-03-12 00:00:00',276,'https://i.scdn.co/image/ab67616d0000b273863e0e305637100311c91aa7','\"Life in a Glasshouse\" is a song written by the English alternative rock band Radiohead that appears on their 2001 album Amnesiac. It is performed by lead singer Thom Yorke with the late British trad jazz trumpeter Humphrey Lyttelton and his band.\n\nBeginning with a brief atmospheric loop and clanging church-like bells, the song quickly morphs into a funereal New Orleans jazz style number by a horn section including a clarinet, a trumpet and a trombone. <a href=\"http://www.last.fm/music/Radiohead/_/Life+in+a+Glasshouse\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5xJc58mBWz68WhwU2n5seR\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5xJc58mBWz68WhwU2n5seR\";}','life-in-a-glasshouse','5xJc58mBWz68WhwU2n5seR',11),(303,'2025-05-27 16:08:11','2025-05-27 16:08:11','Everything In Its Right Place','2000-10-02 00:00:00',251,'https://i.scdn.co/image/ab67616d0000b2736c7112082b63beefffe40151','\"Everything in Its Right Place\" was released as the opening track of Radiohead\'s fourth studio album, Kid A (2000). It features synthesiser, digitally manipulated vocals and unusual time signatures. The lyrics were inspired by the stress felt by the singer, Thom Yorke, while promoting the album OK Computer (1997).\n\nYorke wrote \"Everything in Its Right Place\" on piano. Radiohead worked on it in a conventional band arrangement before transferring it to synthesiser, and described it as a breakthrough in the album recording. <a href=\"http://www.last.fm/music/Radiohead/_/Everything+in+Its+Right+Place\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2kRFrWaLWiKq48YYVdGcm8\";}','everything-in-its-right-place','2kRFrWaLWiKq48YYVdGcm8',1),(304,'2025-05-27 16:08:11','2025-05-27 16:08:11','Kid A','2000-10-02 00:00:00',284,'https://i.scdn.co/image/ab67616d0000b2736c7112082b63beefffe40151','\"Kid A” is one of the more challenging songs on Radiohead’s fourth LP. Much like the album’s opener, “Everything in its Right Place”, it is distinguished by a conspicuous lack of guitars and heavily compressed vocals from Yorke.\n\nWhile some of the lyrics make clear references to literature and politics, it is unlikely that Thom intended for the song itself to carry a clear intellectual meaning. The severe distortion applied to the lead vocal track makes understanding the lyrics difficult <a href=\"http://www.last.fm/music/Radiohead/_/Kid+A\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3QDahKSqLwYJYQRbILdzS6\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3QDahKSqLwYJYQRbILdzS6\";}','kid-a','3QDahKSqLwYJYQRbILdzS6',2),(305,'2025-05-27 16:08:23','2025-05-27 16:08:23','The National Anthem','2000-10-02 00:00:00',351,'https://i.scdn.co/image/ab67616d0000b2736c7112082b63beefffe40151','\"The National Anthem\" is a song by the band Radiohead, the third track from the album Kid A. The song is moored to a repetitive bassline, has a processed electronic production, and develops in a direction influenced by jazz.\nIn the album recording, the bass is played by lead singer Thom Yorke, who wrote the riff at age 16. The song is thought to have been previously attempted at recording sessions in 1994 and 1997, but according to Colin Greenwood, the band decided it was \"too good to use it as a b-side for OK Computer singles\". <a href=\"http://www.last.fm/music/Radiohead/_/The+National+Anthem\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4Wgj6jzoI2gYlumXdYAB8U\";}','the-national-anthem','4Wgj6jzoI2gYlumXdYAB8U',3),(306,'2025-05-27 16:08:24','2025-05-27 16:08:24','How to Disappear Completely','2000-10-02 00:00:00',356,'https://i.scdn.co/image/ab67616d0000b2736c7112082b63beefffe40151','\"How to Disappear Completely\" is a song by the English rock band Radiohead from their fourth studio album \"Kid A\". It was produced by the band with their producer, Nigel Godrich. The song is titled after Doug Richmond\'s 1985 book \"How to Disappear Completely and Never Be Found\".\n\nThe band first performed the song in 1998 during the tour. An early soundcheck performance features in the 1998 documentary \"Meeting People Is Easy\".\n\nDuring the \"Kid A\" sessions in 1999 <a href=\"http://www.last.fm/music/Radiohead/_/How+to+Disappear+Completely\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2rtGaCAeYtmcIvuZsvgTf6\";}','how-to-disappear-completely','2rtGaCAeYtmcIvuZsvgTf6',4),(307,'2025-05-27 16:08:35','2025-05-27 16:08:35','Treefingers','2000-10-02 00:00:00',222,'https://i.scdn.co/image/ab67616d0000b2736c7112082b63beefffe40151','\"Treefingers\" will hands down be one of the biggest surprises on Kid A. One may think that Synthesizers were used to make the song, but as Ed pointed out in an interview, it was done all on guitar. Thom recorded Ed playing guitar for about 10 minutes and then cut and paste the recording in his sampler. <a href=\"http://www.last.fm/music/Radiohead/_/Treefingers\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4LrfsgQ5AGouvH3PlxW2PC\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4LrfsgQ5AGouvH3PlxW2PC\";}','treefingers','4LrfsgQ5AGouvH3PlxW2PC',5),(308,'2025-05-27 16:08:35','2025-05-27 16:08:35','Optimistic','2000-10-02 00:00:00',315,'https://i.scdn.co/image/ab67616d0000b2736c7112082b63beefffe40151','\"Optimistic\" is the sixth track on the 2000 album Kid A by the band Radiohead.\nNo singles were released from Kid A, but promos of several songs from the album, including \"Optimistic\", were sent to radio stations. Without an official single specified by the band or label, the guitar-driven \"Optimistic\" became the default track to be picked up by alternative rock stations in the United States and received more airplay than any other track on Kid A. The song hit number 10 on the Billboard modern rock charts <a href=\"http://www.last.fm/music/Radiohead/_/Optimistic\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1FoUsSi9BCTlNt2Vd7V8XA\";}','optimistic','1FoUsSi9BCTlNt2Vd7V8XA',6),(309,'2025-05-27 16:08:36','2025-05-27 16:08:36','In Limbo','2000-10-02 00:00:00',211,'https://i.scdn.co/image/ab67616d0000b2736c7112082b63beefffe40151','A floaty, mesmerising track from \"Kid A\" that makes heavy use of dreamy imagery. Its themes are loneliness, being lost, confusion and water. It was originally titled “Lost at Sea”.\n\nThe theological meaning of limbo is that of a place outside hell and heaven to which unbaptized infants (or in this case, lost people) and the righteous who died before Christ’s coming were traditionally consigned.\n\nThe inspiration here derives from \"Dante’s Inferno\" (a book in which Thom\'s then-partner, Rachel Owen, was a specialist on). <a href=\"http://www.last.fm/music/Radiohead/_/In+Limbo\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0xivCtzVVrdeq32s8EnOO6\";}','in-limbo','0xivCtzVVrdeq32s8EnOO6',7),(310,'2025-05-27 16:08:48','2025-05-27 16:08:48','Idioteque','2000-10-02 00:00:00',309,'https://i.scdn.co/image/ab67616d0000b2736c7112082b63beefffe40151','\"Idioteque\" is the eighth track on Radiohead\'s album, Kid A. Driven by electronic beats, it was seen as a departure for the rock band, but remains a fan favourite, especially at live concerts. Singer Thom Yorke usually dances during the song, and the crowd joins in singing the second verse (\"Ice age coming, ice age coming\"). The song has been played at nearly every concert since 2001.\n\nThe song features a prominent sample from \"Track page: Mild und Leise\" - an experimental computer piece from 1973 by electronic music pioneer Paul Lansky. <a href=\"http://www.last.fm/music/Radiohead/_/Idioteque\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1W5XugQJGhnSATMI5n002M\";}','idioteque','1W5XugQJGhnSATMI5n002M',8),(311,'2025-05-27 16:08:49','2025-05-27 16:08:49','Morning Bell','2000-10-02 00:00:00',275,'https://i.scdn.co/image/ab67616d0000b2736c7112082b63beefffe40151','Thom recently talked about \"Morning Bell\" in an interview:\n\n\"It\'s very, very violent. Extremely violent. The really weird thing about that was I wrote the song with all the words pretty much straight away, which is basically the only one I did that with. I recorded it onto MiniDisc and then there was a lightning storm, and it wiped the MiniDisc and I lost the song. I completely forgot it. Then five months later, I was on a plane, knackered for 24 hours, I was just falling asleep, and I remembered it. <a href=\"http://www.last.fm/music/Radiohead/_/Morning+Bell\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4h37RgtBg9iynN3BIL5lFU\";}','morning-bell','4h37RgtBg9iynN3BIL5lFU',9),(312,'2025-05-27 16:08:59','2025-05-27 16:08:59','Motion Picture Soundtrack','2000-10-02 00:00:00',200,'https://i.scdn.co/image/ab67616d0000b2736c7112082b63beefffe40151','A favorite of Thom\'s, he expected it to appear on OK Computer, but the band decided not to include it. The song has been played on a few occasions on the OK Computer tour, often as a powerful encore with just his voice and an acoustic guitar. \n\nIf the future of funerals has a sound, this is it. In its organ driven glory, Motion Picture Soundtrack is actually one of the more put together songs and optimistic songs on the album, despite the grim lyrical matter. <a href=\"http://www.last.fm/music/Radiohead/_/Motion+Picture+Soundtrack\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4SrRrB27n7fiRkQcPoKfpk\";}','motion-picture-soundtrack','4SrRrB27n7fiRkQcPoKfpk',10),(313,'2025-05-27 16:08:59','2025-05-27 16:08:59','Untitled','2000-10-02 00:00:00',52,'https://i.scdn.co/image/ab67616d0000b2736c7112082b63beefffe40151',NULL,'N;','untitled','4aeCuOowYXJXrMZsVHZbfF',11),(314,'2025-05-27 16:09:01','2025-05-27 16:09:01','Airbag','1997-05-28 00:00:00',287,'https://i.scdn.co/image/ab67616d0000b273c8b444df094279e70d0ed856','When Thom Yorke and his girlfriend got into a car accident in 1987, he developed a fear of cars.. While he was not injured, his girlfriend suffered from whiplash. He later wrote the songs Airbag, Killer Cars, Stupid Car and The Drunkk Machine because of this incident.\n\nOriginally called \"An Airbag Saved My Life\", after a headline that Thom Yorke saw in an AA manual and was immediately drawn to, and also as a tongue-in-cheek tribute to Indeep\'s 1983 disco hit \'Last Night a DJ Saved My Life\'. <a href=\"http://www.last.fm/music/Radiohead/_/Airbag\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7c378mlmubSu7NGkLFa4sN\";}','airbag','7c378mlmubSu7NGkLFa4sN',1),(315,'2025-05-27 16:09:11','2025-05-27 16:09:11','Paranoid Android','1997-05-28 00:00:00',387,'https://i.scdn.co/image/ab67616d0000b273c8b444df094279e70d0ed856','\"Paranoid Android\" is a song by English alternative rock band Radiohead, and was the lead single from the band\'s third album OK Computer. Its release marked the start of Radiohead\'s reputation as art rock innovators, and the album subsequently received huge acclaim. This song has garnered a reputation for being Radiohead\'s greatest work and one of the best rock songs of all time. The song\'s structure, though unique among Radiohead material, was also <a href=\"http://www.last.fm/music/Radiohead/_/Paranoid+Android\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6LgJvl0Xdtc73RJ1mmpotq\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6LgJvl0Xdtc73RJ1mmpotq\";}','paranoid-android','6LgJvl0Xdtc73RJ1mmpotq',2),(316,'2025-05-27 16:09:12','2025-05-27 16:09:12','Subterranean Homesick Alien','1997-05-28 00:00:00',267,'https://i.scdn.co/image/ab67616d0000b273c8b444df094279e70d0ed856','Originally called \"Uptight,\" which is how Jonny referred to it in its early stages, the song pays homage to Bob Dylan\'s \"Subterranean Homesick Blues.\" It deals with alien abduction and stems from two incidents in Thom\'s life. The first occured at Abingdon School, when he was assigned an essay question that went something like this: \"If you were an alien from another planet arriving on Earth, how would you describe what you saw?\" The second incident <a href=\"http://www.last.fm/music/Radiohead/_/Subterranean+Homesick+Alien\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2CVV8PtUYYsux8XOzWkCP0\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2CVV8PtUYYsux8XOzWkCP0\";}','subterranean-homesick-alien','2CVV8PtUYYsux8XOzWkCP0',3),(317,'2025-05-27 16:09:12','2025-05-27 16:09:12','Exit Music (For A Film)','1997-05-28 00:00:00',267,'https://i.scdn.co/image/ab67616d0000b273c8b444df094279e70d0ed856','Radiohead was in the middle of their 1996 tour when they were approached by director Baz Luhrmann to record a song meant for his upcoming film, Romeo + Juliet.\n\nThe band was shown the final thirty minutes of the film and were instantly driven to inspiration. According to Thom Yorke, “When we saw the scene in which Claire Danes holds the Colt .45 against her head, we started working on the song immediately.”\n\nThe result was “Exit Music (For A Film)”, a chillingly gentle song that bursts into a haunting crescendo of emotion. <a href=\"http://www.last.fm/music/Radiohead/_/Exit+Music+(for+a+Film)\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0z1o5L7HJx562xZSATcIpY\";}','exit-music-for-a-film','0z1o5L7HJx562xZSATcIpY',4),(318,'2025-05-27 16:09:13','2025-05-27 16:09:13','Let Down','1997-05-28 00:00:00',299,'https://i.scdn.co/image/ab67616d0000b273c8b444df094279e70d0ed856','\"God just walked through the room... It was an incredibly spiritual moment\", said guitarist Ed O\'Brien in a 2020 Reddit AMA, of the fifth track on Radiohead\'s OK Computer. \"Let Down\" was recorded at 3 a.m. in the ballroom of St Catherine\'s Court, when the band found inspiration. It makes extensive use of the natural reverberation of the location. This song is best known for its third verse, where Thom Yorke duets with himself across the stereo field, accompanied by the sounds of a ZX Spectrum computer. <a href=\"http://www.last.fm/music/Radiohead/_/Let+Down\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2fuYa3Lx06QQJAm0MjztKr\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2fuYa3Lx06QQJAm0MjztKr\";}','let-down','2fuYa3Lx06QQJAm0MjztKr',5),(319,'2025-05-27 16:09:23','2025-05-27 16:09:23','Karma Police','1997-05-28 00:00:00',264,'https://i.scdn.co/image/ab67616d0000b273c8b444df094279e70d0ed856','Karma Police is the second single from Radiohead\'s 1997 album OK Computer. It is Radiohead\'s most successful song worldwide, apart from Creep. The song is perhaps best recognized for its piano riff, and for its dark bass line.\n\nKarma Police, like several other songs that would make up OK Computer, was debuted live in 1996, when the band briefly supported Alanis Morissette on an American tour. A live version of Karma Police, performed with a Rhodes piano on The Late Show with David Letterman <a href=\"http://www.last.fm/music/Radiohead/_/Karma+Police\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=1uYWYWPc9HU\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/63OQupATfueTdZMWTxW03A\";}','karma-police','63OQupATfueTdZMWTxW03A',6),(320,'2025-05-27 16:09:24','2025-05-27 16:09:24','Fitter Happier','1997-05-28 00:00:00',117,'https://i.scdn.co/image/ab67616d0000b273c8b444df094279e70d0ed856','Many people mistook the computerized voice on this track for that of physicist Stephen Hawking. The strange voice was, in fact, created by Thom on his Mac computer. He recorded it one night in an isolated area of the rehearsal space that the band had set up. Ed: \"Thom basically had this checklist, like a nineties checklist if you like, and he had written it out. There is a bit of him playing piano, [which was] in the rehearsal room. He was very drunk one night <a href=\"http://www.last.fm/music/Radiohead/_/Fitter+Happier\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6wnmRxEbwUK7WLyUtiRuT7\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6wnmRxEbwUK7WLyUtiRuT7\";}','fitter-happier','6wnmRxEbwUK7WLyUtiRuT7',7),(321,'2025-05-27 16:09:25','2025-05-27 16:09:25','Electioneering','1997-05-28 00:00:00',230,'https://i.scdn.co/image/ab67616d0000b273c8b444df094279e70d0ed856','Written on tour this song is invisioned as a politician shouting down a microphone. The song was inspired by the poll tax riots and is very critical (as with most Radiohead work) of a capitalist society.\n\nThe mentioned I.M.F. is a banking trust. \n\n <a href=\"http://www.last.fm/music/Radiohead/_/Electioneering\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0gTRROuntlrPQ64W3J2Etv\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0gTRROuntlrPQ64W3J2Etv\";}','electioneering','0gTRROuntlrPQ64W3J2Etv',8),(322,'2025-05-27 16:09:35','2025-05-27 16:09:35','Climbing Up the Walls','1997-05-28 00:00:00',285,'https://i.scdn.co/image/ab67616d0000b273c8b444df094279e70d0ed856','Sung from the perspective of paranoid fear itself, “Climbing Up the Walls” takes the English idiomatic expression for utter unpleasant feelings, such as worry and doubt giving the expression a voice.\n\n“Climbing Up the Walls” Is one of the first tracks by the band to be described as “scary.” Relying heavily on strings, but not in a conventional way, as the string section, composed by Jonny Greenwood alone, features 16 different violins playing quarter tones apart from one another. <a href=\"http://www.last.fm/music/Radiohead/_/Climbing+Up+the+Walls\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2PDQReEXBViVwkrbQ34vd7\";}','climbing-up-the-walls','2PDQReEXBViVwkrbQ34vd7',9),(323,'2025-05-27 16:09:36','2025-05-27 16:09:36','No Surprises','1997-05-28 00:00:00',229,'https://i.scdn.co/image/ab67616d0000b273c8b444df094279e70d0ed856','\"No Surprises\" is a song by the British alternative rock band Radiohead. It was released as the third and final single from the group\'s 1997 album \"OK Computer\". Accompanied by a music video that featured a single shot of singer Thom Yorke\'s head in a plastic bubble that filled with water, the single peaked at number four in the United Kingdom.\n\nRadiohead wrote \"No Surprises\" while touring with the band R.E.M. in 1995. \"No Surprises\" was the first song Radiohead recorded on the first day of recording sessions for OK Computer. <a href=\"http://www.last.fm/music/Radiohead/_/No+Surprises\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/10nyNJ6zNy2YVYLrcwLccB\";}','no-surprises','10nyNJ6zNy2YVYLrcwLccB',10),(324,'2025-05-27 16:09:37','2025-05-27 16:09:37','Lucky','1997-05-28 00:00:00',258,'https://i.scdn.co/image/ab67616d0000b273c8b444df094279e70d0ed856','\"Lucky\" is a song by the English rock band Radiohead, first released on The Help Album, a 1995 charity compilation organised by the charity War Child. \"Lucky\" was recorded in five hours with the producer Nigel Godrich. Radiohead included it on their third studio album, OK Computer, and released it as a single in France in December 1997.\n\nFrom Ed\'s sweet, tingling, opening riff, the rest of \"Lucky\" was generated. \"I remember fiddling around in the sound check,\" he says. <a href=\"http://www.last.fm/music/Radiohead/_/Lucky\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/14xj58ZexBaEaHARb11Cqs\";}','lucky','14xj58ZexBaEaHARb11Cqs',11),(325,'2025-05-27 16:09:48','2025-05-27 16:09:48','The Tourist','1997-05-28 00:00:00',326,'https://i.scdn.co/image/ab67616d0000b273c8b444df094279e70d0ed856','\"The Tourist\" was written by Jonny, who, explains Thom, was \"in a beautiful square in France on a sunny day, and watching all these American tourists being wheeled around, frantically trying to see everything in 10 minutes.\" Jonny was shocked at how these people could be in a place so beautiful and so special and not realize it because they weren\'t taking the time to just stop and look around. \n\nJonny : \"Thom didn\'t play a thing, he just listened. It\'s quite nervy, with a lot of space. It sounds like the last song on an album.\" <a href=\"http://www.last.fm/music/Radiohead/_/The+Tourist\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1UuaWKypSkIHxFZD03zw4m\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1UuaWKypSkIHxFZD03zw4m\";}','the-tourist','1UuaWKypSkIHxFZD03zw4m',12),(326,'2025-05-27 16:09:49','2025-05-27 16:09:49','Planet Telex','1995-03-13 00:00:00',259,'https://i.scdn.co/image/ab67616d0000b2739293c743fa542094336c5e12','\"Planet Xerox\" was this song\'s original title, but because Xerox was a copyrighted name, Radiohead changed it to \"Planet Telex.\" The only song written in the studio during the Bends sessions, it was recorded one night when the band returned to the studio after drinking a lot of wine. Thom did the vocals lying down, completely drunk. This is the most frequently remixed song in Radiohead\'s roster. <a href=\"http://www.last.fm/music/Radiohead/_/Planet+Telex\">Read more on Last.fm</a>.','a:4:{s:14:\"free streaming\";s:38:\"https://www.deezer.com/track/138544257\";s:21:\"purchase for download\";s:51:\"https://www.beatport.com/track/planet-telex/8734187\";s:9:\"streaming\";s:32:\"https://tidal.com/track/58990498\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/37JISltgxizbDAyNEEqkTY\";}','planet-telex','37JISltgxizbDAyNEEqkTY',1),(327,'2025-05-27 16:09:49','2025-05-27 16:09:49','The Bends','1995-03-13 00:00:00',246,'https://i.scdn.co/image/ab67616d0000b2739293c743fa542094336c5e12','This track was intially introduced as being about \"knowing who your real friends are and when they\'re going to come to your gigs.\" Thom soon simplified this to \"knowing who your friends are.\" The song reflects Radiohead sense of humor; it contains many ridiculous lines about the CIA and the Marines. \n\nOf the opening, Thom says, \"The sound at the beginning comes from this caterwauling mayhem outside this hotel in the States. There was this guy training these eight-year-old kids <a href=\"http://www.last.fm/music/Radiohead/_/The+Bends\">Read more on Last.fm</a>.','a:4:{s:14:\"free streaming\";s:38:\"https://www.deezer.com/track/138544259\";s:21:\"purchase for download\";s:48:\"https://www.beatport.com/track/the-bends/8734190\";s:9:\"streaming\";s:32:\"https://tidal.com/track/58990499\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7oDFvnqXkXuiZa1sACXobj\";}','the-bends','7oDFvnqXkXuiZa1sACXobj',2),(328,'2025-05-27 16:10:00','2025-05-27 16:10:00','High and Dry','1995-03-13 00:00:00',257,'https://i.scdn.co/image/ab67616d0000b2739293c743fa542094336c5e12','\"High and Dry\" is a song by the English alternative rock band Radiohead, and was the first single released from their second album \"The Bends\". It was as a double A-side with album opener \"Planet Telex\". \"High and Dry\" was released in the UK on 5 March 1995 and remains one of the band\'s most popular radio hits, despite reaching only #17 upon release.\n\n\"High and Dry\" was recorded during the \"Pablo Honey\" sessions but was dismissed by the band, who thought that it sounded like a Rod Stewart song. <a href=\"http://www.last.fm/music/Radiohead/_/High+and+Dry\">Read more on Last.fm</a>.','a:4:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=7qFfFVSerQo\";s:21:\"purchase for download\";s:51:\"https://www.beatport.com/track/high-and-dry/8734192\";s:9:\"streaming\";s:32:\"https://tidal.com/track/58990500\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2a1iMaoWQ5MnvLFBDv4qkf\";}','high-and-dry','2a1iMaoWQ5MnvLFBDv4qkf',3),(329,'2025-05-27 16:10:00','2025-05-27 16:10:00','Fake Plastic Trees','1995-03-13 00:00:00',290,'https://i.scdn.co/image/ab67616d0000b2739293c743fa542094336c5e12','\"Fake Plastic Trees\" is a song by the English alternative rock band Radiohead from their second studio album The Bends released in 1995. It was the third single to be released from that album in the UK, but in the US it was the band\'s first single from the album.\n\nAccording to band singer Thom Yorke, the song was recorded as the band had just been to see Jeff Buckley play a set at The Garage in London; when they got back into the studio, Yorke recorded the vocals in one take and broke down in tears at the end.  <a href=\"http://www.last.fm/music/Radiohead/_/Fake+Plastic+Trees\">Read more on Last.fm</a>.','a:4:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=n5h0qHwNrHk\";s:21:\"purchase for download\";s:57:\"https://www.beatport.com/track/fake-plastic-trees/8734194\";s:9:\"streaming\";s:32:\"https://tidal.com/track/58990501\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/73CKjW3vsUXRpy3NnX4H7F\";}','fake-plastic-trees','73CKjW3vsUXRpy3NnX4H7F',4),(330,'2025-05-27 16:10:01','2025-05-27 16:10:01','Bones','1995-03-13 00:00:00',189,'https://i.scdn.co/image/ab67616d0000b2739293c743fa542094336c5e12','Yet another song (like \"My Iron Lung\") that reflects Thom\'s obsession with poor health, this is perhaps a product of the physical tribulations of touring. The song looks at Thom\'s fear of growing old and becoming physically incapacitated. Thom: \"We recorded this about four times before we got it right. The original had the ending going on for about a minute and a half, which was something Jonny got from The Fall.\" <a href=\"http://www.last.fm/music/Radiohead/_/Bones\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/76RAlQcfuQknnQFruYDj6Q\";}','bones','76RAlQcfuQknnQFruYDj6Q',5),(331,'2025-05-27 16:10:02','2025-05-27 16:10:02','(Nice Dream)','1995-03-13 00:00:00',233,'https://i.scdn.co/image/ab67616d0000b2739293c743fa542094336c5e12','This song revels in a happy-life fantasy, but concludes that it can be nothing more than a \"nice dream.\" Heard at the end of the track are selections from an Arctic-sounds tape of John Leckie\'s. The demo version, available on the compilation Volume 13, is mainly an acoustic number featuring organ and strings. \n\nThom: \"We all debuted playing acoustic guitar on this in a sort of cosmic Kumbaya outside the studio. There\'s this awful photograph of us all sitting on a lawn with headphones on. <a href=\"http://www.last.fm/music/Radiohead/_/(Nice+Dream)\">Read more on Last.fm</a>.','a:4:{s:14:\"free streaming\";s:38:\"https://www.deezer.com/track/138544267\";s:21:\"purchase for download\";s:49:\"https://www.beatport.com/track/nice-dream/8734197\";s:9:\"streaming\";s:32:\"https://tidal.com/track/58990503\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1tZcw7GtIqviL32bzaKdSo\";}','nice-dream','1tZcw7GtIqviL32bzaKdSo',6),(332,'2025-05-27 16:10:13','2025-05-27 16:10:13','Just','1995-03-13 00:00:00',234,'https://i.scdn.co/image/ab67616d0000b2739293c743fa542094336c5e12','\"Just\" is a single by the English rock band Radiohead, released in 1995. It is the seventh track on their 1995 album The Bends. Radiohead frontman Thom Yorke wrote the song about a narcissistic friend of his, which on closer inspection is showcased by the imagery in the lyrics - a parallel to earlier My Iron Lung EP track \"Lewis [Mistreated]\". He also says that it was somewhat of a competition between him and Jonny Greenwood to see who could fit the most chords into a song. <a href=\"http://www.last.fm/music/Radiohead/_/Just\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1dyTcli07c77mtQK3ahUZR\";}','just','1dyTcli07c77mtQK3ahUZR',7),(333,'2025-05-27 16:10:14','2025-05-27 16:10:14','My Iron Lung','1995-03-13 00:00:00',276,'https://i.scdn.co/image/ab67616d0000b2739293c743fa542094336c5e12','My Iron Lung is a 1994 EP, including the song of the same name, by the alternative rock band Radiohead. The title track more famously appeared later on the band\'s 1995 album, The Bends. The EP also contains outtakes from then-ongoing recording sessions for The Bends, compiling songs that were issued as B-sides on two separate \"My Iron Lung\" CD singles in the UK and other markets. My Iron Lung was originally released in EP form with all eight songs only in Australia, but it is currently in print worldwide. <a href=\"http://www.last.fm/music/Radiohead/_/My+Iron+Lung\">Read more on Last.fm</a>.','a:4:{s:14:\"free streaming\";s:38:\"https://www.deezer.com/track/138544271\";s:21:\"purchase for download\";s:51:\"https://www.beatport.com/track/my-iron-lung/8734199\";s:9:\"streaming\";s:32:\"https://tidal.com/track/58990505\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0jyikFM0Umv0KlnrOEKtTG\";}','my-iron-lung','0jyikFM0Umv0KlnrOEKtTG',8),(334,'2025-05-27 16:10:14','2025-05-27 16:10:14','Bullet Proof ... I Wish I Was','1995-03-13 00:00:00',208,'https://i.scdn.co/image/ab67616d0000b2739293c743fa542094336c5e12',NULL,'N;','bullet-proof-i-wish-i-was','5XuU9htN358NTMCcqRvfDV',9),(335,'2025-05-27 16:10:24','2025-05-27 16:10:24','Black Star','1995-03-13 00:00:00',247,'https://i.scdn.co/image/ab67616d0000b2739293c743fa542094336c5e12','For Thom, this song is special. Although he has never offered an explanation of it, throughout 1995-96, when the band played it live, he did introduce it in various ways - declaring, for instance, that the song is about \"Sex in the morning. Which is the best time to have it. As long as you\'ve cleaned your teeth beforehand\". The lyrics probe the destruction of a relationship and touch on sex with a third party. <a href=\"http://www.last.fm/music/Radiohead/_/Black+Star\">Read more on Last.fm</a>.','a:4:{s:14:\"free streaming\";s:38:\"https://www.deezer.com/track/138544275\";s:21:\"purchase for download\";s:49:\"https://www.beatport.com/track/black-star/8734201\";s:9:\"streaming\";s:32:\"https://tidal.com/track/58990507\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6UO72VSXEONxdfLyABihs9\";}','black-star','6UO72VSXEONxdfLyABihs9',10),(336,'2025-05-27 16:10:25','2025-05-27 16:10:25','Sulk','1995-03-13 00:00:00',222,'https://i.scdn.co/image/ab67616d0000b2739293c743fa542094336c5e12','One of Thom\'s earliest creations, this song was inspired by a ruthless and unexplained killing spree conducted by a lone gunman in Hungerford, England, in 1987. Although its original concluding lyrics were \"just shoot your gun,\" these were changed when the song was recorded in late 1994. This was because the death of Kurt Cobain was still weighing heavily on people\'s minds while the Hungerford killings were not; Thom chose to change the lyrics so that no one would think the song was about the late NIrvana leader. <a href=\"http://www.last.fm/music/Radiohead/_/Sulk\">Read more on Last.fm</a>.','a:4:{s:14:\"free streaming\";s:38:\"https://www.deezer.com/track/138544277\";s:21:\"purchase for download\";s:43:\"https://www.beatport.com/track/sulk/8734202\";s:9:\"streaming\";s:32:\"https://tidal.com/track/58990508\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1elQc2QcyuBkI8FUIbNvcy\";}','sulk','1elQc2QcyuBkI8FUIbNvcy',11),(337,'2025-05-27 16:10:26','2025-05-27 16:10:26','Street Spirit (Fade Out)','1995-03-13 00:00:00',253,'https://i.scdn.co/image/ab67616d0000b2739293c743fa542094336c5e12','One of Radiohead\'s most successful singles, and a fan favourite. \"Street Spirit\" was released as the band\'s ninth single and reached number five on the UK Singles Chart, the highest chart position until Paranoid Android from OK Computer, which reached number three in 1997.\n\nThom Yorke has described completing the song as a cathartic moment, stating that he and the band were \"bashing their heads against the wall for days and not getting anywhere\" until they were finally able to capture it. <a href=\"http://www.last.fm/music/Radiohead/_/Street+Spirit+(Fade+Out)\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2QwObYJWyJTiozvs0RI7CF\";}','street-spirit-fade-out','2QwObYJWyJTiozvs0RI7CF',12),(338,'2025-05-27 16:10:27','2025-05-27 16:10:27','You','1993-02-22 00:00:00',208,'https://i.scdn.co/image/ab67616d0000b273ec548c00d3ac2f10be73366d','\"You\" is a song by Radiohead from their debut album \"Pablo Honey. A love song of an obsessive nature that first appeared on the Manic Hedgehog demo. This version was included on the Drill EP. For Pablo Honey, the song was rerecorded and some of the lyrics changed. The song greatly showcases Thom Yorke\'s tenor voice with him belting C5 during the guitar solo. Performed live, the song is an excellent showcase for Thom\'s incredible vocal abilities; he holds one note throughout the guitar solo. <a href=\"http://www.last.fm/music/Radiohead/_/You\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5KZ0qobWEFl892YjIC02SE\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5KZ0qobWEFl892YjIC02SE\";}','you','5KZ0qobWEFl892YjIC02SE',1),(339,'2025-05-27 16:10:38','2025-05-27 16:10:38','Creep','1993-02-22 00:00:00',238,'https://i.scdn.co/image/ab67616d0000b273ec548c00d3ac2f10be73366d','\"Creep\" is the first single released by the English alternative rock band Radiohead, and is a track on their debut album Pablo Honey. It was written by the band\'s singer, Thom Yorke, and released in the United Kingdom initially in September 1992. When it was first given limited release, however, Radio 1 found it \"too depressing\", and removed it from their playlist after airing it only twice. However, it subsequently became one of the band\'s biggest hits <a href=\"http://www.last.fm/music/Radiohead/_/Creep\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/70LcF31zb1H0PyJoS1Sx1r\";}','creep','70LcF31zb1H0PyJoS1Sx1r',2),(340,'2025-05-27 16:10:39','2025-05-27 16:10:39','How Do You?','1993-02-22 00:00:00',132,'https://i.scdn.co/image/ab67616d0000b273ec548c00d3ac2f10be73366d','This track from \"Pablo Honey\" differs from the others; whereas most of the album falls under alternative rock and post-grunge, this track is very grunge styling, and Thom’s voice is exaggerated to fit this description. Upon the album’s release, critics hated on this song. As critics over at NME put it, the track “breaks the momentum of Pablo Honey horribly, throwing all of Radiohead’s tortured sensitivity out of the window and leaving them sounding like beer-gutted losers from the class of ‘76”. <a href=\"http://www.last.fm/music/Radiohead/_/How+Do+You%3F\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5qsgK2wcodYCEbgbdCpYOG\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5qsgK2wcodYCEbgbdCpYOG\";}','how-do-you','5qsgK2wcodYCEbgbdCpYOG',3),(341,'2025-05-27 16:10:39','2025-05-27 16:10:39','Stop Whispering','1993-02-22 00:00:00',325,'https://i.scdn.co/image/ab67616d0000b273ec548c00d3ac2f10be73366d','\"Stop Whispering\" is a song by Radiohead, released as the band\'s fourth single. It is the fourth track off their first album \"Pablo Honey\". The song was written as a tribute to the Pixies, a band that had an important influence over Radiohead at the time. The version released in the United States was remixed by Chris Sheldon and featured strings and a slower tempo.\n\n\"Stop Whispering\" is also one of Radiohead\'s oldest songs; it was created when the band was still known as \"On A Friday\", originally being on Dungeon Demo. <a href=\"http://www.last.fm/music/Radiohead/_/Stop+Whispering\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3CbAW3GjkBKfErt4LLbSzr\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3CbAW3GjkBKfErt4LLbSzr\";}','stop-whispering','3CbAW3GjkBKfErt4LLbSzr',4),(342,'2025-05-27 16:10:50','2025-05-27 16:10:50','Thinking About You','1993-02-22 00:00:00',161,'https://i.scdn.co/image/ab67616d0000b273ec548c00d3ac2f10be73366d','Intially part of the Manic Hedgehog demo, this touching love song focuses on the experience of being left behind by someone who has achieved fame. It exposes Thom\'s ability to offer very different but realistic perspectives on issues. In its original form, the tune was very heavily guitar-oriented with a much faster tempo than the acoustic version found on Pablo Honey. This rocking version also appears on the Drill EP and Itch. <a href=\"http://www.last.fm/music/Radiohead/_/Thinking+About+You\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/46tfxn5lP7Qsbz7NHsj9iu\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/46tfxn5lP7Qsbz7NHsj9iu\";}','thinking-about-you','46tfxn5lP7Qsbz7NHsj9iu',5),(343,'2025-05-27 16:10:50','2025-05-27 16:10:50','Anyone Can Play Guitar','1993-02-22 00:00:00',217,'https://i.scdn.co/image/ab67616d0000b273ec548c00d3ac2f10be73366d','\"Anyone Can Play Guitar\" was a single taken from Radiohead\'s first album Pablo Honey, released just in advance of the album. It was the band\'s second single, and their first to receive a wide hearing (\"Creep\" had been issued in limited quantities some months earlier, and had failed to chart, but would soon become a hit and ultimately be re-released later in 1993). \"Anyone Can Play Guitar\" made relatively little impression on the charts, but it remained a staple of the band\'s live sets throughout the early-mid nineties. <a href=\"http://www.last.fm/music/Radiohead/_/Anyone+Can+Play+Guitar\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/23oUaizFBFVFI5PxJrkiO5\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/23oUaizFBFVFI5PxJrkiO5\";}','anyone-can-play-guitar','23oUaizFBFVFI5PxJrkiO5',6),(344,'2025-05-27 16:10:51','2025-05-27 16:10:51','Ripcord','1993-02-22 00:00:00',189,'https://i.scdn.co/image/ab67616d0000b273ec548c00d3ac2f10be73366d','This lyrically intelligent look at the music world is about \"signing [to a label], having lots of money and absolutely no idea what the fuck to do with your life\" - so said Thom at the band\'s 1993 Gothenburg, Sweden, show. Thom\'s skill with metaphors is evident as he explores the control a record company wields over it\'s artists. The song was a live favorite throughout the early part of the band\'s career but was dropped from their set list around mid-1995. <a href=\"http://www.last.fm/music/Radiohead/_/Ripcord\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2wOvYLilnDJfuPXGHGFAWZ\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2wOvYLilnDJfuPXGHGFAWZ\";}','ripcord','2wOvYLilnDJfuPXGHGFAWZ',7),(345,'2025-05-27 16:10:52','2025-05-27 16:10:52','Vegetable','1993-02-22 00:00:00',192,'https://i.scdn.co/image/ab67616d0000b273ec548c00d3ac2f10be73366d','This song has never been explained by the band, but likely deals with personal problems Thom had with friends when Radiohead was signed. It ponders the reactions of his pals to his newfound success. \"Vegetable\" was a live favorite, though it exited set lists around the summer of 1995.\n  <a href=\"http://www.last.fm/music/Radiohead/_/Vegetable\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6HbWoyinLdXPZmk6xONuKw\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6HbWoyinLdXPZmk6xONuKw\";}','vegetable','6HbWoyinLdXPZmk6xONuKw',8),(346,'2025-05-27 16:11:03','2025-05-27 16:11:03','Prove Yourself','1993-02-22 00:00:00',145,'https://i.scdn.co/image/ab67616d0000b273ec548c00d3ac2f10be73366d','Radiohead\'s first proper \'single\', leading off the Drill EP. One of the most regularly played songs during the touring for Pablo Honey. It was apparently written about Oxford. <a href=\"http://www.last.fm/music/Radiohead/_/Prove+Yourself\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0GDuL9TCO41PgsrKWBSGlm\";}','prove-yourself','0GDuL9TCO41PgsrKWBSGlm',9),(347,'2025-05-27 16:11:03','2025-05-27 16:11:03','I Can\'t','1993-02-22 00:00:00',253,'https://i.scdn.co/image/ab67616d0000b273ec548c00d3ac2f10be73366d',NULL,'N;','i-can-t','13nQ70PnhDnTkYqCmdg3sy',10),(348,'2025-05-27 16:11:03','2025-05-27 16:11:03','Lurgee','1993-02-22 00:00:00',187,'https://i.scdn.co/image/ab67616d0000b273ec548c00d3ac2f10be73366d','In this song about lost love, Thom sings that he is much better off without the other person in his life. \"Lurgee,\" unlike most other songs from this period, found its way into the band\'s live set in 1998. One of two songs recorded with Chris Hufford at Courtyard Studios, it was selected for inclusion on Pablo Honey. The same version was used as a B-side for \"Creep.\" \n\nIt\'s pronounced \'L-er-gh-ee\', and is an English slang name for a nasty infectious disease.\n <a href=\"http://www.last.fm/music/Radiohead/_/Lurgee\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/30C1FoJzEhNUILsxghioGz\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/30C1FoJzEhNUILsxghioGz\";}','lurgee','30C1FoJzEhNUILsxghioGz',11),(349,'2025-05-27 16:11:14','2025-05-27 16:11:14','Blow Out','1993-02-22 00:00:00',282,'https://i.scdn.co/image/ab67616d0000b273ec548c00d3ac2f10be73366d','Jonny\'s favorite Pablo Honey track and the band’s closing song of choice for many of the early shows, \"Blow Out\" is one of Thom\'s more personal songs about low self-esteem. On the reissue of the Creep EP, a remix of this track appears as a B-side. <a href=\"http://www.last.fm/music/Radiohead/_/Blow+Out\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5XpcTQlNnfIQbiWE4hvYo7\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5XpcTQlNnfIQbiWE4hvYo7\";}','blow-out','5XpcTQlNnfIQbiWE4hvYo7',12),(350,'2025-05-27 16:35:37','2025-05-27 16:35:37','Angel - Remastered 2019',