fy.com/track/4LImc8oAk3fo7wugjJqV87\";}','small-time-shot-away','4LImc8oAk3fo7wugjJqV87',7),(413,'2025-05-27 16:36:40','2025-05-27 16:36:40','Name Taken','2003-02-10 00:00:00',469,'https://i.scdn.co/image/ab67616d0000b273a6ca9857d2c0368e756e833f','Name Taken first appeared on Massive Attack\'s album 100th Window (released in February 2003). Vocals: Horace Andy. Written by Robert Del Naja and Neil Davidge. <a href=\"http://www.last.fm/music/Massive+Attack/_/Name+Taken\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0YBNkK5AGE3fvIjr7Ctj1I\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0YBNkK5AGE3fvIjr7Ctj1I\";}','name-taken','0YBNkK5AGE3fvIjr7Ctj1I',8),(414,'2025-05-27 16:36:40','2025-05-27 16:36:40','Antistar - Includes Hidden Track \'LP4\'','2003-02-10 00:00:00',1180,'https://i.scdn.co/image/ab67616d0000b273a6ca9857d2c0368e756e833f',NULL,'N;','antistar-includes-hidden-track-lp4','5nlM8Z2ZvVJtP7GjOdsIZh',9),(415,'2025-05-27 16:36:41','2025-05-27 16:36:41','Angel','1998-01-01 00:00:00',379,'https://i.scdn.co/image/ab67616d0000b2732fcb0a3c7a66e516b11cd26e','Angel, the first track on the album Mezzanine is a highly emotional trip-hop tune featuring Horace Andy\'s vocals. The song evokes dark and sinister cries from the slow and repetitive percussion and then strikes a distressed melody with an electric guitar drowning through the sonic atmosphere of the piece. \n\nThe song has been featured in the movies \"Snatch\" (2000), \"Flight of the Phoenix\" (2004) and several others as well as TV series such as \"The West Wing\", \"Person of Interest\" and \"Smallville.\"  <a href=\"http://www.last.fm/music/Massive+Attack/_/Angel\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=hbe3CQamF8k\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7uv632EkfwYhXoqf8rhYrg\";}','angel','7uv632EkfwYhXoqf8rhYrg',1),(416,'2025-05-27 16:36:52','2025-05-27 16:36:52','Risingson','1998-01-01 00:00:00',298,'https://i.scdn.co/image/ab67616d0000b2732fcb0a3c7a66e516b11cd26e','\"Risingson\" is a song by the English trip-hop group Massive Attack, released as a single on 7 July 1997 by Virgin Records. It is the first single from their third album, Mezzanine, and the eighth single overall. The single contains a sample of \"I Found a Reason\", a song by The Velvet Underground.\n\nReception for the song was positive. John Bush of AllMusic described the song as \"a dense, dark feature for Massive Attack themselves (on production as well as vocals), with a kitchen sink\'s worth of dubby effects and reverb. <a href=\"http://www.last.fm/music/Massive+Attack/_/Risingson\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=85E9Q5Wx210\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6ggJ6MceyHGWtUg1KLp3M1\";}','risingson','6ggJ6MceyHGWtUg1KLp3M1',2),(417,'2025-05-27 16:36:52','2025-05-27 16:36:52','Teardrop','1998-01-01 00:00:00',330,'https://i.scdn.co/image/ab67616d0000b2732fcb0a3c7a66e516b11cd26e','\"Teardrop\" is the second single from Massive Attack\'s third studio album, Mezzanine. Vocals are performed by Elizabeth Fraser, former lead singer of Cocteau Twins, who also wrote the lyrics.\n\nA harpsichord-driven track, \"Teardrop\" was originally set to feature vocals from Madonna, whom Massive Attack turned down in favour of Fraser. <a href=\"http://www.last.fm/music/Massive+Attack/_/Teardrop\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=u7K72X4eo_s\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/67Hna13dNDkZvBpTXRIaOJ\";}','teardrop','67Hna13dNDkZvBpTXRIaOJ',3),(418,'2025-05-27 16:36:53','2025-05-27 16:36:53','Inertia Creeps','1998-01-01 00:00:00',357,'https://i.scdn.co/image/ab67616d0000b2732fcb0a3c7a66e516b11cd26e','\"Inertia Creeps\" is a song by English electronic music band Massive Attack, released on 19 October 1998. It was the fourth and final single released from their third album, Mezzanine. Although it was the least commercially successful of the four singles released from Mezzanine, charting only at No. 16 on the New Zealand Singles Chart, it has been noted as one of the best singles from the album.\n\nThe song describes a relationship that Robert del Naja had, which at the time had just ended: <a href=\"http://www.last.fm/music/Massive+Attack/_/Inertia+Creeps\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=w3mn7EC-skg\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3N2UhXZI4Gf64Ku3cCjz2g\";}','inertia-creeps','3N2UhXZI4Gf64Ku3cCjz2g',4),(419,'2025-05-27 16:36:53','2025-05-27 16:36:53','Exchange','1998-01-01 00:00:00',251,'https://i.scdn.co/image/ab67616d0000b2732fcb0a3c7a66e516b11cd26e','There are two versions of this song: “Exchange”, which is instrumental, and “(Exchange)”, which has vocals by Horace Andy.\n\n“Exchange” is perhaps the song that most obviously references Mushroom’s talents and involvement more than any other track on Mezzanine. The Isaac Hayes sample in which the song is heavily based, was once a popular choice for Mushroom to play as part of his DJ sets in the latter days of The Wild Bunch. When it came time however to get copyright clearance for the use of the sample for Exchange <a href=\"http://www.last.fm/music/Massive+Attack/_/Exchange\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2HuMQkNVpFIsur2cRWWQmX\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2HuMQkNVpFIsur2cRWWQmX\";}','exchange','2HuMQkNVpFIsur2cRWWQmX',5),(420,'2025-05-27 16:37:04','2025-05-27 16:37:04','Dissolved Girl','1998-01-01 00:00:00',366,'https://i.scdn.co/image/ab67616d0000b2732fcb0a3c7a66e516b11cd26e','Vocals by Sarah Jay Hawley.  The song was included in The Matrix, but was not included in the movie\'s soundtrack. A slightly reworked version was featured during the closing credits of The 