 Pappadopoulis encounters everything that makes the sixties the 60s. <a href=\"http://www.last.fm/music/The+Doors/_/Been+Down+So+Long\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1E7qCptwRPfvZrIDyDDgjh\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1E7qCptwRPfvZrIDyDDgjh\";}','been-down-so-long','1E7qCptwRPfvZrIDyDDgjh',3),(774,'2025-05-27 16:43:58','2025-05-27 16:43:58','Cars Hiss by My Window','1971-04-19 00:00:00',249,'https://i.scdn.co/image/ab67616d0000b2733992c7ab57975935b29fa22b',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2Sjez1CwJv8Pz018CxKjWa\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2Sjez1CwJv8Pz018CxKjWa\";}','cars-hiss-by-my-window','2Sjez1CwJv8Pz018CxKjWa',4),(775,'2025-05-27 16:43:59','2025-05-27 16:43:59','L.A. Woman','1971-04-19 00:00:00',471,'https://i.scdn.co/image/ab67616d0000b2733992c7ab57975935b29fa22b','According to the L.A. Woman Songfacts, Morrison recorded his vocals in the studio bathroom to get a fuller sound. He spent a lot of time in there anyway because of all the beer he drank during the sessions. <a href=\"http://www.last.fm/music/The+Doors/_/L.A.+Woman\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6DmfWj5kOa1fX8AwN9byOn\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6DmfWj5kOa1fX8AwN9byOn\";}','l-a-woman','6DmfWj5kOa1fX8AwN9byOn',5),(776,'2025-05-27 16:43:59','2025-05-27 16:43:59','L\'America','1971-04-19 00:00:00',274,'https://i.scdn.co/image/ab67616d0000b2733992c7ab57975935b29fa22b',NULL,'N;','l-america','4RE79d7ACKfTPC7qE65xpi',6),(777,'2025-05-27 16:44:10','2025-05-27 16:44:10','Hyacinth House','1971-04-19 00:00:00',190,'https://i.scdn.co/image/ab67616d0000b2733992c7ab57975935b29fa22b','\"Hyacinth House\" is a song by The Doors, featured on the album L.A. Woman. <a href=\"http://www.last.fm/music/The+Doors/_/Hyacinth+House\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4nKmlUaUiUN4rpMGYnUPAu\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4nKmlUaUiUN4rpMGYnUPAu\";}','hyacinth-house','4nKmlUaUiUN4rpMGYnUPAu',7),(778,'2025-05-27 16:44:10','2025-05-27 16:44:10','Crawling King Snake','1971-04-19 00:00:00',298,'https://i.scdn.co/image/ab67616d0000b2733992c7ab57975935b29fa22b',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/14qbY7LbhcXwECCGqH2z7U\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/14qbY7LbhcXwECCGqH2z7U\";}','crawling-king-snake','14qbY7LbhcXwECCGqH2z7U',8),(779,'2025-05-27 16:44:11','2025-05-27 16:44:11','The WASP (Texas Radio and the Big Beat)','1971-04-19 00:00:00',253,'https://i.scdn.co/image/ab67616d0000b2733992c7ab57975935b29fa22b','\"The WASP (Texas Radio and the Big Beat)\" is a 1971 song by The Doors, which appears on L.A. Woman, their final album with frontman Jim Morrison. The music was written by Ray Manzarek, Robby Krieger and John Densmore. The spoken word lyrics, written by Morrison, come from a poem he wrote in 1968, three years before the music was written.\n\nTexas Radio refers to high power Mexican border blaster radio stations that blasted Texas in the 1950s. Not restricted by American regulations, said stations could have up to 250 kilowatts. <a href=\"http://www.last.fm/music/The+Doors/_/The+Wasp+(Texas+Radio+and+the+Big+Beat)\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6ieXnWm8uineF8k9Ugn5DG\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6ieXnWm8uineF8k9Ugn5DG\";}','the-wasp-texas-radio-and-the-big-beat','6ieXnWm8uineF8k9Ugn5DG',9),(780,'2025-05-27 16:44:11','2025-05-27 16:44:11','Riders on the Storm','1971-04-19 00:00:00',434,'https://i.scdn.co/image/ab67616d0000b2733992c7ab57975935b29fa22b','\"Riders on the Storm\" is a song by The Doors from their 1971 album, L.A. Woman; it reached number 14 on the charts. According to band member Robby Krieger, it was inspired by the song, \"(Ghost) Riders in the Sky: A Cowboy Legend\". The song is played in the E Dorian mode, and incorporates real sound effects of thunder and rain, along with Ray Manzarek\'s Fender Rhodes electric piano playing, which emulates the sound of rain.\n\nThe song\'s lyrics allude in part to the notorious spree killer Billy Cook <a href=\"http://www.last.fm/music/The+Doors/_/Riders+on+the+Storm\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/14XWXWv5FoCbFzLksawpEe\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/14XWXWv5FoCbFzLksawpEe\";}','riders-on-the-storm','14XWXWv5FoCbFzLksawpEe',10),(781,'2025-05-27 16:44:12','2025-05-27 16:44:12','House Announcer - Live','1970-07-20 00:00:00',160,'https://i.scdn.co/image/ab67616d0000b273c97ac09bd67730de819b2292',NULL,'N;','house-announcer-live','23IkMPBpKO2blTV2WzQfI8',1),(782,'2025-05-27 16:44:12','2025-05-27 16:44:12','Who Do You Love - Live','1970-07-20 00:00:00',362,'https://i.scdn.co/image/ab67616d0000b273c97ac09bd67730de819b2292',NULL,'N;','who-do-you-love-live','4qNwlHuX0fsUggSaJkNf2q',2),(783,'2025-05-27 16:44:12','2025-05-27 16:44:12','Alabama Song (Whisky Bar)','1970-07-20 00:00:00',111,'https://i.scdn.co/image/ab67616d0000b273c97ac09bd67730de819b2292',NULL,'N;','alabama-song-whisky-bar','1smn3rqQVSdMebdcbe6cg2',3),(784,'2025-05-27 16:44:12','2025-05-27 16:44:12','Back Door Man - Live','1970-07-20 00:00:00',142,'https://i.scdn.co/image/ab67616d0000b273c97ac09bd67730de819b2292',NULL,'N;','back-door-man-live','0IFwig267kKg0PSe8PpJff',4),(785,'2025-05-27 16:44:12','2025-05-27 16:44:12','Love Hides - Live','1970-07-20 00:00:00',108,'https://i.scdn.co/image/ab67616d0000b273c97ac09bd67730de819b2292',NULL,'N;','love-hides-live','6HkqNZstEsxfXnsiXKpewf',5),(786,'2025-05-27 16:44:12','2025-05-27 16:44:12','Five to One - Live','1970-07-20 00:00:00',274,'https://i.scdn.co/image/ab67616d0000b273c97ac09bd67730de819b2292',NULL,'N;','five-to-one-live','1