81,'https://i.scdn.co/image/ab67616d0000b273c97ac09bd67730de819b2292',NULL,'N;','wake-up-live','2BwOu7F4fFdp4U6efFSVmn',15),(796,'2025-05-27 16:44:12','2025-05-27 16:44:12','A Little Game - Live','1970-07-20 00:00:00',72,'https://i.scdn.co/image/ab67616d0000b273c97ac09bd67730de819b2292',NULL,'N;','a-little-game-live','6sHaG6qNSpoKayMS0QRSP0',16),(797,'2025-05-27 16:44:12','2025-05-27 16:44:12','The Hill Dwellers - Live','1970-07-20 00:00:00',155,'https://i.scdn.co/image/ab67616d0000b273c97ac09bd67730de819b2292',NULL,'N;','the-hill-dwellers-live','183AimFDUxzuqjhkwDwTHh',17),(798,'2025-05-27 16:44:12','2025-05-27 16:44:12','Not to Touch the Earth - Live','1970-07-20 00:00:00',254,'https://i.scdn.co/image/ab67616d0000b273c97ac09bd67730de819b2292',NULL,'N;','not-to-touch-the-earth-live','7alVFPjibA7YdDlbm00Y9J',18),(799,'2025-05-27 16:44:12','2025-05-27 16:44:12','Names of the Kingdom - Live','1970-07-20 00:00:00',89,'https://i.scdn.co/image/ab67616d0000b273c97ac09bd67730de819b2292',NULL,'N;','names-of-the-kingdom-live','3vLSwVXSYq4KaeD9i6x6ol',19),(800,'2025-05-27 16:44:12','2025-05-27 16:44:12','The Palace of Exile - Live','1970-07-20 00:00:00',140,'https://i.scdn.co/image/ab67616d0000b273c97ac09bd67730de819b2292',NULL,'N;','the-palace-of-exile-live','5N9NF3cB1HD84TwiMGL5jK',20),(801,'2025-05-27 16:44:12','2025-05-27 16:44:12','Soul Kitchen - Live','1970-07-20 00:00:00',435,'https://i.scdn.co/image/ab67616d0000b273c97ac09bd67730de819b2292',NULL,'N;','soul-kitchen-live','3muFnicqCCV3kgdD24FTZw',21),(802,'2025-05-27 16:44:23','2025-05-27 16:44:23','Roadhouse Blues','1970-02-09 00:00:00',243,'https://i.scdn.co/image/ab67616d0000b273f12a8a7e0b2cbe16d2bef4dc','\"Roadhouse Blues\" is a blues-rock song written and recorded by the American rock band The Doors. The song, which appeared on the B-side of You Make Me Real, was first released as a single from the album Morrison Hotel in March 1970 and peaked at #50. The song quickly became a concert staple for the group, a live version appearing later on the posthumous album An American Prayer and that same version, which has been called \"probably one of the best live performances of any song\", again on In Concert and Greatest Hits. <a href=\"http://www.last.fm/music/The+Doors/_/Roadhouse+Blues\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1Q5kgpp4pmyGqPwNBzkSrw\";}','roadhouse-blues','1Q5kgpp4pmyGqPwNBzkSrw',1),(803,'2025-05-27 16:44:24','2025-05-27 16:44:24','Waiting for the Sun','1970-02-09 00:00:00',238,'https://i.scdn.co/image/ab67616d0000b273f12a8a7e0b2cbe16d2bef4dc','\"Waiting for the Sun\", written by Morrison, was left off as the title track of The Doors\' 1968 album, and was later included on the 1970 album Morrison Hotel. <a href=\"http://www.last.fm/music/The+Doors/_/Waiting+for+the+Sun\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6KVM6U9Wcxgjh0jDjoRDgh\";}','waiting-for-the-sun','6KVM6U9Wcxgjh0jDjoRDgh',2),(804,'2025-05-27 16:44:25','2025-05-27 16:44:25','You Make Me Real','1970-02-09 00:00:00',171,'https://i.scdn.co/image/ab67616d0000b273f12a8a7e0b2cbe16d2bef4dc',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1MR950KaknDDJ2PyU5NQDa\";}','you-make-me-real','1MR950KaknDDJ2PyU5NQDa',3),(805,'2025-05-27 16:44:25','2025-05-27 16:44:25','Peace Frog','1970-02-09 00:00:00',170,'https://i.scdn.co/image/ab67616d0000b273f12a8a7e0b2cbe16d2bef4dc','\"Peace Frog\" is a song by The Doors which appears on the album Morrison Hotel. It was released on vinyl in February 1970 by Elektra/Asylum Records and produced by Paul Rothchild. It has a fairly short running time of 2:50 and blends seamlessly into the next track on the album, \"Blue Sunday\", making it easy for radio stations to play the two songs consecutively. The lyrics were adapted from a couple of Morrison\'s poems, one being entitled \"Abortion Stories\". <a href=\"http://www.last.fm/music/The+Doors/_/Peace+Frog\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5piJiL6aRhvrKBa9YuEfS9\";}','peace-frog','5piJiL6aRhvrKBa9YuEfS9',4),(806,'2025-05-27 16:44:36','2025-05-27 16:44:36','Blue Sunday','1970-02-09 00:00:00',132,'https://i.scdn.co/image/ab67616d0000b273f12a8a7e0b2cbe16d2bef4dc',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2g3JAKjKruTL40VffoGLmg\";}','blue-sunday','2g3JAKjKruTL40VffoGLmg',5),(807,'2025-05-27 16:44:37','2025-05-27 16:44:37','Ship of Fools','1970-02-09 00:00:00',188,'https://i.scdn.co/image/ab67616d0000b273f12a8a7e0b2cbe16d2bef4dc',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2r63hMQCds09Rf30DrNTav\";}','ship-of-fools','2r63hMQCds09Rf30DrNTav',6),(808,'2025-05-27 16:44:38','2025-05-27 16:44:38','Land Ho!','1970-02-09 00:00:00',249,'https://i.scdn.co/image/ab67616d0000b273f12a8a7e0b2cbe16d2bef4dc',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1qnv1QfY7BwG7l39nWYVhB\";}','land-ho','1qnv1QfY7BwG7l39nWYVhB',7),(809,'2025-05-27 16:44:38','2025-05-27 16:44:38','The Spy','1970-02-09 00:00:00',255,'https://i.scdn.co/image/ab67616d0000b273f12a8a7e0b2cbe16d2bef4dc',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3yDEadQDdmdxYBOeMX6bDW\";}','the-spy','3yDEadQDdmdxYBOeMX6bDW',8),(810,'2025-05-27 16:44:49','2025-05-27 16:44:49','Queen of the Highway','1970-02-09 00:00:00',167,'https://i.scdn.co/image/ab67616d0000b273f12a8a7e0b2cbe16d2bef4dc','Queen Of The Highway is a song by the rock group The Doors, from their 1970 album Morrison Hotel. It is the ninth, and third-to-last track on that album. The lyrics were written by lead singer Jim Morrison and are believed to be about his girlfriend Pamela Courson, with the lines \"She was a princess / Queen of the Highway\" referring to her, the \"He was a Monster / Black dressed in leather\" being a description of Jim Morrison himself, and the \"I hope it can continue / Just a little while longer\" lines being perhaps <a href=\"http://www.last.fm/music/The+Doors/_/Queen+of+the+Highway\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1tBMs9Rmw3UMvPJrsXsUyL\";}','queen-of-the-highway','1tBMs9Rmw3UMvPJrsXsUyL',9),(811,'2025-05-27 16:44:50','2025-05-27 16:44:50','Indian Summer','1970-02-09 00:00:00',154,'https://i.scdn.co/image/ab67616d0000b273f12a8a7e0b2cbe16d2bef4dc',NULL,'a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=yOKAQSGCm8Q\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2hdeaGl9nT3UoQIgSqctHj\";}','indian-summer','2hdeaGl9nT3UoQIgSqctHj',10),(812,'2025-05-27 16:44:50','2025-05-27 16:44:50','Maggie M\'Gill','1970-02-09 00:00:00',264,'https://i.scdn.co/image/ab67616d0000b273f12a8a7e0b2cbe16d2bef4dc',NULL,'N;','maggie-m-gill','6PtRNOkuXALHwogMnc9NCx',11),(813,'2025-05-27 16:44:50','2025-05-27 16:44:50','Hitler (Poem)','1970-05-27 16:44:50',141,'https://i.scdn.co/image/ab67616d0000b273fce7d3fcb7d96bd03e39495d',NULL,'N;','hitler-poem','1mPhzVF08zlsNDopfRwPkL',1),(814,'2025-05-27 16:44:50','2025-05-27 16:44:50','Roadhouse Blues - Live','1970-05-27 16:44:50',290,'https://i.scdn.co/image/ab67616d0000b273fce7d3fcb7d96bd03e39495d',NULL,'N;','roadhouse-blues-live','4ZBz3Sd758itkLF28fBNiC',2),(815,'2025-05-27 16:44:50','2025-05-27 16:44:50','Back Door Man','1970-05-27 16:44:50',430,'https://i.scdn.co/image/ab67616d0000b273fce7d3fcb7d96bd03e39495d',NULL,'N;','back-door-man','1EbE7gAmGVJ4IyzywqLKiK',3),(816,'2025-05-27 16:44:50','2025-05-27 16:44:50','When The Music\'s Over','1970-05-27 16:44:50',1205,'https://i.scdn.co/image/ab67616d0000b273fce7d3fcb7d96bd03e39495d',NULL,'N;','when-the-music-s-over','47s0apvaj9njaJkQLyhrSo',4),(817,'2025-05-27 16:44:50','2025-05-27 16:44:50','People Get Ready Baby Please Don\'t Go','1970-05-27 16:44:50',427,'https://i.scdn.co/image/ab67616d0000b273fce7d3fcb7d96bd03e39495d',NULL,'N;','people-get-ready-baby-please-don-t-go','4RnsnKNin8zmSrkg2F5b0i',5),(818,'2025-05-27 16:44:50','2025-05-27 16:44:50','Mystery Train Crossroads','1970-05-27 16:44:50',1215,'https://i.scdn.co/image/ab67616d0000b273fce7d3fcb7d96bd03e39495d',NULL,'N;','mystery-train-crossroads','3OTHTALdljY7JSA5X8WR55',6),(819,'2025-05-27 16:44:50','2025-05-27 16:44:50','Five to One','1970-05-27 16:44:50',359,'https://i.scdn.co/image/ab67616d0000b273fce7d3fcb7d96bd03e39495d',NULL,'N;','five-to-one','6T5a8kojBgEkM9t5ap9ES2',7),(820,'2025-05-27 16:44:50','2025-05-27 16:44:50','Break on Through (to the Other Side)','1970-05-27 16:44:50',316,'https://i.scdn.co/image/ab67616d0000b273fce7d3fcb7d96bd03e39495d',NULL,'N;','break-on-through-to-the-other-side','3vcm4AEMEMwckgAmWwHVAB',8),(821,'2025-05-27 16:45:02','2025-05-27 16:45:02','Tell All the People','1969-07-21 00:00:00',200,'https://i.scdn.co/image/ab67616d0000b273a0c993789a4875837cf7cf71','\"Tell All the People\" was the third single off The Doors\' 1969 album The Soft Parade. It is also known by \"Follow Me Down\" because of the use of the phrase in the song. It was released as an A-side that same year, with \"Easy Ride\" as its B-side, reaching #57 in the US charts. \"Tell All the People\" was written by guitarist Robbie Krieger, and it was famously because of this song, that songwriting credits on the \"Soft Parade\" album were given to individual band members <a href=\"http://www.last.fm/music/The+Doors/_/Tell+All+the+People\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0g1NRq4KmbEYgzaPF7G6CG\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0g1NRq4KmbEYgzaPF7G6CG\";}','tell-all-the-people','0g1NRq4KmbEYgzaPF7G6CG',1),(822,'2025-05-27 16:57:04','2025-05-27 16:57:04','Touch Me','1969-07-21 00:00:00',190,'https://i.scdn.co/image/ab67616d0000b273a0c993789a4875837cf7cf71','\"Touch Me\" is a song by The Doors from their album The Soft Parade. Written by Robby Krieger, the riff is influenced by The Four Seasons\' \"C\'mon Marianne.\" It is notable for its extensive usage of brass and string instruments to accent Jim Morrison\'s vocals (including a powerful solo by featured saxophonist Curtis Amy), and was one of the most popular Doors songs. It was released as a single in December 1968. The song reached #3 on the Billboard Hot 100 and #1 in Cashbox Top 100 in early 1969. <a href=\"http://www.last.fm/music/The+Doors/_/Touch+Me\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4BVE5tIIpYabZcYCbephNW\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4BVE5tIIpYabZcYCbephNW\";}','touch-me','4BVE5tIIpYabZcYCbephNW',2),(823,'2025-05-27 16:57:04','2025-05-27 16:57:04','Shaman\'s Blues','1969-07-21 00:00:00',287,'https://i.scdn.co/image/ab67616d0000b273a0c993789a4875837cf7cf71',NULL,'N;','shaman-s-blues','4MSGvOyqjifxU0TtDxhQil',3),(824,'2025-05-27 16:57:10','2025-05-27 16:57:10','Do It','1969-07-21 00:00:00',188,'https://i.scdn.co/image/ab67616d0000b273a0c993789a4875837cf7cf71',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0wepIheFRGnHEDmZwfINp6\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0wepIheFRGnHEDmZwfINp6\";}','do-it','0wepIheFRGnHEDmZwfINp6',4),(825,'2025-05-27 16:57:11','2025-05-27 16:57:11','Easy Ride','1969-07-21 00:00:00',161,'https://i.scdn.co/image/ab67616d0000b273a0c993789a4875837cf7cf71',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5ypTWakSUT3kLLYtbUFGfO\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5ypTWakSUT3kLLYtbUFGfO\";}','easy-ride','5ypTWakSUT3kLLYtbUFGfO',5),(826,'2025-05-27 16:57:12','2025-05-27 16:57:12','Wild Child','1969-07-21 00:00:00',155,'https://i.scdn.co/image/ab67616d0000b273a0c993789a4875837cf7cf71',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5QTKB8UOaBO9zvWr6ap05R\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5QTKB8UOaBO9zvWr6ap05R\";}','wild-child','5QTKB8UOaBO9zvWr6ap05R',6),(827,'2025-05-27 16:57:22','2025-05-27 16:57:22','Runnin\' Blue','1969-07-21 00:00:00',146,'https://i.scdn.co/image/ab67616d0000b273a0c993789a4875837cf7cf71',NULL,'N;','runnin-blue','0y2Vz9T2PImD6YUdMq9Ebl',7),(828,'2025-05-27 16:57:24','2025-05-27 16:57:24','Wishful Sinful','1969-07-21 00:00:00',175,'https://i.scdn.co/image/ab67616d0000b273a0c993789a4875837cf7cf71','Wishful Sinful is a song written by Doors guitarist Robbie Krieger and performed by The Doors. Released in March 1969 from the band\'s fourth album, The Soft Parade, \"Wishful Sinful\" follows the general theme of the album by incorporating elements of classical music. It reached #44 on the Billboard Hot 100 in 1969.\n\nThough many of the songs on The Soft Parade (including Wishful Sinful) were somewhat unpopular - at least amongst fans of the harder, bluesier Doors sound - at the time of the original release <a href=\"http://www.last.fm/music/The+Doors/_/Wishful+Sinful\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/13ejmQX8lVzeKijqMWiNO7\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/13ejmQX8lVzeKijqMWiNO7\";}','wishful-sinful','13ejmQX8lVzeKijqMWiNO7',8),(829,'2025-05-27 16:57:25','2025-05-27 16:57:25','The Soft Parade','1969-07-21 00:00:00',514,'https://i.scdn.co/image/ab67616d0000b273a0c993789a4875837cf7cf71','\"The Soft Parade\" is the ninth and final track on the fourth studio album of the same name by the rock band The Doors. Many listeners believe that this and \"Shaman\'s Blues\" are reminiscent to the old style of The Doors, as heard in the albums The Doors and Strange Days. This is mainly because the song contains both lyrical and melodic shifts. At the beginning of the song, Jim Morrison starts out with spoken words reminiscent of a raving Christian preacher. <a href=\"http://www.last.fm/music/The+Doors/_/The+Soft+Parade\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0YMzPd9mYx4txOuCnhYUGU\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0YMzPd9mYx4txOuCnhYUGU\";}','the-soft-parade','0YMzPd9mYx4txOuCnhYUGU',9),(830,'2025-05-27 16:57:25','2025-05-27 16:57:25','Whiskey, Mystics & Men #1','1969-05-27 16:57:25',140,'https://i.scdn.co/image/ab67616d0000b2731d86a378800e8cc6e5b74f98',NULL,'N;','whiskey-mystics-and-men-1','4VkwRwipzOi1IPJLP8MX4q',1),(831,'2025-05-27 16:57:25','2025-05-27 16:57:25','Petition The Lord With Prayer','1969-05-27 16:57:25',61,'https://i.scdn.co/image/ab67616d0000b2731d86a378800e8cc6e5b74f98',NULL,'N;','petition-the-lord-with-prayer','79scDkNo87qOKhVQjB91SU',2),(832,'2025-05-27 16:57:25','2025-05-27 16:57:25','The Soft Parade Intro','1969-05-27 16:57:25',228,'https://i.scdn.co/image/ab67616d0000b2731d86a378800e8cc6e5b74f98',NULL,'N;','the-soft-parade-intro','5LEOCKrMJt88xdWlLfosyp',3),(833,'2025-05-27 16:57:25','2025-05-27 16:57:25','Love Me Tender','1969-05-27 16:57:25',156,'https://i.scdn.co/image/ab67616d0000b2731d86a378800e8cc6e5b74f98',NULL,'N;','love-me-tender','4TcBMoly3B1avUjkuTvogh',4),(834,'2025-05-27 16:57:25','2025-05-27 16:57:25','Rock Is Dead #1','1969-05-27 16:57:25',621,'https://i.scdn.co/image/ab67616d0000b2731d86a378800e8cc6e5b74f98',NULL,'N;','rock-is-dead-1','777mCjDQ5rGjHFOFD1K6aN',5),(835,'2025-05-27 16:57:25','2025-05-27 16:57:25','Woman Is A Devil','1969-05-27 16:57:25',375,'https://i.scdn.co/image/ab67616d0000b2731d86a378800e8cc6e5b74f98',NULL,'N;','woman-is-a-devil','5UDXwtt0zk4VkHMWHvkV2Y',6),(836,'2025-05-27 16:57:25','2025-05-27 16:57:25','Rock Is Dead #2','1969-05-27 16:57:25',760,'https://i.scdn.co/image/ab67616d0000b2731d86a378800e8cc6e5b74f98',NULL,'N;','rock-is-dead-2','3mkpUeMj63okRb3rBkghNC',7),(837,'2025-05-27 16:57:25','2025-05-27 16:57:25','Queen Of The Magazines','1969-05-27 16:57:25',244,'https://i.scdn.co/image/ab67616d0000b2731d86a378800e8cc6e5b74f98',NULL,'N;','queen-of-the-magazines','0L33UoJ1F9neR7NaF5UbOR',8),(838,'2025-05-27 16:57:25','2025-05-27 16:57:25','Pipeline','1969-05-27 16:57:25',73,'https://i.scdn.co/image/ab67616d0000b2731d86a378800e8cc6e5b74f98',NULL,'N;','pipeline','5fcnLUkpxCHW5E0U9coCxr',9),(839,'2025-05-27 16:57:25','2025-05-27 16:57:25','Rock Is Dead #3','1969-05-27 16:57:25',1356,'https://i.scdn.co/image/ab67616d0000b2731d86a378800e8cc6e5b74f98',NULL,'N;','rock-is-dead-3','0U8sdFcNojNpf994Sm1TMu',10),(840,'2025-05-27 16:57:25','2025-05-27 16:57:25','Someday Soon','1969-05-27 16:57:25',172,'https://i.scdn.co/image/ab67616d0000b2731d86a378800e8cc6e5b74f98',NULL,'N;','someday-soon','0T20AY6faqGytVSbA7O6qd',11),(841,'2025-05-27 16:57:25','2025-05-27 16:57:25','Mystery Train','1969-05-27 16:57:25',109,'https://i.scdn.co/image/ab67616d0000b2731d86a378800e8cc6e5b74f98',NULL,'N;','mystery-train','6qr1zK38GC8xJwgUpk948G',12),(842,'2025-05-27 16:57:25','2025-05-27 16:57:25','Rock Is Dead #4','1969-05-27 16:57:25',21,'https://i.scdn.co/image/ab67616d0000b2731d86a378800e8cc6e5b74f98',NULL,'N;','rock-is-dead-4','3YOwzSUCXz7XCldLcS4Uae',13),(843,'2025-05-27 16:57:37','2025-05-27 16:57:37','Hello, I Love You','1968-07-03 00:00:00',133,'https://i.scdn.co/image/ab67616d0000b273d848096c6318e3317771721d','\"Hello, I Love You\" is a song by The Doors from their 1968 album Waiting for the Sun. It was released as a single that same year, reaching #1 in the United States, and selling over a million copies in the U.S. alone. This was one of the six songs performed by Rick & the Ravens on the demo for Aura Records in 1965.\n\nSome pressings of the single list the title as Hello I Love You, Won\'t Tell Me Your Name?.\n\nThis song was used in the movies Platoon, Casualties of War, and Forrest Gump. <a href=\"http://www.last.fm/music/The+Doors/_/Hello,+I+Love+You\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3bWGaqVeYKMlLss40mPgNn\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3bWGaqVeYKMlLss40mPgNn\";}','hello-i-love-you','3bWGaqVeYKMlLss40mPgNn',1),(844,'2025-05-27 16:57:37','2025-05-27 16:57:37','Love Street','1968-07-03 00:00:00',169,'https://i.scdn.co/image/ab67616d0000b273d848096c6318e3317771721d','\"Love Street\" is a song performed by the American rock band the Doors. Sequenced as the second album track on \"Waiting for the Sun\", its lyrics were written by lead singer Jim Morrison and as with other songs, it was dedicated to his girlfriend Pamela Courson.\n\nThe song features a departure from the Doors usual psychedelic style, including acoustic sounds and marking a conventional ballad mien. Incorporating elements from classical music, it is described by critics as having a baroque pop aesthetic. <a href=\"http://www.last.fm/music/The+Doors/_/Love+Street\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5Q2Im8o4RthlAMkvUMYwGj\";}','love-street','5Q2Im8o4RthlAMkvUMYwGj',2),(845,'2025-05-27 16:57:38','2025-05-27 16:57:38','Not to Touch the Earth','1968-07-03 00:00:00',234,'https://i.scdn.co/image/ab67616d0000b273d848096c6318e3317771721d','\"Not to Touch the Earth\" is a 1968 song by The Doors from their album Waiting for the Sun. It stems from Jim Morrison\'s poem, \"Celebration of the Lizard\". A recording of the complete poem was attempted at the sessions for the album, but only the musical passage Not to Touch the Earth was deemed fit for release. The poem was released on the album sleeve in written form. The complete poem was released in 2003 on the Legacy: The Absolute Best compilation, and the re-issue of Waiting for the Sun. <a href=\"http://www.last.fm/music/The+Doors/_/Not+to+Touch+the+Earth\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4CyqGx74ElL4WC5TaEbx0x\";}','not-to-touch-the-earth','4CyqGx74ElL4WC5TaEbx0x',3),(846,'2025-05-27 16:57:38','2025-05-27 16:57:38','Summer\'s Almost Gone','1968-07-03 00:00:00',199,'https://i.scdn.co/image/ab67616d0000b273d848096c6318e3317771721d',NULL,'N;','summer-s-almost-gone','657O4nJxZktsNDvBimhZ0i',4),(847,'2025-05-27 16:57:49','2025-05-27 16:57:49','Wintertime Love','1968-07-03 00:00:00',112,'https://i.scdn.co/image/ab67616d0000b273d848096c6318e3317771721d',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5XZKjnMgqL4fHTS5at7657\";}','wintertime-love','5XZKjnMgqL4fHTS5at7657',5),(848,'2025-05-27 16:57:49','2025-05-27 16:57:49','The Unknown Soldier','1968-07-03 00:00:00',201,'https://i.scdn.co/image/ab67616d0000b273d848096c6318e3317771721d','\"The Unknown Soldier\" was the first single from The Doors\' 1968 album Waiting for the Sun, and was also the subject of one of the band\'s few, inventive music videos. The song was Jim Morrison\'s reaction to the Vietnam War and the way that conflict was portrayed in American media at the time. Lines such as, \"Breakfast where the news is read/Television children fed/ unborn living, living dead/bullets strike the helmet\'s head\", concern the way news of the war was being presented in the living rooms of ordinary people. <a href=\"http://www.last.fm/music/The+Doors/_/The+Unknown+Soldier\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3Yr4iI0hT6eLt6EvTKWWTF\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/78JYtz4yOPqAEgZZc3SBLT\";}','the-unknown-soldier','78JYtz4yOPqAEgZZc3SBLT',6),(849,'2025-05-27 16:57:50','2025-05-27 16:57:50','Spanish Caravan','1968-07-03 00:00:00',178,'https://i.scdn.co/image/ab67616d0000b273d848096c6318e3317771721d','\"Spanish Caravan\" is a song by The Doors from the album Waiting for the Sun released in 1968. Its basic flamenco track is an established form of flamenco music known as Granadinas. The beginning riff was taken from Asturias (Leyenda), a classical piece of music by a Spanish composer Isaac Albéniz (1860–1909). It also borrows a similar sounding riff from Malagueña.\n\nWhen the song was performed live, feelings of brutal lust and even desperation were especially emphasized. <a href=\"http://www.last.fm/music/The+Doors/_/Spanish+Caravan\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/32bJv8V2Xgi5mtxdPcsi8B\";}','spanish-caravan','32bJv8V2Xgi5mtxdPcsi8B',7),(850,'2025-05-27 16:57:50','2025-05-27 16:57:50','My Wild Love','1968-07-03 00:00:00',179,'https://i.scdn.co/image/ab67616d0000b273d848096c6318e3317771721d',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6OQCLaG8vDoRcgi7vzYEQK\";}','my-wild-love','6OQCLaG8vDoRcgi7vzYEQK',8),(851,'2025-05-27 16:58:01','2025-05-27 16:58:01','We Could Be so Good Together','1968-07-03 00:00:00',143,'https://i.scdn.co/image/ab67616d0000b273d848096c6318e3317771721d','\"We Could Be So Good Together\" is a song by American rock band The Doors, appearing as the ninth song on their 1968 album, Waiting for the Sun, but was initially released as the B-side of the single \"The Unknown Soldier\". The song was recorded during the sessions for Strange Days, and appears on an early track listing for the album. The song has been described (for example in No One Here Gets Out Alive) as lead singer Jim Morrison\'s way of telling his audience what kind of world they would be able to create if they simply tried. <a href=\"http://www.last.fm/music/The+Doors/_/We+Could+Be+So+Good+Together\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4CIGLBUyPKZzHoYankmQzk\";}','we-could-be-so-good-together','4CIGLBUyPKZzHoYankmQzk',9),(852,'2025-05-27 16:58:01','2025-05-27 16:58:01','Yes, the River Knows','1968-07-03 00:00:00',154,'https://i.scdn.co/image/ab67616d0000b273d848096c6318e3317771721d',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6jrzTN8AezZ9SgE2UMb9tE\";}','yes-the-river-knows','6jrzTN8AezZ9SgE2UMb9tE',10),(853,'2025-05-27 16:58:02','2025-05-27 16:58:02','Five to One','1968-07-03 00:00:00',264,'https://i.scdn.co/image/ab67616d0000b273d848096c6318e3317771721d','\"Five to One\" is a song by The Doors, from their 1968 album Waiting for the Sun.\n\n\"Five to one\" is rumored to be the approximate ratio of whites to blacks, young to old, or pot smokers to non-pot smokers in the US in 1967, depending on whom you ask[clarification needed]. A further urban legend has it as the ratio of Viet Cong to American troops in Vietnam.[clarification needed] However, when asked, Jim Morrison said the lyrics were not political.[clarification needed] This would seem quite likely <a href=\"http://www.last.fm/music/The+Doors/_/Five+to+One\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0MfMViYWUncklO2ULTW2jl\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5FlBGGwGuqYmqr0qeBWrxe\";}','five-to-one','5FlBGGwGuqYmqr0qeBWrxe',11),(854,'2025-05-27 16:58:03','2025-05-27 16:58:03','Strange Days','1967-09-25 00:00:00',186,'https://i.scdn.co/image/ab67616d0000b27386339e6cd71cc2a167451ee5','\"Strange Days\" is a song by The Doors. It was released in 1967 and is the first track on the album of the same name. A visit to New York City by The Doors inspired Jim Morrison to write \"Strange Days\" and other songs on the Strange Days album, the band\'s second. <a href=\"http://www.last.fm/music/The+Doors/_/Strange+Days\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1Gn6vE9SBv1tz26ZYBiWOI\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4WFVX3E568hdAixIj3U222\";}','strange-days','4WFVX3E568hdAixIj3U222',1),(855,'2025-05-27 16:58:13','2025-05-27 16:58:13','You\'re Lost Little Girl','1967-09-25 00:00:00',180,'https://i.scdn.co/image/ab67616d0000b27386339e6cd71cc2a167451ee5',NULL,'N;','you-re-lost-little-girl','5onlaW8X1ps8VS4DhxpFom',2),(856,'2025-05-27 16:58:14','2025-05-27 16:58:14','Love Me Two Times','1967-09-25 00:00:00',195,'https://i.scdn.co/image/ab67616d0000b27386339e6cd71cc2a167451ee5','\"Love Me Two Times\" is a song by The Doors. It was written by Robby Krieger and first appeared on the 1967 album Strange Days. It was released as the second single (after \"People Are Strange\") from that album, and reached #25 on the charts in the US.\n\nRay Manzarek played the final version of this song on a clavinet (the modern-day version of a clavichord), not a harpsichord.\n\n\"Love Me Two Times\" was considered to be somewhat risqué for radio airplay. <a href=\"http://www.last.fm/music/The+Doors/_/Love+Me+Two+Times\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0ipXZXe4Njj2tXDiz24YWE\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/67HxeUADW4H3ERfaPW59ma\";}','love-me-two-times','67HxeUADW4H3ERfaPW59ma',3),(857,'2025-05-27 16:58:14','2025-05-27 16:58:14','Unhappy Girl','1967-09-25 00:00:00',117,'https://i.scdn.co/image/ab67616d0000b27386339e6cd71cc2a167451ee5','This is a poem written by Jim Morrison, about a girl who feels trapped or imprisoned by her choices in life or by missing out on “swimming in mystery” (i.e not exploring herself or the world), therefore she’s imprisoned herself emotionally. <a href=\"http://www.last.fm/music/The+Doors/_/Unhappy+Girl\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7MW3s6XnZua7CNQAfmdGe8\";}','unhappy-girl','7MW3s6XnZua7CNQAfmdGe8',4),(858,'2025-05-27 16:58:15','2025-05-27 16:58:15','Horse Latitudes','1967-09-25 00:00:00',95,'https://i.scdn.co/image/ab67616d0000b27386339e6cd71cc2a167451ee5','\"Horse Latitudes\" is the fifth song from The Doors second album, Strange Days. The song is a spoken word piece by Jim Morrison with the band providing frightening noises as a backdrop. Morrison screams the lyrics, telling of a ship at sea forced to jettison the onboard horses to lighten their load. The words are taken from one of the first poems Jim Morrison ever wrote, inspired by a book cover he saw at a local bookstore as a child.\n\nKeyboardist <a href=\"http://www.last.fm/music/The+Doors/_/Horse+Latitudes\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6vcqR6rCL2k4EDhqH8gzeO\";}','horse-latitudes','6vcqR6rCL2k4EDhqH8gzeO',5),(859,'2025-05-27 16:58:25','2025-05-27 16:58:25','Moonlight Drive','1967-09-25 00:00:00',181,'https://i.scdn.co/image/ab67616d0000b27386339e6cd71cc2a167451ee5','\"Moonlight Drive\" is a song from The Doors\' second album, Strange Days. Although it was only a B-side (of \"Love Me Two Times\"), it is a favorite in The Doors canon. Though a conventional blues arrangement, \"Moonlight Drive\"\'s defining feature was its slightly off-beat rhythm and, more significantly, Robby Krieger\'s \'Bottle-neck\' guitar which creates an eerie sound.\n\nThe song is known to fans as being one of the first written by lead singer Jim Morrison. <a href=\"http://www.last.fm/music/The+Doors/_/Moonlight+Drive\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0ja1dJM5gBTjk5U9wsMP9r\";}','moonlight-drive','0ja1dJM5gBTjk5U9wsMP9r',6),(860,'2025-05-27 16:58:26','2025-05-27 16:58:26','People Are Strange','1967-09-25 00:00:00',130,'https://i.scdn.co/image/ab67616d0000b27386339e6cd71cc2a167451ee5','\"People Are Strange\" is a single released by The Doors in September 1967. It also appears on their second album Strange Days which was also released in September 1967. The single peaked at the #12 position of the U.S. Hot 100 chart. It was written by Robby Krieger and Jim Morrison although credit was given to the The Doors evenly.\n\nIt was covered to moderate success in 1988 by Echo and the Bunnymen for The Lost Boys soundtrack. It was also covered in 2000 by Twiztid on the album Freek Show. <a href=\"http://www.last.fm/music/The+Doors/_/People+Are+Strange\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/62qbAC4pbgrr3kkEDQrhbA\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1Jmqubf9kGkWeYQXQKImL5\";}','people-are-strange','1Jmqubf9kGkWeYQXQKImL5',7),(861,'2025-05-27 16:58:26','2025-05-27 16:58:26','My Eyes Have Seen You','1967-09-25 00:00:00',147,'https://i.scdn.co/image/ab67616d0000b27386339e6cd71cc2a167451ee5',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6HSQ5z5afdLjhphHWfPiEG\";}','my-eyes-have-seen-you','6HSQ5z5afdLjhphHWfPiEG',8),(862,'2025-05-27 16:58:26','2025-05-27 16:58:26','I Can\'t See Your Face in My Mind','1967-09-25 00:00:00',203,'https://i.scdn.co/image/ab67616d0000b27386339e6cd71cc2a167451ee5',NULL,'N;','i-can-t-see-your-face-in-my-mind','6wov6IWJkisFG6rUZIESsB',9),(863,'2025-05-27 16:58:27','2025-05-27 16:58:27','When the Music\'s Over','1967-09-25 00:00:00',659,'https://i.scdn.co/image/ab67616d0000b27386339e6cd71cc2a167451ee5',NULL,'N;','when-the-music-s-over','42dsUTJpzMWUJfEkzsbKWl',10),(864,'2025-05-27 16:58:37','2025-05-27 16:58:37','Break on Through (To the Other Side)','1967-01-04 00:00:00',145,'https://i.scdn.co/image/ab67616d0000b2735b96a8c5d61be8878452f8f1','\"Break on Through (To the Other Side)\" is a song by The Doors from their debut album, The Doors. It was the first single released by the band and was unsuccessful compared to later hits, reaching only #126 in the United States. Despite this, it remains one of the band\'s signature and most popular songs and became a concert staple.\n\nTwenty-four years after its original US release, \"Break on Through\" became a minor hit in the UK, peaking at #64 in the singles chart. <a href=\"http://www.last.fm/music/The+Doors/_/Break+on+Through+(to+the+Other+Side)\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6ToM0uwxtPKo9CMpbPGYvM\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6ToM0uwxtPKo9CMpbPGYvM\";}','break-on-through-to-the-other-side','6ToM0uwxtPKo9CMpbPGYvM',1),(865,'2025-05-27 16:58:38','2025-05-27 16:58:38','Soul Kitchen','1967-01-04 00:00:00',213,'https://i.scdn.co/image/ab67616d0000b2735b96a8c5d61be8878452f8f1','\"Soul Kitchen\" is a song by The Doors from their self-titled debut album The Doors. It is the tribute to the soul food restaurant Olivia\'s in Venice Beach, LA, where Jim Morrison often stayed for a long time, for it reminded him of his home.\n\nAlong with many other songs by The Doors, this song appeared in the Forrest Gump film. <a href=\"http://www.last.fm/music/The+Doors/_/Soul+Kitchen\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2Xdc6qyaFBJZ8QW1KhpVci\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2Xdc6qyaFBJZ8QW1KhpVci\";}','soul-kitchen','2Xdc6qyaFBJZ8QW1KhpVci',2),(866,'2025-05-27 16:58:38','2025-05-27 16:58:38','The Crystal Ship','1967-01-04 00:00:00',152,'https://i.scdn.co/image/ab67616d0000b2735b96a8c5d61be8878452f8f1','\"The Crystal Ship\" is a song by The Doors from their 1967 debut album The Doors. It was also the B-Side of the number-one hit single, \"Light My Fire.\" It is regarded as a love song to Jim Morrison\'s first love, Mary Werbelo. Like much of The Doors\' work, it sets up an eerie, dark flow. It\'s rumored to have been the band\'s first long song, especially for Ray Manzarek\'s and Robby Krieger\'s improvisations, but was changed by When the Music\'s Over. <a href=\"http://www.last.fm/music/The+Doors/_/The+Crystal+Ship\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0gWvVB4bGvADocoPMEDy3K\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0gWvVB4bGvADocoPMEDy3K\";}','the-crystal-ship','0gWvVB4bGvADocoPMEDy3K',3),(867,'2025-05-27 16:58:39','2025-05-27 16:58:39','Twentieth Century Fox','1967-01-04 00:00:00',151,'https://i.scdn.co/image/ab67616d0000b2735b96a8c5d61be8878452f8f1','This song title is a pun on the famous 20th Century Fox movie studio and the modern-day woman described in the song. She is glamorous, yet artificial.\n\nAccording to the Waiting for the Sun Doors archive, Jac Holzman said the track was originally intended to be the follow-up single behind “Break On Through (To the Other Side).” However, the popularity of “Light My Fire” forced them to go in a different direction. <a href=\"http://www.last.fm/music/The+Doors/_/Twentieth+Century+Fox\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/7mc2TP4Vzuyw2vNf1bLW9f\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7mc2TP4Vzuyw2vNf1bLW9f\";}','twentieth-century-fox','7mc2TP4Vzuyw2vNf1bLW9f',4),(868,'2025-05-27 16:58:50','2025-05-27 16:58:50','Alabama Song (Whisky Bar)','1967-01-04 00:00:00',197,'https://i.scdn.co/image/ab67616d0000b2735b96a8c5d61be8878452f8f1','The song was recorded in 1966 by the rock group The Doors, listed as \"Alabama Song (Whisky Bar).\". The lead singer of The Doors, Jim Morrison, changed the second verse from:\n\n\"Show us the way to the next pretty boy\" to \"Show me the way to the next little girl\". Although on the 1967 Live at the Matrix recording, he sings \"... next little boy\".\n\nIn addition, the verse from the original, \"Show me the way to the next little dollar\" is omitted. The melody of the verses is also changed. <a href=\"http://www.last.fm/music/The+Doors/_/Alabama+Song+(Whisky+Bar)\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0JNZGIavoUrdup1NsgJOQs\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0JNZGIavoUrdup1NsgJOQs\";}','alabama-song-whisky-bar','0JNZGIavoUrdup1NsgJOQs',5),(869,'2025-05-27 16:58:50','2025-05-27 16:58:50','Light My Fire','1967-01-04 00:00:00',429,'https://i.scdn.co/image/ab67616d0000b2735b96a8c5d61be8878452f8f1','\"Light My Fire\" is a song originally performed by The Doors which was recorded in August 1966 and released in January 1967. It spent three weeks at number one on the Billboard\'s Hot 100, and one week on the Cashbox Top 100. It was re-released in 1968, peaking at number 87. The song was largely written by Robby Krieger, and credited to the entire band. \n\nAccording to the Light My Fire Songfacts, this was the last song Jim Morrison performed live. It was a show at The Warehouse in New Orleans. <a href=\"http://www.last.fm/music/The+Doors/_/Light+My+Fire\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5uvosCdMlFdTXhoazkTI5R\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5uvosCdMlFdTXhoazkTI5R\";}','light-my-fire','5uvosCdMlFdTXhoazkTI5R',6),(870,'2025-05-27 16:58:50','2025-05-27 16:58:50','Back Door Man','1967-01-04 00:00:00',212,'https://i.scdn.co/image/ab67616d0000b2735b96a8c5d61be8878452f8f1','Originally by blues musician Willie Dixon, this song was covered by The Doors for their eponymous debut album.  The Doors\' drummer John Densmore described it as a song that is \"deeply sexual and got everyone moving\". The song also appears on The Doors\' live album Absolutely Live (1970).\n <a href=\"http://www.last.fm/music/The+Doors/_/Back+Door+Man\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/03By6gD02qhtvIQiK8KidK\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/03By6gD02qhtvIQiK8KidK\";}','back-door-man','03By6gD02qhtvIQiK8KidK',7),(871,'2025-05-27 16:59:01','2025-05-27 16:59:01','I Looked at You','1967-01-04 00:00:00',140,'https://i.scdn.co/image/ab67616d0000b2735b96a8c5d61be8878452f8f1','“I Looked At You” is a track describing the speed of life and how Jim’s psychedelics and trips took him forward to a place where he can’t turn back.\n\nThe song slowly begins to build, showing how Jim’s enthusiasm, mood, and surrounding atmosphere changes with each performance and scenario throughout his life. In this video, he even begins to dance as the song crescendos, as shown here: <a href=\"http://www.last.fm/music/The+Doors/_/I+Looked+at+You\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6vCLIvOIabRk1XQfMb6RXi\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6vCLIvOIabRk1XQfMb6RXi\";}','i-looked-at-you','6vCLIvOIabRk1XQfMb6RXi',8),(872,'2025-05-27 16:59:01','2025-05-27 16:59:01','End of the Night','1967-01-04 00:00:00',170,'https://i.scdn.co/image/ab67616d0000b2735b96a8c5d61be8878452f8f1','End of the Night was partly inspired by/is a reference to the French author Louis-Ferdinand Celiné\'s Voyage au bout de la nuit (Journey to the end of the night), in which the cynical, misanthropic character Bardamu (a pun on the French \'Bard\', a professional poet, working for a nobleman), travels trough the horrors of World War I, colonial Africa and post World War I-America.`  Also quotes directly from William Blake\'s \"Auguries of Innocence.\"   <a href=\"http://www.last.fm/music/The+Doors/_/End+of+the+Night\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/09ezgACZuwWZt6CtQSSLRG\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/09ezgACZuwWZt6CtQSSLRG\";}','end-of-the-night','09ezgACZuwWZt6CtQSSLRG',9),(873,'2025-05-27 16:59:02','2025-05-27 16:59:02','Take It as It Comes','1967-01-04 00:00:00',134,'https://i.scdn.co/image/ab67616d0000b2735b96a8c5d61be8878452f8f1',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4pxHVL0syMQwYK3BxDaTIs\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4pxHVL0syMQwYK3BxDaTIs\";}','take-it-as-it-comes','4pxHVL0syMQwYK3BxDaTIs',10),(874,'2025-05-27 16:59:02','2025-05-27 16:59:02','The End','1967-01-04 00:00:00',703,'https://i.scdn.co/image/ab67616d0000b2735b96a8c5d61be8878452f8f1','\"The End\" is a song by The Doors. Originally a song Jim Morrison wrote about breaking up with a long time girlfriend, it evolved through months of performances at Los Angeles\' Whisky a Go Go into a nearly 12-minute opus on their self-titled album. The band would perform the song to close their last set. It was first released in January 1967.\n\n• Music\nRobby Krieger\'s slinky, haunting guitar lines over D drone in DADGAD tuning using a harmonic minor scale recall Indian drone and raga-based music <a href=\"http://www.last.fm/music/The+Doors/_/The+End\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5UgT7w6zVZjP3oyawMzbiK\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5UgT7w6zVZjP3oyawMzbiK\";}','the-end','5UgT7w6zVZjP3oyawMzbiK',11),(875,'2025-05-27 17:00:00','2025-05-27 17:00:00','Serve The Servants - 2023 Remaster','2023-10-27 00:00:00',215,'https://i.scdn.co/image/ab67616d0000b273455143dda05c7961b95b29bf',NULL,'N;','serve-the-servants-2023-remaster','4PvgxcCZxATeWt4vAZOISo',1),(876,'2025-05-27 17:00:00','2025-05-27 17:00:00','Scentless Apprentice - 2023 Remaster','2023-10-27 00:00:00',227,'https://i.scdn.co/image/ab67616d0000b273455143dda05c7961b95b29bf',NULL,'N;','scentless-apprentice-2023-remaster','2nBW0vuSbiSGRpTm4SMc3Y',2),(877,'2025-05-27 17:00:00','2025-05-27 17:00:00','Heart-Shaped Box - 2023 Remaster','2023-10-27 00:00:00',280,'https://i.scdn.co/image/ab67616d0000b273455143dda05c7961b95b29bf',NULL,'N;','heart-shaped-box-2023-remaster','2LKAB4VBxok5XPD4JVvyNX',3),(878,'2025-05-27 17:00:00','2025-05-27 17:00:00','Rape Me - 2023 Remaster','2023-10-27 00:00:00',169,'https://i.scdn.co/image/ab67616d0000b273455143dda05c7961b95b29bf',NULL,'N;','rape-me-2023-remaster','6LUVnYAspgzDQLWKhV1N7l',4),(879,'2025-05-27 17:00:00','2025-05-27 17:00:00','Frances Farmer Will Have Her Revenge On Seattle - 2023 Remaster','2023-10-27 00:00:00',249,'https://i.scdn.co/image/ab67616d0000b273455143dda05c7961b95b29bf',NULL,'N;','frances-farmer-will-have-her-revenge-on-seattle-2023-remaster','2w0tLhhthDCLxu2VHi2cqQ',5),(880,'2025-05-27 17:00:00','2025-05-27 17:00:00','Dumb - 2023 Remaster','2023-10-27 00:00:00',151,'https://i.scdn.co/image/ab67616d0000b273455143dda05c7961b95b29bf',NULL,'N;','dumb-2023-remaster','41GZsHDaQs5xsfxD156swD',6),(881,'2025-05-27 17:00:00','2025-05-27 17:00:00','Very Ape - 2023 Remaster','2023-10-27 00:00:00',115,'https://i.scdn.co/image/ab67616d0000b273455143dda05c7961b95b29bf',NULL,'N;','very-ape-2023-remaster','5Yludhd9Q6nHd4j9vUJ7I6',7),(882,'2025-05-27 17:00:00','2025-05-27 17:00:00','Milk It - 2023 Remaster','2023-10-27 0