/track/3w5Ekq9O8g0gGFEsT77Ydi\";}','serve-the-servants','3w5Ekq9O8g0gGFEsT77Ydi',1),(1236,'2025-05-27 17:00:39','2025-05-27 17:00:39','Scentless Apprentice','1993-09-21 00:00:00',228,'https://i.scdn.co/image/ab67616d0000b273c4f52ef8782f0e8ede4c1aaf','\"Scentless Apprentice\" most likely dates back to late 1992, and is rare among Nirvana songs in that all three members - singer/guitarist Kurt Cobain, drummer Dave Grohl and bassist Krist Novoselic - contributed to writing.\n\nAccording to the 1993 Nirvana biography Come as You Are by Michael Azerrad, the song\'s main guitar riff was written by Grohl. Cobain was initially unimpressed with the riff, and admitted in the book that he only worked on it so that Grohl would not be offended. <a href=\"http://www.last.fm/music/Nirvana/_/Scentless+Apprentice\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3pqjXnDi8Nux88e4zv49Fc\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/54UFDHWI2q7WHfrGbSNWph\";}','scentless-apprentice','54UFDHWI2q7WHfrGbSNWph',2),(1237,'2025-05-27 17:00:44','2025-05-27 17:00:44','Heart-Shaped Box','1993-09-21 00:00:00',281,'https://i.scdn.co/image/ab67616d0000b273c4f52ef8782f0e8ede4c1aaf',NULL,'N;','heart-shaped-box','66w5OYw2ja8lnmaA3Ns0PU',3),(1238,'2025-05-27 17:00:44','2025-05-27 17:00:44','Rape Me','1993-09-21 00:00:00',170,'https://i.scdn.co/image/ab67616d0000b273c4f52ef8782f0e8ede4c1aaf','Rape Me is a song by the American grunge band Nirvana. The song was released as the second single from Nirvana\'s 1993 album In Utero, packaged as a double a-side along with \"All Apologies.\"\n\n\"Rape Me\" was written by Nirvana singer/guitarist Kurt Cobain in an apartment in Los Angeles, California in May 1991, around the time the band\'s second album, Nevermind (1991), was being mixed. It was first performed live on June 18, 1991, at the Catalyst in Santa Cruz <a href=\"http://www.last.fm/music/Nirvana/_/Rape+Me\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/7qIW8MsqBUsSP2KlZhWP06\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2i5K0EdMY5zFs9t7KfYK3k\";}','rape-me','2i5K0EdMY5zFs9t7KfYK3k',4),(1239,'2025-05-27 17:00:45','2025-05-27 17:00:45','Frances Farmer Will Have Her Revenge On Seattle','1993-09-21 00:00:00',250,'https://i.scdn.co/image/ab67616d0000b273c4f52ef8782f0e8ede4c1aaf','\"Frances Farmer Will Have Her Revenge on Seattle\" was inspired by Shadowland, a 1978 biography of actress Frances Farmer, whom Cobain had been fascinated with ever since he read the book in high school.\n\nFrances Farmer was an American actress from Seattle. Despite what many believe, this song has very little (arguably, nothing) to do with her so-called controversial essay \"God Dies\".\n\nFarmer was involuntarily institutionalized by her family a number of times for causing trouble and legal problems with Paramount Pictures <a href=\"http://www.last.fm/music/Nirvana/_/Frances+Farmer+Will+Have+Her+Revenge+on+Seattle\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/27rDqwKojyXsjg2GmYmqDL\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/06B04lID9HGPwPWwBkTQfU\";}','frances-farmer-will-have-her-revenge-on-seattle','06B04lID9HGPwPWwBkTQfU',5),(1240,'2025-05-27 17:00:45','2025-05-27 17:00:45','Dumb','1993-09-21 00:00:00',151,'https://i.scdn.co/image/ab67616d0000b273c4f52ef8782f0e8ede4c1aaf','\"Dumb\" is a song by American rock band Nirvana. It is the sixth song on the band\'s third studio album In Utero, released in 1993.\nKurt Cobain wrote \"Dumb\" in the summer of 1990 after he had begun to follow some of his own poppier instincts. Cobain debuted the song for Calvin Johnson of K Records on KAOS (FM) in the same year.\nThe first version to be officially released was on the In Utero album in 1993 and Cobain said that he did not – as had been <a href=\"http://www.last.fm/music/Nirvana/_/Dumb\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4Zawb6nn8bBG7PhR7JrUen\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5gRcv46AMTrosmTOqrOV3Q\";}','dumb','5gRcv46AMTrosmTOqrOV3Q',6),(1241,'2025-05-27 17:00:56','2025-05-27 17:00:56','Very Ape','1993-09-21 00:00:00',115,'https://i.scdn.co/image/ab67616d0000b273c4f52ef8782f0e8ede4c1aaf','An up-tempo sweep at the sort of macho pose found in underground rock circles.  Originally titled \"Perky New Wave Number\".\n\nThe riff from the song was used  by British techno band The Prodigy at their track \"Voodoo People\" from the 1995 album \"Music for the Jilted Generation\", But rather than sampled it was played by a guitarist Lance Riddler <a href=\"http://www.last.fm/music/Nirvana/_/Very+Ape\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2bSAOu1H2ZIKY1ef9gxgRE\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0hUit24g1EIoATdKYWUiRj\";}','very-ape','0hUit24g1EIoATdKYWUiRj',7),(1242,'2025-05-27 17:00:57','2025-05-27 17:00:57','Milk It','1993-09-21 00:00:00',234,'https://i.scdn.co/image/ab67616d0000b273c4f52ef8782f0e8ede4c1aaf','\'Milk It\' is track number 8 from Nirvana\'s third and final studio album \'In Utero\' it was released on September 13, 1993 by DGC Records.  <a href=\"http://www.last.fm/music/Nirvana/_/Milk+It\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6EhAwRsJBZCAhiafdLByU5\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4rtZtLpriBscg7zta3TZxp\";}','milk-it','4rtZtLpriBscg7zta3TZxp',8),(1243,'2025-05-27 17:00:57','2025-05-27 17:00:57','Pennyroyal Tea','1993-09-21 00:00:00',218,'https://i.scdn.co/image/ab67616d0000b273c4f52ef8782f0e8ede4c1aaf','\"Pennyroyal Tea\" is a song by the American grunge band Nirvana. It is the ninth song on their 1993 album, In Utero, scheduled to be released as the album\'s third single in April 1994. The plan was abandoned after Nirvana frontman Kurt Cobain was found dead that same month, as the label did not want to appear to be capitalizing on his untimely death. A few copies survived from the initial manufacturing process and have gone on to become highly-sought after by music collectors and Nirvana enthusiasts alike. <a href=\"http://www.last.fm/music/Nirvana/_/Pennyroyal+Tea\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3z53rfQOg6Eb5pBCRsd7Uu\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3z53rfQOg6Eb5pBCRsd7Uu\";}','pennyroyal-tea','3z53rfQOg6Eb5pBCRsd7Uu',9),(1244,'2025-05-27 17:00:57','2025-05-27 17:00:57','Radio Friendly Unit Shifter','1993-09-21 00:00:00',291,'https://i.scdn.co/image/ab67616d0000b273c4f52ef8782f0e8ede4c1aaf','According to Kurt Cobain, this song is a throwaway song - just a bunch of random poetry lines thrown together.\nThe title is a reference to the Nirvana song \"Smells Like Teen Spirit,\" and it\'s slick, radio-friendly sound.\nThe original title for the song, \"Four Month Media Blackout,\" is a reference to late 1991 and 1992, when \"Teen Spirit\" was on the charts. \nNirvana used this to open many of their 1993 and 1994 shows. <a href=\"http://www.last.fm/music/Nirvana/_/Radio+Friendly+Unit+Shifter\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1pskfGyHOw3knCWWjDlipy\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0W0s27FypnkXjJTJKUAnx0\";}','radio-friendly-unit-shifter','0W0s27FypnkXjJTJKUAnx0',10),(1245,'2025-05-27 17:01:08','2025-05-27 17:01:08','Tourette\'s','1993-09-21 00:00:00',95,'https://i.scdn.co/image/ab67616d0000b273c4f52ef8782f0e8ede4c1aaf',NULL,'N;','tourette-s','6ZXGdStfF4q5jnyK76uG4a',11),(1246,'2025-05-27 17:01:09','2025-05-27 17:01:09','All Apologies','1993-09-21 00:00:00',233,'https://i.scdn.co/image/ab67616d0000b273c4f52ef8782f0e8ede4c1aaf','All Apologies is a song by the American grunge band Nirvana. It was released as the second single (along with \"Rape Me\") from the band\'s third album, In Utero (1993). It was included on Rolling Stone\'s list of The 500 Greatest Songs of All Time, at number 455. \"All Apologies\" was the band\'s third number one Modern Rock hit and reached number 32 in the UK.\n\n\"All Apologies\" was nominated for a Grammy Award for Best Rock Performance by a Duo or Group with Vocal and Best Rock Song in 1995. <a href=\"http://www.last.fm/music/Nirvana/_/All+Apologies\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2xAiwGGuaqdEklu33zEXr9\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1Ic9pKxGSJGM0LKeqf6lGe\";}','all-apologies','1Ic9pKxGSJGM0LKeqf6lGe',12),(1247,'2025-05-27 17:01:10','2025-05-27 17:01:10','Dive','1992-12-14 00:00:00',235,'https://i.scdn.co/image/ab67616d0000b273e1f5fcef5fb5f70aa0a717fc','Cobain said this paid homage to bands like Kiss, but in reality, the lyrics are far more ambiguous. It is one of the last recorded Nirvana songs featuring original drummer Chad Channing, who was replaced by Dave Grohl a few months after this. This is also Courtney Love\'s favourite Nirvana song. <a href=\"http://www.last.fm/music/Nirvana/_/Dive\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6G2baGa99QcqUUTmkEgeZl\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6G2baGa99QcqUUTmkEgeZl\";}','dive','6G2baGa99QcqUUTmkEgeZl',1),(1248,'2025-05-27 17:01:11','2025-05-27 17:01:11','Sliver','1992-12-14 00:00:00',136,'https://i.scdn.co/image/ab67616d0000b273e1f5fcef5fb5f70aa0a717fc','\"Sliver\" is a song by the grunge band Nirvana. It was originally released as a non-album single in 1990 by Sub Pop. It later appeared on their compilation album Incesticide in 1992 and their 2002 \'best of\' album Nirvana. DGC re-released the song to radio to support the release of Incesticide, resulting in significant airplay.\n\nA live performance is included on the 1992 \"In Bloom\" single, another live performance can be seen on the 1994 home video Live! Tonight! Sold Out!! (released on DVD in 2006) <a href=\"http://www.last.fm/music/Nirvana/_/Sliver\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=QECJ9pCyhns\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3BtHClmMmURD8UHF2fiyxt\";}','sliver','3BtHClmMmURD8UHF2fiyxt',2),(1249,'2025-05-27 17:01:21','2025-05-27 17:01:21','Stain','1992-12-14 00:00:00',160,'https://i.scdn.co/image/ab67616d0000b273e1f5fcef5fb5f70aa0a717fc','“Stain” was recorded in September 1989 for the Blew EP sessions.\n\nThe song portrays the typical ne\'er do well in the eyes of Kurt, and probably touches base on some of the criticism he’s taken from his own friends and family, such as Tracy Marander, the girl who Kurt wrote About a Girl about. He was, “A stain on society.” In this sense, the lyrics are similar to “Even in His Youth” and “Negative Creep”. <a href=\"http://www.last.fm/music/Nirvana/_/Stain\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4IryVI254hGj0J8ND5r8gZ\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4IryVI254hGj0J8ND5r8gZ\";}','stain','4IryVI254hGj0J8ND5r8gZ',3),(1250,'2025-05-27 17:01:21','2025-05-27 17:01:21','Been A Son - BBC Mark Goodier Session','1992-12-14 00:00:00',115,'https://i.scdn.co/image/ab67616d0000b273e1f5fcef5fb5f70aa0a717fc',NULL,'N;','been-a-son-bbc-mark-goodier-session','4dXBG3zz9SzaPBtm4Fv91x',4),(1251,'2025-05-27 17:01:21','2025-05-27 17:01:21','Turnaround - BBC John Peel Session 1990','1992-12-14 00:00:00',139,'https://i.scdn.co/image/ab67616d0000b273e1f5fcef5fb5f70aa0a717fc',NULL,'N;','turnaround-bbc-john-peel-session-1990','7zMAm9ebhkMQuGrYm8FcPt',5),(1252,'2025-05-27 17:01:22','2025-05-27 17:01:22','Molly\'s Lips - BBC John Peel Session 1990','1992-12-14 00:00:00',114,'https://i.scdn.co/image/ab67616d0000b273e1f5fcef5fb5f70aa0a717fc',NULL,'N;','molly-s-lips-bbc-john-peel-session-1990','0brL7VMo7onJJTGMSdajic',6),(1253,'2025-05-27 17:01:22','2025-05-27 17:01:22','Son Of A Gun - BBC John Peel Session 1990','1992-12-14 00:00:00',168,'https://i.scdn.co/image/ab67616d0000b273e1f5fcef5fb5f70aa0a717fc',NULL,'N;','son-of-a-gun-bbc-john-peel-session-1990','76sVqjHYyW99EpeQLDkPME',7),(1254,'2025-05-27 17:01:22','2025-05-27 17:01:22','(New Wave) Polly - BBC Mark Goodier Session','1992-12-14 00:00:00',107,'https://i.scdn.co/image/ab67616d0000b273e1f5fcef5fb5f70aa0a717fc',NULL,'N;','new-wave-polly-bbc-mark-goodier-session','0k9tUFpXZg7TvMZk4l6OTa',8),(1255,'2025-05-27 17:01:33','2025-05-27 17:01:33','Beeswax','1992-12-14 00:00:00',170,'https://i.scdn.co/image/ab67616d0000b273e1f5fcef5fb5f70aa0a717fc','Dates back to 1988 when Dale Crover was the band\'s drummer, but not issued until August 1991. <a href=\"http://www.last.fm/music/Nirvana/_/Beeswax\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/73heu76HyAQRRN1u3vubq6\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/73heu76HyAQRRN1u3vubq6\";}','beeswax','73heu76HyAQRRN1u3vubq6',9),(1256,'2025-05-27 17:01:33','2025-05-27 17:01:33','Downer','1992-12-14 00:00:00',103,'https://i.scdn.co/image/ab67616d0000b273e1f5fcef5fb5f70aa0a717fc','Inspired by an early love of hardcore bands like MDC and Black Flag, it was one of the first songs Cobain ever wrote.\n\n\"I was trying to be Mr Political Punk Rock Black Flag Guy... I really didn\'t know what I was talking about.\" He admitted. <a href=\"http://www.last.fm/music/Nirvana/_/Downer\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4e0MJaiXSwXBhrQZHyoK8c\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4e0MJaiXSwXBhrQZHyoK8c\";}','downer','4e0MJaiXSwXBhrQZHyoK8c',10),(1257,'2025-05-27 17:01:34','2025-05-27 17:01:34','Mexican Seafood','1992-12-14 00:00:00',115,'https://i.scdn.co/image/ab67616d0000b273e1f5fcef5fb5f70aa0a717fc','Was on the setlist of Nirvana\'s first public gig at a house party in 1987.  It details Cobain\'s obsession with bodily fluids and functions. <a href=\"http://www.last.fm/music/Nirvana/_/Mexican+Seafood\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6x20PMZz6zDTODupdLxJUZ\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6x20PMZz6zDTODupdLxJUZ\";}','mexican-seafood','6x20PMZz6zDTODupdLxJUZ',11),(1258,'2025-05-27 17:01:35','2025-05-27 17:01:35','Hairspray Queen','1992-12-14 00:00:00',253,'https://i.scdn.co/image/ab67616d0000b273e1f5fcef5fb5f70aa0a717fc','Often described as Nirvana\'s tribute to Gang of Four, a band Nirvana regularly paid tribute to. <a href=\"http://www.last.fm/music/Nirvana/_/Hairspray+Queen\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5X2Z78KBrHKkzcjdZZs5UN\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5X2Z78KBrHKkzcjdZZs5UN\";}','hairspray-queen','5X2Z78KBrHKkzcjdZZs5UN',12),(1259,'2025-05-27 17:01:45','2025-05-27 17:01:45','Aero Zeppelin','1992-12-14 00:00:00',281,'https://i.scdn.co/image/ab67616d0000b273e1f5fcef5fb5f70aa0a717fc','A gothic sounding analysis of big bucks rock and roll.  In his journals Cobain commented, \"This song is not about Aerosmith or Led Zeppelin, it\'s about The Cult, Faster Pussycat, Kingdom Come, Guns \'N Roses and Nirvana.\" <a href=\"http://www.last.fm/music/Nirvana/_/Aero+Zeppelin\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6ENZJCRagbW3jlzXSucfoI\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6ENZJCRagbW3jlzXSucfoI\";}','aero-zeppelin','6ENZJCRagbW3jlzXSucfoI',13),(1260,'2025-05-27 17:01:46','2025-05-27 17:01:46','Big Long Now','1992-12-14 00:00:00',303,'https://i.scdn.co/image/ab67616d0000b273e1f5fcef5fb5f70aa0a717fc',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1Yk88pNibq8kIHKDQW5Jnu\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1Yk88pNi