5-27 17:02:48','2025-05-27 17:02:48','Blew','1989-06-01 00:00:00',174,'https://i.scdn.co/image/ab67616d0000b27397507fd22fb690cb9085a864','A testament to how raw Nirvana were at the time: on the first day of the Bleach sessions, Cobain and Novoselic tuned their guitars down two notes, forgetting they had already tuned down from a standard setting.  Blew, a meditation on entrapment and control was even sludgier than they intended. <a href=\"http://www.last.fm/music/Nirvana/_/Blew\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4FoVw6Nqavw4lfnwCmH4BT\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7pETV41GUutaZ6KMHMAYIH\";}','blew','7pETV41GUutaZ6KMHMAYIH',1),(1412,'2025-05-27 17:02:49','2025-05-27 17:02:49','Floyd The Barber','1989-06-01 00:00:00',138,'https://i.scdn.co/image/ab67616d0000b27397507fd22fb690cb9085a864','A claustrophobic, desperate dirge about \"a small town gone bad\", Floyd was Cobain\'s comment on his upbringing in Aberdeen, Washington and the feelings of emasculation that came from living with his macho dad.  \n\nThe song took its title from a character in 60s US sitcom The Andy Griffith Show. <a href=\"http://www.last.fm/music/Nirvana/_/Floyd+the+Barber\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4WG43ZPnIc9vI3BAbnG7Et\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0aMqNFBj9KtPTD3c3tByRT\";}','floyd-the-barber','0aMqNFBj9KtPTD3c3tByRT',2),(1413,'2025-05-27 17:03:00','2025-05-27 17:03:00','About A Girl','1989-06-01 00:00:00',168,'https://i.scdn.co/image/ab67616d0000b27397507fd22fb690cb9085a864','\"About a Girl\" was written after Kurt Cobain spent an entire afternoon listening to Meet The Beatles! repeatedly.[1] At the time, Cobain was trying to conceal his pop songwriting instincts, and he was reluctant to include the song on Bleach for fear of alienating the band\'s then-exclusively grunge fan base. In a 1993 Rolling Stone interview with David Fricke, he explained:\n\n    \"Even to put \"About a Girl\" on Bleach was a risk. I was heavily into pop, I really liked R. <a href=\"http://www.last.fm/music/Nirvana/_/About+a+Girl\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3ti6Jgpb9qYyclshjuVnGo\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2SHTKB8YYlawTGIuJ2b2ok\";}','about-a-girl','2SHTKB8YYlawTGIuJ2b2ok',3),(1414,'2025-05-27 17:03:01','2025-05-27 17:03:01','School','1989-06-01 00:00:00',162,'https://i.scdn.co/image/ab67616d0000b27397507fd22fb690cb9085a864','On April 24, 1988, Jonathan Poneman from Sub Pop secured Nirvana the opening slot on a Sub Pop Sunday show at The Vogue in Seattle. Poneman, along with his business partner Bruce Pavitt, scene photographer Charles Peterson, and Mudhoney\'s Mark Arm, were among those who were embarrassed by the band\'s typically messy performance.\n\nHowever, in his subsequent letter to Melvin\'s drummer Dale Crover, Cobain put a self-serving spin on the night\'s events <a href=\"http://www.last.fm/music/Nirvana/_/School\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/40K9cDjcCCGTRTpOcY2swh\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0EY1Z9UmZnYZyM7zHs6C0j\";}','school','0EY1Z9UmZnYZyM7zHs6C0j',4),(1415,'2025-05-27 17:03:02','2025-05-27 17:03:02','Love Buzz','1989-06-01 00:00:00',215,'https://i.scdn.co/image/ab67616d0000b27397507fd22fb690cb9085a864','\"Love Buzz\" is a song written by Robbie van Leeuwen of Dutch rock band Shocking Blue. The American grunge band Nirvana recorded a cover version of the song for its debut single, released on Sub Pop in 1988. It was the first single in the Sub Pop Single of the Month club, a marketing gimmick which helped Sub Pop stay temporarily financially solvent. A different mix of the song would also appear on Nirvana\'s debut album, Bleach, along with the single\'s b-side, \"Big Cheese\". <a href=\"http://www.last.fm/music/Nirvana/_/Love+Buzz\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1LXCcreL7xDtzp9qD9vaBi\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5muVpPu8Fj9fXfDbbqDdrZ\";}','love-buzz','5muVpPu8Fj9fXfDbbqDdrZ',5),(1416,'2025-05-27 17:03:13','2025-05-27 17:03:13','Paper Cuts','1989-06-01 00:00:00',246,'https://i.scdn.co/image/ab67616d0000b27397507fd22fb690cb9085a864','Partly based on the true story of a local family who kept their children locked in a room (\"At my feeding time/She\'d push food through the door\").  The song also drew on Cobain\'s own feelings of parental neglect. <a href=\"http://www.last.fm/music/Nirvana/_/Paper+Cuts\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0cuawnxMvyCBwZbXtaTxmY\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0cuawnxMvyCBwZbXtaTxmY\";}','paper-cuts','0cuawnxMvyCBwZbXtaTxmY',6),(1417,'2025-05-27 17:03:13','2025-05-27 17:03:13','Negative Creep','1989-06-01 00:00:00',175,'https://i.scdn.co/image/ab67616d0000b27397507fd22fb690cb9085a864','IGN has described \"Negative Creep\" as a prime example of Seattle\'s authentic grunge sound, showcasing Kurt\'s penchant for antisocial themes through a first-person perspective.\n\nThis track stands out both on the album Bleach and within Nirvana\'s discography. It prominently features Cobain\'s piercing, high-pitched wails layered over a slick yet raw riff that runs throughout the song. The enigmatic lyrics add to its status as an \"unsung masterpiece,\" as some fans would describe it. <a href=\"http://www.last.fm/music/Nirvana/_/Negative+Creep\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5IeTFRymTDiza7DciBD1Gk\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5IeTFRymTDiza7DciBD1Gk\";}','negative-creep','5IeTFRymTDiza7DciBD1Gk',7),(1418,'2025-05-27 17:03:14','2025-05-27 17:03:14','Scoff','1989-06-01 00:00:00',250,'https://i.scdn.co/image/ab67616d0000b27397507fd22fb690cb9085a864','Yet another crude outburst of malice and sarcasm. The line \"I\'m not worth it in your eyes\" delves into Cobain\'s troubled childhood, whereas the recurring phrase \"Give me back my alcohol\" can be interpreted as a bitter response to his parents\' concerns that his future as a high school dropout would only lead to a downward spiral. <a href=\"http://www.last.fm/music/Nirvana/_/Scoff\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/7qlMlDDjN46ugUlU44ABoh\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/43OH1K8VQSctPPt7982cRF\";}','scoff','43OH1K8VQSctPPt7982cRF',8),(1419,'2025-05-27 17:03:25','2025-05-27 17:03:25','Swap Meet','1989-06-01 00:00:00',183,'https://i.scdn.co/image/ab67616d0000b27397507fd22fb690cb9085a864','This track can be considered a love song in a \"white trash\" style, and it stands out as one of the more upbeat moments on the album. It seemingly revolves around a couple living in poverty who share their common interests. The chorus alludes to Cobain\'s personal connection with his girlfriend at the time, Tracy Marander. <a href=\"http://www.last.fm/music/Nirvana/_/Swap+Meet\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/7iU9kLfTsJxwBA931jm3Rv\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7iU9kLfTsJxwBA931jm3Rv\";}','swap-meet','7iU9kLfTsJxwBA931jm3Rv',9),(1420,'2025-05-27 17:03:25','2025-05-27 17:03:25','Mr. Moustache','1989-06-01 00:00:00',203,'https://i.scdn.co/image/ab67616d0000b27397507fd22fb690cb9085a864','A sneering, six-note tirade lambasting macho, redneck culture (and by extension, Cobain\'s own father) and the self-righteous political correctness of Olympia\'s underground scene. <a href=\"http://www.last.fm/music/Nirvana/_/Mr.+Moustache\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5TZbtpZcTWKEn81Du4hiTb\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5TZbtpZcTWKEn81Du4hiTb\";}','mr-moustache','5TZbtpZcTWKEn81Du4hiTb',10),(1421,'2025-05-27 17:03:26','2025-05-27 17:03:26','Sifting','1989-06-01 00:00:00',322,'https://i.scdn.co/image/ab67616d0000b27397507fd22fb690cb9085a864',' <a href=\"http://www.last.fm/music/Nirvana/_/Sifting\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4ZWHaSHT6NGehQtNerMgTA\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4ZWHaSHT6NGehQtNerMgTA\";}','sifting','4ZWHaSHT6NGehQtNerMgTA',11),(1422,'2025-05-27 17:03:26','2025-05-27 17:03:26','Big Cheese','1989-06-01 00:00:00',222,'https://i.scdn.co/image/ab67616d0000b27397507fd22fb690cb9085a864','The title refers to Sub Pop boss Jonathan Poneman who was already poking his nose into Nirvana\'s affairs and, Cobain felt, was being judgemental about their art. <a href=\"http://www.last.fm/music/Nirvana/_/Big+Cheese\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6ZYvlKKiccbtX1N0lJUonV\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6ZYvlKKiccbtX1N0lJUonV\";}','big-cheese','6ZYvlKKiccbtX1N0lJUonV',12),(1423,'2025-05-27 17:03:37','2025-05-27 17:03:37','Downer','1989-06-01 00:00:00',103,'https://i.scdn.co/image/ab67616d0000b27397507fd22fb690cb9085a864','Inspired by an early love of hardcore bands like MDC and Black Flag, it was one of the first songs Cobain ever wrote.\n\n\"I was trying to be Mr Political Punk Rock Black Flag Guy... I really didn\'t know what I was talking about.\" He admitted. <a href=\"http://www.last.fm/music/Nirvana/_/Downer\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4e0MJaiXSwXBhrQZHyoK8c\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6YL8C91mzH8s0Qd14xBpJd\";}','downer','6YL8C91mzH8s0Qd14xBpJd',13),(1424,'2025-05-27 17:11:09','2025-05-27 17:11:09','Parigoria','2025-01-31 00:00:00',252,'https://i.scd