e','7Mj6ZcL9mmguKgofjqgKN4',1),(2116,'2025-05-27 17:51:49','2025-05-27 17:51:49','Wagging Tongue','2023-03-24 00:00:00',204,'https://i.scdn.co/image/ab67616d0000b273dc2882cd98a9bc32e56e6293','\"Wagging Tongue\" is the second track featured on Depeche Mode\'s 15th studio album, Memento Mori, released on 24 March 2023. It was released as a single on 7 July 2023, and its music video was released on 24 May 2023. The music video was directed by The Sacred Egg, with Anton Corbijn acting as a creative director. The song peaked in the UK Singles Chart, reaching a position of 54. Frontman Dave Gahan states the song contains \"Kraftwerk-esque chords and arpeggiated synths,\" a common theme seen across the album. <a href=\"http://www.last.fm/music/Depeche+Mode/_/Wagging+Tongue\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5g2GhW0Xdc0HHwUCaKkmRQ\";}','wagging-tongue','5g2GhW0Xdc0HHwUCaKkmRQ',2),(2117,'2025-05-27 17:51:50','2025-05-27 17:51:50','Ghosts Again','2023-03-24 00:00:00',238,'https://i.scdn.co/image/ab67616d0000b273dc2882cd98a9bc32e56e6293','\"Ghosts Again\" is a song by English electronic band Depeche Mode. It was released on 9 February 2023 as the lead single from their 15th studio album, Memento Mori.\n\nThe song marks the first single release since the death of co-founder and keyboardist Andy Fletcher in May 2022. To Dave Gahan, the song \"captures this perfect balance of melancholy and joy,\" while Martin Gore added that the song has \"such an upbeat feel to it\" and how rare it is for the band to record a song that \"I just don\'t get sick of listening to.\" <a href=\"http://www.last.fm/music/Depeche+Mode/_/Ghosts+Again\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3p5JD79PQP737dyEY2hnmf\";}','ghosts-again','3p5JD79PQP737dyEY2hnmf',3),(2118,'2025-05-27 17:52:00','2025-05-27 17:52:00','Don\'t Say You Love Me','2023-03-24 00:00:00',228,'https://i.scdn.co/image/ab67616d0000b273dc2882cd98a9bc32e56e6293',NULL,'N;','don-t-say-you-love-me','1FD5Ls4IazGePpuS5PphMn',4),(2119,'2025-05-27 17:52:00','2025-05-27 17:52:00','My Favourite Stranger','2023-03-24 00:00:00',237,'https://i.scdn.co/image/ab67616d0000b273dc2882cd98a9bc32e56e6293','\"My Favourite Stranger\" is the fifth track featured on Depeche Mode\'s 15th studio album, Memento Mori, released on 24 March 2023. It was released as a single on 29 September 2023, and its music video was released on 21 September 2023 and was directed by long-time collaborator Anton Corbijn. It was co-written by Martin Gore and Richard Butler from The Psychedelic Furs. Depeche Mode\'s frontman, Dave Gahan, says the song is \"about having a shadow, someone who follows you around the clock and tells you things. <a href=\"http://www.last.fm/music/Depeche+Mode/_/My+Favourite+Stranger\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2ARxntdEqBj9MeKFuckr8R\";}','my-favourite-stranger','2ARxntdEqBj9MeKFuckr8R',5),(2120,'2025-05-27 17:52:01','2025-05-27 17:52:01','Soul With Me','2023-03-24 00:00:00',255,'https://i.scdn.co/image/ab67616d0000b273dc2882cd98a9bc32e56e6293',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4KyjDltC4B68pef319qLjJ\";}','soul-with-me','4KyjDltC4B68pef319qLjJ',6),(2121,'2025-05-27 17:52:01','2025-05-27 17:52:01','Caroline\'s Monkey','2023-03-24 00:00:00',256,'https://i.scdn.co/image/ab67616d0000b273dc2882cd98a9bc32e56e6293',NULL,'N;','caroline-s-monkey','7l8CZIiIt5ERP9tg7tArrF',7),(2122,'2025-05-27 17:52:12','2025-05-27 17:52:12','Before We Drown','2023-03-24 00:00:00',245,'https://i.scdn.co/image/ab67616d0000b273dc2882cd98a9bc32e56e6293',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2LRqm962By8aNwJX0WxFNG\";}','before-we-drown','2LRqm962By8aNwJX0WxFNG',8),(2123,'2025-05-27 17:52:12','2025-05-27 17:52:12','People Are Good','2023-03-24 00:00:00',264,'https://i.scdn.co/image/ab67616d0000b273dc2882cd98a9bc32e56e6293','\"People Are Good\" is a song by English electronic music band Depeche Mode, released on 5 April 2024 as the seventh and final single from their fifteenth studio album Memento Mori.\n\n\"People Are Good\" is a song reminiscent of the industrial sound of Depeche Mode\'s early years, without being overly insistent of this trend, and is actually closer to dark wave—with lyrics about the ideal people and how they really are. The band also released a special collection of five remixes of the song. <a href=\"http://www.last.fm/music/Depeche+Mode/_/People+Are+Good\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2h4QlHTk5OKkKozTszRYgi\";}','people-are-good','2h4QlHTk5OKkKozTszRYgi',9),(2124,'2025-05-27 17:52:13','2025-05-27 17:52:13','Always You','2023-03-24 00:00:00',258,'https://i.scdn.co/image/ab67616d0000b273dc2882cd98a9bc32e56e6293',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0Fy8AMzsGc5MVD7fHIVaKn\";}','always-you','0Fy8AMzsGc5MVD7fHIVaKn',10),(2125,'2025-05-27 17:52:13','2025-05-27 17:52:13','Never Let Me Go','2023-03-24 00:00:00',243,'https://i.scdn.co/image/ab67616d0000b273dc2882cd98a9bc32e56e6293',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2RfrOEGUK6lakj8PIGvQh6\";}','never-let-me-go','2RfrOEGUK6lakj8PIGvQh6',11),(2126,'2025-05-27 17:52:24','2025-05-27 17:52:24','Speak To Me','2023-03-24 00:00:00',275,'https://i.scdn.co/image/ab67616d0000b273dc2882cd98a9bc32e56e6293',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4ZFIkAVwQYnmfxXQI1yEl0\";}','speak-to-me','4ZFIkAVwQYnmfxXQI1yEl0',12),(2127,'2025-05-27 17:52:24','2025-05-27 17:52:24','Intro - LiVE SPiRiTS','2020-06-26 00:00:00',150,'https://i.scdn.co/image/ab67616d0000b2739fd9e55f370136f88143e295',NULL,'N;','intro-live-spirits','6Qv4IIv6EQCUJdIWyWzDWu',1),(2128,'2025-05-27 17:52:24','2025-05-27 17:52:24','Going Backwards - LiVE SPiRiTS','2020-06-26 00:00:00',372,'https://i.scdn.co/image/ab67616d0000b2739fd9e55f370136f88143e295'