Speaks - Acoustic Version','2001-05-14 00:00:00',360,'https://i.scdn.co/image/ab67616d0000b2734b1d8575577b851f773c3d5c',NULL,'N;','when-the-body-speaks-acoustic-version','1kig7JPkEAIVZ8EwV4gqT8',24),(2340,'2025-05-27 17:53:21','2025-05-27 17:53:21','Dream On','2001-05-14 00:00:00',259,'https://i.scdn.co/image/ab67616d0000b2738111c637c7c2b1cba52f24b3','\"Dream On\" is Depeche Mode\'s thirty-sixth UK single, released on April 23, 2001 in the UK and April 24 in the US. It was the first single for the then-upcoming album Exciter.\n\"Dream On\" is an electronic based song mixed in with acoustic guitar and rough vocals, causing some people to falsely think of it as a country song. The single version starts with the guitar, while the album version has David Gahan saying \"Can you feel a little love?\" before a minimal electro beat opens the song. <a href=\"http://www.last.fm/music/Depeche+Mode/_/Dream+On\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0T7Horo32W34iuW6iC6iRU\";}','dream-on','0T7Horo32W34iuW6iC6iRU',1),(2341,'2025-05-27 17:53:27','2025-05-27 17:53:27','Shine','2001-05-14 00:00:00',332,'https://i.scdn.co/image/ab67616d0000b2738111c637c7c2b1cba52f24b3',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2UKO82iMluuUTpal7daTxe\";}','shine','2UKO82iMluuUTpal7daTxe',2),(2342,'2025-05-27 17:53:27','2025-05-27 17:53:27','The Sweetest Condition','2001-05-14 00:00:00',222,'https://i.scdn.co/image/ab67616d0000b2738111c637c7c2b1cba52f24b3',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6U7vEjDKsP59O0DLZaWDS4\";}','the-sweetest-condition','6U7vEjDKsP59O0DLZaWDS4',3),(2343,'2025-05-27 17:53:28','2025-05-27 17:53:28','When the Body Speaks','2001-05-14 00:00:00',361,'https://i.scdn.co/image/ab67616d0000b2738111c637c7c2b1cba52f24b3','\"When the Body Speaks\"  was featured on Depeche Mode\'s tenth studio album, Exciter, released in 2001. The track showcases Depeche Mode\'s ability to blend electronic elements with emotive vocals and introspective lyrics, creating a haunting and atmospheric sound.\n\nThe song\'s composition is characterized by its slow tempo, ethereal synth textures, and lead singer Dave Gahan\'s emotive vocal delivery. \"When the Body Speaks\" explores themes of vulnerability, intimacy, and the unspoken communication that can occur between individuals. <a href=\"http://www.last.fm/music/Depeche+Mode/_/When+the+Body+Speaks\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5ypac5htDoms5nj37DqZvz\";}','when-the-body-speaks','5ypac5htDoms5nj37DqZvz',4),(2344,'2025-05-27 17:53:28','2025-05-27 17:53:28','The Dead of Night','2001-05-14 00:00:00',290,'https://i.scdn.co/image/ab67616d0000b2738111c637c7c2b1cba52f24b3',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/03bARMDVZwd4ijp5RhdS0f\";}','the-dead-of-night','03bARMDVZwd4ijp5RhdS0f',5),(2345,'2025-05-27 17:53:39','2025-05-27 17:53:39','Lovetheme','2001-05-14 00:00:00',122,'https://i.scdn.co/image/ab67616d0000b2738111c637c7c2b1cba52f24b3',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/40qPGaiaeOWdjrq2es9YxG\";}','lovetheme','40qPGaiaeOWdjrq2es9YxG',6),(2346,'2025-05-27 17:53:39','2025-05-27 17:53:39','Freelove','2001-05-14 00:00:00',370,'https://i.scdn.co/image/ab67616d0000b2738111c637c7c2b1cba52f24b3',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4a1zFFjW4mbbU4bjFT3cXO\";}','freelove','4a1zFFjW4mbbU4bjFT3cXO',7),(2347,'2025-05-27 17:53:40','2025-05-27 17:53:40','Comatose','2001-05-14 00:00:00',204,'https://i.scdn.co/image/ab67616d0000b2738111c637c7c2b1cba52f24b3',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7uuhEXAUSYlSGwAIfL21GJ\";}','comatose','7uuhEXAUSYlSGwAIfL21GJ',8),(2348,'2025-05-27 17:53:40','2025-05-27 17:53:40','I Feel Loved','2001-05-14 00:00:00',260,'https://i.scdn.co/image/ab67616d0000b2738111c637c7c2b1cba52f24b3','I Feel Loved is Depeche Mode\'s thirty-seventh UK single, release