 on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0ooy3NjwsJreceWYCxlfQt\";}','never-let-me-down-again','0ooy3NjwsJreceWYCxlfQt',1),(2467,'2025-05-27 17:54:45','2025-05-27 17:54:45','The Things You Said','1987-09-28 00:00:00',235,'https://i.scdn.co/image/ab67616d0000b2738636ea09d374ec9937e81388',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4P9jWfITiiSq2uueK1vzoU\";}','the-things-you-said','4P9jWfITiiSq2uueK1vzoU',2),(2468,'2025-05-27 17:54:45','2025-05-27 17:54:45','Strangelove','1987-09-28 00:00:00',296,'https://i.scdn.co/image/ab67616d0000b2738636ea09d374ec9937e81388','Strangelove is Depeche Mode\'s eighteenth UK single, released on 13 Apr 87, and the first single for the then upcoming album Music for the Masses. It reached #16 in the UK charts (Depeche Mode would fail to make the Top 10 of the UK singles chart throughout the second half of the 1980s), but hit #2 in West Germany and in South Africa, and was a Top 10 success in several other countries (Sweden, Switzerland, etc.).\n\nThe original version of \"Strangelove\" is a fast-paced poppy track. <a href=\"http://www.last.fm/music/Depeche+Mode/_/Strangelove\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2dcB3lv4706Qzapml9T1hV\";}','strangelove','2dcB3lv4706Qzapml9T1hV',3),(2469,'2025-05-27 17:54:51','2025-05-27 17:54:51','Sacred','1987-09-28 00:00:00',284,'https://i.scdn.co/image/ab67616d0000b2738636ea09d374ec9937e81388','\"Sacred\" is the fourth track on the 1987 album Music For The Masses by Depeche Mode.\n\nAndy Fletcher told Képes 7 magazine (translated from Hungarian): \"Sacred is about love, about love as a creed.\"\n\nDave Bascombe told Vaughn George in April 2020: \" details on \'Sacred\', because I\'m never happy with that. I had a monitor mix on that which I think I lost. Actually, it did resurface online as a cassette mix I had done, and that was much more how it should have been, and I tried too hard on this mi