s alive is a record that explores the theme of life and hope. Guitarist and singer Neil Halstead said via a press release: “It wouldn’t feel right to make a really dark record right now. The album is quite eclectic emotionally, but it does feel hopeful.” <a href=\"http://www.last.fm/music/Slowdive/_/kisses\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/7LuPjGUfJqxuW14W4gMrU2\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7LuPjGUfJqxuW14W4gMrU2\";}','kisses','7LuPjGUfJqxuW14W4gMrU2',5),(2626,'2025-05-28 01:45:23','2025-05-28 01:45:23','skin in the game','2023-09-01 00:00:00',232,'https://i.scdn.co/image/ab67616d0000b2731c44c9b9b5305bf50106f16a',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2EpduTUFSZfeb0GI4CaCQD\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2EpduTUFSZfeb0GI4CaCQD\";}','skin-in-the-game','2EpduTUFSZfeb0GI4CaCQD',6),(2627,'2025-05-28 01:45:33','2025-05-28 01:45:33','chained to a cloud','2023-09-01 00:00:00',411,'https://i.scdn.co/image/ab67616d0000b2731c44c9b9b5305bf50106f16a',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6Ys7r105cVURUyOYLq93qp\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6Ys7r105cVURUyOYLq93qp\";}','chained-to-a-cloud','6Ys7r105cVURUyOYLq93qp',7),(2628,'2025-05-28 01:45:34','2025-05-28 01:45:34','the slab','2023-09-01 00:00:00',310,'https://i.scdn.co/image/ab67616d0000b2731c44c9b9b5305bf50106f16a',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2qvOC1CRBtwOcl2dlcOCM1\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2qvOC1CRBtwOcl2dlcOCM1\";}','the-slab','2qvOC1CRBtwOcl2dlcOCM1',8),(2629,'2025-05-28 01:45:34','2025-05-28 01:45:34','Slomo','2017-05-05 00:00:00',413,'https://i.scdn.co/image/ab67616d0000b273640ce3531798c73d5a1da037','Bassist Nick Chaplin told the Observer:\n\n\"Neil’s been kind a folk singer for 20 years. You can kind of hear it when you listen to the vocal melodies and lyrics in “Slomo,” for example. It’s a song I think Neil’s been kicking around for a while that he would have written as a solo folk song. There’s a lot of imagery about Cornwall, where he lives by the sea, typical Southwestern English kind of folk topics, and it’s ended up as a Slowdive song.\" <a href=\"http://www.last.fm/music/Slowdive/_/Slomo\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0KYOthr76o5GlmYLEfp9OX\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0KYOthr76o5GlmYLEfp9OX\";}','slomo','0KYOthr76o5GlmYLEfp9OX',1),(2630,'2025-05-28 01:45:35','2025-05-28 01:45:35','Star Roving','2017-05-05 00:00:00',338,'https://i.scdn.co/image/ab67616d0000b273640ce3531798c73d5a1da037','\"Star Roving\" was the first single from Slowdive’s self-titled 2017 comeback album, and their first song in 22 years. It received widespread critical acclaim upon release, is one of the band’s most streamed songs, and was included in the \"FIFA 18\" soundtrack.\n\n\"When the band decided to get back together in 2014, we really wanted to make new music. It’s taken us a whole load of shows and a few false starts to get to that point, but it’s with pride and a certain trepidation we unleash ‘Star Roving. <a href=\"http://www.last.fm/music/Slowdive/_/Star+Roving\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0eNeturRjWHoi2SxITY0XC\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7nq6qpHhCJ3pNOa3KHi8fe\";}','star-roving','7nq6qpHhCJ3pNOa3KHi8fe',2),(2631,'2025-05-28 01:45:35','2025-05-28 01:45:35','Don\'t Know Why','2017-05-05 00:00:00',276,'https://i.scdn.co/image/ab67616d0000b273640ce3531798c73d5a1da037',NULL,'N;','don-t-know-why','3X3bnDoDXEuxt5R1iNJgmV',3),(2632,'2025-05-28 01:45:46','2025-05-28 01:45:46','Sugar for the Pill','2017-05-05 00:00:00',270,'https://i.scdn.co/image/ab67616d0000b273640ce3531798c73d5a1da037','“Sugar for the Pill” is the second single to Slowdive\'s self-titled comeback album. It is something entirely different—a disarming heartbreak ballad led by singer Neil Halstead in a surprisingly gentle mood. Sparer than their early, fuzzy compositions, and warmer than the equally minimalistic tracks on Pygmalion, “Sugar for the Pill” is simple and delicate, but never frail. The song’s greatest surprise is a smooth, catchy ‘80s soft-rock chorus—a considerable risk for a band that rarely indulged in straightforward pop. <a href=\"http://www.last.fm/music/Slowdive/_/Sugar+For+The+Pill\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0eVz3hV2xOXdneGpnWDFpb\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0eVz3hV2xOXdneGpnWDFpb\";}','sugar-for-the-pill','0eVz3hV2xOXdneGpnWDFpb',4),(2633,'2025-05-28 01:45:46','2025-05-28 01:45:46','Everyone Knows','2017-05-05 00:00:00',262,'https://i.scdn.co/image/ab67616d0000b273640ce3531798c73d5a1da037',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6wPeyFOPttrFZ5cWr77wRg\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6wPeyFOPttrFZ5cWr77wRg\";}','everyone-knows','6wPeyFOPttrFZ5cWr77wRg',5),(2634,'2025-05-28 01:45:47','2025-05-28 01:45:47','No Longer Making Time','2017-05-05 00:00:00',348,'https://i.scdn.co/image/ab67616d0000b273640ce3531798c73d5a1da037',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3q4YT4K5Xj6v9bWFb7OudB\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3q4YT4K5Xj6v9bWFb7OudB\";}','no-longer-making-time','3q4YT4K5Xj6v9bWFb7OudB',6),(2635,'2025-05-28 01:45:58','2025-05-28 01:45:58','Go Get It','2017-05-05 00:00:00',369,'https://i.scdn.co/image/ab67616d0000b273640ce3531798c73d5a1da037',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4WAOdPcGchhto2JyJrWcQL\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4WAOdPcGchhto2JyJrWcQL\";}','go-get-it','4WAOdPcGchhto2JyJrWcQL',7),(2636,'2025-05-28 01:45:58','2025-05-28 01:45