WQnXrlDMC2C\";}','j-s-heaven','4g1zeUDCp2rWQnXrlDMC2C',6),(2643,'2025-05-28 01:46:22','2025-05-28 01:46:22','Visions Of LA','1996-07-23 00:00:00',103,'https://i.scdn.co/image/ab67616d0000b2732827d57028c36a89a30ff7d6',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4MjpGsanEmhozcWoJG3jAs\";}','visions-of-la','4MjpGsanEmhozcWoJG3jAs',7),(2644,'2025-05-28 01:46:23','2025-05-28 01:46:23','Blue Skied An\' Clear','1996-07-23 00:00:00',411,'https://i.scdn.co/image/ab67616d0000b2732827d57028c36a89a30ff7d6',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3iM1i7dnn64SPveF0ETJnq\";}','blue-skied-an-clear','3iM1i7dnn64SPveF0ETJnq',8),(2645,'2025-05-28 01:46:23','2025-05-28 01:46:23','All Of Us','1996-07-23 00:00:00',248,'https://i.scdn.co/image/ab67616d0000b2732827d57028c36a89a30ff7d6',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1vY8M5S4rCRp6pU9x5scEF\";}','all-of-us','1vY8M5S4rCRp6pU9x5scEF',9),(2646,'2025-05-28 01:46:24','2025-05-28 01:46:24','Alison','1994-11-05 00:00:00',232,'https://i.scdn.co/image/ab67616d0000b27353da07db25e2543cce38abfe','\"Alison\" is a song of longing, lamenting and admiration for someone named Alison. The narrator is speaking to her, telling her how lost he feels without her, and how her complicated life still amazes him. He admires her strength and courage, telling her that he\'ll \"wear your clothes when we\'re both high\" while they both sink deeper into sorrow. The chorus speaks of the hope that Alison is out there somewhere, and the narrator is content to \"drink [her] wine\" and just wait for her return. <a href=\"http://www.last.fm/music/Slowdive/_/Alison\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/33HRECrmuelZxOpid6XTNX\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2W70vgf87uyNB2XRpRDEES\";}','alison','2W70vgf87uyNB2XRpRDEES',1),(2647,'2025-05-28 01:46:35','2025-05-28 01:46:35','Machine Gun','1994-11-05 00:00:00',268,'https://i.scdn.co/image/ab67616d0000b27353da07db25e2543cce38abfe','“Machine Gun” is one of the most ethereally dreamy shoegaze tracks on Souvlaki.\n\nThe capital of Sheba was the city of Ma\'rib. Nearby was a great dam, which provided enough water to make Sheba an agricultural nation, as well as a land of beautiful gardens. It was a fertile oasis in the desert. There is evidence that this dam burst, and the devastation caused by the ensuing flood, coupled with the loss of water for agriculture, may have led to the demise of several Sabaean cities which no longer exist today. <a href=\"http://www.last.fm/music/Slowdive/_/Machine+Gun\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1wXJjKJy5Pt38Bu3tUzTUL\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3Md1APzDGyfBBNQ2l7O5nj\";}','machine-gun','3Md1APzDGyfBBNQ2l7O5nj',2),(2648,'2025-05-28 01:46:36','2025-05-28 01:46:36','40 Days','1994-11-05 00:00:00',195,'https://i.scdn.co/image/ab67616d0000b27353da07db25e2543cce38abfe','Seeking seclusion after his breakup with Rachel Goswell, Neil Halstead left on a two-week trip to a Welsh cottage, where he recorded this song.\n\n\"It hadn’t been long since i and Rachel split up, so i was kinda miserable about that, and i was miserable to be in this little cottage in the middle of nowhere.“, – he says. \"It was about being miserable. A lot of Slowdive’s stuff was about atmospheres, and so possibly in a sort of slightly teenagy way it was about creating cinematic moments. <a href=\"http://www.last.fm/music/Slowdive/_/40+Days\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4qyJE4D584f7qJCRSy7HOE\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3jQBAyQVJSl9fc6l4tsWWP\";}','40-days','3jQBAyQVJSl9fc6l4tsWWP',3),(2649,'2025-05-28 01:46:36','2025-05-28 01:46:36','Sing','1994-11-05 00:00:00',291,'https://i.scdn.co/image/ab67616d0000b27353da07db25e2543cce38abfe','Early demos for the album were influenced by David Bowie’s \"Low\", among other albums. Slowdive asked Brian Eno to produce the album but he declined, however, he agreed to do a couple of days of recording with Neil Halstead, and out of these sessions came the tracks “Sing” and “Here She Comes”. Eno provides keyboards and treatments on both tracks, ending up with co-writing “Sing” with Neil. Following these sessions Neil began to take greater influence from ambient music and has cited Aphex Twin <a href=\"http://www.last.fm/music/Slowdive/_/Sing\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1dmph9kxaIm9btfmCT9r2c\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2alubJkPNdHA97Unct4J23\";}','sing','2alubJkPNdHA97Unct4J23',4),(2650,'2025-05-28 01:46:47','2025-05-28 01:46:47','Here She Comes','1994-11-05 00:00:00',139,'https://i.scdn.co/image/ab67616d0000b27353da07db25e2543cce38abfe','Neil is telling of his crippling loneliness despite being surrounded by people. We are taken into his dark and lonely mind to see and feel what he sees and feels. But, he is taken out of his dark state when he sees the woman he loves approaching. <a href=\"http://www.last.fm/music/Slowdive/_/Here+She+Comes\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5FuYgi1xinZAQyD5CYLpUJ\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5Lung4Ft8vuIbwHdWdvQF5\";}','here-she-comes','5Lung4Ft8vuIbwHdWdvQF5',5),(2651,'2025-05-28 01:46:47','2025-05-28 01:46:47','Souvlaki Space Station','1994-11-05 00:00:00',359,'https://i.scdn.co/image/ab67616d0000b27353da07db25e2543cce38abfe','“Souvlaki Space Station“ is considered a metaphorical title that likely alludes to a feeling of being lost or adrift in a dreamlike, ethereal space.\n\nEarly demos for the album were influenced by David Bowie’s Low, among other albums. Low was heavily influenced by  Brian Eno, who Slowdive asked to produce their album. He declined, however, he agreed to do a couple of days of recording with Halstead, and out of these sessions came the tracks “Sing” and “Here She Comes”. <a href=\"http://www.last.fm/music/Slowdive/_/Souvlaki+Space+Station\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/76JhicgPtW4zbN72tpnMyA\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/03e9mpepwyHY6vfOuTptv8\";}','souvlaki-space-station','03e9mpepwyHY6vfOuTptv8',6),(2652,'2025-05-28 01:46:48','2025-05-28 01:46:48','When the Sun Hits','1994-11-05 00:00:00',287,'https://i.scdn.co/image/ab67616d0000b27353da07db25e2543cce38abfe','\"When the Sun Hits\" is a song about a relationship between two people where one is starting to become distant and the other is desperately trying to save it. The narrator pleads for the other to stay, recognizing the importance of their relationship and the strength of their connection. The chorus speaks of the power of the relationship, with the \"sun\" representing their love and its intensity. The song speaks of the deep and powerful love that the narrator has for the other person <a href=\"http://www.last.fm/music/Slowdive/_/When+the+Sun+Hits\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0oxYB9GoOIDrdzniNdKC44\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7aXUzHn4A6fGKofVPGCoeT\";}','when-the-sun-hits','7aXUzHn4A6fGKofVPGCoeT',7),(2653,'2025-05-28 01:46:48','2025-05-28 01:46:48','Altogether','1994-11-05 00:00:00',222,'https://i.scdn.co/image/ab67616d0000b27353da07db25e2543cce38abfe','“Altogether” is the eighth track of Slowdive’s second studio album, Souvlaki.\n\nThe song creates a sleepy mood with both its lyricism and its atmosphere – in the context of the band, the lyrics are probably highlighting a past romantic moment between Neil Halstead and Rachel Goswell that they shared before they broke up (the majority of the album is like this). <a href=\"http://www.last.fm/music/Slowdive/_/Altogether\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1I3f8tsoYbIPEgQ1TPvJPb\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4KnSm0B0r4F5zsB9qsfiUB\";}','altogether','4KnSm0B0r4F5zsB9qsfiUB',8),(2654,'2025-05-28 01:46:59','2025-05-28 01:46:59','Melon Yellow','1994-11-05 00:00:00',233,'https://i.scdn.co/image/ab67616d0000b27353da07db25e2543cce38abfe','\"Melon Yellow\" is the ninth track of Slowdive’s second studio album, Souvlaki. It has been speculated that the song is about limerence – a state of mind stemming from an obsessive romantic attraction to another person and a desire to be with this person and get one’s feelings reciprocated. <a href=\"http://www.last.fm/music/Slowdive/_/Melon+Yellow\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1G6E8yhilqdeZuduRrob1S\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6HDbazzz9BHKufmSfuLTVE\";}','melon-yellow','6HDbazzz9BHKufmSfuLTVE',9),(2655,'2025-05-28 01:46:59','2025-05-28 01:46:59','Dagger','1994-11-05 00:00:00',215,'https://i.scdn.co/image/ab67616d0000b27353da07db25e2543cce38abfe','“Dagger“ is the final song on Souvlaki and was written during a retreat to a Welsh cottage by Neil Halstead in the summer of 1992. It is about a “fucked up relationship”, likely the one Neil and Rachel shared during the early days of the band.\n\nThe song has an acoustic sound, which is pretty unique in Slowdive’s discography, but similar to the dream-folk style of Mojave 3, the band formed by Neil Halstead, Rachel Goswell, and Ian McCutcheon after Slowdive’s disbandment. <a href=\"http://www.last.fm/music/Slowdive/_/Dagger\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3MmRfG64qt04Efx9gK9Ec8\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5p0ZJLF1ZmL2WNJ2ky8VVb\";}','dagger','5p0ZJLF1ZmL2WNJ2ky8VVb',10),(2656,'2025-05-28 01:46:59','2025-05-28 01:46:59','Some Velvet Morning