8q59waoxGjcRZDC3ffhH',4),(2835,'2025-05-28 01:52:30','2025-05-28 01:52:30','Wo bist du','2005-10-27 00:00:00',235,'https://i.scdn.co/image/ab67616d0000b2734ea617c398a01a5228069744',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2mZ7SXzf5mZkohPfDFIUET\";}','wo-bist-du','2mZ7SXzf5mZkohPfDFIUET',5),(2836,'2025-05-28 01:52:30','2025-05-28 01:52:30','Stirb nicht vor mir (Don\'t Die Before I Do)','2005-10-27 00:00:00',245,'https://i.scdn.co/image/ab67616d0000b2734ea617c398a01a5228069744',NULL,'N;','stirb-nicht-vor-mir-don-t-die-before-i-do','0xv6NzfBHZhbZ5MWLzdh3T',6),(2837,'2025-05-28 01:52:41','2025-05-28 01:52:41','Zerstören','2005-10-27 00:00:00',328,'https://i.scdn.co/image/ab67616d0000b2734ea617c398a01a5228069744','The song was previously called “Ankara” and has a reference to the Iraq War. At the beginning of the song, a Turkish-speaking woman sings, something new for Rammstein.\n\nChristian “Flake” Lorenz told a daily newspaper the following about the song “Zerstören\" (german for Destroy): “This is our country song about George W. Bush and is meant completely seriously. He behaves in the world like a child who wants to destroy everything. But he only grabs other people’s things!” <a href=\"http://www.last.fm/music/Rammstein/_/Zerst%C3%B6ren\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4HLcqGelHzQY7nAhxhh1hO\";}','zerstoren','4HLcqGelHzQY7nAhxhh1hO',7),(2838,'2025-05-28 01:52:41','2025-05-28 01:52:41','Hilf mir','2005-10-27 00:00:00',283,'https://i.scdn.co/image/ab67616d0000b2734ea617c398a01a5228069744',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2STUa7rb27i7mCX7eOvr5K\";}','hilf-mir','2STUa7rb27i7mCX7eOvr5K',8),(2839,'2025-05-28 01:52:42','2025-05-28 01:52:42','Te quiero puta!','2005-10-27 00:00:00',235,'https://i.scdn.co/image/ab67616d0000b2734ea617c398a01a5228069744',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0KwqP13BnZMIycfxnqWtK1\";}','te-quiero-puta','0KwqP13BnZMIycfxnqWtK1',9),(2840,'2025-05-28 01:52:42','2025-05-28 01:52:42','Feuer und Wasser','2005-10-27 00:00:00',312,'https://i.scdn.co/image/ab67616d0000b2734ea617c398a01a5228069744',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4LoFzVisVHdPh9K7Q54ST5\";}','feuer-und-wasser','4LoFzVisVHdPh9K7Q54ST5',10),(2841,'2025-05-28 01:52:53','2025-05-28 01:52:53','Ein Lied','2005-10-27 00:00:00',223,'https://i.scdn.co/image/ab67616d0000b2734ea617c398a01a5228069744',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2gYAXMfRklQwZPAcQmFAzR\";}','ein-lied','2gYAXMfRklQwZPAcQmFAzR',11),(2842,'2025-05-28 01:52:54','2025-05-28 01:52:54','Reise, Reise','2004-09-27 00:00:00',251,'https://i.scdn.co/image/ab67616d0000b273cbe7573e1175f842e24b34c2',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6bvTzuFABmFnAAmVZ3nlMh\";}','reise-reise','6bvTzuFABmFnAAmVZ3nlMh',1),(2843,'2025-05-28 01:52:54','2025-05-28 01:52:54','Mein Teil','2004-09-27 00:00:00',272,'https://i.scdn.co/image/ab67616d0000b273cbe7573e1175f842e24b34c2','This song was inspired by the Rotenburg Cannibal. \n\n\"Teil\" translates literally to \"part\" or \"member,\" but is German slang for penis. The chorus of \"Mein Teil\" (My Part) includes the line, \"Denn du bist was du isst und ihr wisst was es ist. Es ist mein Teil,\" which translates to \"You are what you eat and you know what it is. It is my part\" with \"Du bist was du isst\" being the famous catchphrase for the Swedish brand of crisp bread Wasa. The original quote was made by Ludwig Feuerbach <a href=\"http://www.last.fm/music/Rammstein/_/Mein+Teil\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=PBvwcH4XX6U\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/39RKlCfLoqb8o2aXfpVfjW\";}','mein-teil','39RKlCfLoqb8o2aXfpVfjW',2),(2844,'2025-05-28 01:52:55','2025-05-28 01:52:55','Dalai Lama','2004-09-27 00:00:00',338,'https://i.scdn.co/image/ab67616d0000b273cbe7573e1175f842e24b34c2','The song is an adaptation of Der Erlkönig, a poem written by Johann Wolfgang von Goethe in 1782 and subsequently set to music by many composers, including Franz Schubert. \"Dalai Lama\" is a reference to the current Dalai Lama\'s well-publicized dislike of air travel. Other than this somewhat oblique reference, the song does not have anything to do with Tibetan Buddhism or the Dalai Lama.\n\nThe song updates the storyline of Erlkönig, replacing the poem\'s travelling man and child on horseback with a man and child on an aircraft <a href=\"http://www.last.fm/music/Rammstein/_/Dalai+Lama\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7fL0Tc5DGA7wLeXzkckiLW\";}','dalai-lama','7fL0Tc5DGA7wLeXzkckiLW',3),(2845,'2025-05-28 01:53:06','2025-05-28 01:53:06','Keine Lust','2004-09-27 00:00:00',222,'https://i.scdn.co/image/ab67616d0000b273cbe7573e1175f842e24b34c2','\"Keine Lust\" (No Desire) is a song by the German band Rammstein. It was released as a fourth & final single from the album \"Reise, Reise\" on 28 February 2005 in Germany, Austria, and Switzerland as a maxi-single, a limited edition digipak  single, a 7\" vinyl single, a 12\" Vinyl single, and as a two-track. The title is a German phrase which might be translated as \"No Desire\", although the phrase as used in the lyrics \"Ich habe keine Lust\" is more like the English \"I do not feel like\" or \"I do not want to\". <a href=\"http://www.last.fm/music/Rammstein/_/Keine+Lust\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=1M4ADcMn3dA\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7eeDeUM9E7b0vkDfRz20Zt\";}','keine-lust','7eeDeUM9E7b0vkDfRz20Zt',4),(2846,'2025-05-28 01:53:06','2025-05-28 01:53:06','Los','2004-09-27 00:00:00',263,'https://i.scdn.co/image/ab67616d0000b273cbe7573e1175f842e24b34c2',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6IUhPMJf4iJQ3Go1CkHDsa\";}','los','6IUhPMJf4iJQ3Go1CkHDsa',5),(2847,'2025-05-28 01:53:07','2025-05-28 01:53:07','Amerika','2004-09-27 00:00:00',226,'https://i.scdn.co/image/ab67616d0000b273cbe7573e1175f842e24b34c2','The song deals with the worldwide dominance of the culture of the United States of America. It is sung largely in German with a chorus partly in English. It has received mixed reviews: some perceive it as anti-American, others as being opposed to globalization. The band views it as a satirical commentary on Cocacolonization. It features mentions of Coca-Cola, Wonderbra, and Mickey Mouse. <a href=\"http://www.last.fm/music/Rammstein/_/Amerika\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1a8JpAL3vbAdXYrEABvOtb\";}','amerika','1a8JpAL3vbAdXYrEABvOtb',6),(2848,'2025-05-28 01:53:17','2025-05-28 01:53:17','Moskau','2004-09-27 00:00:00',256,'https://i.scdn.co/image/ab67616d0000b273cbe7573e1175f842e24b34c2','  Rumored to have originally been intended as a duet with Yulia Volkova of Russian pop duo t.A.T.u., it instead features the vocals of Viktoria Fersh, whose voice bears a strong resemblance to Volkova\'s. Many (perhaps even most) sources say that it is Volkova who performs the additional vocals, but this theory is contradicted by the artist listing on the second to last page of the Reise Reise lyrics booklet.\n\nThe song refers to the Russian capital of Moscow. <a href=\"http://www.last.fm/music/Rammstein/_/Moskau\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4L9UGREMQBfYLmGwlACgTV\";}','moskau','4L9UGREMQBfYLmGwlACgTV',7),(2849,'2025-05-28 01:53:18','2025-05-28 01:53:18','Morgenstern','2004-09-27 00:00:00',239,'https://i.scdn.co/image/ab67616d0000b273cbe7573e1175f842e24b34c2',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0gf9HMeZDXRexbuM5CihZg\";}','morgenstern','0gf9HMeZDXRexbuM5CihZg',8),(2850,'2025-05-28 01:53:18','2025-05-28 01:53:18','Stein um Stein','2004-09-27 00:00:00',232,'https://i.scdn.co/image/ab67616d0000b273cbe7573e1175f842e24b34c2','Stein means Stone, \"um\" in this context stands for \"by\" or \"after\". The song describes how the singer walls his beloved in so she won\'t be able to leave him. Pretty macabre.\n\nTranslation:\n\n I have plans, big plans;\nI\'m building you a house;\nevery stone is one tear,\nand you\'ll never move out again.\n\nYes I\'m building you a little house,\nIt has no window, no door,\nit will be dark inside,\nNo light comes through .*\n\nYes, I\'m getting you a home,\nand you\'ll be a part of it. <a href=\"http://www.last.fm/music/Rammstein/_/Stein+um+Stein\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/20hfLWeQSJnJ2CiPxmjzsj\";}','stein-um-stein','20hfLWeQSJnJ2CiPxmjzsj',9),(2851,'2025-05-28 01:53:19','2025-05-28 01:53:19','Ohne dich','2004-09-27 00:00:00',271,'https://i.scdn.co/image/ab67616d0000b273cbe7573e1175f842e24b34c2','Ohne dich (Without You) is a power ballad by Rammstein on their album Reise, Reise. It was released as the third single from the album on 22 November 2004 in Germany, Switzerland and Austria.\n\nIt is a song of lost love and follows a slow, even romantic ballad style. The central recurring theme is \'Without you, I cannot be, without you..., With you, I am also alone, without you...\' <a href=\"http://www.last.fm/music/Rammstein/_/Ohne+dich\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=LIPc1cfS-oQ\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4aFC7Mes7CW5vHcb8ZApAx\";}','ohne-dich','4aFC7Mes7CW5vHcb8ZApAx',10),(2852,'2025-05-28 01:53:29','2025-05-28 01:53:29','Amour','2004-09-27 00:00:00',290,'https://i.scdn.co/image/ab67616d0000b273cbe7573e1175f842e24b34c2',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1pOkWIJCshtoREcAcXmYSk\";}','amour','1pOkWIJCshtoREcAcXmYSk',11),(2853,'2025-05-28 01:53:30','2025-05-28 01:53:30','Mein Herz brennt','2001-04-02 00:00:00',279,'https://i.scdn.co/image/ab67616d0000b2738b2c42026277efc3e058855b','The track was featured in the 2002 Swedish film \"Lilja 4-ever\" (English: \"Lilya 4-Ever\") and the 2002 Israeli television series \"Heaven or Hell\". <a href=\"http://www.last.fm/music/Rammstein/_/Mein+Herz+brennt\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=WXv31OmnKqQ\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5ArNGisLzrNOIVwWajRRdt\";}','mein-herz-brennt','5ArNGisLzrNOIVwWajRRdt',1),(2854,'2025-05-28 01:53:30','2025-05-28 01:53:30','Links 2 3 4','2001-04-02 00:00:00',216,'https://i.scdn.co/image/ab67616d0000b2738b2c42026277efc3e058855b',NULL,'N;','links-2-3-4','52XYwQKlXp7scE7KrBBCID',2),(2855,'2025-05-28 01:53:31','2025-05-28 01:53:31','Sonne','2001-04-02 00:00:00',272,'https://i.scdn.co/image/ab67616d0000b2738b2c42026277efc3e058855b','\"Sonne\" (German for \"Sun\") is a song by the German Neue Deutsche Härte group Rammstein. It was the first single released from the then forthcoming album Mutter. According to Till Lindemann, the song was originally written as an entrance song for the boxer Vitali Klitschko, which was also the working title of the song.\n\nAn excerpt of \"Sonne\" was used in the 2002 movie FeardotCom, when the psychopathic torturist abducted an unsuspecting aspiring actress. <a href=\"http://www.last.fm/music/Rammstein/_/Sonne\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=StZcUAPRRac\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3gVhsZtseYtY1fMuyYq06F\";}','sonne','3gVhsZtseYtY1fMuyYq06F',3),(2856,'2025-05-28 01:53:42','2025-05-28 01:53:42','Ich will','2001-04-02 00:00:00',217,'https://i.scdn.co/image/ab67616d0000b2738b2c42026277efc3e058855b','\"Ich will\" (German for I want) is a single by Rammstein. It was originally released in Germany on September 10, 2001. Since it was released the day before the September 11, 2001 attacks, many channels did not air the music video (which was to debut on U.S. television the night of September 11, 2001). The German single contains a live cover version of The Ramones\' song \"Pet Sematary\", sung by keyboardist Flake.\n\nThe music video of \"Ich will\" features the band members engaging in a bank robbery. <a href=\"http://www.last.fm/music/Rammstein/_/Ich+will\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=EOnSh3QlpbQ\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3X0K6fII7VIwL1URPrp8Ko\";}','ich-will','3X0K6fII7VIwL1URPrp8Ko',4),(2857,'2025-05-28 01:53:42','2025-05-28 01:53:42','Feuer frei!','2001-04-02 00:00:00',188,'https://i.scdn.co/image/ab67616d0000b2738b2c42026277efc3e058855b','\"Feuer frei!\" is a song by German rock band Rammstein. The song is released as the fifth single from their third album Mutter. The title is from the command to start shooting in German military language, can be compared to \"fire at will\", or \"open fire\". Feuer frei! is one of the band\'s most known songs, and is credited as their most popular. The song is featured in the film xXx, it is also featured during the CSI episode \"Slaves of Las Vegas\".\n\nThe UK Feuer Frei! single was released in three parts (2xCD <a href=\"http://www.last.fm/music/Rammstein/_/Feuer+frei%21\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=ZkW-K5RQdzo\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5aNH8inF5BsbThDeOLs7zs\";}','feuer-frei','5aNH8inF5BsbThDeOLs7zs',5),(2858,'2025-05-28 01:53:43','2025-05-28 01:53:43','Mutter','2001-04-02 00:00:00',268,'https://i.scdn.co/image/ab67616d0000b2738b2c42026277efc3e058855b','\"Mutter\" (German for mother) is a song by Rammstein on the album of the same name.\n\nThe lyrics tell the story of a child not born from a womb but in an experiment, thus having no true father or mother. The song was confirmed by Till Lindemann and Richard Kruspe to be a reference to their unhappy childhood relationships with their own mothers. The decidedly depressing lyrics describe a character\'s plan to kill both the mother \"who never gave birth to him\" and himself, which he carries out. <a href=\"http://www.last.fm/music/Rammstein/_/Mutter\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=gNdnVVHfseA\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7jfZybgHr6yzp4iuMS2K8u\";}','mutter','7jfZybgHr6yzp4iuMS2K8u',6),(2859,'2025-05-28 01:53:43','2025-05-28 01:53:43','Spieluhr','2001-04-02 00:00:00',286,'https://i.scdn.co/image/ab67616d0000b2738b2c42026277efc3e058855b','This is about a child trapped in quicksand with a music box in its hand. And apparently  it matters that \"no angel climbs down, only rain weeping on the grave, with a melody in the Wind/ Pneuma\". We hear this \"on a Mortal Sunday as God\'s husbandry and the little heart of the child is saved\". \"My heart beats no more, and on Earth the child sings\". ?\n\"Hoppe Hoppe\" is from a nursery rhyme with the infant being bounced on the knees, like a horseback rider.  <a href=\"http://www.last.fm/music/Rammstein/_/Spieluhr\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0KFwkmCpsFqUs09Bs8iVFP\";}','spieluhr','0KFwkmCpsFqUs09Bs8iVFP',7),(2860,'2025-05-28 01:53:54','2025-05-28 01:53:54','Zwitter','2001-04-02 00:00:00',257,'https://i.scdn.co/image/ab67616d0000b2738b2c42026277efc3e058855b','Zwitter is the eighth song of the album Mutter (2001).\nThe title is translated into : hermaphrodite.\nIn other words, there’s no confirmed meaning for this song however speculations arise. The word Zwitter is used in a sarcastic sense to describe an intense love relation with oneself, to a point of wanting to have sex with their own figure. Others could describe it as narcissism. <a href=\"http://www.last.fm/music/Rammstein/_/Zwitter\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3Q70zeuBGJzhCOtzeBXoPS\";}','zwitter','3Q70zeuBGJzhCOtzeBXoPS',8),(2861,'2025-05-28 01:53:54','2025-05-28 01:53:54','Rein raus','2001-04-02 00:00:00',189,'https://i.scdn.co/image/ab67616d0000b2738b2c42026277efc3e058855b','\"Rein raus\" (meaning \"in, out\" in German) is sung by the German metal band Rammstein and is a song about sex.  The lyrics go as \"Ich bin der Reiter, Du bist das Ross, Ich steige auf, Wir reiten los\" (I am the rider, you are the horse, I climb on, we ride off) and \"Der Ritt war kurz, Es tut mir leid, Ich steige ab, hab keine Zeit, Muss jetzt zu den anderen Pferden, Wollen auch geritten werden\" (The ride was short, I am sorry, I climb off, I have no time, Now I must go to the other horses, They all want to be ridden) <a href=\"http://www.last.fm/music/Rammstein/_/Rein+Raus\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4fPrxIohi60EZfNy2TlD44\";}','rein-raus','4fPrxIohi60EZfNy2TlD44',9),(2862,'2025-05-28 01:53:55','2025-05-28 01:53:55','Adios','2001-04-02 00:00:00',228,'https://i.scdn.co/image/ab67616d0000b2738b2c42026277efc3e058855b',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3zPvL6ZCSVAHvSZXNoAbkl\";}','adios','3zPvL6ZCSVAHvSZXNoAbkl',10),(2863,'2025-05-28 01:53:56','2025-05-28 01:53:56','Nebel','2001-04-02 00:00:00',294,'https://i.scdn.co/image/ab67616d0000b2738b2c42026277efc3e058855b',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6DxTbdswlgfUp2mJ3vtptB\";}','nebel','6DxTbdswlgfUp2mJ3vtptB',11),(2864,'2025-05-28 01:54:06','2025-05-28 01:54:06','Spiel mit mir - Live','1999-08-31 00:00:00',323,'https://i.scdn.co/image/ab67616d0000b27335001a591bcdfa8c3a12e566',NULL,'N;','spiel-mit-mir-live','7KdkgoER8Gis8kjBQUskR9',1),(2865,'2025-05-28 01:54:06','2025-05-28 01:54:06','Bestrafe mich - Live','1999-08-31 00:00:00',229,'https://i.scdn.co/image/ab67616d0000b27335001a591bcdfa8c3a12e566',NULL,'N;','bestrafe-mich-live','1kcBsHfbeBS93moWMzgRl9',2),(2866,'2025-05-28 