d a very nifty catch in the chorus with the childlike voices blending in surprisingly well with Till\'s deep growling [but tuneful] vocal. The female vocals were sung by Bobolina, singer of Bobo in the White Wooden Houses. <a href=\"http://www.last.fm/music/Rammstein/_/Engel\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:43:\"https://www.youtube.com/watch?v=x2rQzv8OWEY\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0xrkyEMkG4dVa5OMLQZOX8\";}','engel','0xrkyEMkG4dVa5OMLQZOX8',2),(2881,'2025-05-28 01:54:30','2025-05-28 01:54:30','Tier','1997-08-25 00:00:00',226,'https://i.scdn.co/image/ab67616d0000b273a715d32590424cd667879ba3','Tier-  (German for Animal) is the third track on the album Sehnsucht by Rammstein(1997). It explores themes of incest and child abuse. \nWhen asked about the meaning of the song Till Lindemann the frontman declared:(translated) “ Animals like dogs or rats mate with each other, but there is no incest in this sense. That is nature. But man has the possibility to think consciously, and if a father becomes horny at the sight of his daughter, whom he himself has fathered, then that is no longer natural, but sick. <a href=\"http://www.last.fm/music/Rammstein/_/Tier\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0S2UfCA5A275xChEi9a6vU\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0S2UfCA5A275xChEi9a6vU\";}','tier','0S2UfCA5A275xChEi9a6vU',3),(2882,'2025-05-28 01:54:31','2025-05-28 01:54:31','Bestrafe mich','1997-08-25 00:00:00',216,'https://i.scdn.co/image/ab67616d0000b273a715d32590424cd667879ba3','\"Bestrafe mich\" (\"Punish me\"), is the fourth track on the album Sehnsucht by Rammstein. It uses S&M imagery and wordplay to describe the relationship between man and God. <a href=\"http://www.last.fm/music/Rammstein/_/Bestrafe+Mich\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5QueZSIpWUbH4nLZlkjjkP\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5QueZSIpWUbH4nLZlkjjkP\";}','bestrafe-mich','5QueZSIpWUbH4nLZlkjjkP',4),(2883,'2025-05-28 01:54:41','2025-05-28 01:54:41','Du hast','1997-08-25 00:00:00',234,'https://i.scdn.co/image/ab67616d0000b273a715d32590424cd667879ba3','\"Du hast\" (German, \"you have\") is a song by the German Tanz-Metall band Rammstein from the 1997 album Sehnsucht. The song is one of the band\'s best known worldwide, owing to its inclusion on the soundtrack of The Matrix and heavy airplay on MTV. It has also been featured in other films, such as CKY2K and 2001\'s How High, as well as TV\'s Gilmore Girls in the episode \"Presenting Lorelai Gilmore\".\n\nThe video for the song was influenced by Reservoir Dogs. <a href=\"http://www.last.fm/music/Rammstein/_/Du+hast\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5awDvzxWfd53SSrsRZ8pXO\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5awDvzxWfd53SSrsRZ8pXO\";}','du-hast','5awDvzxWfd53SSrsRZ8pXO',5),(2884,'2025-05-28 01:54:42','2025-05-28 01:54:42','Bück dich','1997-08-25 00:00:00',201,'https://i.scdn.co/image/ab67616d0000b273a715d32590424cd667879ba3','\"Bück dich\" (\"Bend down,\" \"Bend over\") is a song by the German Tanz-Metall band Rammstein that first appeared on their second full-length album, Sehnsucht. The lyrics refer to sodomy.\n\n\"Bück Dich\" is a command meaning \"Bend Over!\" The word dich does not actually translate as \"down\". The German word for down is (he)runter. \'Dich\' is a pronoun with more than one meaning. It is mostly used as the accusative form of du (you, like English used to have \"thou\" and \"thee\". <a href=\"http://www.last.fm/music/Rammstein/_/B%C3%BCck+Dich\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0HSVba6oa1QdUkco67C3e3\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0HSVba6oa1QdUkco67C3e3\";}','buck-dich','0HSVba6oa1QdUkco67C3e3',6),(2885,'2025-05-28 01:54:43','2025-05-28 01:54:43','Spiel mit mir','1997-08-25 00:00:00',285,'https://i.scdn.co/image/ab67616d0000b273a715d32590424cd667879ba3','\"Spiel mit mir\" (Eng: play with me ) is the seventh song on the album Sehnsucht by the German Industrial-Metal band Rammstein.\nJudging by the context of the lyrics, the song is from the older brother’s perspective brüderlien is more commonly used to talk about a younger brother. Interpretations  may differ however, many agree that an incestous relationship is described, the younger brother being unable to sleep, the older brother shows him a “game” to help him doze off. <a href=\"http://www.last.fm/music/Rammstein/_/Spiel+Mit+Mir\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2VR7EqYSBdqPVW5u3gcotK\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2VR7EqYSBdqPVW5u3gcotK\";}','spiel-mit-mir','2VR7EqYSBdqPVW5u3gcotK',7),(2886,'2025-05-28 01:54:53','2025-05-28 01:54:53','Klavier','1997-08-25 00:00:00',262,'https://i.scdn.co/image/ab67616d0000b273a715d32590424cd667879ba3',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2TfSwSYe7N7gaHFtlWvuZg\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2TfSwSYe7N7gaHFtlWvuZg\";}','klavier','2TfSwSYe7N7gaHFtlWvuZg',8),(2887,'2025-05-28 01:54:54','2025-05-28 01:54:54','Alter Mann','1997-08-25 00:00:00',262,'https://i.scdn.co/image/ab67616d0000b273a715d32590424cd667879ba3',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2jZxjkVESS9tepcceOJesB\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2jZxjkVESS9tepcceOJesB\";}','alter-mann','2jZxjkVESS9tepcceOJesB',9),(2888,'2025-05-28 01:54:55','2025-05-28 01:54:55','Eifersucht','1997-08-25 00:00:00',215,'https://i.scdn.co/image/ab67616d0000b273a715d32590424cd667879ba3','Eifersucht (meaning \"Jealousy\", but also \"Envy\" more or less) is the 10th track of the album \"Sehnsucht\" (meaning: \"Longing\"). The protagonist in the song provokes 