as written by guitarist Daron Malakian, who also provides lead vocals on the track. The song received a nomination for Best Hard Rock Performance at the 49th Annual Grammy Awards.\n\"Lonely Day\" features a dreary musical theme with a heavy chorus and a dual guitar solo near the end. The chorus is notable for featuring the double superlative \"most loneliest\". <a href=\"http://www.last.fm/music/System+of+a+Down/_/Lonely+Day\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4xBHZ2Mr0gCdFYXrPZuYXO\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1VNWaY3uNfoeWqb5U8x2QX\";}','lonely-day','1VNWaY3uNfoeWqb5U8x2QX',11),(2924,'2025-05-28 01:57:36','2025-05-28 01:57:36','Soldier Side','2005-11-22 00:00:00',220,'https://i.scdn.co/image/ab67616d0000b273f5e7b2e5adaa87430a3eccff',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4gQvyUEUYBWwNiUlN19ZTG\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1ez4uWPnJwYufNhYTLVsJr\";}','soldier-side','1ez4uWPnJwYufNhYTLVsJr',12),(2925,'2025-05-28 01:57:46','2025-05-28 01:57:46','Soldier Side - Intro','2005-05-17 00:00:00',63,'https://i.scdn.co/image/ab67616d0000b273c65f8d04502eeddbdd61fa71',NULL,'N;','soldier-side-intro','6f1HJMVJ1CgUeCIM6r795H',1),(2926,'2025-05-28 01:57:47','2025-05-28 01:57:47','B.Y.O.B.','2005-05-17 00:00:00',255,'https://i.scdn.co/image/ab67616d0000b273c65f8d04502eeddbdd61fa71','\"B.Y.O.B\" (Bring Your Own Bombs) is a Grammy Award-winning song as well as the first single released from System of a Down\'s fourth album Mezmerize. It is a politically charged song and was written to protest the Iraq War.\n\n\"B.Y.O.B.\" was released as downloadable content in the video game Rock Band as well as it being featured in Guitar Hero World Tour.\n <a href=\"http://www.last.fm/music/System+of+a+Down/_/B.Y.O.B.\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0EYOdF5FCkgOJJla8DI2Md\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0EYOdF5FCkgOJJla8DI2Md\";}','b-y-o-b','0EYOdF5FCkgOJJla8DI2Md',2),(2927,'2025-05-28 01:57:48','2025-05-28 01:57:48','Revenga','2005-05-17 00:00:00',228,'https://i.scdn.co/image/ab67616d0000b273c65f8d04502eeddbdd61fa71','\"Revenga\" is the third song by System of a Down from their 2005 album Mezmerize. It is believed by many fans that the meaning of the song is about a man who had a crush on someone that hated him, the man either being Daron, or just an unnamed person. The lines \"I saw her laugh, then she said go away\" seem to suggest that he asked her out and she turned him down and laughed at him, and now he wants to take revenge on her (\"poisoning a drink, bleeding in a sink, choking with a link, killing with a stink\"). <a href=\"http://www.last.fm/music/System+of+a+Down/_/Revenga\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/577mOFb1LAvSANIUZ4mbQ7\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/577mOFb1LAvSANIUZ4mbQ7\";}','revenga','577mOFb1LAvSANIUZ4mbQ7',3),(2928,'2025-05-28 01:57:48','2025-05-28 01:57:48','Cigaro','2005-05-17 00:00:00',131,'https://i.scdn.co/image/ab67616d0000b273c65f8d04502eeddbdd61fa71','“Cigaro” details the pointless and seemingly endless obsession of ‘Boys and their Toys’, whether it be the explicit concept of penis size or the size of their guns, men are always trying to prove their superiority over one another.\n\nSerj & Daron criticize the corporate and political bosses that sit back, smoke their cigars, and talk complete shit to further their already grossly inflated ego’s and public profiles while ignoring laws and restrictions imposed (by them) and promoting their products to the population. <a href=\"http://www.last.fm/music/System+of+a+Down/_/Cigaro\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/47EqCQZG5v4o0WFMufGf5S\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/47EqCQZG