station KROQ on May 23, 2005 and was released to alternative and rock radio stations on July 12 of the same year.\n\nThe song is sometimes compared to one of System of a Down\'s other songs \"Aerials,\" which also deals with the nature of life in the lyrics. <a href=\"http://www.last.fm/music/System+of+a+Down/_/Question%21\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6y2DHyCYf6azhUfXmnuH6w\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6y2DHyCYf6azhUfXmnuH6w\";}','question','6y2DHyCYf6azhUfXmnuH6w',8),(2933,'2025-05-28 01:58:11','2025-05-28 01:58:11','Sad Statue','2005-05-17 00:00:00',205,'https://i.scdn.co/image/ab67616d0000b273c65f8d04502eeddbdd61fa71',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1wGRSG94dLt8fIZWhR3rGG\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1wGRSG94dLt8fIZWhR3rGG\";}','sad-statue','1wGRSG94dLt8fIZWhR3rGG',9),(2934,'2025-05-28 01:58:12','2025-05-28 01:58:12','Old School Hollywood','2005-05-17 00:00:00',176,'https://i.scdn.co/image/ab67616d0000b273c65f8d04502eeddbdd61fa71','According to this song, Jack Gilardi is 10 ft. tall. <a href=\"http://www.last.fm/music/System+of+a+Down/_/Old+School+Hollywood\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6iFVJGxSVdFkzYQJL7Rgdk\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6iFVJGxSVdFkzYQJL7Rgdk\";}','old-school-hollywood','6iFVJGxSVdFkzYQJL7Rgdk',10),(2935,'2025-05-28 01:58:12','2025-05-28 01:58:12','Lost In Hollywood','2005-05-17 00:00:00',320,'https://i.scdn.co/image/ab67616d0000b273c65f8d04502eeddbdd61fa71',' <a href=\"http://www.last.fm/music/System+of+a+Down/_/Lost+in+Hollywood\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0GrHWVTDsaWcD4nrCGr7VE\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0GrHWVTDsaWcD4nrCGr7VE\";}','lost-in-hollywood','0GrHWVTDsaWcD4nrCGr7VE',11),(2936,'2025-05