oom%21\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5en63QU81VfRQIsoqBcfde\";}','boom','5en63QU81VfRQIsoqBcfde',4),(2940,'2025-05-28 01:58:26','2025-05-28 01:58:26','Nüguns','2002-11-26 00:00:00',150,'https://i.scdn.co/image/ab67616d0000b2737cf4c0d42c5b62c9deebdcd8',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0ognkBvJqaov2gWDgaMzvz\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0ognkBvJqaov2gWDgaMzvz\";}','nuguns','0ognkBvJqaov2gWDgaMzvz',5),(2941,'2025-05-28 01:58:36','2025-05-28 01:58:36','A.D.D. (American Dream Denial)','2002-11-26 00:00:00',197,'https://i.scdn.co/image/ab67616d0000b2737cf4c0d42c5b62c9deebdcd8','The American Dream Denial may be a play on this as the implication of the song seems to be that Americans are completely oblivious to the fact that the “American Dream” no longer exists. \n\nWe’re constantly distracted by what’s being fed to us on television, and what not, that we cannot see what is really happening within our own country. Those in power manipulate our attention and keep us where they want us. <a href=\"http://www.last.fm/music/System+of+a+Down/_/A.D.D.+(American+Dream+Denial)\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7gZX4vZqjJJWsdosIB0h6P\";}','a-d-d-american-dream-denial','7gZX4vZqjJJWsdosIB0h6P',6),(2942,'2025-05-28 01:58:37','2025-05-28 01:58:37','Mr. Jack','2002-11-26 00:00:00',249,'https://i.scdn.co/image/ab67616d0000b2737cf4c0d42c5b62c9deebdcd8','“Mr. Jack” talks about living within a corrupt police state where those in authority can arrest and condemn whoever they please. System of a Down, in its first demo tape, released the first version of this called “P.I.G.”\n\nMr. Jack could be a nickname for the greedy cops who are out to make dirty money for the state rather than actually protect and serve. This explains the freeway line as cops are regularly seen hiding on the side of the road, cheaply trying to pull over any and everyone. <a href=\"http://www.last.fm/music/System+of+a+Down/_/Mr.+Jack\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4TYI2YExAWaIOpGP4y7AbI\";}','mr-jack','4TYI2YExAWaIOpGP4y7AbI',7),(2943,'2025-05-28 01:58:37','2025-05-28 01:58:37','I-E-A-I-A-I-O','2002-11-26 00:00:00',188,'https://i.scdn.co/image/ab67616d0000b2737cf4c0d42c5b62c9deebdcd8',NULL,'N;','i-e-a-i-a-i-o','3RgDvs9Jpvn3kUuaTek1R5',8),(2944,'2025-05-28 01:58:37','2025-05-28 01:58:37','36','2002-11-26 00:00:00',46,'https://i.scdn.co/image/ab67616d0000b2737cf4c0d42c5b62c9deebdcd8',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2TyFfQ1OuubEwfxFvapfzC\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2TyFfQ1OuubEwfxFvapfzC\";}','36','2TyFfQ1OuubEwfxFvapfzC',9),(2945,'2025-05-28 01:58:48','2025-05-28 01:58:48','Pictures','2002-11-26 00:00:00',126,'https://i.scdn.co/image/ab67616d0000b2737cf4c0d42c5b62c9deebdcd8',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3A5E8GUX5bdPGxxJP1IrYx\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3A5E8GUX5bdPGxxJP1IrYx\";}','pictures','3A5E8GUX5bdPGxxJP1IrYx',10),(2946,'2025-05-28 01:58:48','2025-05-28 01:58:48','Highway Song','2002-11-26 00:00:00',193,'https://i.scdn.co/image/ab67616d0000b2737cf4c0d42c5b62c9deebdcd8',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4TRPgtjVmqg7EAWZe1T94E\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4TRPgtjVmqg7EAWZe1T94E\";}','highway-song','4TRPgtjVmqg7EAWZe1T94E',11),(2947,'2025-05-28 01:58:49','2025-05-28 01:58:49','Fuck the System','2002-11-26 00:00:00',132,'https://i.scdn.co/image/ab67616d0000b2737cf4c0d42c5b62c9deebdcd8',NULL,'N;','fuck-the-system','5hjKYe3NOmWx2NVzVAeIGF',12),(2948,'2025-05-28 01:58:49','2025-05-28 01:58:49','Ego Brain','2002-11-26 00:00:00',201,'https://i.scdn.co/image/ab67616d0000b2737cf4c0d42c5b62c9deebdcd8','\"Man made shame\"\n\nThis line is the crux of the whole song. It states that humanity as a collective clings to the Ego, believing it to be as real as the source, to our own detriment. Individuals carry around this “Pain Body” of shame believing they have to move on and deal with it, but this is ironically the cause of their man made shame.\n\nThe theremin on this song is performed by Greg Collins. <a href=\"http://www.last.fm/music/System+of+a+Down/_/Ego+Brain\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2HVCLZ6dMDelXhloO5sAjV\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2HVCLZ6dMDelXhloO5sAjV\";}','ego-brain','2HVCLZ6dMDelXhloO5sAjV',13),(2949,'2025-05-28 01:58:50','2025-05-28 01:58:50','Thetawaves','2002-11-26 00:00:00',156,'https://i.scdn.co/image/ab67616d0000b2737cf4c0d42c5b62c9deebdcd8',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6l17lK6a9LFqhOfh770wWg\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6l17lK6a9LFqhOfh770wWg\";}','thetawaves','6l17lK6a9LFqhOfh770wWg',14),(2950,'2025-05-28 01:59:00','2025-05-28 01:59:00','Roulette','2002-11-26 00:00:00',201,'https://i.scdn.co/image/ab67616d0000b2737cf4c0d42c5b62c9deebdcd8',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4sM7v7wyRAuV6ZTO2dvnCA\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4sM7v7wyRAuV6ZTO2dvnCA\";}','roulette','4sM7v7wyRAuV6ZTO2dvnCA',15),(2951,'2025-05-28 01:59:02','2025-05-28 01:59:02','Streamline','2002-11-26 00:00:00',217,'https://i.scdn.co/image/ab67616d0000b2737cf4c0d42c5b62c9deebdcd8','The meaning of the song is based on the separation of two people who shared a strong bond within each other, transitioning from sadness to hope from time to time, according to the sequence of the song. <a href=\"http://www.last.fm/music/System+of+a+Down/_/Streamline\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/4YtuhhgpKwckVZNGzjpxBh\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4YtuhhgpKwckVZNGzjpxBh\";}','streamline','4YtuhhgpKwckVZNGzjpxBh',16),(2952,'2025-05-28 01:59:03','2025-05-28 01:59:03','Prison Song','2001-09-04 00:00:00',201,'https://i.scdn.co/image/ab67616d0000b27307bc7d2a745636c356b4d0aa','\"Prison Song\" is the opening track to System of a Down\'s 2001 album Toxicity. The song was released as an unofficial airplay-only single, and a promotional live video of the song was released.\n\nWritten by Serj Tankian and Daron Malakian, the lyrics are about the United States prison industrial complex, the world\'s largest. The song expresses the belief that the government is partially responsible for the spread of the use of illegal drugs and thus <a href=\"http://www.last.fm/music/System+of+a+Down/_/Prison+Song\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3AwLxSqo1jOOMpNsgxqRNE\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3AwLxSqo1jOOMpNsgxqRNE\";}','prison-song','3AwLxSqo1jOOMpNsgxqRNE',1),(2953,'2025-05-28 01:59:14','2025-05-28 01:59:14','Needles','2001-09-04 00:00:00',193,'https://i.scdn.co/image/ab67616d0000b27307bc7d2a745636c356b4d0aa','\"Needles\" is the second song in System of a Down\'s album Toxicity, connected to the previous track \"Prison Song\".\nIt was written by Serj Tankian and Daron Malakian. The lyrics, are about drug (such as heroin) abuse and its dangers. Just like having a tape worm, you keep feeding this addiction without ever being \"nourished\". The more you feed it the bigger it gets and the less you get from it. After the second chorus, there is a bass riff that leads into bridge, where Malakian the guitarist sings \"I\'m sitting in my room with a needle in my hand. <a href=\"http://www.last.fm/music/System+of+a+Down/_/Needles\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6V8oQXzymTzpEZOsiBiyJT\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6V8oQXzymTzpEZOsiBiyJT\";}','needl