2:04:33','Pierrot the Clown','2006-03-13 00:00:00',262,'https://i.scdn.co/image/ab67616d0000b2738d8d7e2161c2bf9ecee56d39','\"Pierrot the Clown\" is a song of Placebo\'s fifth studio album Meds. It has a slow, mellow feeling in the song which fits its lyrical context of a character in a sombre mood. In the chorus the song compares the character to Pierrot the Clown. Its orchestration is expansive, featuring a string section, glockenspiel and acoustic guitar, among others. \n\nPierrot is a stock character of mime and Commedia dell\'Arte, a French variant of the Italian Pedrolino. <a href=\"http://www.last.fm/music/Placebo/_/Pierrot+the+Clown\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0YYsLGK2PPWx57CFdBUJJg\";}','pierrot-the-clown','0YYsLGK2PPWx57CFdBUJJg',9),(3116,'2025-05-28 02:04:33','2025-05-28 02:04:33','Broken Promise','2006-03-13 00:00:00',252,'https://i.scdn.co/image/ab67616d0000b2738d8d7e2161c2bf9ecee56d39',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0sr5Asc1L08YH4WM2qAChF\";}','broken-promise','0sr5Asc1L08YH4WM2qAChF',10),(3117,'2025-05-28 02:04:44','2025-05-28 02:04:44','One of a Kind','2006-03-13 00:00:00',200,'https://i.scdn.co/image/ab67616d0000b2738d8d7e2161c2bf9ecee56d39',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4qoaVoRbM4hGakOGMKXWwd\";}','one-of-a-kind','4qoaVoRbM4hGakOGMKXWwd',11),(3118,'2025-05-28 02:04:44','2025-05-28 02:04:44','In the Cold Light of Morning','2006-03-13 00:00:00',232,'https://i.scdn.co/image/ab67616d0000b2738d8d7e2161c2bf9ecee56d39',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2xCsokeD7GmKNlA1AUZW83\";}','in-the-cold-light-of-morning','2xCsokeD7GmKNlA1AUZW83',12),(3119,'2025-05-28 02:04:45','2025-05-28 02:04:45','Song to Say Goodbye','2006-03-13 00:00:00',216,'https://i.scdn.co/image/ab67616d0000b2738d8d7e2161c2bf9ecee56d39','\"Song to Say Goodbye\" is the second single from Placebo\'s sixth studio album Meds. It was produced by Dimitri Tikovoi. As \"Because I Want You\" was only released in the United Kingdom, \"Song to Say Goodbye\" is considered the first single from Meds. The song develops around some piano notes that repeat throughout it. It is quite sentimental due to the power of its lyrics.\nIt is a song that refers to drug addiction, specifically heroin. It contains a phrase of Neil Young\'s: \"The needle and the damage done\". <a href=\"http://www.last.fm/music/Placebo/_/Song+to+Say+Goodbye\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6Vkn98iI3sfATzdacZ307z\";}','song-to-say-goodbye','6Vkn98iI3sfATzdacZ307z',13),(3120,'2025-05-28 02:04:46','2025-05-28 02:04:46','Bulletproof Cupid','2003-03-24 00:00:00',142,'https://i.scdn.co/image/ab67616d0000b2739b2e4db4b78ab31b5d55f2fc','\"Bulletproof Cupid\" is so far the only occasion Placebo have opened an album with an instrumental track, and the only time an instrumental track has appeared in the official track list. \n\nMolko stated: \"There’s an element of ‘we’re back, we rock’. This is not our acoustic album. We didn’t want it to interrupt the flow so we stuck it on the beginning. It pulls people into the record, first you get this sonic slap on the face and they’re waiting for the vocals to start and they don’t\"  <a href=\"http://www.last.fm/music/Placebo/_/Bulletproof+Cupid\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/05RjDB9sx2KxNBiOBAIf8v\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/05RjDB9sx2KxNBiOBAIf8v\";}','bulletproof-cupid','05RjDB9sx2KxNBiOBAIf8v',1),(3121,'2025-05-28 02:04:57','2025-05-28 02:04:57','English Summer Rain','2003-03-24 00:00:00',241,'https://i.scdn.co/image/ab67616d0000b2739b2e4db4b78ab31b5d55f2fc','English Summer Rain is the fourth single from Placebo\'s studio album Sleeping with Ghosts, and was released in February 2004.\n\nIn Australia, the song was ranked #53 on Triple J\'s Hottest 100 of 2004. <a href=\"http://www.last.fm/music/Placebo/_/English+Summer+Rain\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/7wbG7nhJIhRdY1tBK02zxy\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7wbG7nhJIhRdY1tBK02zxy\";}','english-summer-rain','7wbG7nhJIhRdY1tBK02zxy',2),(3122,'2025-05-28 02:04:57','2025-05-28 02:04:57','This Picture','2003-03-24 00:00:00',214,'https://i.scdn.co/image/ab67616d0000b2739b2e4db4b78ab31b5d55f2fc','This Picture is a single by alternative rock band Placebo. Released in July 2003, it was lifted from their album Sleeping with Ghosts.\n\n\"This Picture\" was remixed by Junior Sanchez for the bonus remix CD of \"Once More with Feeling (album)\".\n\nIt tells the story of a relationship involving sadomasochism and an abusive female in a position of dominance. In the lyrics, the phrase \"ashtray girl\" is meant to refer to a woman who uses her partner as an \"emotional <a href=\"http://www.last.fm/music/Placebo/_/This+Picture\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/7pmahAnqScI4MjbQiZZqei\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7pmahAnqScI4MjbQiZZqei\";}','this-picture','7pmahAnqScI4MjbQiZZqei',3),(3123,'2025-05-28 02:04:58','2025-05-28 02:04:58','Sleeping With Ghosts','2003-03-24 00:00:00',278,'https://i.scdn.co/image/ab67616d0000b2739b2e4db4b78ab31b5d55f2fc','Sleeping with Ghosts is the title cut from Placebo\'s fourth album, Sleeping with Ghosts. The song is a depiction of how, \"Soulmates never die,\" or in more simple terms, how true friendships/relationships never end, linking it with the album\'s concept of relationships. The song\'s composition is softer compared to the other songs of the album, it features lighter, slower guitar and more piano than other titles. The chorus line, \"Soulmates never die,\" was used as the title for the live DVD, Soulmates Never Die (Live in Paris 2003). <a href=\"http://www.last.fm/music/Placebo/_/Sleeping+with+Ghosts\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5Wa66vmcJPuTs9PlAdGVp7\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5Wa66vmcJPuTs9PlAdGVp7\";}','sleeping-with-ghosts','5Wa66vmcJPuTs9PlAdGVp7',4),(3124,'2025-05-28 02:05:08','2025-05-28 02:05:08','The Bitter End','2003-03-24 00:00:00',190,'https://i.scdn.co/image/ab67616d0000b2739b2e4db4b78ab31b5d55f2fc','\"The Bitter End\" is the first single of off Placebo\'s fourth studio album \"Sleeping With Ghosts\" released in March 2003. Lyricist and vocalist Brian Molko states that \"The Bitter End\"  is a \"The back-to-basics rock song, written in two days. Two people trying to come out of a relationship with the least scars. Very fuck you.\"\n\n\"The Bitter End\" is very obviously derived from the 1949 dystopian novel \"1984\" written by George Orwell with very palpable <a href=\"http://www.last.fm/music/Placebo/_/The+Bitter+End\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2yYASbXnAV71CLbNY1HCWf\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2yYASbXnAV71CLbNY1HCWf\";}','the-bitter-end','2yYASbXnAV71CLbNY1HCWf',5),(3125,'2025-05-28 02:05:09','2025-05-28 02:05:09','Something Rotten','2003-03-24 00:00:00',328,'https://i.scdn.co/image/ab67616d0000b2739b2e4db4b78ab31b5d55f2fc','\"Something Rotten\" takes residence as Placebo’s most sonically adventurous track since they dived into the hip-hop world with  “Spite & Malice,” the fourth track off their album prior that incorporates elements of Reggae and Dub, as well as looped electronics. \n\n\"Something Rotten\" has never been played live, Brian states \"A dub reggae jam we gave to Jim (\"Sleeping With Ghosts\" Producer) as a challenge and he rose to it. An abstract song about something sinister that’s close to home\". <a href=\"http://www.last.fm/music/Placebo/_/Something+Rotten\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/69FTBHqMCIYdYK8aBsRyHY\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/69FTBHqMCIYdYK8aBsRyHY\";}','something-rotten','69FTBHqMCIYdYK8aBsRyHY',6),(3126,'2025-05-28 02:05:09','2025-05-28 02:05:09','Plasticine','2003-03-24 00:00:00',206,'https://i.scdn.co/image/ab67616d0000b2739b2e4db4b78ab31b5d55f2fc','Often described as \"A band of outcasts, for outcasts\" by the members of British rock band, Placebo, \"Plasticine\" is a track that embodies that message and is about not conforming, and celebrating your own unique personality. Singer and Frontman Brian Molko expressed that \"Plasticine\" is  “A classic Placebo song with a classic Placebo theme – individuality.”\n\nThe track received a remix in the form of a lounge version, which featured on the CD single release of “Special Needs\" and on the album \"Sleeping With Ghosts : B sides\". <a href=\"http://www.last.fm/music/Placebo/_/Plasticine\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0vrCTn6A3NdkLhUGLvte0Y\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0vrCTn6A3NdkLhUGLvte0Y\";}','plasticine','0vrCTn6A3NdkLhUGLvte0Y',7),(3127,'2025-05-28 02:05:10','2025-05-28 02:05:10','Special Needs','2003-03-24 00:00:00',315,'https://i.scdn.co/image/ab67616d0000b2739b2e4db4b78ab31b5d55f2fc','Special Needs is a single by alternative rock band Placebo. Taken from Sleeping with Ghosts, their fourth album, it reached number 27 in the UK singles chart. The video is filmed in an empty swimming pool, and includes a boy and a girl in separate changing rooms making love to thin air. <a href=\"http://www.last.fm/music/Placebo/_/Special+Needs\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0AATuEhrQtGDevnhq9Nx2k\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0AATuEhrQtGDevnhq9Nx2k\";}','special-needs','0AATuEhrQtGDevnhq9Nx2k',8),(3128,'2025-05-28 02:05:10','2025-05-28 02:05:10','I\'ll Be Yours','2003-03-24 00:00:00',212,'https://i.scdn.co/image/ab67616d0000b2739b2e4db4b78ab31b5d55f2fc',NULL,'N;','i-ll-be-yours','5RFrsUMEro83hqOFkcUUR8',9),(3129,'2025-05-28 02:05:20','2025-05-28 02:05:20','Second Sight','2003-03-24 00:00:00',169,'https://i.scdn.co/image/ab67616d0000b2739b2e4db4b78ab31b5d55f2fc','\"Second Sight\" is the tenth track off of \"Sleeping With Ghosts\", it takes the mould of the song two songs before hand ,“Plasticine”, being an upbeat guitar-based track while the lyrics are significantly darker. Brian succinctly said \"Second Sight\" is about  \"A one-night-stand song saying walk away for your own self-respect\". <a href=\"http://www.last.fm/music/Placebo/_/Second+Sight\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0sqVCDIL7VH7mmG0TJbWnW\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0sqVCDIL7VH7mmG0TJbWnW\";}','second-sight','0sqVCDIL7VH7mmG0TJbWnW',10),(3130,'2025-05-28 02:05:21','2025-05-28 02:05:21','Protect Me from What I Want','2003-03-24 00:00:00',195,'https://i.scdn.co/image/ab67616d0000b2739b2e4db4b78ab31b5d55f2fc','Brian Molko told Kerrang! Magazine  that this song “was inspired by the conceptual artist Jenny Holzer.” He added: “It is really a discourse with myself about my self destructive behaviour\". \n\nDuring live performances Brian plays the harmonica. He said the lyrics were \"Written when I was hurting deeply and coming out of a very self-destructive relationship, hence the creepy atmosphere\". \n\n“Protect Me From What I Want” was re-recorded in French under the name “Protege Moi <a href=\"http://www.last.fm/music/Placebo/_/Protect+Me+from+What+I+Want\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6gWTeVFeCtQH4IZV4GL6IE\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6gWTeVFeCtQH4IZV4GL6IE\";}','protect-me-from-what-i-want','6gWTeVFeCtQH4IZV4GL6IE',11),(3131,'2025-05-28 02:05:21','2025-05-28 02:05:21','Centrefolds','2003-03-24 00:00:00',300,'https://i.scdn.co/image/ab67616d0000b2739b2e4db4b78ab31b5d55f2fc','The final track on the record, and the first in Placebo’s history not to hide a bonus, hidden song after it. The piano is played by Stefan, and the lead guitar is played by Brian. It was part of their live show during the tour, usually appearing either just before, or during the encore. Brian said: Someone telling a washed-up celebrity ‘I’m the best you can get now so you’d better be mine.’ It’s about obsession, questions of status and self-degradation. <a href=\"http://www.last.fm/music/Placebo/_/Centrefolds\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/28ZH7dOeXMA4QdhPVLcVcE\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/28ZH7dOeXMA4QdhPVLcVcE\";}','centrefolds','28ZH7dOeXMA4QdhPVLcVcE',12),(3132,'2025-05-28 02:05:33','2025-05-28 02:05:33','Running Up That Hill','2003-03-24 00:00:00',297,'https://i.scdn.co/image/ab67616d0000b27362c995dbce6d7ffa4c097475','Placebo covered \"Running Up That Hill\", releasing it originally on the bonus disc of their 2003 album Sleeping with Ghosts. The song had a fairly low profile for some time before attracting further attention in 2006, after Placebo began to include it in their set whilst touring to promote Meds.\n\n\"Running Up That Hill\" was released as a single in October, 2006, and was included on the re-released version of Meds in 2007, along with the song, \'UNEEDMEMORETHANINEEDU\'. <a href=\"http://www.last.fm/music/Placebo/_/Running+Up+That+Hill\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0uYVJ8z5kgMayMNPJA6Cz9\";}','running-up-that-hill','0uYVJ8z5kgMayMNPJA6Cz9',1),(3133,'2025-05-28 02:05:33','2025-05-28 02:05:33','Where Is My Mind? - XFM Live Version','2003-03-24 00:00:00',224,'https://i.scdn.co/image/ab67616d0000b27362c995dbce6d7ffa4c097475',NULL,'N;','where-is-my-mind-xfm-live-version','6Yg3J1OkP45u