rontman Brian Molko <a href=\"http://www.last.fm/music/Placebo/_/Taste+in+Men\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/6DVWb7uBVyyLwWslndW6DL\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/6DVWb7uBVyyLwWslndW6DL\";}','taste-in-men','6DVWb7uBVyyLwWslndW6DL',1),(3143,'2025-05-28 02:05:59','2025-05-28 02:05:59','Days Before You Came','2000-10-09 00:00:00',153,'https://i.scdn.co/image/ab67616d0000b27393deba59f323074beff846ff','Following the smash hit single \"Taste in Men\", \"Black Market Music\" \'s second track \"Days Before You Came\" continues the upbeat theme of the album, being heavily distorted and of a frenetic pace, much like crowd favourites \"Brick Shithouse\" and \"Scared of Girls\" from their album prior, \"Without You I\'m Nothing\". In a 2000 interview by Jennifer Van Gessel as Placebo returned to Australia, Stefan Olsdal stated that \"Days Before You Came\" along with <a href=\"http://www.last.fm/music/Placebo/_/Days+Before+You+Came\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/7BvY9yXMT4oWDscmnyEbgv\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7BvY9yXMT4oWDscmnyEbgv\";}','days-before-you-came','7BvY9yXMT4oWDscmnyEbgv',2),(3144,'2025-05-28 02:06:00','2025-05-28 02:06:00','Special K','2000-10-09 00:00:00',232,'https://i.scdn.co/image/ab67616d0000b27393deba59f323074beff846ff','Special K is a single by alternative rock band Placebo, taken from their third album. The song has many drug references: the \"special K\" in the title refers to the drug ketamine and lines in the song such as \"just like I swallowed half my stash\" and \"I fall down...hit the ground\" refer to drug stashes and withdrawal. <a href=\"http://www.last.fm/music/Placebo/_/Special+K\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0W6QtgkxPNJ7simo1UcBIr\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0W6QtgkxPNJ7simo1UcBIr\";}','special-k','0W6QtgkxPNJ7simo1UcBIr',3),(3145,'2025-05-28 02:06:10','2025-05-28 02:06:10','Spite and Malice','2000-10-09 00:00:00',217,'https://i.scdn.co/image/ab67616d0000b27393deba59f323074beff846ff',NULL,'N;','spite-and-malice','4GBGMbIcgZu6MPWU01hy8O',4),(3146,'2025-05-28 02:06:11','2025-05-28 02:06:11','Passive Aggressive','2000-10-09 00:00:00',324,'https://i.scdn.co/image/ab67616d0000b27393deba59f323074beff846ff','\"Passive Aggressive\", the fifth track off \"Black Market Music\", is lyrically simple yet structurally unique, the first verse repeating itself twice and the final chorus repeating itself twice with the harmonic exceptions Brian Molko implies.\n\nReligious references seep into this track like many others on this album, this slow song embodies Molko\'s self removal from the clergy that he was forced into is his childhood. \"Passive Aggressive\" again follows the narrative of a central figure embroiled in addiction <a href=\"http://www.last.fm/music/Placebo/_/Passive+Aggressive\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1OKCK7kcbnb7dfk5Dpwndx\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1OKCK7kcbnb7dfk5Dpwndx\";}','passive-aggressive','1OKCK7kcbnb7dfk5Dpwndx',5),(3147,'2025-05-28 02:06:11','2025-05-28 02:06:11','Black-Eyed','2000-10-09 00:00:00',228,'https://i.scdn.co/image/ab67616d0000b27393deba59f323074beff846ff',NULL,'N;','black-eyed','5UfHkQ5bUY4pTxwlCFJNUK',6),(3148,'2025-05-28 02:06:11','2025-05-28 02:06:11','Blue American','2000-10-09 00:00:00',211,'https://i.scdn.co/image/ab67616d0000b27393deba59f323074beff846ff','In an interview, Molko described \"Blue American\", the seventh track off of \"Black Market Music\", as  “Three and a half minutes of self-disgust, American style\". With the Singer being of American-descent, \"Blue American\" acts in a sort of autobiographical way. \"Blue American\" delves into themes of religion and racism, The reference of religion tying in his strict Christian upbringing and the reference to racism, highlighting that it is still a prevalent <a href=\"http://www.last.fm/music/Placebo/_/Blue+American\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/29bWJPo6YCPo0SKKaLmQGE\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/29bWJPo6YCPo0SKKaLmQGE\";}','blue-american','29bWJPo6YCPo0SKKaLmQGE',7),(3149,'2025-05-28 02:06:22','2025-05-28 02:06:22','Slave to the Wage','2000-10-09 00:00:00',246,'https://i.scdn.co/image/ab67616d0000b27393deba59f323074beff846ff','\"The very idea of working in an office seemed so horrifically depressing that I decided I would do everything in my power not to make that happen\" Brian Molko tells Belfast Telegraph in 2015, Molko has held the same opinion since the beginning of Placebo\'s career in 1996. \"Slave to the Wage\" is Molko\'s exact feeling\'s regarding the traditional \'9-5\' passing off the societal rite of passage and embracing a different purpose in life. \n\n\"Slave to the Wage\" was the second single to be released off of their third album \"Black Market Music\" <a href=\"http://www.last.fm/music/Placebo/_/Slave+to+the+Wage\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/493r2DTRhYUzsy90HauADi\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/493r2DTRhYUzsy90HauADi\";}','slave-to-the-wage','493r2DTRhYUzsy90HauADi',8),(3150,'2025-05-28 02:06:22','2025-05-28 02:06:22','Commercial for Levi','2000-10-09 00:00:00',140,'https://i.scdn.co/image/ab67616d0000b27393deba59f323074beff846ff','The song \"Commercial for Levi\" is named for sound technician Levi Tecofski, who on one occasion saved frontman Brian Molko\'s life; Molko, drunk and about to cross the road, was quickly pulled back by Tecofski from the path of an approaching vehicle. <a href=\"http://www.last.fm/music/Placebo/_/Commercial+for+Levi\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/58QIwAfslTXzyr2gF1tAKB\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/58QIwAfslTXzyr2gF1tAKB\";}','commercial-for-levi','58QIwAfslTXzyr2gF1tAKB',9),(3151,'2025-05-28 02:06:23','2025-05-28 02:06:23','Haemoglobin','2000-10-09 00:00:00',226,'https://i.scdn.co/image/ab67616d0000b27393deba59f323074beff846ff','Driving heavily on themes of pathos, Placebo\'s \"Haemoglobin\" off their third album \"Black Market Music\" is a track written about the Racism and the act of lynching of African American\'s during the era of slavery. Racial discrimination is a topic Placebo touches on in this track, \"Blue American\" in the same album and \"Trigger Happy Hands\" in 2010 from \"Battle For the Sun : Redux\". \"Haemoglobin\" is an intense and important song, not escaping criticism though due to Molko\'s heavy referencing. <a href=\"http://www.last.fm/music/Placebo/_/Haemoglobin\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/60fwO4MzFmf7PNC3lKF5NJ\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/60fwO4MzFmf7PNC3lKF5NJ\";}','haemoglobin','60fwO4MzFmf7PNC3lKF5NJ',10),(3152,'2025-05-28 02:06:23','2025-05-28 02:06:23','Narcoleptic','2000-10-09 00:00:00',262,'https://i.scdn.co/image/ab67616d0000b27393deba59f323074beff846ff','“Narcoleptic”, the eleventh track off of \"Black Market Music“, is a song quoted to be about \"The passing of love, drugs and love are one big pillow and they can make you forget about so many things, and put you into a somnambulist state, like sleep walking” by the singer/songwriter Brian Molko. It’s quite possible \"Narcoleptic\" is in reference to the frontman\'s heroin phase, and the way in which addicts can “nod off” during the day whilst on the drug. <a href=\"http://www.last.fm/music/Placebo/_/Narcoleptic\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/7y5kniR76wx8tyub8NbkBp\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7y5kniR76wx8tyub8NbkBp\";}','narcoleptic','7y5kniR76wx8tyub8NbkBp',11),(3153,'2025-05-28 02:06:34','2025-05-28 02:06:34','Peeping Tom','2000-10-09 00:00:00',316,'https://i.scdn.co/image/ab67616d0000b27393deba59f323074beff846ff','The official final track of Placebo\'s third album, \"Black Market Music\", \"Peeping Tom\" is simply about voyeurism according to songwriter and frontman, Brian Molko - \"I try in the song to place you inside the head and make you feel the emotions of this voyeur and try and make you feel sympathetic. The song is full of pathos and extremely sad\". The reoccurring lyrics of \"I\'m weightless / I\'m bare / I\'m faithless / I\'m scared\" in the tracks chorus can <a href=\"http://www.last.fm/music/Placebo/_/Peeping+Tom\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5w9d8yCMV0ZDMCPBgeCMfA\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5w9d8yCMV0ZDMCPBgeCMfA\";}','peeping-tom','5w9d8yCMV0ZDMCPBgeCMfA',12),(3154,'2025-05-28 02:06:35','2025-05-28 02:06:35','Black Market Blood','2000-10-09 00:00:00',237,'https://i.scdn.co/image/ab67616d0000b27393deba59f323074beff846ff',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2uIoOMW04x2JRARmUmz4N3\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2uIoOMW04x2JRARmUmz4N3\";}','black-market-blood','2uIoOMW04x2JRARmUmz4N3',13),(3155,'2025-05-28 02:06:35','2025-05-28 02:06:35','Pure Morning','1998-10-12 00:00:00',254,'https://i.scdn.co/image/ab67616d0000b273f05be6e0f6c59b1563b4e35e',NULL,'N;','pure-morning','32F0zqsDgqpIEYApk2b8sr',1),(3156,'2025-05-28 02:06:35','2025-05-28 02:06:35','Brick Shithouse','1998-10-12 00:00:00',198,'https://i.scdn.co/image/ab67616d0000b273f05be6e0f6c59b1563b4e35e',NULL,'N;','brick-shithouse','3mc8UayivlPPX3wv7hsRNO',2),(3157,'2025-05-28 02:06:35','2025-05-28 02:06:35','You Don\'t Care About Us','1998-10-12 00:00:00',238,'https://i.scdn.co/image/ab67616d0000b273f05be6e0f6c59b15