a',7),(3175,'2025-05-28 02:06:36','2025-05-28 02:06:36','Without You I\'m Nothing - Brothers in Rhythm Club Mix','1998-05-28 02:06:36',651,'https://i.scdn.co/image/ab67616d0000b273ebe9f3a71b869ccc0574759d',NULL,'N;','without-you-i-m-nothing-brothers-in-rhythm-club-mix','7wtSXa89uBpI4d7uaerwuO',8),(3176,'2025-05-28 02:06:36','2025-05-28 02:06:36','Mars Landing Party','1998-05-28 02:06:36',105,'https://i.scdn.co/image/ab67616d0000b273ebe9f3a71b869ccc0574759d',NULL,'N;','mars-landing-party','4hwjOZPCetsXZzsKds7Rpq',9),(3177,'2025-05-28 02:06:36','2025-05-28 02:06:36','Aardvark','1998-05-28 02:06:36',180,'https://i.scdn.co/image/ab67616d0000b273ebe9f3a71b869ccc0574759d',NULL,'N;','aardvark','3Q6JTlQT4cCAr7js1clkq4',10),(3178,'2025-05-28 02:06:37','2025-05-28 02:06:37','Come Home','1996-06-17 00:00:00',309,'https://i.scdn.co/image/ab67616d0000b2739710d6b9be102de728f6e26f','“Come Home” was released as the lead single from Placebo’s debut album of the same name. It was released under the record label \'Deceptive\', before the band\'s signing with \'Virgin Records\'. It was a minor chart success, making it to number 86 in the U.K Singles chart, and features the British band\'s original drummer, Robert Schultzberg.\n\nThe song was re-recorded for their debut album and didn’t appear on their singles collection \'Once More With Feeling\', on account of it being pre-Virgin records. <a href=\"http://www.last.fm/music/Placebo/_/Come+Home\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1lEU16tT3VZWQ76I5I2ZXJ\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1lEU16tT3VZWQ76I5I2ZXJ\";}','come-home','1lEU16tT3VZWQ76I5I2ZXJ',1),(3179,'2025-05-28 02:06:38','2025-05-28 02:06:38','Teenage Angst','1996-06-17 00:00:00',162,'https://i.scdn.co/image/ab67616d0000b2739710d6b9be102de728f6e26f','\"This song is about hating your parents\" is a way Brian Molko introduced the second track off of their self-titled album when playing live. The fourth single from their debut album, “Teenage Angst” managed to reach number 30 on the U.K Singles Chart, and came accompanied by a bright and vivid video “shot” inside a giant red latex cube.\n\nThe song has gone through multiple, significant arrangements such as during their exclusive \'Loud Like Love <a href=\"http://www.last.fm/music/Placebo/_/Teenage+Angst\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3GKEh2H15w9ZECfi1BtQ20\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3GKEh2H15w9ZECfi1BtQ20\";}','teenage-angst','3GKEh2H15w9ZECfi1BtQ20',2),(3180,'2025-05-28 02:06:48','2025-05-28 02:06:48','Bionic','1996-06-17 00:00:00',300,'https://i.scdn.co/image/ab67616d0000b2739710d6b9be102de728f6e26f','\"This song is about a robotic fuck\" is the way Brian Molko often introduced this track off their self-titled album. In 2004 the frontman details that \"It’s screaming sexual energy. You know, it’s absolutely belting out desire. I was desperately so. That’s kind of a reflection of the person I was at the age of 20, you know\". One of Placebo\'s more repetitive tracks, “Bionic” appears to be about the preference for artificial bedroom devices, over more organic partners. <a href=\"http://www.last.fm/music/Placebo/_/Bionic\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/50bBCTAS5bTDAcVxnShfuk\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/50bBCTAS5bTDAcVxnShfuk\";}','bionic','50bBCTAS5bTDAcVxnShfuk',3),(3181,'2025-05-28 02:06:49','2025-05-28 02:06:49','36 Degrees','1996-06-17 00:00:00',185,'https://i.scdn.co/image/ab67616d0000b2739710d6b9be102de728f6e26f','With a disturbing under-water shot music video, \"36 Degrees\" was released as the third single from Placebo’s debut album, peaking at number 80 on the UK Singles Charts. The track has gone through several different arrangements, most notable being the 2005 version which was released on the “Song To Say Goodbye” single and a similar performance of the song found on the \"Meds : B sides\" album. It also received a remake for their special 2015 MTV Unplugged performance <a href=\"http://www.last.fm/music/Placebo/_/36+Degrees\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1KQxjMICHx5mHfcJJSx4Uh\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1KQxjMICHx5mHfcJJSx4Uh\";}','36-degrees','1KQxjMICHx5mHfcJJSx4Uh',4),(3182,'2025-05-28 02:06:49','2025-05-28 02:06:49','Hang on to Your IQ','1996-06-17 00:00:00',313,'https://i.scdn.co/image/ab67616d0000b2739710d6b9be102de728f6e26f','\"Hang on to Your IQ\" off of Placebo\'s self-titled album starts the decline of the albums energy as slower, more sombre songs start to dominate the track list. Brian Molko explained to NME in 1998 that \"Hang on to Your IQ\" is the most \"story-like\" song on the album: \"The person in ‘Hang On To Your IQ’ is so self-conscious they can’t operate properly sexually, which we all go through at certain times in our lives\". \n\n\"Hang on to Your IQ\" was never played live after 2001 <a href=\"http://www.last.fm/music/Placebo/_/Hang+on+to+Your+IQ\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/5iampCWfhOcG2ptg5xpYqC\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5iampCWfhOcG2ptg5xpYqC\";}','hang-on-to-your-iq','5iampCWfhOcG2ptg5xpYqC',5),(3183,'2025-05-28 02:06:50','2025-05-28 02:06:50','Nancy Boy','1996-06-17 00:00:00',212,'https://i.scdn.co/image/ab67616d0000b2739710d6b9be102de728f6e26f','Nancy Boy is a song by Placebo, released as the third single from their self-titled album. It was released on January 20th, 1997 and it became their breakthrough single, reaching number 4 in the UK charts and making them known to mainstream audiences. As with their first single \"Come Home\", the single/radio edit (aka the \'Sex mix\') is a rerecorded version, noticeably different from the album version. It was later released on the compilation album Once More With Feeling. <a href=\"http://www.last.fm/music/Placebo/_/Nancy+Boy\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3CfbvqIrSOuB142hqFM2mf\";}','nancy-boy','3CfbvqIrSOuB142hqFM2mf',6),(3184,'2025-05-28 02:07:00','2025-05-28 02:07:00','I Know','1996-06-17 00:00:00',284,'https://i.scdn.co/image/ab67616d0000b2739710d6b9be102de728f6e26f',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3ICRNTxEU4tRb3oBK8f1Nm\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3ICRNTxEU4tRb3oBK8f1Nm\";}','i-know','3ICRNTxEU4tRb3oBK8f1Nm',7),(3185,'2025-05-28 02:07:01','2025-05-28 02:07:01','Bruise Pristine','1996-06-17 00:00:00',215,'https://i.scdn.co/image/ab67616d0000b2739710d6b9be102de728f6e26f','\"Bruise Pristine\" is a song by English alternative rock band Placebo, released in its original version in October of \'95, 6 months before the release of the first record. In 1996 it earned a re-release, featuring the solo acoustic track “Then The Clouds Will Open For Me.” It was re-recorded for the band\'s self-titled debut album, and this version was released in May 1997 as the fifth and final single from the album.\n\nAfter the success of “Nancy Boy <a href=\"http://www.last.fm/music/Placebo/_/Bruise+Pristine\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/7lWGSC1CBEWcEkclz5HSru\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/7lWGSC1CBEWcEkclz5HSru\";}','bruise-pristine','7lWGSC1CBEWcEkclz5HSru',8),(3186,'2025-05-28 02:07:01','2025-05-28 02:07:01','Lady of the Flowers','1996-06-17 00:00:00',287,'https://i.scdn.co/image/ab67616d0000b2739710d6b9be102de728f6e26f',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/2DJAJRyGCknrwjp9Ukn8oR\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2DJAJRyGCknrwjp9Ukn8oR\";}','lady-of-the-flowers','2DJAJRyGCknrwjp9Ukn8oR',9),(3187,'2025-05-28 02:07:1