b67616d0000b27309fd83d32aee93dceba78517','Stadium Arcadium is the fourth track from the Red Hot Chili Peppers\' ninth studio album of the same name. All members are credited on this song. John Frusciante also was credited by the backing vocals on the track. <a href=\"http://www.last.fm/music/Red+Hot+Chili+Peppers/_/Stadium+Arcadium\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4y84ILALZSa4LyP6H7NVjR\";}','stadium-arcadium','4y84ILALZSa4LyP6H7NVjR',4),(3589,'2025-05-29 16:07:38','2025-05-29 16:07:38','Hump de Bump','2006-05-09 00:00:00',213,'https://i.scdn.co/image/ab67616d0000b27309fd83d32aee93dceba78517','\"Hump de Bump\" is a song by American alternative rock band Red Hot Chili Peppers from their 2006 studio album Stadium Arcadium. \n\nThe song is the fifth and final single released from the album. Originally expected to be the 4th single for the US, Canada and Australia, (\"Desecration Smile\" was the 4th single released internationally) the band decided to make the single and video a worldwide release thanks to the positive feedback on the song\'s music video.  <a href=\"http://www.last.fm/music/Red+Hot+Chili+Peppers/_/Hump+de+Bump\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5f2ZVFERwwh3asebmurZEf\";}','hump-de-bump','5f2ZVFERwwh3asebmurZEf',5),(3590,'2025-05-29 16:07:39','2025-05-29 16:07:39','She\'s Only 18','2006-05-09 00:00:00',205,'https://i.scdn.co/image/ab67616d0000b27309fd83d32aee93dceba78517',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3gvyksxkLbyKwi0WjCiPXE\";}','she-s-only-18','3gvyksxkLbyKwi0WjCiPXE',6),(3591,'2025-05-29 16:07:39','2025-05-29 16:07:39','Slow Cheetah','2006-05-09 00:00:00',319,'https://i.scdn.co/image/ab67616d0000b27309fd83d32aee93dceba78517','Slow Cheetah is a rock and roll song from the Red Hot Chili Peppers\' 2006 album Stadium Arcadium. The song is characteristic of the band\'s stylistic shift from rap and funk towards a mellower sound, evident in their latest albums. “Slow Cheetah” is unusual in that it is one of the few songs on Stadium Arcadium to feature the use of an acoustic guitar.\n\nAndrew Perry of The Observer notes that within the dreamy, anthemic atmosphere of “Slow Cheetah <a href=\"http://www.last.fm/music/Red+Hot+Chili+Peppers/_/Slow+Cheetah\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/06wTEKL2rSrSaOjFtgG8fj\";}','slow-cheetah','06wTEKL2rSrSaOjFtgG8fj',7),(3592,'2025-05-29 16:07:50','2025-05-29 16:07:50','Torture Me','2006-05-09 00:00:00',224,'https://i.scdn.co/image/ab67616d0000b27309fd83d32aee93dceba78517',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/5ZISTTuh3YIBtYsCvBKk5w\";}','torture-me','5ZISTTuh3YIBtYsCvBKk5w',8),(3593,'2025-05-29 16:07:50','2025-05-29 16:07:50','Strip My Mind','2006-05-09 00:00:00',259,'https://i.scdn.co/image/ab67616d0000b27309fd83d32aee93dceba78517',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0J3ytriezGZ3KCREfHKDOI\";}','strip-my-mind','0J3ytriezGZ3KCREfHKDOI',9),(3594,'2025-05-29 16:07:51','2025-05-29 16:07:51','Especially in Michigan','2006-05-09 00:00:00',240,'https://i.scdn.co/image/ab67616d0000b27309fd83d32aee93dceba78517','Omar A. Rodriguez-Lopez is credited with the guitar solo on this track. <a href=\"http://www.last.fm/music/Red+Hot+Chili+Peppers/_/Especially+in+Michigan\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1ylzYcU6FGnuBqqdqqH7QL\";}','especially-in-michigan','1ylzYcU6FGnuBqqdqqH7QL',10),(3595,'2025-05-29 16:07:51','2025-05-29 16:07:51','Warlocks','2006-05-09 00:00:00',205,'https://i.scdn.co/image/ab67616d0000b27309fd83d32aee93dceba78517','Billy Preston is credited with playing clavinet on this track. <a href=\"http://www.last.fm/music/Red+Hot+Chili+Peppers/_/Warlocks\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1jrARDhheF2nrDEevG9rmo\";}','warlocks','1jrAR