horus of the song are different from the version released on Stadium Arcadium.\n\nThe single version, was edited due to length for radio play and is shorter than the album version which is 4:15 long. <a href=\"http://www.last.fm/music/Red+Hot+Chili+Peppers/_/Desecration+Smile\">Read more on Last.fm</a>.','a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0GRvnYqlnh7ttq9NS6s3Ta\";}','desecration-smile','0GRvnYqlnh7ttq9NS6s3Ta',1),(3600,'2025-05-29 16:08:14','2025-05-29 16:08:14','Tell Me Baby','2006-05-09 00:00:00',247,'https://i.scdn.co/image/ab67616d0000b27309fd83d32aee93dceba78517',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/0itNMuBHye9fu392b4e9oa\";}','tell-me-baby','0itNMuBHye9fu392b4e9oa',2),(3601,'2025-05-29 16:08:15','2025-05-29 16:08:15','Hard to Concentrate','2006-05-09 00:00:00',241,'https://i.scdn.co/image/ab67616d0000b27309fd83d32aee93dceba78517',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/37kTASujIfZZ27NV7PfIrf\";}','hard-to-concentrate','37kTASujIfZZ27NV7PfIrf',3),(3602,'2025-05-29 16:08:15','2025-05-29 16:08:15','21st Century','2006-05-09 00:00:00',262,'https://i.scdn.co/image/ab67616d0000b27309fd83d32aee93dceba78517',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/4vHmY3cg7PWCPE0buO3G6t\";}','21st-century','4vHmY3cg7PWCPE0buO3G6t',4),(3603,'2025-05-29 16:08:26','2025-05-29 16:08:26','She Looks to Me','2006-05-09 00:00:00',245,'https://i.scdn.co/image/ab67616d0000b27309fd83d32aee93dceba78517',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/31EJcKUZGaDCm684ByEx0G\";}','she-looks-to-me','31EJcKUZGaDCm684ByEx0G',5),(3604,'2025-05-29 16:08:26','2025-05-29 16:08:26','Readymade','2006-05-09 00:00:00',270,'https://i.scdn.co/image/ab67616d0000b27309fd83d32aee93dceba78517',NULL,'a:1:{s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2Y5ngAobMcspRywfmb77k5\";}','readymade','2Y5ngAobMcspRywfmb77k5',6),(3605,'2025-05-29 16:08:27','2025-05-29 16:08:27','If','2006-05-09 00:00:0