2025-05-29 16:09:04','2025-05-29 16:09:04','Don\'t Forget Me','2002-07-09 00:00:00',277,'https://i.scdn.co/image/ab67616d0000b273fdbcee40748537ff80a7af70',NULL,'N;','don-t-forget-me','0LGNCDBI88WlGMuo1w6zgS',5),(3637,'2025-05-29 16:09:15','2025-05-29 16:09:15','The Zephyr Song','2002-07-09 00:00:00',231,'https://i.scdn.co/image/ab67616d0000b273fdbcee40748537ff80a7af70','The Zephyr Song was the second single released for the Red Hot Chili Peppers\' eighth studio album By the Way. The song, as a single, was released in two parts. Both editions held two previously unheard-of B-sides, making it, collectively, hold four non-LP tracks. This is the largest amount of accumulated unreleased studio recorded B-sides any solitary single the Red Hot Chili Peppers have ever released. Coincidentally, it is also one of their rarest singles, regularly fetching prices above 100 dollars. <a href=\"http://www.last.fm/music/Red+Hot+Chili+Peppers/_/The+Zephyr+Song\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1ndGB6rvxKYN9seCYO1dTF\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2UaJHs6wlASNl7q34j7hK1\";}','the-zephyr-song','2UaJHs6wlASNl7q34j7hK1',6),(3638,'2025-05-29 16:09:15','2025-05-29 16:09:15','Can\'t Stop','2002-07-09 00:00:00',269,'https://i.scdn.co/image/ab67616d0000b273fdbcee40748537ff80a7af70',NULL,'N;','can-t-stop','4BcS4LomxUnQpzx4hCaJTs',7),(3639,'2025-05-29 16:09:16','2025-05-29 16:09:16','I Could Die for You','2002-07-09 00:00:00',192,'https://i.scdn.co/image/ab67616d0000b273fdbcee40748537ff80a7af70',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3oP2vxUR2bjFCrU9YolGnM\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3EAcsZy8hsDrDoTaM13ewu\";}','i-could-die-for-you','3EAcsZy8hsDrDoTaM13ewu',8),(3640,'2025-05-29 16:09:16','2025-05-29 16:09:16','Midnight','2002-07-09 00:00:00',295,'https://i.scdn.co/image/ab67616d0000b273fdbcee40748537ff80a7af70',NULL,'a:2:{s:14:\"free streaming\";s