JI',15),(3663,'2025-05-29 16:09:42','2025-05-29 16:09:42','Fat Dance - 2006 Remaster','1999-06-08 00:00:00',220,'https://i.scdn.co/image/ab67616d0000b27394d08ab63e57b0cae74e8595',NULL,'N;','fat-dance-2006-remaster','3BW34zpQNgRUwuQ4eUyzMN',16),(3664,'2025-05-29 16:09:42','2025-05-29 16:09:42','Over Funk - 2006 Remaster','1999-06-08 00:00:00',178,'https://i.scdn.co/image/ab67616d0000b27394d08ab63e57b0cae74e8595',NULL,'N;','over-funk-2006-remaster','0809RpHic1xrZzh9CT4wXo',17),(3665,'2025-05-29 16:09:42','2025-05-29 16:09:42','Quixoticelixer - 2006 Remaster','1999-06-08 00:00:00',288,'https://i.scdn.co/image/ab67616d0000b27394d08ab63e57b0cae74e8595',NULL,'N;','quixoticelixer-2006-remaster','28w7CPWQCqQxt0YCzDN75b',18),(3666,'2025-05-29 16:09:43','2025-05-29 16:09:43','Around the World','1999-06-08 00:00:00',239,'https://i.scdn.co/image/ab67616d0000b273a9249ebb15ca7a5b75f16a90','Around the World is a song by Red Hot Chili Peppers released as the second single from their 1999 album, Californication. The single peaked at number seven on the Billboard Modern Rock Tracks and number sixteen on the Mainstream Rock Tracks.\n\nAnthony Kiedis has stated that in the lyrics for the verses he is telling about his journeys and his experiences on them, about being a member of the Red Hot Chili Peppers and living an extreme life. He also noted that Roberto Benigni\'s film Life Is Beautiful was a lyrical inspiration. <a href=\"http://www.last.fm/music/Red+Hot+Chili+Peppers/_/Around+the+World\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0aGQHMr7bc23Y9Ts84ffop\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/1Y6DGcTCuMAtw8KB3h4W3q\";}','around-the-world','1Y6DGcTCuMAtw8KB3h4W3q',1),(3667,'2025-05-29 16:09:54','2025-05-29 16:09:54','Parallel Universe','1999-06-08 00:00:00',269,'https://i.scdn.co/image/ab67616d0000b273a9249ebb15ca7a5b75f16a90',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1Se0r96r0gnqg67kJPmESc\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3ZwxczCIlt4nA7czQaugvM\";}','parallel-universe','3ZwxczCIlt4nA7czQaugvM',2),(3668,'2025-05-29 16:09:54','2025-05-29 16:09:54','Scar Tissue','1999-06-08 00:00:00',215,'https://i.scdn.co/image/ab67616d0000b273a9249ebb15ca7a5b75f16a90','\"Scar Tissue\" is the first single from American rock band Red Hot Chili Peppers\' seventh studio album, Californication (1999).\n\nThe first single from the album Californication. It was the first single to feature the return of guitarist John Frusciante, who left the band in 1992 after the release of their breakthrough album Blood Sugar Sex Magik. He returned to the band for the recording of Californication.\n\nThe song spent 16 consecutive weeks atop <a href=\"http://www.last.fm/music/Red+Hot+Chili+Peppers/_/Scar+Tissue\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/1G391cbiT3v3Cywg8T7DM1\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/2QOMGq8wVTZbLmh7McrvgF\";}','scar-tissue','2QOMGq8wVTZbLmh7McrvgF',3),(3669,'2025-05-29 16:09:55','2025-05-29 16:09:55','Otherside','1999-06-08 00:00:00',255,'https://i.scdn.co/image/ab67616d0000b273a9249ebb15ca7a5b75f16a90','\"Otherside\" is a song by the Red Hot Chili Peppers, released in 2000.[1] It was the third single from their album Californication, and confronts the battles ex-junkies have with their prior addictions. The single was highly successful peaking at number fourteen on the Billboard Hot 100, the fourth highest ever for the band; and number one on the US Modern Rock Tracks, which was at the time the fifth for the band. The song remained at number one on this chart for thirteen consecutive weeks, one of the longest runs at the top of that chart. <a href=\"http://www.last.fm/music/Red+Hot+Chili+Peppers/_/Otherside\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/64BbK9SFKH2jk86U3dGj2P\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3CeYdUfGPCjKMDYyI1PpCh\";}','otherside','3CeYdUfGPCjKMDYyI1PpCh',4),(3670,'2025-05-29 16:09:56','2025-05-29 16:09:56','Get on Top','1999-06-08 00:00:00',198,'https://i.scdn.co/image/ab67616d0000b273a9249ebb15ca7a5b75f16a90',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/0GcWf1Cc4ixN35D3O9VdcP\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3s3oiCHAHLWmKZUYk1ozJG\";}','get-on-top','3s3oiCHAHLWmKZUYk1ozJG',5),(3671,'2025-05-29 16:10:06','2025-05-29 16:10:06','Californication','1999-06-08 00:00:00',329,'https://i.scdn.co/image/ab67616d0000b273a9249ebb15ca7a5b75f16a90','\"Californication\" is a song by American rock band Red Hot Chili Peppers from their seventh album, Californication.\n\nThe song reached #69 on the Billboard Hot 100 in the USA, and #16 on the UK charts, and hit #1 on both US Modern Tracks and US Mainstream Rock Tracks. It is notable for its sparse combination of guitar and bass notes in the intro, and its unique music video.\n\nThe song is mainly about the dark side of Hollywood. The song opens with the \"Psychic spies from China try to steal your mind\'s elation. <a href=\"http://www.last.fm/music/Red+Hot+Chili+Peppers/_/Californication\">Read more on Last.fm</a>.','a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/48UPSzbZjgc449aqz8bxox\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/34KTEhpPjq6IAgQg2yzJAL\";}','californication','34KTEhpPjq6IAgQg2yzJAL',6),(3672,'2025-05-29 16:10:07','2025-05-29 16:10:07','Easily','1999-06-08 00:00:00',231,'https://i.scdn.co/image/ab67616d0000b273a9249ebb15ca7a5b75f16a90',NULL,'a:2:{s:14:\"free streaming\";s:53:\"https://open.spotify.com/track/3QJnjJH53Ocg22MaLutrgJ\";s:7:\"spotify\";s:53:\"https://open.spotify.com/track/3DmOWG8OD9eR12180fmJqf\";}','easily','3DmOWG8OD9eR12180fmJqf',7),(3673,'2025-05-29 16:10:07','2025-05-29 16:10:07','Porcelain','1999-06-08 00:00:00',163,'https://i.scdn.co/image/ab67616d0000b273a9249ebb15ca7a5b75f16a90','